INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1213149', 'Frigidaire - 24" Built-In Dishwasher - White', 'Easy controls and innovative design meet in this Frigidaire 24-inch built-in dishwasher. The tall tub design allows you to wash large objects without fuss, and the ready-select controls let you choose what setting to use at the press of a button. This Frigidaire 24-inch built-in dishwasher can save energy with the energy saver dry option, which turns off the heat.', 'abcat0905000', 259.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1213/1213149_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2638126', 'Bosch - 100 Series 24" Tall Tub Built-In Dishwasher with Stainless-Steel Tub - Stainless steel', 'Bosch 100 Series 24" Tall Tub Built-In Dishwasher: Customize the way you load and wash your dishes with this high-performance dishwasher. Featuring a high-temperature wash and 6 cycle options, this dishwasher produces an efficient, sanitized clean for a generous amount of dishes.', 'abcat0905000', 699.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2638/2638126_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2638232', 'Bosch - 100 Series 24" Front Control Tall Tub Built-In Dishwasher with Stainless-Steel Tub - Stainless steel', 'Bosch 100 Series 24" Tall Tub Built-In Dishwasher: Get your dishes thoroughly cleaned without drowning out your conversations and TV shows. This remarkably quiet dishwasher features an adjustable upper rack, 6 wash cycles, and delayed start times to accommodate big messes and busy schedules.', 'abcat0905000', 649.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2638/2638232_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2638241', 'Bosch - 100 Series 24" Front Control Tall Tub Built-In Dishwasher with Hybrid Stainless-Steel Tub - White', 'Bosch 100 Series 24" Tall Tub Built-In Dishwasher: Get your dishes thoroughly cleaned without drowning out your conversations and TV shows. This remarkably quiet dishwasher features an adjustable upper rack, 6 wash cycles, and delayed start times to accommodate big messes and busy schedules.', 'abcat0905000', 549.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2638/2638241_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2683398', 'Bosch - 100 Series 24" Front Control Tall Tub Built-In Dishwasher with Stainless-Steel Tub - Black', 'Bosch 100 Series 24" Tall Tub Built-In Dishwasher: Get your dishes thoroughly cleaned without drowning out your conversations and TV shows. This remarkably quiet dishwasher features an adjustable upper rack, 6 wash cycles, and delayed start times to accommodate big messes and busy schedules.', 'abcat0905000', 549.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/2683/2683398cv1d.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3629329', 'GE - SpaceMaker 24" Built-In Dishwasher - Stainless steel', 'Ensure your dishes are thoroughly cleaned with this dishwasher that features a PowerScrub wash system and 5 cycles. The Piranha hard food disposer pulverizes chunks of food, so there''s no need to prewash.', 'abcat0905000', 1034.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3629/3629329_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4331772', 'SPT - 22" Tabletop Portable Dishwasher - White', 'SPT Tabletop Portable Dishwasher: Simplify after-meal cleanups with this dishwasher that offers an easy-to-use control panel and a quiet design. Load up to 6 place settings and choose from the 6 wash cycles to thoroughly clean your dishware.', 'abcat0905000', 295.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4331/4331772_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4689305', 'Thermador - 24" Built-In Dishwasher - Stainless steel', 'Thermador Sapphire DWHD650JFM - Dishwasher - built-in - Niche - width: 24 in - depth: 24 in - height: 34.1 in - stainless steel', 'abcat0905000', 698.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4689/4689305_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5009834', 'GE - 24" Built-In Dishwasher - Silver', 'Keep dishes like new with this GE built-in dishwasher. Equipped with a Hot Start option, the appliance washes dishes with water automatically set at the appropriate temperature. Two-stage filtration ensures that the water remains clean. Clean up to 12 place settings at a single time by using the touch pad controls on this GE built-in dishwasher.', 'abcat0905000', 414.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5009/5009834_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5009837', 'GE - 24" Built-In Dishwasher - Black', 'Spray away food and grease in this GE built-in dishwasher. The deluxe silverware basket holds an ample amount of flatware, and the QuietPower motor and insulation blanket decrease cycle-related noise. Select from five washing cycles or delay the start of the cycle with the touch pad controls. This GE built-in dishwasher removes food debris with its Piranha hard food disposer.', 'abcat0905000', 439.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5009/5009837_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5074406', 'GE - Profile™ Series 24" Hidden Control Tall Tub Built-In Dishwasher with Stainless Steel Tub - Stainless steel', 'Enjoy exceptionally clean dishes with this GE stainless steel dishwasher. This fully integrated dishwasher has a three-level wash system with more than 140 spray jets, ensuring thorough rinsing on the top and bottom shelves. The Piranha hard food disposer and removable filter in this GE stainless steel dishwasher provide effective and low-maintenance operation.', 'abcat0905000', 710.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5074/5074406_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5231200', 'Hotpoint - 24" Built-In Dishwasher - White', 'Keep your dishes clean with minimal effort with this Hotpoint built-in dishwasher. It has a hard food disposer that turn solid chunks into tiny particles to safely flush away the debris, and a water saver cycle lets you quickly wash a batch of dishes in this Hotpoint built-in dishwasher for a last-minute dinner.', 'abcat0905000', 332.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5231/5231200_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5231207', 'Hotpoint - 24" Built-In Dishwasher - Bisque', 'Power through loads of dishes with this Hotpoint built-in dishwasher. It includes a super-quiet motor so that you barely notice that it''s running, and a water saver cycle allows you to quickly wash everyday items and get them back into the cupboards. The hard food disposer in this Hotpoint built-in dishwasher removes large particles of food by grinding them up.', 'abcat0905000', 332.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5231/5231207_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5231208', 'Hotpoint - 24" Built-In Dishwasher - Black', 'Keep your kitchen tidy by washing your dishes in this Hotpoint built-in dishwasher. Big particles of food quickly turn into smaller particles thanks to the Piranha hard food disposer, and a hot start option provides the perfect temperature for intense washes. The quiet motor ensures this Hotpoint built-in dishwasher isn''t distracting.', 'abcat0905000', 332.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5231/5231208_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5330412', 'Viking - 24" Built-In Dishwasher - Stainless steel', 'Wash dishes easily with this multilevel Viking dishwasher. The built-in water softener reduces water hardness to mitigate spotting and etching of glassware, and variable wash options help ensure all dishes are sparkling clean. The two-position upper rack in this Viking dishwasher adjusts to accommodate larger or oddly shaped dishes and pots.', 'abcat0905000', 1129, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5330/5330412_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5710286', 'Bosch - 300 Series 24" Recessed Handle Dishwasher with Stainless Steel Tub - Stainless steel', 'Clean more dishes in less time. This Bosch dishwasher lets you change rack positions until everything fits with its 3 rack organization system. Plus, front controls let you set cycles and select options easily, like Speed 60, Five-Level Wash, and Extra Dry.', 'abcat0905000', 949.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5710/5710286_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5710291', 'Bosch - 500 Series 24" Pocket Handle Dishwasher with Stainless Steel Tub - Black', 'Sleek design, powerful wash. With its ultra-quiet operation this Bosch dishwasher won&#8217;t disrupt you, day or night. Plus, the flexible racking system fits more items into every cycle by allowing you to change the rack positions, and even add a 3rd rack when you need it.', 'abcat0905000', 854.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5710/5710291_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5710317', 'Bosch - 300 Series 24" Custom Panel Dishwasher with Stainless Steel Tub - Custom Panel Ready', 'A more inviting kitchen. This Bosch dishwasher blends with your counters and cabinets for a sleek, built-in look. And with options like Speed 60, Extra-Dry and Five-Level Wash, you&#8217;ll get sparkling clean dishes in less time.', 'abcat0905000', 1049.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5710/5710317_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5710324', 'Bosch - 300 Series 24" Scoop Handle Dishwasher with Stainless Steel Tub - Stainless steel', 'Combine class and convenience. This Bosch dishwasher lets you arrange the racks in up to 9 different positions, so you can fit as many items as possible. Plus, it runs so quietly you&#8217;ll be able to enjoy a conversation, listen to music, stream media and more right in the kitchen.', 'abcat0905000', 999.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5710/5710324_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5760304', 'Frigidaire - Gallery 24" Top Control Tall Tub Built-In Dishwasher with Stainless Steel Tub - Stainless steel', 'The Frigidaire Gallery 24 in. built-in dishwasher features the OrbitClean&#174; wash system, which has four times better water coverage for a complete clean. Dishes come out remarkably dry every time with the fan-assisted EvenDry&#8482; system. Don&#8217;t wait when dishes can be cleaned with our 30-minute quick clean. This Frigidaire dishwasher has an LED floor beam indicator that illuminates to let you know dishes are clean.', 'abcat0905000', 699.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5760/5760304_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5760404', 'Frigidaire - Gallery 24" Top Control Tall Tub Built-In Dishwasher with Stainless Steel Tub - Stainless steel', 'The Frigidaire Gallery 24 in. built-in dishwasher features a large capacity tall tub design that fits 14 place settings allows you to wash more at once. The premium stainless steel interior enhances performance and extends the life of the dishwasher. DishSense Technology uses sensors to detect the best water temperature and duration. The ENERGY STAR Qualified appliance also has an Energy Saver option that dries without using heat, cutting down on your energy bill.', 'abcat0905000', 836.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5760/5760404_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5796504', 'Whirlpool - 24" Built-In Dishwasher - White', 'Clean up after meals with this 24-inch, built-in Whirlpool dishwasher. With three wash cycles for heavily soiled dishware, normal loads and a quick one-hour run, this appliance lets you choose the most convenient option for your after-dinner cleanup needs. This Whirlpool dishwasher has a low 63dBA noise level for quiet operation.', 'abcat0905000', 579.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5796/5796504_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5796505', 'Whirlpool - 24" Front Control Tall Tub Portable Dishwasher - White', 'Clean dishes quickly or delay your wash up to 4 hours with this Whirlpool portable dishwasher. Push-button controls let you determine the preferred wash cycle, and a full-length silverware basket provides plenty of room for utensils. This 24-inch Whirlpool portable dishwasher has a heated dry cycle to speed up chores.', 'abcat0905000', 899.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5796/5796505_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5796507', 'Whirlpool - 24" Front Control Tall Tub Portable Dishwasher - Black', 'Clean your china with this 24-inch Whirlpool portable dishwasher. It contains a full-length silverware basket and removable water filtration system, and it offers three cleaning cycles, including a 1-hour wash to handle small messes. This Whirlpool portable dishwasher has a control lock for safety.', 'abcat0905000', 899.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5796/5796507_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5796511', 'Whirlpool - 24" Built-In Dishwasher - Stainless steel', 'Save time and let this Whirlpool dishwasher do the evening''s chores. This full console appliance comes with 1-hour, heavy and normal wash cycles to selectively tackle each type of cleaning challenge. This 24-inch Whirlpool dishwasher has a heated dry option to eliminate residual moisture and reduce spots on your glasses.', 'abcat0905000', 599.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5796/5796511_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5796512', 'Amana - 24" Built-In Dishwasher - Black', 'Finish up in the kitchen faster with this 24-inch Amana dishwasher. Its Triple Filter Wash System removes bits of food from dishes, so there&#8217;s no need to spend time pre-rinsing and cleaning before loading the machine. A 1-hour cycle lets you clean lighter loads in record time with this Amana dishwasher.', 'abcat0905000', 499.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5796/5796512_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5796514', 'Whirlpool - 24" Built-In Dishwasher - Black', 'Get shining plates and silverware effortlessly with this 24-inch Whirlpool dishwasher. The appliance''s three cycles, including a 1-hour wash option, let you clean everything from lightly soiled coffee cups to well-used pots and pans. Use this built-in Whirlpool dishwasher''s heated dry option, and enjoy glassware free of streaks and spots.', 'abcat0905000', 579.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5796/5796514_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5796517', 'Whirlpool - 24" Front Control Built-In Dishwasher with 1-Hour Wash Cycle, 55dBA - Black', 'Ease daily chores with this three-cycle Whirlpool dishwasher. It has timed-wash features that include a 1-hour wash and a 4-hour delay, so dishes are cleaned at your convenience, and a high-temperature wash that removes baked-on food. This Whirlpool dishwasher is energy efficient to save on utility costs, and it has a 55dBa rating for a quieter kitchen.', 'abcat0905000', 494.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5796/5796517_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5796519', 'Whirlpool - 24" Built-In Dishwasher - Fingerprint Resistant Black Stainless', 'Simplify after-dinner cleanup tasks with this black stainless steel Whirlpool dishwasher. It has five wash cycles and six settings for achieving the best cleaning results, and it operates quietly at 47dBA, so it won&#8217;t interfere with indoor activities. This 24-inch Whirlpool dishwasher has a high-temperature wash option for heavily soiled tableware.', 'abcat0905000', 809.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5796/5796519_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5796520', 'Amana - 24" Built-In Dishwasher - White', 'Keep dishes sparkling with this Amana dishwasher. Its triple-filter system lets you wash without pre-rinsing for quicker loading, and three wash cycles are available to match load requirements. This energy efficient Amana Dishwasher has a soothing 64dBa sound rating and the 12-place-setting capacity ensures cleanup is done in a single cycle.', 'abcat0905000', 499.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5796/5796520_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5796521', 'Whirlpool - 24" Front Control Built-In Dishwasher with 1-Hour Wash Cycle, 55dBA - White', 'Volunteer to do the dishes after dinner with this 24-inch Whirlpool dishwasher. It has three wash cycles, including a high-temperature wash option for cleaning baked-on food particles, and its noise level is rated at 55dBA for quiet operation. This Whirlpool dishwasher has a 4-hour time delay setting for added convenience.', 'abcat0905000', 494.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5796/5796521_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5796523', 'Whirlpool - 24" Built-In Dishwasher - Stainless steel', 'Eliminate the hassle of post-meal cleanup with this Whirlpool dishwasher. Its sensor wash setting adjusts to your load for a thorough clean, and it has a 1-hour setting, so you can have your dishes ready in time for dinner. This 24-inch Whirlpool dishwasher has a stainless steel tub so it lasts longer.', 'abcat0905000', 719.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5796/5796523_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5796525', 'Amana - 24" Built-In Dishwasher - Stainless steel', 'Spend less time scrubbing with this stainless steel Amana dishwasher. Its three wash cycles include a triple-filter wash system for successful cleaning results, and it has a capacity for cleaning 12 place settings to get the job done quickly. This 24-inch Amana dishwasher has a heated dry option to remove excess moisture from clean dishes.', 'abcat0905000', 549.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5796/5796525_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5796527', 'Whirlpool - 24" Built-In Dishwasher - Stainless steel', 'Eliminate the hassle of hand-washing pots and pans with this 24-inch Whirlpool dishwasher. It has three wash cycles to accommodate varying soil levels, and its heated dry option reduces the time it takes to complete a load. This Whirlpool dishwasher is ENERGY STAR-qualified to conserve energy and lower utility costs.', 'abcat0905000', 566.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5796/5796527_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5853619', 'Frigidaire - 24" Built-In Dishwasher - Stainless steel', 'Get exceptionally clean dishes with this 24-inch Frigidaire dishwasher. The Orbitclean spray arm ensures thorough water coverage to reach every dish, and DishSense technology adjusts the cycle length depending on the amount of cleaning the load requires. The delay start option on this Frigidaire dishwasher lets you schedule loads in advance.', 'abcat0905000', 566.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5853/5853619_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5884879', 'Bertazzoni - 24" Top Control Built-In Dishwasher with Stainless Steel Tub - Stainless steel', 'Boost your peace of mind with this 24-inch Bertazzoni dishwasher. Its high-pressure Power-Zone and three spray arms cut through the grimiest food deposits, and the two-pump wash system, filter and food disposer ensure consistent results. The six wash cycles and five options of this Bertazzoni dishwasher let you customize loads to match preferences and needs.', 'abcat0905000', 1199, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5884/5884879_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5884880', 'Bertazzoni - 24" Top Control Built-In Dishwasher with Stainless Steel Tub - Stainless steel', 'Lighten your load with this 24-inch Bertazzoni dishwasher. The six wash cycles provide effortless cleaning options without sacrificing performance, and the 48dBA sound level makes sure it operates quietly for a relaxing kitchen experience. This Bertazzoni dishwasher has a stainless steel finish to prevent fingerprints and maintain a sleek, contemporary appearance.', 'abcat0905000', 999, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5884/5884880_sd.jpg');
