INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5887099', 'Dacor - Professional Top Control Built-In Dishwasher with Stainless Steel Tub, WaterWall™, 3rd Rack, 44 dBA, Handle Required - Silver stainless steel', 'When it comes to dinner, we say the more the merrier. With the capacity to hold up to fourteen place settings and the largest cleaning zone available, innovations like WaterWall&#8482; and ZoneBooster&#8482; technologies ensure that when the AutoRelease door opens, every pot, pan, plate, and glass will be ready for the spotlight.', 'abcat0905000', 1099, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5887/5887099_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5887101', 'Dacor - Top Control Built-In Dishwasher with Stainless Steel Tub, WaterWall™, AutoRelease Door, 3rd Rack, 44 dBA, Panel Ready - Custom Panel Ready', 'When it comes to dinner, we say the more the merrier. With the capacity to hold up to fourteen place settings and the largest cleaning zone available, innovations like WaterWall&#8482; and ZoneBooster&#8482; technologies ensure that when the AutoRelease door opens, every pot, pan, plate, and glass will be ready for the spotlight.', 'abcat0905000', 1099, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5887/5887101_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5936101', 'Bosch - 24" Top Control Built-In Dishwasher with Stainless Steel Tub - Stainless steel', 'Clean your dishes quickly with this Bosch Benchmark 24-inch dishwasher. The sturdy build ensures durability even with frequent use, while telescopic rails support easy loading and unloading. This Bosch Benchmark 24-inch dishwasher features a white interior light for illumination, a self-latching door design for safety and a compact design for ease of placement.', 'abcat0905000', 2249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5936/5936101_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5936102', 'Bosch - Benchmark Top Control Built-In Dishwasher with Stainless Steel Tub, 3rd Rack, 39 dBa - Custom Panel Ready', 'Experience efficient cleaning with this 24-inch Bosch Benchmark dishwasher. The third rack is adjustable to fit different-sized utensils and has fold-down sides to accommodate more dishes. With brilliant light to provide interior illumination, this Bosch Benchmark dishwasher operates at 39dBA for quiet cleaning, while the water softener feature ensures dishes come out sparkling.', 'abcat0905000', 2249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5936/5936102_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5936103', 'Bosch - Benchmark Top Control Built-In Dishwasher with Stainless Steel Tub, 3rd Rack, 38 dBa - Stainless steel', 'Clean your dishes, including tall items, such as stemware, with this Bosch Benchmark stainless steel dishwasher. The full-color display lets you navigate through the different wash cycles quickly, while the telescopic rails glide smoothly for easy unloading. This Bosch Benchmark stainless steel dishwasher features bright interior lighting for operating in the dark.', 'abcat0905000', 2249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5936/5936103_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5984200', 'Whirlpool - 24" Built-In Dishwasher - Stainless steel', 'Maximize the efficiency of your post-meal cleanup with this Whirlpool built-in dishwasher. The sensor feature detects the type of load and selects the appropriate cycle, and an integrated fan pulls in fresh air to thoroughly dry your dishes. This Whirlpool built-in dishwasher has a one-hour wash cycle for when you need a dish quickly.', 'abcat0905000', 746.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5984/5984200_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5984202', 'Whirlpool - 24" Built-In Dishwasher - Black', 'Tackle dirty dishes with this Whirlpool built-in dishwasher. Choose from numerous wash cycles and sensor cycles, including fan dry or heated dry, to get the right clean and finish for your dishes. This Whirlpool built-in dishwasher is ENERGY STAR-certified, so you can maximize the efficiency of your home and save on power bills.', 'abcat0905000', 701.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5984/5984202_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5984300', 'Whirlpool - 24" Built-In Dishwasher - Fingerprint Resistant Black Stainless', 'Get dishes clean quickly and conveniently with this 24-inch Whirlpool dishwasher. It has five wash cycles and five options for customizing each load, and its capacity of 15 place settings simplifies cleanup after big meals. This energy-efficient Whirlpool dishwasher has a 24-hour delay cycle, so you can decide when it operates.', 'abcat0905000', 836.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5984/5984300_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5984301', 'Whirlpool - 24" Built-In Dishwasher - White', 'Make short work of kitchen cleanup with this 24-inch Whirlpool dishwasher. It has a high-temperature wash option for heavily soiled dishes, and the quiet 51dBA noise level doesn''t interfere with activities while it washes your pots and pans. This Whirlpool dishwasher has five wash cycles, so you can customize each load.', 'abcat0905000', 701.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5984/5984301_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6039801', 'Frigidaire - 24" Built-In Dishwasher - Black stainless steel', 'Clean dinner dishes quickly and efficiently with this 24-inch built-in Frigidaire dishwasher. It has five wash levels and includes DirtSense Technology that automatically adjusts cycle times for best results, and it operates quietly at 54dBA, so it won&#8217;t interrupt kitchen conversations. This Frigidaire dishwasher has a delayed start for added convenience.', 'abcat0905000', 611.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6039/6039801_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6112229', 'Whirlpool - 24" Tall Tub Built-In Dishwasher - White', 'Simplify after dinner cleanup with this 24-inch Whirlpool dishwasher. Its sensor cycle feature automatically adjusts water levels and dry settings based on temperature, load size and soil level to save energy, and its convenient one-hour wash cleans your dishes quickly when you''re short on time. This Whirlpool dishwasher has an illuminated display that shows the cycle status at a glance.', 'abcat0905000', 656.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6112/6112229_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6112237', 'Whirlpool - 24" Tall Tub Built-In Dishwasher - Black', 'Clean on your schedule with this 24-inch Whirlpool dishwasher. Its tall tub design holds larger cookware, and its cycle status indicator lets you know exactly how long each phase takes. This built-in Whirlpool dishwasher has a smudge-resistant finish and offers normal, heavy and high-temp options to handle different soil levels.', 'abcat0905000', 656.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6112/6112237_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6112239', 'Whirlpool - 24" Tall Tub Built-In Dishwasher - Stainless steel', 'Simplify after-dinner cleanup with this Whirlpool built-in dishwasher. It has a tall tub to hold a variety of kitchenware items, and the heavy cycle adds time to eliminate pre-scrubbing dirty dishes. This stainless steel Whirlpool built-in dishwasher has sensors that detect the amount of dirt on your dishes and adapts the normal cycle for proper cleaning.', 'abcat0905000', 701.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6112/6112239_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6112313', 'Whirlpool - 24" Tall Tub Built-In Dishwasher - Stainless steel', 'Get sparkling results with this 24-inch Whirlpool dishwasher. It offers normal, heavy and one-hour wash cycles to clean thoroughly, and the soil sensor adjusts the settings depending on the load''s needs. This heavy-duty Whirlpool dishwasher has vinyl racks for durability and operates at only 55dB to keep your home peaceful.', 'abcat0905000', 593.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6112/6112313_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6149437', 'Thermador - 24" Built-In Dishwasher - Custom Panel Ready', 'Simplify after-dinner chores with this 24-inch Thermador dishwasher. Its bright blue PowerBeam shines on the floor to let you know when it''s operating quietly at 48dBA, and the tall sprinkler ensures items on the bottom rack are cleaned sufficiently. This Thermador dishwasher has a PowerBoost option for increasing water pressure and temperature for heavy-duty cleaning.', 'abcat0905000', 399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6149/6149437_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6182517', 'LG - 24" Top Control Smart Built-In Dishwasher with TrueSteam, Tub Light and Quiet Operation - Black stainless steel', 'Post-dinner party cleanup? Let your LG dishwasher do the heavy lifting. LG QuadWash provides maximum cleaning coverage making it easier than ever to get your dishes clean, and with TrueSteam technology, you get up to 60% less water spots.&#185; The Glide Rail keeps the upper rack on track while the Ball-bearing wheel provides a smooth lower rack glide for easier loading and unloading. Need more room? No problem. The EasyRack Plus system and height-adjustable 3rd rack provide the flexibility you need to fit more dishes.', 'abcat0905000', 1299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6182/6182517_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6183216', 'Bertazzoni - 18" Front Control Built-In Dishwasher with Stainless Steel Tub - Stainless steel', 'Clean up to eight place settings at once with this 18-inch Bertazzoni panel-ready dishwasher. Three sprayers ensure efficient water coverage, while six wash cycles combined with four wash options put you in control of the entire process. This two-rack Bertazzoni panel-ready dishwasher has a concealed LED touch panel for convenient cycle adjustments.', 'abcat0905000', 949, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6183/6183216_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6183217', 'Bertazzoni - 24" Front Control Built-In Dishwasher with Stainless Steel Tub - Stainless steel', 'Get dishes sparkling clean with this 24-inch Bertazzoni panel-ready dishwasher. It has six wash cycles and four wash options to choose from for a customized clean, and three water sprayers tackle tough food messes. This Bertazzoni panel-ready dishwasher can accommodate 10 place settings to minimize the number of loads run.', 'abcat0905000', 999, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6183/6183217_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6196689', 'Fisher & Paykel - 24" Front Control Built-In Dishwasher - White', 'Get a thorough clean with this Fisher & Paykel DishDrawer dishwasher. The three settings include a sanitize mode that removes harmful bacteria from your cookware, and its bench-height design limits the need to bend for easier loading. This Fisher & Paykel DishDrawer dishwasher''s inner racking can be folded to accommodate larger items.', 'abcat0905000', 899, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6196/6196689_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6196690', 'Fisher & Paykel - 24" Front Control Built-In Dishwasher - Stainless steel', 'Get a customized clean with this Fisher & Paykel DishDrawer dishwasher. It has room for up to seven place settings, with collapsible racks to accommodate larger items, and its six modes let you tailor the cycle to suit your dishware. This Fisher & Paykel DishDrawer dishwasher sits at bench height for easier loading.', 'abcat0905000', 799, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6196/6196690_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6196691', 'Fisher & Paykel - 24" Front Control Built-In Dishwasher - Black', 'Enjoy quicker kitchen cleanup with this 24-inch Fisher & Paykel DishDrawer dishwasher. Its three cycle options include a sanitize mode that removes harmful bacteria from your cookware, and the flexible racks fold to accommodate larger items. This Fisher & Paykel DishDrawer dishwasher sits at a convenient bench height, making loading less strenuous.', 'abcat0905000', 899, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6196/6196691_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6196692', 'Fisher & Paykel - 24" Front Control Built-In Dishwasher - Black', 'Take after-dinner cleanup tasks to the next level with this Fisher & Paykel dishwasher. Its two independent drawers let you fit a variety of tall and wide dishes and administer different wash programs for each. The sanitize option on this Fisher & Paykel dishwasher eliminates 99.99 percent of bacteria in the final rinse.', 'abcat0905000', 1699, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6196/6196692_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6196694', 'Fisher & Paykel - 24" Front Control Built-In Dishwasher - Stainless steel', 'Spend less time on cleanup with this Fisher & Paykel DishDrawer dishwasher. Its dual drawers have adjustable racking with room for up to 14 place settings, and the upper drawer is taller to accommodate larger dishes. This Fisher & Paykel DishDrawer dishwasher''s drawers operate independently, so you can run separate wash cycles for different items.', 'abcat0905000', 1699, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6196/6196694_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6196695', 'Fisher & Paykel - 24" Front Control Built-In Dishwasher - White', 'Make cleanups more efficient with this Fisher & Paykel DishDrawer dishwasher. Its two drawers operate independently, letting you run different wash cycles to suit your dishes, and its top drawer has a higher profile to accommodate larger items. This easy-to-load Fisher & Paykel DishDrawer dishwasher sits at bench height to minimize back strain in loading.', 'abcat0905000', 1699, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6196/6196695_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6196698', 'Fisher & Paykel - 24" Front Control Built-In Dishwasher - Stainless steel', 'Simplify after-dinner cleanup with this Fisher & Paykel DishDrawer dishwasher. Its bench height positioning limits the need to bend when loading, and its flexible racking lets you arrange the shelves to accommodate a variety of dishes. This Fisher & Paykel DishDrawer dishwasher''s sanitize mode removes harmful bacteria from dishes and cookware.', 'abcat0905000', 899, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6196/6196698_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6196700', 'Fisher & Paykel - 24" Front Control Built-In Dishwasher - Stainless steel', 'Simplify cleanup after large meals with this Fisher & Paykel DishDrawer dishwasher. Its two drawers can be set to different wash programs to suit dish type, and they''re easy to load with little bending required. The racks in this Fisher & Paykel DishDrawer dishwasher are adjustable to accommodate a variety of dish sizes.', 'abcat0905000', 1599, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6196/6196700_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6196836', 'Fisher & Paykel - 24" Front Control Built-In Dishwasher - Stainless steel', 'Achieve sparkling clean plates and silverware with this Fisher & Paykel double DishDrawer dishwasher. The two sections can be used independently to keep delicate crystal separate from pans needing heavy scrubbing, and the built-in water softener improves results. This Fisher & Paykel double DishDrawer dishwasher holds up to 14 place settings on adjustable shelving.', 'abcat0905000', 1799, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6196/6196836_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6196896', 'KitchenAid - 24" Front Control Tall Tub Built-In Dishwasher with Stainless Steel Tub - Stainless steel', 'This sleek front control dishwasher with smudge-resistant PrintShield Finish delivers KitchenAid performance and style passionate cooks appreciate. One-touch ProWash Cycle senses soil levels, then automatically adjusts cycle time and water usage in real time for the best cleaning performance. Upper-rack SatinGlide Max rails roll out smoothly even when fully loaded. Heat Dry option and durable stainless steel tub facilitate drying.', 'abcat0905000', 854.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6196/6196896_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6203218', 'Fisher & Paykel - 24" Top Control Built-In Dishwasher - Custom Panel Ready - Custom Panel Ready', 'Update your kitchen with this Fisher & Paykel DishDrawer integrated dishwasher. The built-in water softener reduces minerals for spot-free glasses, and the double-drawer design blends with cabinets for a sleek look. Delayed start, knock-to-pause functionality and 15 program settings make this Fisher & Paykel DishDrawer integrated dishwasher convenient to use.', 'abcat0905000', 1799, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6203/6203218_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6203220', 'Fisher & Paykel - 24" Top Control Built-In Dishwasher - Custom Panel Ready - Custom Panel Ready', 'Get a customized clean with this 24-inch Fisher & Paykel DishDrawer dishwasher. It has 15 settings, including an Eco Option for energy-efficient cleaning and a sanitize setting to effectively remove bacteria from dirty dishware. This fully integrated Fisher & Paykel DishDrawer dishwasher''s Knock to Pause function lets you pause cycles with a simple touch.', 'abcat0905000', 799, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6203/6203220_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6203221', 'Fisher & Paykel - 24" Top Control Built-In Dishwasher - Custom Panel Ready - Custom Panel Ready', 'Simplify cleaning tasks with this Fisher & Paykel dishwasher. Its two drawers can be run independently of one another for washing small or large loads, and it''s positioned at bench height for minimal bending during loading and unloading. Knock gently on the outside of this Fisher & Paykel dishwasher to pause a load in progress.', 'abcat0905000', 1699, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6203/6203221_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6203939', 'Fisher & Paykel - 24" Front Control Built-In Dishwasher - Custom Panel Ready - Custom Panel Ready', 'Cut down on cleanup time with this 24-inch Fisher & Paykel DishDrawer dishwasher. Its two sections operate independently, letting you select different wash programs to clean heavily soiled cookware and delicate crystal glasses simultaneously. This Fisher & Paykel DishDrawer dishwasher is designed to sit at bench height for easy loading with minimal bending required.', 'abcat0905000', 1599, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6203/6203939_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6217605', 'LG - 24" Front-Control Built-In Smart Wifi-Enabled Dishwasher with Stainless Steel Tub, Quadwash, and 3rd Rack - Stainless steel', 'Finally, a dishwasher that gets it done right, the first time. LG&#8217;s new QuadWash&#8482; system uses Multi-Motion arms that work together for maximum cleaning coverage, while 3rd Rack provides a customization racking experience. LG&#8217;s convenient front control design makes it easier than ever to preview and select the settings you want. All this paired with the reassurance of LG&#8217;s 10-year Direct Drive Motor warranty.', 'abcat0905000', 799.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6217/6217605_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6231626', 'Fisher & Paykel - 24" Integrated Single DishDrawer™, Tall, Panel Ready, Water SoftenerDishDrawer Dishwasher - Custom Panel Ready', 'This Fisher & Paykel DishDrawer&#8482; dishwasher is integrated into your kitchen, has extra height for taller dishes and built-in water softener and panel ready.', 'abcat0905000', 999, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6231/6231626_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6247246', 'Bosch - 100 Series 24" Front Control Built-In Dishwasher with Stainless Steel Tub - White', 'Make quick work of dishwashing with this 24-inch Bosch built-in dishwasher. With a sound level no higher than 50 dBA, it won''t disturb you while you''re in the kitchen, and the extra utility rack provides a place for all your odd-sized items. This ENERGY STAR-certified Bosch built-in dishwasher has a stainless steel tall tub for longevity.', 'abcat0905000', 549.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6247/6247246_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6247252', 'Bosch - 100 Series 24" Front Control Built-In Dishwasher with Stainless Steel Tub - Stainless steel', 'Update your kitchen with this Bosch 100 Series built-in dishwasher. The stainless steel and polypropylene tall tub provides ample space and dependable durability. This Bosch 100 Series built-in dishwasher ensures reliable cleaning performance with the added bonus of quiet 50dB operation.', 'abcat0905000', 649.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6247/6247252_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6247260', 'Bosch - 100 Series 24" Top Control Built-In Dishwasher with Hybrid Stainless Steel Tub - Stainless steel', 'Add this Bosch Series 100 built-in dishwasher to your contemporary kitchen. Operating at only 48dB, it quietly yet effectively cleans your dishes and utensils. The three-level adjustable-height shelves accommodate different sizes of pots and glassware, and the third rack provides 30 percent more stacking space in this Bosch Series 100 built-in dishwasher.', 'abcat0905000', 849.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6247/6247260_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6247261', 'Bosch - 100 Series 24" Top Control Built-In Dishwasher with Hybrid Stainless Steel Tub - Black', 'Tackle stacks of dinner dishes with this Bosch 100 Series built-in dishwasher. Three racks provide plenty of options for loading everything from pots and pans to small serving plates, while five different wash cycles let you choose the right option for every load. This Bosch 100 Series built-in dishwasher offers quiet operation, so you can wash dishes while chatting with your family at dinner.', 'abcat0905000', 749.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6247/6247261_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6251500', 'Fisher & Paykel - 24" Front Control Tall Tub Built-In Dishwasher - Stainless steel', 'Simplify after-dinner cleanup with this Fisher & Paykel single DishDrawer dishwasher. Its seven place settings provide enough room for the whole family''s utensils, and its six wash cycles help leave tableware sparkling clean. This Fisher & Paykel single DishDrawer dishwasher has a 12-hour delay start function that makes it easy to plan when to run it.', 'abcat0905000', 1099, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6251/6251500_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6254613', 'GE Profile - 18" Top Control Built-In Dishwasher with Stainless Steel Tub - Black', 'Keep stacks of dirty dishes to a minimum with this space-saving GE Profile built-in dishwasher. The Piranha hard food disposal system prevents clogs and keeps food particles off of your dishes, while the high-temperature rinse function sanitizes dishes to kill up to 99.9 percent of bacteria. This GE Profile built-in dishwasher boasts three wash cycles and automatic temperature control for consistent, reliable results.', 'abcat0905000', 944.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6254/6254613_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6254614', 'GE Profile - 18" Top Control Built-In Dishwasher with Stainless Steel Tub - White', 'Tackle loads of dishes in your small kitchen with this GE Profile 18-inch built-in dishwasher. The Piranha hard food disposer makes quick work of stuck-on foods, and three wash cycles let you choose the right option for every load. An adjustable upper rack and fold-down tines provide flexible dish placement options. This GE Profile 18-inch built-in dishwasher connects easily with Google Assistant and Amazon Alexa, making it an ideal addition to your smart home setup.', 'abcat0905000', 944.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6254/6254614_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6272903', 'Frigidaire - 24" Front Control Tall Tub Built-In Dishwasher - Black', 'Clear the kitchen quickly with this 24-inch Frigidaire built-in dishwasher. Its ENERGY STAR certification helps you save money on electric bills, and the large-capacity racks on both top and bottom save time and effort. High-temperature washing and drying leaves dishes sanitized and ready for use with this Frigidaire built-in dishwasher.', 'abcat0905000', 458.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6272/6272903_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6254615', 'GE Profile - 18" Top Control Built-In Dishwasher with Stainless Steel Tub - Stainless steel', 'Give your small kitchen a stylish upgrade with this GE Profile stainless steel built-in dishwasher. The Piranha hard food disposal system tackles stuck on foods to prevent clogs, and an auto-sense cycle automatically adjusts to keep your dishes spotless. This GE Profile stainless steel built-in dishwasher offers three wash cycles and a high-temperature rinse cycle to reduce bacteria and ensure your dinnerware and flatware are ready for use.', 'abcat0905000', 799.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6254/6254615_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6254617', 'Haier - 18" Front Control Built-In Dishwasher with Stainless Steel Tub - Stainless steel', 'Perform kitchen chores efficiently with this 18-inch Haier GE dishwasher. Its Piranha dispenser breaks down large food particles to prevent clogging, and the child lock feature prevents accidental opening while in operation. This Haier GE dishwasher has three wash cycles, eight place settings and an adjustable upper rack to provide flexible washing options.', 'abcat0905000', 699.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6254/6254617_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6259006', 'Fisher & Paykel - 24" Front Control Built-In Dishwasher - Stainless steel', 'Wash dishes quickly and efficiently with this Fisher & Paykel double DishDrawer dishwasher. Independent programs for each drawer let you run two loads simultaneously, and nine wash cycle options provide versatility. This Fisher and Paykel double DishDrawer dishwasher with adjustable racks and fold-down tines accommodates up to 14 place settings for convenient cleanup after larger gatherings.', 'abcat0905000', 1899, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6259/6259006_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6266032', 'Fisher & Paykel - 24" Front Control Built-In Dishwasher - Stainless steel', 'Clean plates after dinner with this 24-inch Fisher & Paykel DishDrawer dishwasher. The single drawer opens easily and can be positioned higher or lower to reduce bending, and it runs quietly, so there''s no unwanted ambient noise. This Fisher & Paykel DishDrawer dishwasher sanitizes cookware and has an extra-dry cycle for plastic vessels.', 'abcat0905000', 1099, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6266/6266032_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6266041', 'Thermador - Sapphire 24" Top Control Smart Built-In Stainless Steel Tub Dishwasher with Home Connect - Stainless steel', 'Find ease in kitchen cleanup with this 24-inch Thermador Sapphire dishwasher. It has a large capacity of 16 place settings, and its flexible folding tines and adjustable chef&#8217;s tool drawer let you maximize space for utensils and large platters. Select from the seven wash cycles of this Thermador Sapphire dishwasher for appropriate cleaning of delicate glassware or heavily soiled plates.', 'abcat0905000', 2299, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6266/6266041_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6266042', 'Thermador - 24" Top Control Built-In Stainless Steel Tub Dishwasher - Custom Panel Ready', 'WiFi smart appliance capabilities include personalized control, notifications & remote diagnostics via Home Connect app. Impressively Quiet &#8211; 48 dBA for peaceful kitchen experience. Chef&#8217;s Tool Drawer (3rd Rack) is designed to make loading and unloading tools and hard to place items extraordinarily easier', 'abcat0905000', 1399, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6266/6266042cv11d.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6266046', 'Thermador - 24" Top Control Built-In Dishwasher with Stainless Steel Tub - Stainless steel', 'Clean up to 16 place settings at once with this Thermador dishwasher. Flexible folding tines, adjustable racks and an extra-tall sprinkler system for oversized items easily handle larger loads, and the digital touch pad provides convenient control over programs and functions. This Thermador dishwasher operates at a quiet 42dBA for reduced noise during use.', 'abcat0905000', 2299, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6266/6266046_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6266048', 'Thermador - 24" Top Control Built-In Dishwasher with Stainless Steel Tub - Stainless steel', 'Simplify after-dinner cleanup with this Thermador dishwasher. Its bright sapphire glow interior light lets you find clean dishes when the kitchen''s dark, and the extra tall-item sprinkler makes sure glasses on the highest rack get a thorough rinse. This Thermador dishwasher operates at just 44dBA, so you''ll barely hear it when it runs.', 'abcat0905000', 2799, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6266/6266048_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6266052', 'Thermador - Sapphire 24" Top Control Smart Built-In Stainless Steel Tub Dishwasher with Home Connect - Custom Panel Ready', 'Clean 16 place settings at once with this 24-inch Thermador Sapphire dishwasher. Its racks and chef&#8217;s tool drawer are adjustable to accommodate different-sized dinnerware, and the extra-tall-item sprinkler provides proper washing for long trays and platters. Monitor the operating time of this 42dbA Thermador Sapphire dishwasher via its PowerBeam indicator.', 'abcat0905000', 2299, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6266/6266052_sd.jpg');
