INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6266055', 'Thermador - 24" Top Control Smart Built-In Stainless Steel Tub Dishwasher with Home Connect - Stainless steel', 'WiFi smart appliance capabilities include personalized control, notifications & remote diagnostics via Home Connect app. Impressively Quiet &#8211; 48 dBA for peaceful kitchen experience. Chef&#8217;s Tool Drawer (3rd Rack) is designed to make loading and unloading tools and hard to place items extraordinarily easier.', 'abcat0905000', 1399, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6266/6266055_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6272900', 'Frigidaire - 24" Front Control Tall Tub Built-In Dishwasher - Stainless steel', 'Streamline kitchen cleanup with this stylish 24-inch Frigidaire built-in dishwasher. It runs at only 60 dB, so you can quietly sanitize and dry dishes with the high-heat cleaning and drying cycles, while large-capacity racks allow for quick, easy cleanup. Give your kitchen a modern feel with this sleek stainless steel Frigidaire built-in dishwasher.', 'abcat0905000', 503.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6272/6272900_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6272901', 'Frigidaire - 24" Front Control Tall Tub Built-In Dishwasher - White', 'Tackle dirty cookware with this 24-inch Frigidaire built-in dishwasher. Select from three cycles using the electronic control panel and choose to delay cleaning for up to four hours. This white, ENERGY STAR-rated Frigidaire built-in dishwasher includes standard racks that allow for 8-inch clearance on top and up to 13 inches of clearance on the bottom.', 'abcat0905000', 458.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6272/6272901_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6272905', 'Frigidaire - 24" Front Control Tall Tub Built-In Dishwasher - Stainless steel', 'Enjoy effortless post-meal cleanup with this 24-inch Frigidaire built-in dishwasher. It has five wash cycles to accommodate slightly soiled dishes or crusty pots and pans, and its ample interior space holds up to 14 place settings. This Frigidaire built-in dishwasher has a stainless steel front panel that gives it a modern look.', 'abcat0905000', 521.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6272/6272905_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6272926', 'LG - 24" Top-Control Built-In Smart Wifi-Enabled Dishwasher with Stainless Steel Tub, Quadwash, and 3rd Rack - Black stainless steel', 'Finally, a dishwasher that gets it done right, the first time. LG''s new QuadWash&#8482; system uses Multi-Motion arms that work together for maximum cleaning coverage, while 3rd Rack provides a customization racking experience. LG''s convenient top control design makes it easier than ever to preview and select the settings you want. All this paired with the reassurance of LG&#8217;s 10-year Direct Drive Motor warranty.', 'abcat0905000', 949.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6272/6272926_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6272931', 'Samsung - 24" Front Control Built-In Dishwasher - Black', 'The Samsung dishwasher with easy-to-use digital touch controls offers the flexibility of a 3rd rack to easily access and clean more utensils and culinary tools. The upper rack is height-adjustable so that it can easily accommodate dishes of various shapes and sizes. The interior door is made from stainless steel making it more durable and hygienic.', 'abcat0905000', 629.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6272/6272931_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6272933', 'Samsung - 24" Front Control Built-In Dishwasher - White', 'The Samsung dishwasher with easy-to-use digital touch controls offers the flexibility of a 3rd rack to easily access and clean more utensils and culinary tools. The upper rack is height-adjustable so that it can easily accommodate dishes of various shapes and sizes. The interior door is made from stainless steel making it more durable and hygienic.', 'abcat0905000', 629.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6272/6272933_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6272935', 'Samsung - 24" Front Control Built-In Dishwasher - Stainless steel', 'The Samsung dishwasher with easy-to-use digital touch controls offers the flexibility of a 3rd rack to easily access and clean more utensils and culinary tools. The upper rack is height-adjustable so that it can easily accommodate dishes of various shapes and sizes. The interior door is made from stainless steel making it more durable and hygienic.', 'abcat0905000', 719.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6272/6272935_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6273021', 'GE - Front Control Built-In Dishwasher with 3rd Rack, 50 dBA - Stainless steel', 'Ensure clean dishes anytime with this 24-inch GE dishwasher. Its adjustable, full-extending upper rack and two stem shelves accommodate a variety of glassware and plates, and the four dedicated water jets provide powerful cleaning for hard-to-reach areas. This GE dishwasher has three wash levels for versatile operation and a hidden vent for quick drying.', 'abcat0905000', 674.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6273/6273021_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1624523', 'GE - 1.6 Cu. Ft. Over-the-Range Microwave - White', 'GE 1.6 Cu. Ft. Over-the-Range Microwave: Make popcorn, reheat leftovers, thaw frozen items and more using this GE over-the-range microwave, which features one-touch settings for flexible operation. The cooktop light allows you to maintain a clear view of the stovetop below. Plus, the 2-speed exhaust fan removes smoke, steam and odors that are produced while cooking on your range.', 'abcat0903000', 233.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1624/1624523_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1624532', 'GE - 1.6 Cu. Ft. Over-the-Range Microwave - Stainless steel', 'GE 1.6 Cu. Ft. Over-the-Range Microwave: This GE microwave installs over your existing range and features a 2-speed, 300 cfm external venting system and cooktop light to blow away smoke and odors and illuminate your stove. Simplify snack and meal preparation thanks to convenience cooking controls, which allow you to reheat leftovers, defrost frozen foods and more.', 'abcat0903000', 251.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1624/1624532_sd.jpg');
