INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2557267', 'GE - Profile Series 1.1 Cu. Ft. Mid-Size Microwave with Sensor Cooking - Stainless steel', 'This GE Profile Series PEM31SFSS mid-size microwave utilizes sensor cook options, including options for cooking popcorn, vegetables and potatoes, reheating items and preparing beverages, for simple use. Weight and time defrost help facilitate thawing.', 'abcat0903000', 479, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2557/2557267_sd.jpg');
