INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2876946', 'GE - 1.6 Cu. Ft. Over-the-Range Microwave - Bisque', 'Prepare delicious meals, snacks and beverages with this GE JVM3160DFCC over-the-range microwave that features food-specific one-touch controls for simple use. Ten power levels offer customized cooking options for different dishes.', 'abcat0903000', 233.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2876/2876946_sd.jpg');
