INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3288385', 'Sharp - 24" 1.2 Cu. Ft. Built-in Microwave Drawer - Stainless steel', 'Heat a large dish or plenty of food items in this 1.2 cu. ft. Sharp Microwave Drawer oven. Its design offers multiple installation options in your custom-designed kitchen, and the large capacity holds a 4-quart casserole dish. Open and close this 24-inch Sharp Microwave Drawer oven via its manual handle or the auto touch control panel.', 'abcat0903000', 1099.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/3288/3288385_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3289056', 'Cuisinart - 1.0 Cu. Ft. Mid-Size Microwave - Stainless steel', 'This stainless-steel microwave has 8 preset options, including popcorn, reheat, beverage, frozen vegetables, and others to help you choose the correct settings for your meals. It has preprogrammed one-touch controls, a 12" rotating glass tray and touchpad controls with an LCD for easy operation.', 'abcat0903000', 199.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3289/3289056_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3544001', 'LG - 1.8 Cu. Ft. Over-the-Range Microwave - Stainless steel', 'Quickly prepare a meal or snack with this LG LMV1831ST 1.8 cu. ft. over-the-range microwave that features sensor cooking with 7 options to ensure thorough heating. The EasyClean interior resists stains and simplifies cleanup.', 'abcat0903000', 369.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/3544/3544001_sa.jpg');
