INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3545028', 'LG - 2.2 Cu. Ft. Over-the-Range Microwave - Stainless steel', 'This LG LMHM2237ST over-the-range microwave features bilevel cooking that lets you heat up to 2 dishes at once. The ExtendaVent 2.0 system offers ventilation over the entire cooktop to quickly remove odors, and the EasyClean interior simplifies cleanup.', 'abcat0903000', 549.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3545/3545028_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3546009', 'LG - 2.2 Cu. Ft. Over-the-Range Microwave - Stainless steel', 'Prepare tasty meals with this LG LMH2235ST 2.2 cu. ft. over-the-range microwave that features 8 sensor-cook options. The ExtendaVent 2.0 ventilation system quickly removes smoke and odors, while the EasyClean interior simplifies cleanup.', 'abcat0903000', 519.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/3546/3546009_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3546018', 'LG - 2.0 Cu. Ft. Over-the-Range Microwave - Stainless steel', 'With an EasyClean interior, this LG LMVM2033ST 2.0 cu. ft. microwave resists stains and easily wipes clean with a damp cloth. The 8 sensor-cook options use humidity-sensing technology to ensure prepared food is flavorful and fully heated.', 'abcat0903000', 499.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/3546/3546018_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4229724', 'Fisher & Paykel - 2.0 Cu. Ft. Full-Size Microwave - Stainless steel', 'Get ready for family meals with this DCS countertop microwave. Its 13 Smart & Easy sensor settings eliminate guesswork by automatically determining cooking times and power levels, and its 2.0 cu. ft. of space accommodates oversized containers. The turntable in this 1200W DCS countertop microwave can be switched off when heating large casserole dishes.', 'abcat0903000', 659, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4229/4229724_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4259700', 'Sharp - 24" 1.2 Cu. Ft. Built-in Microwave Drawer - Stainless steel', 'Modernize your kitchen design with this 24-inch Sharp microwave drawer oven. Its low profile supports versatile installation for a sleek, contemporary look, and the 1.2 cu. ft. capacity accommodates casserole dishes and frozen dinners. This Sharp microwave drawer oven has a hidden control panel that lets you access functions effortlessly.', 'abcat0903000', 1299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4259/4259700_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4259901', 'Sharp - 30" 1.2 Cu. Ft. Built-in Microwave Drawer - Stainless steel', 'Enjoy design flexibility with this 30-inch Sharp microwave drawer. Its hidden control panel provides an easy-to-read display so you can quickly input operations, and the Easy Touch Automatic Drawer system prevents liquids from being jarred during use. The 1.2 cu. ft. capacity of this Sharp microwave drawer accommodates a 4-quart casserole dish or 20-oz. coffee cup.', 'abcat0903000', 1399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4259/4259901_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4283426', 'Fisher & Paykel - 1.1 Cu. Ft. Over-the-Counter Microwave - Black/brushed stainless steel', 'Cook food conveniently with this 30-inch DCS Appliances over-the-range microwave. It produces temperatures ranging from 100 to 450 degrees F to prepare your meals quickly, and it functions as a convection oven with options to bake or roast. This DCS Appliances over-the-range microwave provides hood lighting and a powerful fan.', 'abcat0903000', 999, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4283/4283426_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4321118', 'GE Profile - 2.1 Cu. Ft. Over-the-Range Microwave with Sensor Cooking - Slate', 'GE Over-the-Range Microwave: Enjoy leftovers and snacks quickly when you cook in this microwave, which features sensor cooking for effective heating that automatically adjusts cook times as needed. Pop popcorn or add 30 seconds to your food''s cooking time with the touch of a button.', 'abcat0903000', 539.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4321/4321118_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4321128', 'GE Profile - 2.1 Cu. Ft. Over-the-Range Microwave with Sensor Cooking - Stainless steel', 'GE over-the-range microwave: Heat up snacks and leftovers quickly with this microwave, which features sensor cooking to automatically adjust heating times to suit your needs. Chef Connect lets you sync clocks and range burners with the microwave''s surface light and vent (range not included).', 'abcat0903000', 539.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4321/4321128_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4482603', 'KitchenAid - 2.0 Cu. Ft. Over-the-Range Microwave with Sensor Cooking - White', 'KitchenAid Over-the-Range Microwave: With sensor steam/simmer cycle, this full-size microwave allows you to create thoroughly cooked dishes with moist, flavorful sides and offers 16 one-touch settings for simple operation. Turn the turntable on or off to suit your dish.', 'abcat0903000', 719.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4482/4482603_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4482604', 'KitchenAid - 1.9 Cu. Ft. Convection Over-the-Range Microwave with Sensor Cooking - Stainless steel', 'KitchenAid Convection Microwave: With Crispwave technology for browning, crisping and frying, this microwave makes it easy to cook your family''s favorite meals and treats. High-Speed Cooking technology combines microwave energy, broil element heat and a convection fan for fast results. The 6-speed fan helps keep your kitchen smelling fresh, and the task light illuminates the cooktop below.', 'abcat0903000', 1169.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4482/4482604_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4482606', 'KitchenAid - 1.9 Cu. Ft. Convection Over-the-Range Microwave with Sensor Cooking - White', 'This high power, 1000-watt convection over-the-range microwave lets you use it to steam and simmer thanks to a sensor-monitored cooking cycle and an innovative container. A 6-speed ventilation fan helps capture smoke, grease and odors from the cooking surface below, empowering cooks to create with confidence. The beauty of the stainless steel finish even extends to the interior.', 'abcat0903000', 944.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4482/4482606_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4483501', 'LG - 2.0 Cu. Ft. Over-the-Range Microwave with Sensor Cooking - Black stainless steel', 'LG Over-the-Range Microwave with Sensor Cooking: Heat up frozen meals or make freshly popped popcorn with sensor-cook technology for well-cooked, consistent results. The removable turntable allows simple cleaning.', 'abcat0903000', 499.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4483/4483501_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4560222', 'Frigidaire - 1.6 Cu. Ft. Built-In Microwave - Black', 'Frigidaire Built-In Microwave: Enjoy freshly popped popcorn or heat frozen meals with this microwave''s 10 power levels and sensor-cook option. The membrane controls make cooking mode selection simple.', 'abcat0903000', 206.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4560/4560222_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4639100', 'GE - 2.0 Cu. Ft. Full-Size Microwave - Stainless steel', 'GE Microwave: Quickly heat a frozen meal, defrost meat for cooking or make popcorn for a movie night with preprogrammed settings and sensor-cook options. The 16" glass turntable and spacious interior offer ample room for larger dishes.', 'abcat0903000', 309, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4639/4639100_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4653032', 'LG - 2.2 Cu. Ft. ExtendaVent 2.0 Over-the-Range Microwave with Sensor Cooking - Black stainless steel', 'LG 2.2 Cu. Ft. Black Stainless Steel ExtendaVent 2.0 Over-the-Range Microwave: With 1000W of power, heat your snacks and melt butter quickly in this over-the-range microwave, which features a 400 cfm exhaust fan with 4 settings for flexibility. A cooking light helps you keep an eye on your food.', 'abcat0903000', 599.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4653/4653032_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4820000', 'Samsung - 1.6 Cu. Ft. Over-the-Range Microwave - Stainless steel', 'Cook what you love. This over-the-range Samsung microwave lets you heat healthy food with the touch of a button. Plus, the powerful ventilation system keeps your kitchen air fresh and free of steam or fumes, and Eco Mode turns off the LED display when it&#8217;s not needed.', 'abcat0903000', 197.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4820/4820000_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4892500', 'Samsung - 2.1 Cu. Ft.  Over-the-Range Microwave with Sensor Cook - Black stainless steel', 'Samsung''s 1000-Watt Over the Range Microwave gives you the convenience of traditional microwave cooking plus the added PowerGrill feature that allows you to grill up to 1500 watts, just like you would with your outdoor grill. Glass Touch Bottom Controls provide precise touch control with a premium look. Keep the microwave spotless and avoid scratches with Ceramic Enamel Interior. Plus, 2.1 cu. ft. of capacity provides big space for big results.', 'abcat0903000', 494.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4892/4892500_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4901028', 'Monogram - 1.1 Cu. Ft. Mid-Size Microwave - Black/stainless steel', 'Get dinner ready in a flash with this Monogram countertop microwave. This 800-watt oven uses sensors to adjust cooking time and power, and it defrosts frozen food automatically based on the item''s weight. Turn the turntable of this 1.1-cu.-ft. Monogram countertop microwave on and off to accommodate whatever you''re cooking.', 'abcat0903000', 750, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4901/4901028_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4916904', 'GE - 1.6 Cu. Ft. Over-the-Range Microwave - Black', 'This GE full-size microwave has 1000W of power for efficient cooking and a turntable with on/off control. It features Express Cook options, automatic settings for defrosting and 10 power levels. Its automatic fan engages when it senses heat from the cooktop. This GE full-size microwave features convenience cooking controls for making popcorn, reheating foods and beverages and cooking potatoes.', 'abcat0903000', 251.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4916/4916904_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4916905', 'GE - 1.6 Cu. Ft. Over-the-Range Microwave - White', 'For optimum cooking power, this GE full-size microwave oven features recirculating venting and 10 power levels. It has 1000W of power and electronic touch controls, along with convenience cooking controls and Express Cook options. Quickly add cooking time with the add-30-seconds function. This GE full-size microwave oven has a 12.5-inch turntable that has on/off control for even heating.', 'abcat0903000', 269.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4916/4916905_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4916912', 'GE - 1.6 Cu. Ft. Over-the-Range Microwave - White', 'Heating favorite foods is easy with this GE full-size microwave. This 1000W over-the-range microwave''s electronic touch controls and 10 power levels make it easy to cook a variety of foods. Choose from Express Cook options or use the turntable''s on/off control for even heat. This GE microwave has an add-30-seconds function for better control while cooking.', 'abcat0903000', 251.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4916/4916912_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4916913', 'GE - 1.6 Cu. Ft. Over-the-Range Microwave - Stainless steel', 'This GE over-the-range microwave has Express Cook options and a turntable with on/off control. This 1000W full-size microwave features convenience cooking controls, along with auto and time defrost and an add-30-seonds function. With a two-speed venting system, this GE over-the-range microwave oven eliminates odors, steam and smoke for a pleasant cooking experience.', 'abcat0903000', 309.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4916/4916913_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4956315', 'KitchenAid - 1.4 Cu. Ft. Built-In Microwave - Black stainless steel', 'KitchenAid built-in microwaveThis convection microwave oven can quickly and thoroughly defrost, melt or cook your favorite foods. The EasyConvect&#8482; Conversion System takes the guesswork out of convection cooking, ensuring exceptional results. And its chrome inlaid frame, satin cross-hatched handles, stainless steel oven cooking cavity and touch controls are the perfect balance of elegance and functionality.', 'abcat0903000', 2474.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4956/4956315_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5009810', 'GE - 1.6 Cu. Ft. Over-the-Range Microwave - Black', 'Steam and cook easily in this black GE over-the-range microwave. Flip the turntable on and off as needed with the turntable switch. Choose from 10 power levels when cooking dishes in the 1.6 cubic feet interior. The two-speed 300-CFM venting system of this GE over-the-range microwave quickly whisks steam, odors and smoke away.', 'abcat0903000', 269.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5009/5009810_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5009811', 'GE - 1.6 Cu. Ft. Over-the-Range Microwave - Stainless steel', 'Warm, cook and defrost food in this GE over-the-range microwave. Convenient controls let you select the correct cooking mode with the press of a button. The 12.5-inch turntable of this 1.6-cubic-foot appliance sets to a stationary mode for direct heating. Use the 10 power levels of this stainless steel GE over-the-range microwave to cook a variety of dishes.', 'abcat0903000', 289.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5009/5009811_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5028254', 'Royal Sovereign - 0.9 Cu. Ft. Compact Microwave - Stainless steel', 'Cook, defrost and heat up food with this Royal Sovereign commercial microwave. The easy-to-operate microwave delivers up to 1000 W of power so that you can efficiently prepare food to your liking, and the lack of turntable inside makes it easy to clean. The 10 programmable settings let you use this Royal Sovereign commercial microwave to prepare food consistently.', 'abcat0903000', 337.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5028/5028254_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5157600', 'KitchenAid - 1.4 Cu. Ft. Built-In Microwave - Black', 'Quickly cook, defrost or warm up your favorite foods with this KitchenAid built-in microwave oven. Its 1.4-cubic-foot size is large enough to accommodate dishes for the entire family. Use the included trim kit to mount your KitchenAid built-in microwave into spaces of either 27 inches or 30 inches to match your range.', 'abcat0903000', 1664.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5157/5157600_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5191602', 'Samsung - 1.1 Cu. Ft. Countertop Convection Microwave with Sensor Cook and PowerGrill - Black stainless steel', 'The Samsung Countertop Microwave makes preparing multiple dishes effortless with 1.1 cu. ft. capacity. The Power Convection quickly circulates heat, delivering oven like results.  Additionally, PowerGrill functions like a grill, allowing you to brown and crisp your food on the outside while maintaining tenderness inside.', 'abcat0903000', 390.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5191/5191602_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5211900', 'GE - 1.6 Cu. Ft. Over-the-Range Microwave - Slate', 'Use the Convenience Cooking controls on this GE over-the-range microwave oven to make meals in a flash when you''re on the go. This combination vent and microwave features two speeds for keeping cooking exhaust to a minimum. Set defrost times on this GE over-the-range microwave oven manually or automatically, and turn on the turntable for fast even heating.', 'abcat0903000', 251.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5211/5211900_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5268301', 'GE - 1.7 Cu. Ft. Over-the-Range Microwave - Stainless steel', 'Simplify meal preparation with this GE over-the-range microwave. Advanced sensor controls automatically set optimal cook and defrost times based on the foods you need to cook, and the melt feature easily liquefies butter, cheese or chocolate. This GE over-the-range microwave also has a two-speed venting system for effortless removal of smoke, steam and odors.', 'abcat0903000', 413.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5268/5268301_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5268702', 'GE - 1.7 Cu. Ft. Over-the-Range Microwave - Slate', 'Adjust cooking power and time automatically with this GE microwave. It automatically defrosts foods based on the weight, and the oven then sets the correct power level and defrosting time by itself. Bid goodbye to undesirable steam, smoke and odors with this GE microwave, thanks to its 300-cfm two-speed venting system.', 'abcat0903000', 440.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5268/5268702_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5268800', 'GE - 1.9 Cu. Ft. Over-the-Range Microwave with Sensor Cooking - Slate', 'Broaden your cooking options with this GE sensor microwave. Its 1.9-cubic-foot interior and 1000W power delivers what you need to prepare a variety of dishes, and its sensor cooking controls let you automatically adjust time and power. Defrost automatically based on weight or time, or use the melt function for consistent and controlled cooking with this high-performance GE sensor microwave.', 'abcat0903000', 323.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5268/5268800_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5269000', 'GE Profile - 1.7 Cu. Ft. Convection Over-the-Range Microwave with Sensor Cooking - Stainless steel', 'Achieve oven-quality cooking with this GE Profile Series microwave. It combines convection and microwave cooking to quickly deliver perfectly cooked food, and it''s made for installation over the range to save counter space. This GE Profile Series microwave includes a rack that lets heat circulate evenly around food, providing golden-brown results.', 'abcat0903000', 620.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5269/5269000_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5291501', 'GE - 1.9 Cu. Ft. Over-the-Range Microwave - Stainless steel', 'Expand your kitchen capabilities with this GE over-the-range microwave oven, and use sensor cooking for perfect results every time. The easy-to-clean enamel interior makes wiping up messes simple. This forward-thinking GE over-the-range microwave oven uses either weight or time defrost to ensure perfect thawing of a variety of frozen foods.', 'abcat0903000', 521.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5291/5291501_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5291502', 'GE - 1.9 Cu. Ft. Over-the-Range Microwave with Sensor Cooking - White', 'Make quick work of reheating or creating recipes from scratch with this GE over-the-counter microwave oven. Ten power levels let you adjust the level of cooking for even results. Convertible venting works with recirculating, vertical or horizontal outside exhaust, letting you incorporate this GE over-the-counter microwave oven into a variety of setups.', 'abcat0903000', 476.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/5291/5291502_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1118136', 'Whirlpool - 21.3 Cu. Ft. Top-Freezer Refrigerator - Monochromatic stainless steel', 'Store your groceries at the right temperature for freshness with this 21.3 cu. ft. Whirlpool WRT541SZDM top-freezer refrigerator, which features frameless glass shelves, humidity-controlled crispers and a Flexi-Slide bin for flexible storage options.', 'abcat0901000', 1169.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1118/1118136_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5291503', 'GE - 1.9 Cu. Ft. Over-the-Range Microwave with Sensor Cooking - Black', 'Heat up dinner or defrost a roast in this GE over-the-range microwave oven, featuring 10 power settings for perfect results. The four-speed with boost venting system lets you clear the air quickly, and this GE over-the-range microwave oven has a recessed turntable that turns on and off with a touch of a button.', 'abcat0903000', 476.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5291/5291503_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5291508', 'GE - 1.7 Cu. Ft. Over-the-Range Microwave with Sensor Cooking - Black', 'Melt butter without worrying with the Melt mode on this GE over-the-range microwave oven, and use 10 power settings for effortless cooking. The Add 30 Seconds button lets you increase cooking time by 30-second increments, and this GE over-the-range microwave oven features an up-front charcoal filter with indicator light, so you know when it''s time to change it.', 'abcat0903000', 341.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5291/5291508_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5291509', 'GE Profile - 1.7 Cu. Ft. Convection Over-the-Range Microwave with Sensor Cooking - White', 'Make dinner in no time with this GE over-the-range microwave/convection oven. The three-speed fan clears the air quickly, and the included convection rack turns your microwave into a fast cooking oven. Intuitive sensor cooking controls on this GE over-the-range microwave/convection oven ensure delicious, well-cooked results with each recipe you make.', 'abcat0903000', 575.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5291/5291509_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5291511', 'GE - 1.9 Cu. Ft. Over-the-Range Microwave with Sensor Cooking - White', 'Create a culinary masterpiece or reheat leftovers in minutes with this GE over-the-range microwave oven. The Melt option on the oven lets you create perfectly melted chocolate, butter and other ingredients with the touch of a button. This GE over-the-range microwave oven features timed and weighted defrost for thawing a range of frozen foods.', 'abcat0903000', 431.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5291/5291511_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5291512', 'GE - 1.7 Cu. Ft. Over-the-Range Microwave - White', 'Reheat dinner or bake a cake with the versatility of this GE over-the-range microwave oven. Convenience controls let you cook to perfection at the touch of a button. Ten power levels offer complete control over your results, and the two-speed 300-CFM venting system helps keep the air in your kitchen clean and clear.', 'abcat0903000', 251.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5291/5291512_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5291513', 'GE Profile - 1.7 Cu. Ft. Convection Over-the-Range Microwave with Sensor Cooking - Black', 'Get dual function at the touch of a button with this GE over-the-range microwave/convection oven, featuring sensor controls that ensure perfect results. The convection function offers baking and browning with delicious results. The easy-clean exterior on this GE over-the-range microwave/convection oven makes cleaning up messes as simple as the swipe of a cloth.', 'abcat0903000', 575.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5291/5291513_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5291514', 'GE - 1.9 Cu. Ft. Over-the-Range Microwave with Sensor Cooking - Stainless steel', 'Add the contemporary look of stainless steel into your kitchen with this GE over-the-range microwave oven. The 1.9-cubic-foot interior offers room for making an entire meal all at once. Sensor cooking helps ensure exacting results, and this GE over-the-range microwave oven features both weight and time defrosting to handle a range of foods.', 'abcat0903000', 476.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5291/5291514_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5291520', 'GE - 1.9 Cu. Ft. Over-the-Range Microwave with Sensor Cooking - Black', 'Cook dinner or pop a bag of popcorn in this GE over-the-range microwave oven, featuring convenience cooking controls for quick results. Sensor cooking offers even cooking for everything from tender meats to casseroles. The easy-clean enamel exterior on this GE over-the-range microwave oven makes cleaning up accidental splatters and spills super easy.', 'abcat0903000', 431.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5291/5291520_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5291525', 'GE - 1.7 Cu. Ft. Over-the-Range Microwave - Black', 'Use this GE over-the-range microwave oven to defrost dinner and then cook quickly. The one-touch convenience controls offer easy heating a variety of often-heated items. A recessed turntable assures even results, and sensor controls provide effortless cooking. This GE over-the-range microwave oven has a two-speed fan to keep the air clear in your kitchen.', 'abcat0903000', 296.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5291/5291525_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5291526', 'GE - 1.7 Cu. Ft. Over-the-Range Microwave with Sensor Cooking - White', 'Let sensor controls on this GE over-the-counter range do all of the work, checking time and temperature and delivering perfect results with every dish. An integrated Melt mode lets you melt cheese, butter and other ingredients without worrying about scorching. Weight and time defrost on this GE over-the-counter range works to thaw a range of frozen meats and food.', 'abcat0903000', 341.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5291/5291526_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5291527', 'GE - 1.7 Cu. Ft. Over-the-Range Microwave with Sensor Cooking - Stainless steel', 'Bring a sleek, updated look to your kitchen, along with convenient cooking, with this GE over-the-range microwave oven. The stainless steel exterior adds modern appeal, and 10 power levels provide an option for every recipe. This GE over-the-range microwave oven offers a two-speed venting system to keep the air in your kitchen clean.', 'abcat0903000', 341.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5291/5291527_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5439301', 'GE Profile - 2.1 cu. ft. Sensor Over-the-Range Microwave - Stainless steel', 'Heat food for convenient meals in this GE microwave. It installs over the range to save space on your counter and includes a sensor-based cooking function that lets you prepare food at the right temperature every time. Easy defrost functions on this GE microwave let you prep food for more traditional cooking.', 'abcat0903000', 539.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5439/5439301_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5463501', 'KitchenAid - 2.0 Cu. Ft. Over-the-Range Microwave with Sensor Cooking - Black stainless steel', 'Reheat dishes or defrost main ingredients quickly with this KitchenAid over-the-range microwave. The turntable rotates smoothly for even cooking, and it has 16 settings for one-touch cooking of family favorites such as popcorn and baked potatoes. This KitchenAid over-the-range microwave has a three-speed fan to eliminate excess heat and cooking odors.', 'abcat0903000', 764.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5463/5463501_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1118145', 'Whirlpool - 14.3 Cu. Ft. Top-Freezer Refrigerator - White', 'Chill groceries with this Whirlpool WRT134TFDW 14.3 cu. ft. top-freezer refrigerator, which features interior temperature control dials for easy adjustments. Three shelves and a deli meat drawer help organize the storage space.', 'abcat0901000', 719.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1118/1118145_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5463700', 'KitchenAid - 1.9 Cu. Ft. Convection Over-the-Range Microwave - Black stainless steel', 'Heat leftovers quickly with this KitchenAid over-the-range microwave. The Sensor Steam function automatically adjusts to perfectly steam food, and the 1.9-cubic-foot capacity can accommodate larger dishes. This KitchenAid over-the-range microwave has a 1500W convection element for baking up to 425 degrees F, so you can prepare dessert without taking up valuable oven space.', 'abcat0903000', 989.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5463/5463700_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5473704', 'GE Profile - 2.1 Cu. Ft. Over-the-Range Microwave - Stainless steel', 'Heat food quicker with this GE microwave. The LED cooktop lighting illuminates the heating area, providing better visibility without the use of kitchen lights. Defrost settings calculate optimal defrosting time and power level by food weight, and the sensor controls of this GE microwave automatically adjust cooking times for optimal results.', 'abcat0903000', 549.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5473/5473704_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5508900', 'Amana - 1.6 Cu. Ft. Over-the-Range Microwave - Black on stainless steel', 'Make a quick snack or reheat leftovers with this Amana over-the-range microwave. The instant-action keys let you cook, reheat and defrost common foods with just the push of a button, and the overhead design saves valuable counter space. This Amana over-the-range microwave has a hidden vent for a seamless look.', 'abcat0903000', 369.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5508/5508900_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5509900', 'Bosch - 800 Series 1.8 Cu. Ft. Convection Over-the-Range Microwave with Sensor Cooking - Stainless steel', 'Expand your cooking options with this Bosch over-the-counter convection microwave, which features a multi-speed vent for comfortable cooking. The stainless interior ensures even heating, and true convection heating replicates the actions of an oven. This Bosch over-the-counter convection microwave installs with slide-in ranges and microwaves for a complete Bosch setup.', 'abcat0903000', 849.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5509/5509900_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5527514', 'GE - 1.5 Cu. Ft. Mid-Size Microwave - Slate', 'Cook food fast and efficiently with this GE convection microwave oven. Microwave sensor cooking controls detect humidity released during cooking and adjust the time accordingly to get your dish to the desired temperature. With this GE convection microwave oven, you can prepare meats and vegetables quickly via convenient convection cooking options.', 'abcat0903000', 799, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5527/5527514_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5527520', 'GE - 1.5 Cu. Ft. Mid-Size Microwave - Black on black', 'Get desired cooking results without sacrificing moistness or crispness by using this GE counter-top microwave. Its 10 power levels provide greater cooking flexibility, and sensor cooking controls automatically adjust time and power settings to suit cooking needs. The convection rack of this GE counter-top microwave promotes even heat distribution and helps you achieve golden-brown finishes.', 'abcat0903000', 699, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5527/5527520_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5527521', 'GE - 1.5 Cu. Ft. Mid-Size Microwave - White on white', 'Cook favorite foods with this GE microwave oven. It can also be used as a convection oven thanks to a rack that lets hot air circulate around food for even cooking, and a warmer setting keeps food hot. This GE microwave oven has a sensor control that adjusts cooking time and power level for perfect results.', 'abcat0903000', 699, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5527/5527521_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5527522', 'GE - 1.5 Cu. Ft. Mid-Size Microwave - Stainless steel', 'Heat food faster with this GE microwave. Its 1.5-cubic-foot capacity holds a medium-sized plate of leftovers, and the built-in warming oven keeps premade meals warm until they are ready to be served. You don''t have to lift a finger if food needs additional heating thanks to the automatic sensor cooking controls of this GE microwave.', 'abcat0903000', 829, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5527/5527522_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5527523', 'GE - 1.1 Cu. Ft. Mid-Size Microwave - Slate', 'Create culinary masterpieces with this 1.1-cubic-foot GE Profile microwave oven. The fuss-free defrost setting calculates optimal time and power level based on food weight, and a kitchen timer helps you stay on track. Toggle the turntable on and off as needed, and prevent accidental activation of this GE Profile microwave oven with the lockout setting.', 'abcat0903000', 509, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5527/5527523_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5534700', 'GE - 0.7 Cu. Ft. Compact Microwave - Black on black', 'Cook tasty meals and snacks in this 700W GE countertop microwave. Preprogrammed buttons for reheating, defrosting and cooking convenience items let you quickly prepare snacks, and the turntable rotates food to minimize cold spots. This compact GE countertop microwave has an ample 0.7-cubic-foot capacity and instant-on controls for one-touch operation.', 'abcat0903000', 179.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5534/5534700_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5534800', 'GE - 0.7 Cu. Ft. Compact Microwave - Stainless steel', 'Complete cooking tasks in minutes with this 700W countertop GE microwave oven. A rotating turntable provides consistent heat distribution, and a one-touch operating panel lets you engage automatic functions or program cooking power and time manually. Keep on task with the kitchen timer and cycle-complete reminder of this GE microwave oven.', 'abcat0903000', 199.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5534/5534800_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5578591', 'Bosch - 500 Series 1.6 Cu. Ft. Built-In Microwave - Stainless steel', 'Enjoy the quality of oven cooking and the speed of a microwave with this Bosch speed convection oven. The 24-inch width is ideal for smaller homes or apartments, and the stainless steel finish provides a modern look. This Bosch speed convection oven comes with a number of cooking presets for convenient food-prep options.', 'abcat0903000', 1899.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5578/5578591_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5578592', 'Bosch - 800 Series 1.2 Cu. Ft. Built-In Microwave - Stainless steel', 'Get high performance and modern design with this Bosch microwave. This 30-inch drawer microwave opens and closes with the push of a button, and it has 11 presets for easy convenience. Install this Bosch microwave flush to a cabinet or underneath your counter to save space and maintain the sleek look of your kitchen.  How to Measure for a New Appliance A little measuring now can help you avoid delivery headaches later. Watch the video &#8250;', 'abcat0903000', 1849.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5578/5578592_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5578732', 'Samsung - 1.4 cu. ft. Countertop Microwave with Sensor Cook - Stainless steel', 'The Samsung Countertop Microwave makes preparing multiple dishes effortless with 1.4 cu. ft. capacity. Designed with a scratch-resistant interior, this modern microwave features Sensor Cooking options which automatically provide optimal cooking results.', 'abcat0903000', 165.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5578/5578732_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5584000', 'Bosch - 300 Series 1.6 Cu. Ft. Over-the-Range Microwave - Stainless steel', 'Get multifunctional convenience with this Bosch over-the-range microwave. This 30-inch appliance with a capacity of 1.6 cu. ft. accommodates all types of food, while its high-speed vent efficiently dispels steam and smoke. The auto-defrost function on this Bosch over-the-range microwave lets you quickly defrost frozen foods with the large LCD touch panel display.', 'abcat0903000', 499.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5584/5584000_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5584100', 'Bosch - 500 Series 2.1 Cu. Ft. Over-the-Range Microwave - Stainless steel', 'The Precisely Designed OTR Microwave is a Perfect Match to the Sleek Design of the Bosch Kitchen. 1,100 Watts of Power - offers exceptional cooking speed and heating performance. A large cooking interior gives you flexibility to cook various dishes. A sensor detects when food is finished and automatically turns off. A multi-speed vent efficiently removes steam, smoke, grease and odors. The OTR microwave is designed to install with a Bosch slide-in range or cooktop.', 'abcat0903000', 599.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5584/5584100_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5596707', 'Amana - 1.6 Cu. Ft. Over-the-Range Microwave - Black', 'Quickly reheat foods with this 1.6 cu. ft. Amana microwave. It has a 12-inch turntable for even heating and an auto defrost feature for last-minute meal prep. This 30-inch Amana microwave lets you control the ventilation and lighting in your cooking area with the adjustable 300-cfm fan and cooktop surface light.', 'abcat0903000', 319.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5596/5596707_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5596709', 'Amana - 1.6 Cu. Ft. Over-the-Range Microwave - White', 'Reheat leftovers in this 1.6-cu.-ft. Amana over-the-range microwave. It has a built-in 300-cfm blower and two-speed fan to rid the air of smoke, odors and grease as you cook. This 1000W Amana over-the-range microwave has a built-in light so you can see what you''re doing on the stove or light the way to a late-night snack.', 'abcat0903000', 319.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5596/5596709_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5644200', 'JennAir - 1.5 Cu. Ft. Mid-Size Microwave - Stainless steel', 'This 900-watt Jenn-Air&#174; countertop microwave includes a separate 1400-watt convection element that allows you to use it as a true second oven. If you desire an in-wall installation, the flat-front design allows you to achieve a flush-to-cabinet installation with the addition of a trim kit.', 'abcat0903000', 1149, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5644/5644200_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5666706', 'KitchenAid - 1.4 Cu. Ft. Built-In Microwave - Black stainless steel', 'This convection cooking microwave oven combines great power with a powerful convection element to increase the speed of cooking. The EasyConvect conversion system takes the guesswork out of convection cooking, ensuring exceptional results. And its chrome inlaid frame, satin cross-hatched handles, stainless steel oven cooking cavity and touch controls are the perfect balance of elegance and functionality.', 'abcat0903000', 2474.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5666/5666706_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5687934', 'Samsung - 1.4 cu. ft. Countertop Microwave with Sensor Cook - Black stainless steel', 'The Samsung Countertop Microwave makes preparing multiple dishes effortless with 1.4 cu. ft. capacity. Designed with a scratch-resistant interior, this modern microwave features Sensor Cooking options which automatically provide optimal cooking results.', 'abcat0903000', 219.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5687/5687934_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5699000', 'Bosch - 500 Series 1.6 Cu. Ft. Built-In Microwave - Stainless steel', 'Install this Bosch built-in microwave oven above your matching range, and create meals in minutes with elegant ease. The sleek stainless steel design brings modern efficiency to your kitchen, and automatic sensing ensures even results. This Bosch built-in microwave oven offers 1.6 cu. ft. of cooking space to expand your cooking options.', 'abcat0903000', 1399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5699/5699000_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5699200', 'Bosch - 500 Series 1.6 Cu. Ft. Built-In Microwave - Stainless steel', 'Built-in microwave oven 500 Series features design matched for use in combination with Bosch wall oven.', 'abcat0903000', 1399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5699/5699200_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5703102', 'Bosch - 800 Series 1.6 Cu. Ft. Built-In Microwave - Stainless steel', 'Enjoy hot snacks and meals with this 30-inch Bosch speed oven. Its SpeedChef cooking cycles provide convenient presets to instantly heat favorite foods, such as pizza, popcorn and beverages. This 2-in-1 Bosch speed oven lets you cook a variety of dishes efficiently with its convection cooking options and microwave technology.', 'abcat0903000', 1999.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5703/5703102_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5703201', 'Bosch - 800 Series 1.6 Cu. Ft. Built-In Microwave - Stainless steel', 'Cook nearly any type of food with this 1.6 cu. ft. Bosch built-in convection microwave. It offers several cooking functions, including broil and convection, to leave your stove and oven free for other tasks. This 30-inch Bosch built-in convection microwave has 10 power levels and pre-programmed settings to make cooking simple and easy.', 'abcat0903000', 2199.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5703/5703201_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5703300', 'Bosch - 800 Series 1.6 Cu. Ft. Built-In Microwave - Stainless steel', 'Prepare large quantities of food quickly with this Bosch microwave oven. Its 1.6 cu. ft. capacity holds large dishes such as casseroles, and its nine-speed chef programs make heating favorite dishes fast and easy. The drop-down door on this 1000W Bosch microwave oven provides easy access, while convection cooking heats food evenly.', 'abcat0903000', 2049.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5703/5703300_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5705915', 'Bosch - Benchmark Series 1.8 Cu. Ft. Convection Over-the-Range Microwave with Sensor Cooking - Stainless steel', 'Cook your favorite recipes with this 30-inch Bosch Benchmark convection microwave oven. Its triple distribution system provides even heating, and its convection cooking mode produces oven-like results for baked and roasted dishes. This 1.8 cu. ft. Bosch Benchmark convection microwave has a 385-cfm multispeed vent that eliminates odors, excess heat and smoke.', 'abcat0903000', 899.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5705/5705915_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5709444', 'Viking - 1.2 Cu. Ft. Built-In Microwave - Stainless steel', 'Maximize your kitchen space with this Viking undercounter microwave oven. It has a heavy-duty construction so that it withstands daily use and even inadvertent door slams, and the undercounter design utilizes a drawer action to keep it hidden. Thanks to the 1.2-cubic-foot capacity, this Viking undercounter microwave oven can handle numerous dishes.', 'abcat0903000', 2309, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5709/5709444_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5711947', 'Haier - 1.4 Cu. Ft. Over-the-Range Microwave with Sensor Cooking - Stainless steel', 'Warm meals and snacks in this Haier microwave. It''s an over-the-range model, so it doesn''t take up counter space, and it has a spacious 1.4 cu. ft. capacity, so you can heat a whole meal at once. This Haier microwave is made from stainless steel, which resists staining and provides long-lasting use.', 'abcat0903000', 439.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5711/5711947_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5712110', 'Sharp - Carousel 1.1 Cu. Ft. Mid-Size Microwave - Stainless steel', 'Reheat meals the easy way with this Sharp 1.1-cubic-foot countertop microwave. Thaw ingredients in minutes using the unit''s auto-defrost function and cook a variety of foods using the microwave''s numerous one-touch start options. The innovative Carousel turntable in this Sharp 1.1-cubic-foot countertop microwave helps reduce hot and cold spots for a delicious result.', 'abcat0903000', 139.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5712/5712110_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5712119', 'Sharp - Carousel 1.1 Cu. Ft. Mid-Size Microwave - White', 'Cook meals for the family and warm up leftovers with this Sharp 1.1-cubic-foot countertop microwave. Equipped with a Carousel turntable, this white microwave heats food quickly and evenly, reducing hot and cold spots. Handy one-touch start settings and an auto-defrost function make this Sharp 1.1-cubic-foot countertop microwave easy to use.', 'abcat0903000', 129.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5712/5712119_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5712120', 'Sharp - Carousel 1.4 Cu. Ft. Mid-Size Microwave - Black stainless steel', 'Defrost frozen ingredients and cook meals in minutes with this Sharp 1.4-cubic foot countertop microwave. Several one-touch options and an advanced sensor inside the microwave help cook foods quickly and thoroughly. With its stylish black and stainless steel design, this Sharp 1.4-cubic foot countertop microwave looks good in any modern kitchen.', 'abcat0903000', 169.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5712/5712120_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5714901', 'LG - NeoChef 1.5 Cu. Ft. Mid-Size Microwave - Stainless steel', 'Add versatility to your kitchen with this LG microwave. Its 1.5 cu. ft. capacity accommodates large dishes, while its stainless steel construction is stylish and easy to clean. Smart Inverter technology lets you cook continuously at a low power setting for precise results.', 'abcat0903000', 239.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5714/5714901_sd.jpg');
