INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4289408', 'Viking - Professional 5 Series Quiet Cool 25.3 Cu. Ft. Side-by-Side Built-In Refrigerator - Apple red', 'Cool food quickly with this Viking refrigerator. LED lights on the top and side-walls provide visibility in low lighting, and the Pro Chill Management system lets you optimize temperature settings with its digital read-out that lets you know food is at the right chill level. Prevent excess moisture from spoiling foods with the Humidity Zone drawers of this Viking refrigerator.', 'abcat0901000', 11099, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4289/4289408_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4320911', 'KitchenAid - 30 Cu. Ft. Side-by-Side Built-In Refrigerator - Stainless steel', 'Maximize your food storage space with this KitchenAid built-in side-by-side refrigerator. Sensor technology in both the fridge and freezer compartments work to keep your foods fresher for longer, and the SatinGlide crisper drawers operate on ball bearings for effortless opening and closing. Boasting a fingerprint-resistant surface, this stainless steel KitchenAid built-in side-by-side refrigerator stays looking great in your kitchen.', 'abcat0901000', 9809.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4320/4320911_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4320912', 'KitchenAid - 29.5 Cu. Ft. Side-by-Side Built-In Refrigerator - Stainless steel', 'Keep food fresh in this KitchenAid side-by-side refrigerator. The produce preserver absorbs ethylene gas to prevent fruits from becoming overly ripe, and the exterior PrintShield finish keeps the stainless steel fridge smudge-free. Enjoy the energy efficiency of this ENERGY STAR-qualified 29.5 cu. ft. KitchenAid side-by-side refrigerator, which uses LED bulbs for bright interior lighting.', 'abcat0901000', 10709.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/4320/4320912_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4320913', 'KitchenAid - 25 Cu. Ft. Side-by-Side Built-In Refrigerator - Stainless steel', 'Keep your fresh and frozen foods stored elegantly in this KitchenAid built-in side-by-side refrigerator. LED lighting illuminates each compartment for convenient visibility, and the adjustable glass shelves let you customize your storage space. Featuring Produce Preserver technology, this KitchenAid built-in side-by-side refrigerator absorbs ethylene gas to prevent your produce from over-ripening.', 'abcat0901000', 9629.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4320/4320913_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4394008', 'Whirlpool - 18.2 Cu. Ft. Top-Freezer Refrigerator - Stainless steel', 'Whirlpool Top-Freezer Refrigerator: Keep your home stocked with healthy snacks and groceries using this 18.2 cu. ft. refrigerator, which features 3 frameless glass shelves and 2 humidity-controlled crispers to prolong the freshness of your fruits and vegetables. Electronic controls offer simple temperature adjustment.', 'abcat0901000', 989.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4394/4394008_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4437000', 'GE - 21.9 Cu. Ft. Side-by-Side Counter-Depth Refrigerator - Fingerprint resistant slate', 'GE Counter-Depth Refrigerator: Keep healthy snacks and fresh ingredients accessible with this spacious refrigerator, which features ample shelf space and adjustable door bins to accommodate all your groceries. LED lights help you find what you need.', 'abcat0901000', 2429.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4437/4437000_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4437001', 'GE - 21.9 Cu. Ft. Side-by-Side Counter-Depth Refrigerator - White', 'GE Counter-Depth Refrigerator: Keep healthy snacks and fresh ingredients accessible with this spacious refrigerator, which features ample shelf space and adjustable door bins to accommodate all your groceries. LED lights help you find what you need.', 'abcat0901000', 2339.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4437/4437001_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4481801', 'GE - 21.9 Cu. Ft. Counter-Depth Refrigerator - High gloss black', 'GE Counter-Depth Refrigerator: Keep fresh and frozen items neatly organized in this refrigerator, which offers spill-proof glass shelves for easy cleanup and a through-the-door dispenser that produces chilled water and ice with a press of a button. Electronic touch controls make it easy to adjust the temperature.', 'abcat0901000', 2339.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4481/4481801_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4510603', 'LG - 21.8 Cu. Ft. French Door Refrigerator - Stainless steel', 'Maximize the shelf life of fresh ingredients in this 22.0 cu. ft. LG French door refrigerator. Its Smart Cooling system utilizes an energy-efficient linear compressor to maintain a stable environment during temperature fluctuations. Store and access prepared cheese and dessert platters easily from the full-width Glide N'' Serve pantry drawer of this LG French door refrigerator.', 'abcat0901000', 1999.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4510/4510603_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4661201', 'LG - Door-in-Door 26.0 Cu. Ft. Side-by-Side Refrigerator with Thru-the-Door Ice and Water - Black stainless steel', 'With a generous 26cu. ft. capacity and featuring our Door-in-Door&#174; design, this side-by-side refrigerator maximizes food storage space to accommodate all of your family''s food. From post-workout protein shakes to after-school snacks, LG''s Door-in-Door&#174; design keeps all your favorites at your fingertips while reducing cold air loss to help keep foods, fresher longer and conserve on precious energy &#8212;all with the push of a button. It''s designed with convenient slide-out and folding shelving, tilting and adjustable door bins, and multiple crisper drawers&#8212; to help facilitate organization, so you can find just what you need in a snap. Plus, it comes with sophisticated LG styling and features like an intuitive LED display, contoured doors, and Smart Cooling System helps keep your food fresher..', 'abcat0901000', 1899.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4661/4661201_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4832402', 'JennAir - 21.9 Cu. Ft. French Door Counter-Depth Refrigerator - Stainless steel', 'This Jenn-Air&#174; freestanding counter depth French door refrigerator offers a sleek, integrated look with an internal water dispenser. The 72-inch height provides three extra inches that fill the gap 69-inch refrigerators leave below standard cabinets. An electronic climate control system helps maintain an ideal environment for keeping ingredients fresh. This model is available in Euro-Style Stainless (JFC2290REM) and Pro-Style Stainless (JFC2290REP) exterior design styles.', 'abcat0901000', 4049, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4832/4832402_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4841305', 'Amana - 18.2 Cu. Ft. Top-Freezer Refrigerator - White', 'This Amana refrigerator comes with humidity-controlled crisper bins that help greens stay green so you can spend less time doing grocery runs, and more time catching up on the game.', 'abcat0901000', 949.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4841/4841305_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4841311', 'Amana - 18.2 Cu. Ft. Top-Freezer Refrigerator - Stainless steel', 'Keep food fresh in this 30-inch Amana refrigerator. The humidity-controlled crisper bins manage moisture efficiently to prolong the life of produce, and the 18 cu. ft. capacity lets you store enough items to prevent unnecessary grocery trips. This Amana refrigerator has an adjustable flip-up shelf for tall wine bottles and other beverages.', 'abcat0901000', 1049.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4841/4841311_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4841314', 'Amana - 18.2 Cu. Ft. Top-Freezer Refrigerator - Black', 'Maximize kitchen storage with this 30-inch Amana refrigerator. It has an 18 cu. ft. capacity to hold food for a medium-sized household, and the flip-up shelf lets you stock tall wine bottles and other beverages within easy reach. This black Amana refrigerator has humidity-controlled crisper drawers to preserve fruits and vegetables.', 'abcat0901000', 949.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4841/4841314_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4841319', 'Amana - 18 Cu. Ft. Top-Freezer Refrigerator - White', 'Organize your food by item and by temperature with this Whirlpool top freezer refrigerator, which includes dedicated storage for each food type and an automatic ice maker. Electronic temperature controls let you choose the ideal temperature for the freezer and fridge. This Whirlpool top freezer refrigerator ships as a right-hand door swing but can be reversed.', 'abcat0901000', 949.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4841/4841319_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4913900', 'Samsung - 27.8 Cu. Ft. 4-Door Flex French Door Fingerprint Resistant Refrigerator with Food ShowCase - Black stainless steel', 'Make this sleek Samsung refrigerator the center of your kitchen. Access on-the-go items quickly, get filtered water and ice right from the door, and keep ingredients fresh and cool, just the way they should be.', 'abcat0901000', 3599.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4913/4913900_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4930900', 'Samsung - 27.8 Cu. Ft. 4-Door Flex French Door Fingerprint Resistant Refrigerator with Food ShowCase - Stainless steel', 'Make this sleek Samsung refrigerator the center of your kitchen. Access on-the-go items quickly, get filtered water and ice right from the door, and keep ingredients fresh and cool, just the way they should be.', 'abcat0901000', 3419.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4930/4930900_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4956306', 'KitchenAid - 24.2 Cu. Ft. French Door Built-In Refrigerator - Black stainless steel', 'Behind these built-in French doors lie performance and beauty. The Preserva&#174; Food Care System features three technologies that work in concert to assure crisp produce and deliciously flavorful foods while helping to eliminate refrigerator odors. The glossy silver Platinum Interior Design complements the metallic accents on shelves, crisper and baskets while the SatinGlide&#174; System with Soft-Close assures their smooth operation.', 'abcat0901000', 9809.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4956/4956306_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4956326', 'KitchenAid - 25.8 Cu. Ft. 5-Door French Door Refrigerator - Black stainless steel', 'This uniquely versatile, platinum interior refrigerator offers 5 doors, including 2 soft-close drawers, to deliver optimized storage. This refrigerator also features the Preserva&#174; Food Care System which uses two independent cooling systems to help keep food fresh longer, while under-shelf LED lighting beautifully displays the food below for greater visibility.', 'abcat0901000', 4139.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4956/4956326_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4965902', 'JennAir - 29.5 Cu. Ft. Side-by-Side Built-In Refrigerator - Stainless steel', 'Store all the ingredients you need for your next family get-together with this JennAir side-by-side refrigerator. It has a combined 29.5 cu. ft. of space to store fresh produce, dairy items, cold cuts and frozen treats, and the sensor-controlled temperature management system maintains safe food temperatures. This JennAir side-by-side refrigerator has touch controls and an LED display for easy operation.', 'abcat0901000', 12199, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/4965/4965902cv11a.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4965903', 'JennAir - 25 Cu. Ft. Side-by-Side Built-In Refrigerator - Stainless steel', 'Have enough room to stock your kitchen with fresh ingredients by using this JennAir side-by-side refrigerator. The in-door water dispenser provides easy access to water and ice, so there''s more room in the freezer, and the sensor-controlled temperature management system automatically monitors and adjusts cooling levels throughout the appliance. This JennAir side-by-side refrigerator absorbs ethylene gas to prevent produce from over-ripening.', 'abcat0901000', 11599, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4965/4965903_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4965906', 'JennAir - 25.6 Cu. Ft. Side-by-Side Refrigerator - Custom Panel Ready', 'The exclusive Obsidian interior brings a luxurious finish to the inside of this JennAir integrated built-in refrigerator. The refrigerator achieves a seamless look with a flush design that features concealed hinges and trim pieces.', 'abcat0901000', 9699, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4965/4965906_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4965907', 'JennAir - 29.2 Cu. Ft. Side-by-Side Refrigerator - Custom Panel Ready', 'The excellent interior brings a luxurious finish to the inside of this JennAir integrated built-in refrigerator. The refrigerator achieves a seamless look with a flush design, that features concealed hinges and trim pieces.', 'abcat0901000', 10399, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4965/4965907_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4980433', 'Samsung - 25.5 Cu. Ft. French Door Refrigerator with Internal Water Dispenser - Stainless steel', 'Add this sleek and spacious Samsung 25.5 cu. ft. french door refrigerator to your busy household. Control the settings exactly how you want in order to freeze and chill food fast. Plus, you''ll have plenty of ways to organize ingredients, making it easier for everyone to grab and go. Get great-tasting, filtered water directly from your refrigerator. Spend less time and money buying bottled water.', 'abcat0901000', 1649.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4980/4980433_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4980442', 'Samsung - 24.6 Cu. Ft. French Door Refrigerator with Thru-the-Door Ice and Water - Stainless steel', 'Eat the way you love every day. From produce to poultry, dairy and more, this Samsung refrigerator will keep ingredients fresh, delicious and ready for use in your favorite recipes.', 'abcat0901000', 1999.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4980/4980442_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4997901', 'GE - 27.7 Cu. Ft. French Door Refrigerator - Fingerprint resistant slate', 'Upgrade your kitchen with this GE ENERGY STAR French door refrigerator. LED showcase lighting illuminates the inside of the refrigerator compartment, making it easy to find your ingredients as you cook. An advanced water filtration system delivers fresh water and ice, and a customizable freezer compartment lets you add a second icemaker to this GE ENERGY STAR French door refrigerator.', 'abcat0901000', 2969.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4997/4997901_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4997904', 'GE - 24.7 Cu. Ft. French Door Refrigerator - Fingerprint resistant slate', 'Keep perishables organized in this GE French door refrigerator. One temperature-controlled drawer spans the width of the fridge interior, storing large trays and platters. Bright LED spotlights cast a clear glow on the four adjustable split shelves and two humidity-controlled crisper drawers. This slate-colored GE French door refrigerator''s six adjustable door bins accommodate multiple gallon-sized containers easily.', 'abcat0901000', 1889.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4997/4997904_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5003901', 'GE - 11.6 Cu. Ft. Top-Freezer Refrigerator - Black', 'Store and access your food conveniently in this GE Series refrigerator with a top-mounted freezer. It has LED interior lighting, up-front temperature controls that are easy to reach and can be installed with an optional ice maker. This 11.6-cubic-foot GE Series refrigerator is ENERGY STAR certified and has ADA compliance, ensuring smooth operation.', 'abcat0901000', 989.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5003/5003901_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5003902', 'GE - 24.7 Cu. Ft. French Door Refrigerator - High gloss white', 'Find your late night snacks easily with the clear LED lighting on this GE French door refrigerator. Its internal water dispenser with a replacement filter provides your family access to clean drinking water and saves you money on bottled water. With two humidity-controlled drawers, this GE French door refrigerator keeps your vegetables crisp and fresh longer.', 'abcat0901000', 1799.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5003/5003902_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4630403', 'Scosche - MagicPlates for Most Cell Phones (3-Count) - Black', 'These Scosche MagicPlates MAGRKI mount plates feature multiple size options, so you can easily mount your compatible cell phone to a Scosche MagicMount Original or MagicMount Surface. The included adhesive stickers allow you to relocate your cell phone mounts.', 'abcat0811002', 8.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4630/4630403_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5003903', 'GE - 24.8 Cu. Ft. Bottom-Freezer Refrigerator - Stainless steel', 'Keep food fresh with this ENERGY STAR GE bottom-freezer refrigerator, featuring a factory-installed ice maker. The Ramp-up LED lighting slowly illuminates the fresh food compartment, while the built-in water filtration system removes any trace of pharmaceuticals. Maximize interior space with the cabinet-integrated controls technology on this GE bottom-freezer refrigerator.', 'abcat0901000', 1799.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5003/5003903_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5003904', 'GE - 21.0 Cu. Ft. Bottom-Freezer Refrigerator - Stainless steel', 'Add class to your kitchen by using this GE ENERGY STAR refrigerator with a bottom-mounted freezer. The large dimensions are spacious enough for all your food storage needs, and the adjustable glass shelves provide an array of different shelf configurations. This GE ENERGY STAR refrigerator has bright LED lighting, making it easy to find what you''re looking for.', 'abcat0901000', 1304.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5003/5003904_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5003906', 'GE - 24.8 Cu. Ft. French Door Refrigerator - Stainless steel', 'Find what you need quickly and easily with the crisp, clear LED lighting in this GE French door refrigerator. An internal water dispenser with a replaceable filter lets you deliver filtered water with one touch. This GE refrigerator has two humidity-controlled drawers that are perfect for storing vegetables and one full-width adjustable temperature drawer.', 'abcat0901000', 1619.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5003/5003906_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5003910', 'GE - 21.0 Cu. Ft. Bottom-Freezer Refrigerator - High gloss black', 'Modernize your kitchen space with this GE Series refrigerator. The 30-inch-wide, adjustable glass shelves make storing food easy and provide a variety of storage options. The LED lighting provides clear illumination, letting you see all of your refrigerated products. This GE Series refrigerator can easily accommodate the installation of an ice maker.', 'abcat0901000', 1304.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5003/5003910_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5003912', 'GE - 21.0 Cu. Ft. Bottom-Freezer Refrigerator - Stainless steel', 'Explore new refrigeration possibilities thanks to the clever design of the GE Series ENERGY STAR bottom-freezer refrigerator. The sliding snack drawer gives you more space in the fridge where you really need it. Get ice-cold filtered water straight from your fridge with the GE Series ENERGY STAR bottom-freezer refrigerator.', 'abcat0901000', 1709.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5003/5003912_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5003915', 'GE - 21.0 Cu. Ft. Bottom-Freezer Refrigerator - High gloss white', 'Experience the intelligent new design of this GE ENERGY STAR bottom-freezer refrigerator. Customize the space in your fridge with the adjustable shelves to create a variety of food storage options. Two clear crisper drawers on this GE ENERGY STAR bottom-freezer refrigerator let you see the contents inside and let you access items without bending down.', 'abcat0901000', 1304.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5003/5003915_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5003920', 'GE - 24.7 Cu. Ft. French Door Refrigerator - High gloss black', 'Keep food cool and fresh while saving space with this GE Series French door refrigerator. It has an internal water dispenser with advanced XWFE water filtration and an automatic ice maker for your convenience. Easily store tall items in this 24.8-cubic-foot GE Series French door refrigerator with its adjustable splits and by sliding its QuickSpace Shelf as needed.', 'abcat0901000', 1799.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5003/5003920_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5003922', 'GE - 21.0 Cu. Ft. Bottom-Freezer Refrigerator - Fingerprint resistant slate', 'Easily store food and keep it fresh with this GE ENERGY STAR bottom-freezer refrigerator. Enjoy ice in your drink whenever you like with the factory-installed ice maker, and quickly find items you are looking for with its clear LED lighting. This GE ENERGY STAR bottom-freezer refrigerator makes it comfortable to access your fresh produce without bending down.', 'abcat0901000', 1799.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5003/5003922_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5003924', 'GE - 21.0 Cu. Ft. Bottom-Freezer Refrigerator - High gloss white', 'Easily store your food with this GE bottom-freezer refrigerator. Enjoy added convenience in your life by being able access the entire refrigerator, including the vegetable drawer, without having to bend down. It has an adjustable digital temperature display so you can customize this GE bottom-freezer refrigerator to meet your refrigeration needs.', 'abcat0901000', 1709.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5003/5003924_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5003926', 'GE - 11.6 Cu. Ft. Top-Freezer Refrigerator - White', 'Keep your food fresh and organized in this GE top-mount refrigerator, which has a capacity of 11.6 cubic feet. Interior LED lighting and the transparent door shelves and crisper drawers make finding food items quick. This GE top-mount refrigerator is built with up-front electronic controls, letting you easily reach and adjust the temperature.', 'abcat0901000', 989.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5003/5003926_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5009820', 'GE - 11.6 Cu. Ft. Top-Freezer Refrigerator - Stainless steel', 'Store and access food conveniently with this GE Series top-freezer refrigerator. This 11.6-cubic-foot ENERGY STAR appliance uses LED interior lighting for better visibility of food items. It is ADA compliant and has easy-to-use up-front temperature controls. This GE Series top-freezer refrigerator is also compatible with an optional ice maker.', 'abcat0901000', 1079.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5009/5009820_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5009841', 'GE Profile - 23.1 Cu. Ft. French Door Counter-Depth Refrigerator with Internal Water Dispenser - Fingerprint resistant slate', 'Keep your food and produce fresh with this GE Profile counter-depth French door refrigerator. The counter-depth design lets it fit most current cabinetry setups. TwinChill evaporators provide separate optimal temperatures for frozen and fresh food, while LED lighting improves visibility. This GE Profile counter-depth French door refrigerator has QuickSpace Shelf systemfor storage flexibility.', 'abcat0901000', 2969.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5009/5009841_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5009845', 'GE - 23.6 Cu. Ft. French Door Refrigerator - Stainless steel', 'Make room for food items of various sizes with this GE Series French door refrigerator. Its flexible QuickSpace Shelf systemcan slide individually to easily accommodate tall items like wine bottles. This 23.8-cubic-foot GE Series French door refrigerator saves more space with its external ice and water dispenser, which uses XWFE advanced water filtration.', 'abcat0901000', 2429.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5009/5009845_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4638100', 'Kenu - Airframe+ Car Holder for Mobile Phones - Black', 'Safely support your Apple iPhone or iPod in your car with this Kenu 46264BBR car mount, which features a spring-loaded expandable jaw to securely hold your device.', 'abcat0811002', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4638/4638100_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5009847', 'GE - 23.6 Cu. Ft. French Door Refrigerator - Fingerprint resistant slate', 'Store more food items and save space with this GE Series French door refrigerator. Its 23.8-cubic-foot storage space has an adjustable QuickSpace Shelf system that can conveniently slide to accommodate tall items. This GE Series French door refrigerator has two humidity-controlled drawers, one full-width adjustable-temperature bottom drawer and an external ice and water dispenser.', 'abcat0901000', 2519.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5009/5009847_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5009853', 'GE - 20.8 Cu. Ft. French Door Refrigerator - Fingerprint resistant slate', 'Save time and energy with this GE Series French door refrigerator. This 20.8-cubic-foot ENERGY STAR appliance has a door alarm to ensure no door is left open. Its factory-installed ice maker automatically creates ice and uses XWFE advanced water filtration. This GE Series French door refrigerator has up-front temperature controls with actual temperature display for easy monitoring.', 'abcat0901000', 1799.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5009/5009853_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5009900', 'GE - 20.8 Cu. Ft. French Door Refrigerator - Stainless steel', 'Spend less on energy bills with this energy-saving GE Series French door refrigerator. Its bottom-mount freezer is 30 inches wide and has an automatic ice maker, letting you access ice whenever you like. This GE Series French door refrigerator is ENERGY STAR certified, has LED interior lighting, a door alarm and up-front temperature controls, providing easy adjustment and use.', 'abcat0901000', 1709.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5009/5009900_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5009902', 'GE - 23.6 Cu. Ft. French Door Refrigerator - High gloss white', 'Combining functionality and style, this GE ENERGY STAR French door refrigerator provides simpler ways to store food. The external water-and-ice dispenser saves space by making and storing ice on the door, while the bottom-freezer drawer provides easier access to veggies and fruits. This GE ENERGY STAR French door refrigerator features sliding shelves, providing more storage space when necessary.', 'abcat0901000', 2429.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5009/5009902_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5009904', 'GE - 28.7 Cu. Ft. French Door Refrigerator with LED Lighting - Fingerprint resistant slate', 'Enjoy having ample space to store large grocery loads with this GE French door bottom-mount freezer refrigerator. The spill-proof shelves keep spilled liquids from dripping onto other foods, while the TwinChill evaporators keep fridge and freezer temperatures at optimum levels. Quickly cool warm drinks with ice from the automatic ice maker installed in this GE French door bottom-mount freezer refrigerator.', 'abcat0901000', 2276.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5009/5009904_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5009907', 'GE - 23.6 Cu. Ft. French Door Refrigerator - High gloss black', 'Save space and store more food items with this GE Series French door refrigerator. Its 23.8-cubic-foot capacity creates room for tall items by moving the QuickSpace Shelf for instant, flexible storage. This GE Series French door refrigerator has an external ice and water dispenser with a digital temperature display to further save on inside space.', 'abcat0901000', 2429.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5009/5009907_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5016800', 'Café - 25.2 Cu. Ft. Side-by-Side Built-In Refrigerator - Stainless steel', 'Store more food longer with this GE Cafe series side-by-side refrigerator. Its 25.2 cu. ft. of storage space has nine shelves and 10 door bins to let you organize groceries however you like. This 42-inch GE Cafe series side-by-side refrigerator also comes with humidity-controlled drawers to keep fruits, vegetables and dairy products fresh longer.', 'abcat0901000', 7139.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5016/5016800_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5017302', 'Café - 29.6 Cu. Ft. Side-by-Side Built-In Refrigerator - Stainless steel', 'Provide a professional look for your kitchen with this built-in GE Cafe Series side-by-side refrigerator. The integrated water filtration system removes trace particles for increased safety, and the advanced temperature management system helps the interior of the fridge maintain a consistent temperature. This GE Cafe Series side-by-side refrigerator includes humidity-controlled drawers to keep produce and dairy fresh.', 'abcat0901000', 7589.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5017/5017302_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5074433', 'GE Profile - 22.1 Cu. Ft. French Door Counter-Depth Refrigerator with Hands-Free AutoFill - Fingerprint resistant slate', 'Keep food fresh in this GE Profile Series refrigerator. This 22.2-cubic-foot French-door refrigerator has a bottom drawer-style freezer and counter-depth design that provides a nearly built-in look. The TwinChill system of this GE Profile series refrigerator uses separate evaporators for fresh and frozen food to prevent odor transfer, and the in-door water dispenser provides hands-free operation.', 'abcat0901000', 3329.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5074/5074433_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5074437', 'GE Profile - 27.7 Cu. Ft. French Door Refrigerator with Hands-Free AutoFill - Fingerprint resistant slate', 'Keep perishable foods fresh with this GE Profile Series refrigerator. This 27.8-cubic-foot French-door refrigerator has a full-width temperature-controlled drawer with three custom settings to chill your meats, beverages or deli at optimal temperatures. Conveniently fill your water pitcher while keeping your hands free with the sensor-enabled auto-fill water dispenser of this GE Profile Series refrigerator.', 'abcat0901000', 3149.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5074/5074437_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5091206', 'Bosch - 800 Series 11 Cu. Ft. Bottom-Freezer Counter-Depth Refrigerator - Stainless steel', 'Keep your chilled goods cool and your frozen goods even cooler with this 24-inch Bosch counter-depth fridge-freezer. The lower part is a handy freezer that can store up to 3.3 cubic feet, and the top part stores up to 7.7 cubic feet. This Bosch counter-depth fridge-freezer even includes a wine rack so that you can keep your bottles cool.', 'abcat0901000', 3099.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5091/5091206_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5100704', 'Samsung - 25.5 Cu. Ft. French Door Refrigerator with Internal Water Dispenser - White', 'Add this sleek and spacious Samsung 25.5 cu. ft. french door refrigerator to your busy household. Control the settings exactly how you want in order to freeze and chill food fast. Plus, you''ll have plenty of ways to organize ingredients, making it easier for everyone to grab and go. Get great-tasting, filtered water directly from your refrigerator. Spend less time and money buying bottled water.', 'abcat0901000', 1549.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5100/5100704_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4666312', 'Kanex - Apple MFi Certified 4'' Lightning-to-USB Charge-and-Sync Cable - Blue', 'Charge your Apple&#174; iPhone&#174; or iPad&#174; and transfer photos and music to your computer with this 4'' Kanex K8PIN4FBL charge-and-sync cable, which features a Lightning interface for simple connection to select devices.', 'abcat0811002', 10.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4666/4666312_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5160900', 'Insignia™ - 21 Cu. Ft. Top-Freezer Refrigerator - Stainless steel', 'Only at Best Buy Fill this Insignia top-mount refrigerator with your groceries, and keep them at the perfect temperature. Self-defrosting capabilities eliminate frost build-up, and the ample 21-cubic-foot size offers more than enough room for family use. This Insignia top-mount refrigerator is ENERGY STAR rated, saving money while storing your perishables and frozen goods.', 'abcat0901000', 799.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5160/5160900_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5161100', 'Insignia™ - 18 Cu. Ft. Top-Freezer Refrigerator - White', 'Only at Best Buy Grab a midnight snack from this Insignia freezer and refrigerator combo. The shelves adjust to accommodate tall items, and the self-levelling legs make installation easy. This Insignia freezer and refrigerator combo is 30 inches wide and has a full 18 cubic feet of space, so there''s plenty of room for produce, meats and leftovers.', 'abcat0901000', 599.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5161/5161100_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5161200', 'Insignia™ - 18 Cu. Ft. Top-Freezer Refrigerator - Stainless steel', 'Add the look of luxe stainless steel to your kitchen with this Insignia NS-RTM18SS7 18 Cu. Ft. Top Mount Refrigerator. Its 18 cubic foot capacity makes it an ideal option for apartments and smaller kitchens. Adjustable shelves let you customize your food storage to suit your needs. The top mount freezer puts frozen food within easy reach and reversable fridge door lets you position your new refrigerator to fit your kitchen layout or personal preference. Adjustable, spill-safe glass shelving in the fridge keeps your items neatly organized, and convenient door storage offers extra space for butter, eggs, bottled drinks and more. Crisper drawers prevent moisture loss to help keep fruits and vegetables fresh longer. Keep everything at proper temps with controls in both refrigerator and freezer. Add an optional ice maker (sold separately) to keep ice on hand for parties and get-togethers.', 'abcat0901000', 679.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5161/5161200_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5223100', 'Amana - 18 Cu. Ft. Top-Freezer Refrigerator - Silver', 'Enjoy easy cleaning and plenty of storage with this Amana 30-inch fridge-freezer. Glass shelves are easy to adjust and are wipe clean for accidental spillages, and gallon bins make it easy to organize large bottles of milk and soda. A humidity-controlled crisper keeps your fresh salad and vegetables crisp inside this Amana 30-inch fridge-freezer.', 'abcat0901000', 1049.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5223/5223100_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5223101', 'Amana - 18 Cu. Ft. Top-Freezer Refrigerator - Black', 'Easy temperature control and a massive 18 cubic feet of capacity ensure this Amana fridge-freezer makes your life simpler. It includes a dairy center where you can place your butter, cheese and yogurt for easy retrieval, and humidity-controlled crispers keep fruit and salad fresh. Place frozen items such as frozen meals and desserts in the top of this Amana fridge-freezer.', 'abcat0901000', 949.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5223/5223101_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5333600', 'KitchenAid - 29.5 Cu. Ft. Side-by-Side Built-In Refrigerator - Stainless steel', 'Organize your cold storage in this side-by-side KitchenAid refrigerator. With a refrigerator capacity of 19.22 cu. ft. and a freezer capacity of 10.30 cu. ft., this appliance easily stores a week''s worth of groceries for the family. This KitchenAid refrigerator has an exterior ice and water dispenser to let you get a cool drink without opening the doors.', 'abcat0901000', 10529.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5333/5333600_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5455000', 'KitchenAid - 20 Cu. Ft. French Door Counter-Depth Refrigerator - Black stainless steel', 'Store fresh foods in this KitchenAid counter-depth refrigerator. French doors up top let you open the unit only as much as you need, and adjustable shelves and door bins keep items organized. An interior dispenser provides access to cold water in this KitchenAid counter-depth refrigerator, and automatic temperature controls keep your items safe for eating.', 'abcat0901000', 2609.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5455/5455000_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2173081', 'AXXESS - 6'' Male-USB-to-Male-USB 3.0 Cable - Black', 'The male USB and male USB 3.0 connectors on this AXXESS AX-USB-3.0 replacement cable ensure simple integration with your system. The 6'' length allows flexible use throughout your vehicle.', 'abcat0811002', 15.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2173/2173081_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2253772', 'Apple - 6.6'' USB Type A-to-Lightning Charging Cable - White', 'Connect your compatible Apple&#174; device to your computer''s USB port with this Apple MD819ZM/A cable which features a Lightning connector to help charge and sync your iPad&#174; mini, iPad with Retina, iPhone&#174; 5, 5s or 5c and more.', 'abcat0811002', 24.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2253/2253772_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2432595', 'Insignia™ - Travel Adapter/Converter - Black', 'Easily power your 25-1875W single-voltage appliances while you travel using this Insignia&#8482; NS-MTC1875 adapter/converter, which comes with 5 international plugs for use in a variety of countries across continents.', 'abcat0811002', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2432/2432595_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2977359', 'Insignia™ - 6'' Micro USB Charge-and-Sync Cable - Black', 'This 6'' Insignia&#8482; NS-MCDT6B micro USB cable is compatible with most micro USB-equipped devices, including cell phones, tablets, MP3 players and more. The low-profile housing fits into most cases, so you can charge and sync your device.', 'abcat0811002', 10.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2977/2977359_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3118221', 'Cobra - Premium Wired Microphone', 'Communicate clearly on your CB with this four-pin Cobra Premium power microphone. The stretchable cord extends to a maximum of 9 feet for flexibility, while the wire mesh grille and a heavy-duty ABS housing provide durable performance. This Cobra Premium power microphone features an ergonomic design for easy handling and works with a 9V battery (not included).', 'abcat0811002', 15.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3118/3118221_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4431919', 'kate spade new york - Case for Most Cell Phones - Gold', 'The bag doubles as a wallet with additional compartments to store cash, credit & ID.', 'abcat0811002', 84.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4431/4431919_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4596900', 'TracFone - Keep Your Own Phone Sim Card Kit', 'Use your compatible cell phone on the TracFone network with this TracFone SIM kit, which contains GSM and CDMA LTE three-in-one (nano/micro/regular) SIM cards and activation instructions to suit your needs.', 'abcat0811002', 1, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4596/4596900_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4763612', 'ToughTested - Pouch for Most Cell Phones - Black', 'Take your smartphone on the go with this ToughTested TT-RUGGED-BK pouch, which features canvas construction for long-lasting protection. The steel belt clip and carabiner clip let you fasten the pouch to your belt or backpack for easy carrying.', 'abcat0811002', 17.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4763/4763612_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4901000', 'Scosche - stuckUP™ Vehicle Mount for Select Mobile Devices', 'Mount devices ranging from your smartphone to your GPS in your car with this Scorche stuckUP mounting kit. Mount it to your AC vents with the clips, or use its suction cup to stick it to the windshield. This Scorche stuckUP also has a 360-degree swivel for quick and easy adjustments to ensure optimal visibility.', 'abcat0811002', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4901/4901000_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4901840', 'CableLinx - MFi USB Charge and Sync 0.29'' Device Cable - Black', 'Add a flat charging cable to your universal charger with the ChargeHub CableLinx Lightning to USB 2.0 cable. The short cable can also be used with a laptop or desktop computer to sync a variety of Apple devices, including select iPhones and iPads. The flat design of the ChargeHub CableLinx Lightning to USB 2.0 cable ensures easy storage.', 'abcat0811002', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4901/4901840_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4922700', 'AudioMate - AM830B Bluetooth Adapter', 'This Bluetooth adaptor features a built-in Lithium polymer battery for up to 30 hours of music playback. This adaptor is compatible with headphones, enabling hands-free calls with up to 40m of communication distance. You can connect it easily with your phone, tablet or laptop. Use the holding clip to conveniently wear this Bluetooth adaptor on the go.', 'abcat0811002', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4922/4922700_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4948300', 'Plantronics - Voyager 5220 Bluetooth Headset with Amazon Alexa - Black', 'Only at Best Buy  Rely on the clarity of this Plantronics Voyager 5200 Series Bluetooth headset. WindSmart technology and the four noise-canceling microphones let you take calls anywhere without distraction from background noises. The voice control button and moisture-resistant coating on this Plantronics Voyager 5200 Series Bluetooth headset let you use your phone hands-free, even in light rain or while working out.', 'abcat0811002', 119.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/4948/4948300_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4973317', 'UltraLast - Lithium Battery for Casio G''zOne Commando 4G LTE', 'Keep a backup power supply handy for your mobile phone with this UltraLast lithium-ion replacement battery. The compact design fits neatly in your device''s battery compartment, and the included instructions tell you how to install this unit in your phone. With its rechargeable functionality, this UltraLast lithium-ion replacement battery gives your phone the charge it needs for calls and texts.', 'abcat0811002', 18.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4973/4973317_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4973326', 'UltraLast - Lithium-Ion Battery for Samsung Galaxy Mega (6.3 in)', 'Experience the latest in operating systems with Android 4.2.2 installed on the Samsung Galaxy Mega 6.3. The slimness and size makes it a bridge device between a phone and a tablet, and it has a crystal clear LCD display. The Samsung Galaxy Mega 6.3 also comes with an 8-megapixel camera for brilliantly crisp, detailed pictures.', 'abcat0811002', 23.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4973/4973326_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4973339', 'UltraLast - Lithium-Ion Battery for LG G3, G3 D855, G3 D855P, G3 Stylus D690 and G3 Stylus D693N', 'Game, text and browse for longer on your LG phone with this UltraLast lithium-ion replacement battery. Compatible with a wide range of LG devices, this versatile battery delivers the charge your phone needs to keep going. Clearly labeled instructions on the side of this UltraLast lithium-ion replacement battery make installation quick and easy.', 'abcat0811002', 27.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4973/4973339_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4973344', 'UltraLast - Lithium Battery for Samsung Galaxy Note 4', 'Place calls, send texts and browse the Internet for longer with this UltraLast lithium-ion replacement battery. Compatible with the Samsung Galaxy Note 4, this battery delivers the power you need to use all your phone''s apps. With its rechargeable design, this UltraLast lithium-ion replacement battery keeps your device ready for use wherever life takes you.', 'abcat0811002', 23.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4973/4973344_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5019113', 'Insignia™ - 3'' 3.5mm Audio Cable - Black', 'This 3'' Insignia&#8482; NS-LW16 3.5mm audio cable lets you connect a cell phone, tablet or MP3 player to a stereo system, speaker or computer and features a low-profile design that enables easy connectivity while your device remains in its case.', 'abcat0811002', 12.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5019/5019113_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5019131', 'Insignia™ - 15.6 W 4.9 ft Universal AC Adapter - Black', 'When it comes to rediscovering dated electronics or old children&#8217;s toys, having the power cord can mean the difference between a fun-filled afternoon or hours spent searching for a cable you last saw years ago. Save yourself the headache and the fuss with this Insignia Universal AC Adapter, designed for devices requiring a round-pin connector (not for use with laptops). A total of seven interchangeable tips let you switch between multiple electronics or find the one that&#8217;s perfect for the job at hand. Its adjustable voltage gives you the flexibility to choose the precise voltage you need, while an included USB port lets you power devices such as phone chargers. Take back your afternoon with this multi-voltage power adapter.', 'abcat0811002', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5019/5019131_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5019219', 'Insignia™ - 6'' 3.5mm Audio Cable - Black', 'Listen to music stored on compatible 3.5mm-enabled devices with your home or vehicle stereo system, portable speakers or computer with this Insignia&#174; NS-MH32 6'' audio cable that features a low-profile design for easy connection.', 'abcat0811002', 14.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5019/5019219_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5019255', 'Insignia™ - Apple MFi Certified 4'' 30-Pin Charge-and-Sync Cable - White', 'Easily charge and sync your compatible 30-pin-enabled Apple&#174; iPhone&#174;, iPod&#174; or iPad&#174; with this 4'' Insignia&#8482; NS-A3SCW cable that allows connection to your PC or Mac. The slim profile allows the cable to fit most cases.', 'abcat0811002', 17.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5019/5019255_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5019323', 'Insignia™ - 3'' 3.5mm Cassette Adapter - Multi', 'This Insignia&#8482; NS-CA103 adapter lets you enjoy music stored on your compatible MP3 player, cell phone or other device with a 3.5mm headphone jack through a cassette player. Stereo separation helps ensure crystal-clear sound.', 'abcat0811002', 9.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5019/5019323_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5019341', 'Insignia™ - 4'' Micro USB Charge-and-Sync Cable - Black', 'Keep your micro USB-enabled devices ready for use with this Insignia&#8482; NS-MCDT2 micro USB cable, which allows simple charging as well as quick and easy data transfer. The 4'' length offers flexible placement options.', 'abcat0811002', 12.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5019/5019341_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5034105', 'EMTEC - Power Pouch Portable Charger - Red', 'Rid yourself of charging cables with this Emtec Power Pouch. The sleek, gray case includes a reserve battery and an attached USB cable inside to charge and protect your Android device. When fully charged, this Emtec Power Pouch provides enough power for two complete charges or up to 27 hours of talk time for your mobile device.', 'abcat0811002', 36.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/5034/5034105_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5120800', 'JOBY - GripTight Mount PRO Holder for Smartphone', 'Stabilize your smartphone when shooting photos or video with the GripTight Mount Pro. Rotate your phone and adjust the tilt angle while the mount keeps your phone secure in landscape and portrait mode.  Perfect for content creators, vloggers, and taking selfies.', 'abcat0811002', 34.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5120/5120800cv15d.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5164201', 'SureCall - Fusion4Home Omni/Whip', 'Enhance the signal strength of your phone with this Surecall Fusion4Home cellular booster. Made for homes of up to 2,000 square feet, this booster fortifies text, talk and 4G LTE signals and helps increase call clarity. Suitable for indoor use, this Surecall Fusion4Home cellular booster is contained in a durable metal shell and includes equipment to improve even marginal signals.', 'abcat0811002', 449.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5164/5164201_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5164206', 'SureCall - Fusion4Home Yagi/Whip', 'Enhance text, voice and 4G LTE data signals with this SureCall Fusion4Home antenna set. The indoor whip antenna provides coverage for two to four rooms, enhancing performance for the entire household or small office. The Yagi antenna in this SureCall Fusion4Home antenna set boosts performance outdoors when you have at least a bar of signal strength already.', 'abcat0811002', 399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5164/5164206_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5164212', 'SureCall - Fusion4Home Yagi/Panel', 'Boost the strength of your phone signal with this SureCall Fusion4Home cellular booster. Made for use in homes and offices, this booster can reduce dropped and missed calls and improve talk, text and data speeds. This SureCall Fusion4Home cellular booster enhances even marginal signals and provides improved performance for several users at once.', 'abcat0811002', 499.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5164/5164212_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5175802', 'Apple - 2 m USB Type C-to-Lightning Charging Cable - White', 'Keep the power flowing between your devices with this Apple USB-C to Lightning cable. It lets you connect compatible iPhones, iPods and iPads directly to Macbooks without any additional adapters. This USB-C to Lightning cable can be connected to a USB-C power adapter to utilize the iPad Pro''s fast-charge feature.', 'abcat0811002', 34.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5175/5175802_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5176916', 'SaharaCase - Case with Glass Screen Protector for Apple® iPhone® 6 and 6s - Clear', 'Prevent damage to your iPhone 6/6s from daily use or drops with this SaharaCase phone case. Rubberized TPU creates a secure grip and precise cutouts let you maintain access to ports and buttons. Prevent screen cracks with this SaharaCase phone case, thanks to a durable tempered glass display protector that features a smooth finish to maintain screen responsiveness.', 'abcat0811002', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5176/5176916_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5199700', 'Dantona - Lithium-Ion Battery for LG G4', 'Replace the dying battery in your LG G4 with a new Dantona Industries replacement battery. It''s compatible with select LG phones, including the DS1402, H810, and H818N models, and it''s rechargeable to ensure that your phone is ready when you need it. This replacement Dantona Industries replacement battery has a 3000 mAh capacity and voltage of 3.85.', 'abcat0811002', 25.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5199/5199700_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5234308', 'TUMI - 4 Port USB Travel Adapter - Black', 'In today&#8217;s lightning-fast and ever-changing digital world, TUMI&#8217;s vast collection of tech accessories and electronics continue to evolve and expand as fast as technology itself. TUMI offers lightweight, sophisticated mobile solutions designed for Global Citizens on the move.  Please Note: This device does not convert electrical voltage.', 'abcat0811002', 125, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5234/5234308_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5370525', 'myCharge - HUBXTRA 4400 mAh Portable Charger for Most Lightning-Equipped Apple® Devices - Gray', 'Worry less about dead batteries with this myCharge HUBXTRA power bank. It has built-in wall prongs to charge up to three devices at once, and the USB-A port, Lightning and micro-USB cables power electronics of different sizes. Charge devices up to 65 percent faster with the hyper-charge capability of this myCharge HUBXTRA power bank.', 'abcat0811002', 59.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5370/5370525_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5459502', 'Insignia™ - Fitness Armband Carrying case for Apple® iPhone® Xs Max, XR, 8 Plus, 7 Plus, Samsung Note9 and Galaxy S10, S10+, S9+ - Black', 'Only at Best Buy Take your iPhone 13 Pro Max, Xs Max, XR, 8+, 7+, 6s+, 6+, Samsung Galaxy S21 Ultra, S21+, S10+, S10, S9+, S8+, Note9, Note 8 with you even when running using this Insignia armband. Simply place your smartphone into the band to keep it secure even during the most strenuous exercise.', 'abcat0811002', 24.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5459/5459502_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5459600', 'Insignia™ - Fitness Armband Carrying case for Apple® iPhone® XS, X, 8, 7, SE (2nd edition) and Samsung Galaxy S10e and s9 - Black', 'Only at Best Buy Keep your iPhone 13 Pro, 13, 13 mini, Xs, X, 8, 7, 6s, 6, and Samsung S21, S10e, S9, S8, S7 safe when exercising with this Insignia armband. Your cell phone simply slips inside so that you can listen to music and keep track of your exercise routine using your smartphone''s included apps.', 'abcat0811002', 24.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5459/5459600_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5470401', 'Net10 - Keep Your Own Phone Sim Card Kit', 'Activate a compatible cell phone to work with the Net10 network by using this Net10 SIM card activation kit. It works with talk, text and data use, and you can keep your old phone number for convenience. This Net10 SIM card activation kit comes with instructions for easy installation.', 'abcat0811002', 1, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5470/5470401_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5507517', 'QFX - Dynamic Vocal Microphone', 'Put your vocal talent on display when you plug in this QFX professional dynamic unidirectional microphone. Accommodate your performance style by mounting the microphone on a stand or carrying it with you during high-energy concerts. The QFX professional dynamic unidirectional microphone provides a built-in spherical wind and pop filter and high-frequency response to broadcast rich, clear sound.', 'abcat0811002', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5507/5507517_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5510300', 'Tech21 - EVO CHECK Case for Apple® iPhone® 7 Plus and 8 Plus - Smokey/Black', 'Protect your iPhone 7 Plus and 8 Plus with this Tech21 Evo Check case. Advance protection includes bumpers to prevent impacts from drops from cracking your phone, yet it still offers full access to your iPhone''s ports and functions. The seriously slim design of this Tech21 Evo Check case reduces bulk, making it easy to slip in your pocket.', 'abcat0811002', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5510/5510300_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5510323', 'Tech21 - Evo Check Case for Apple iPhone 7, 8 and SE (3rd Generation) - Smokey/Black', 'Protect your iPhone 8 with this stylish Tech21 Evo Check case. Its slim design reduces bulk and weight in your pocket so you can comfortably tote your device, and tough FlexShock material protects your device from minor drop damage. Strategically placed cutouts ensure unhindered access to ports with this Tech21 Evo Check case. Model 47718BBR', 'abcat0811002', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5510/5510323_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5513289', 'Garmin - Vehicle Charger - Black', 'Get where you''re going without running out of power with this Garmin vehicle charger. The 12V charger is compatible with a range of Garmin Nuvi GPS models to deliver you from doorstep to doorstep without having to ask for directions. This Garmin vehicle charger plugs easily into your car''s auxiliary power port.', 'abcat0811002', 24.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5513/5513289_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5519605', 'kate spade new york - Protective Hardshell Case for Apple® iPhone® 8 Plus - Cream with Stones/Hollyhock Floral Clear', 'Give your iPhone 8 Plus a chic look with this kate spade new york protective hardshell case. The hollyhock pattern is inspired by the iconic designer''s beautiful prints, and the slim profile makes this case easy to hold. Constructed from co-molded materials, this kate spade new york protective hardshell case defends your device against accidental damage.', 'abcat0811002', 28.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5519/5519605_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5519700', 'kate spade new york - Protective Hardshell Case for Apple® iPhone® SE (3rd Generation) and iPhone® 8/7/6/6s - Hollyhock Floral Clear/Cream with Stones', 'Protect your phone and add a pop of pretty with this kate spade new york hardshell case. The solid construction keeps your phone safe from accidental drops, while convenient cutouts let you easily access functions. A little bit of bling on this floral kate spade new york hardshell case makes it fashionable as well as functional.', 'abcat0811002', 28.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5519/5519700_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5580935', 'Samsung - USB Type C-to-Micro USB adapter - White', 'Connect your USB-C devices to standard USB chargers with this Samsung USB type-C-to-Micro-USB adaptor. The built-in Micro USB connector lets you transfer data or charge your electronics quickly, and the conveniently compatible design works with the Samsung Galaxy Note 7. With its compact size, this Samsung USB type-C-to-Micro-USB adaptor fits neatly in your bag or desk drawer.', 'abcat0811002', 24.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5580/5580935_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5607902', 'Samsung - 3.3'' USB Type A-to-USB Type C Device Cable - White', 'Charge your device quickly and easily with this Samsung USB-C cable. It also transfers photo, video, data and music files between your smartphone and laptop.', 'abcat0811002', 24.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5607/5607902_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5622278', 'Apple - Lightning-to-3.5mm Headphone Adapter - White', 'This adapter lets you connect devices that use a 3.5 mm audio plug to your Lightning devices. Works with all devices that have a Lightning connector and support iOS 10 or later, including iPod touch, iPad, and iPhone. Also works with iPad models with iPadOS.', 'abcat0811002', 7.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5622/5622278_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5632801', 'zNitro - Screen Protector for Apple iPhone 7 - Clear', 'Secure the face of your iPhone 7 with this zNitro screen protector. Its engineered tempered glass is independently hammer tested for impact resistance, and it uses simple peel-and-stick installation. This zNitro screen protector''s glass construction eliminates drag when scrolling through your favorite apps, and its packaging is certified to be environmentally safe.', 'abcat0811002', 14.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5632/5632801_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5632810', 'zNitro - Screen Protector for Apple iPhone 7 Plus - Transparent', 'Enjoy privacy while writing texts with this zNitro screen protector for the iPhone 7 Plus. It''s made of impact-tested tempered glass to prevent breakage and is easily installed with peel-and-stick technology. This zNitro screen protector makes the screen''s contents invisible from the side view so you can keep them confidential.', 'abcat0811002', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5632/5632810_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5664705', 'Snakable - Apple MFi Certified 4'' Lightning USB Charging Cable - Cloud white', 'Keep your Apple devices charged with help from this Snakable armored Lightning to USB cable. It holds up in rugged environments and is compatible with many phone cases.', 'abcat0811002', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5664/5664705_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5681087', 'OtterBox - Defender Series Case for LG G Flex Cell Phones - Papaya', 'Protect your LG G Flex cell phone with this OtterBox Defender Series 77-38411 case that features a built-in screen protector to guard your phone''s touch screen. A holster-style swiveling belt clip provides simple portability.', 'abcat0811002', 49.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5681/5681087_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5690301', 'Death Lens - Wide Angle Lens for Apple® iPhone® 6 Plus and 6s Plus', 'Get professional results from your cellphone camera with this Death Lens Wide Angle lens for iPhone 6 Plus. Expand the angles on your camera, taking in entire vistas with one shot. This Death Lens Wide Angle lens screws into an included protective case for stunning shots and extra damage control all in one package.', 'abcat0811002', 24.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5690/5690301_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5824647', 'CableLinx - 3.5" Micro to USB Charge Cable Value Pack - Black', 'Enjoy convenient charging anywhere with this four-pack of ChargeHub CableLinx micro to USB cables. They can be used with any USB device for versatility, and their flat design eliminates tangling.', 'abcat0811002', 23.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5824/5824647_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5690304', 'Death Lens - Wide Angle Lens', 'Capture breathtaking shots with your cellphone camera and this Death Lens clip-on wide angle lens. The lens clips easily and tightly to your phone with the integrated spring tension clamp ensuring a secure grip. This Death Lens clip-on wide angle lens needs no tools for installation, and it can be easily removed when needed.', 'abcat0811002', 24.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5690/5690304_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5690305', 'Death Lens - Full Protection Impact Case for Apple® iPhone® 6 and 6s', 'Ensure your phone is always protected no matter where you go with this Death Lens full protection impact case. Made for iPhone 6/6s, this durable case doesn''t add bulk to your phone while offering complete defense against dings and drops. This Death Lens full protection impact case is compatible with Death Lens Fisheye and Wide Angle lenses.', 'abcat0811002', 24.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5690/5690305_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5690306', 'Death Lens - Full Protection Impact Case for Apple® iPhone® 6 Plus and 6s Plus', 'Defend your iPhone 6 Plus against potential damage with this Death Lens full protection impact case. The case is compatible with screw-in Death Lens Fisheye and Wide Angle lenses so you can keep it in place when taking the shot. This Death Lens full protection impact case features a slim profile that sits easy in your hand.', 'abcat0811002', 24.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5690/5690306_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5690311', 'Death Lens - Fisheye Lens for Apple® iPhone® 6 and 6s', 'Expand the camera capabilities of your iPhone 6 with this Death Lens Fisheye camera lens. The setup comes with a case that can be used with or without the lens, offering protection along with stunning shots. This easy-to-use Death Lens Fisheye camera lens perfectly reproduces sports VX1000 video fisheye visuals.', 'abcat0811002', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5690/5690311_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5690315', 'Death Lens - Fisheye Lens for Apple® iPhone® 6 Plus and 6s Plus', 'Give your iPhone 6 Plus greater camera range with this Death Lens Fisheye lens. The case and lens combo can be used with or without the lens so you know your phone is protected against drops and dings. The Death Lens Fisheye lens screws directly into the case, eliminating accidental scratching and flyaway lenses.', 'abcat0811002', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5690/5690315_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5690317', 'Death Lens - Fisheye Lens', 'Clip this Death Lens clip-on fisheye lens to your iPhone, and instantly expand your phone''s picture-taking capabilities. The spring tension clip and grippers hold tightly to your phone, eliminating the chance of a dropped lens. This Death Lens clip-on fisheye lens can be used with or without a case for easy function.', 'abcat0811002', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5690/5690317_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5690403', 'Death Lens - Pro Kit Fisheye Lens for Apple® iPhone® 6 and 6s', 'Take professional level photos while protecting your iPhone 6 with this Death Lens Pro Kit, featuring the Death Lens Fisheye lens for stunning photography. The impact resistance case can be used with or without the lens, giving you versatility in your phone use and protection. This Death Lens Pro Kit is completely compatible with your phone.', 'abcat0811002', 79.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5690/5690403_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5690404', 'Death Lens - Pro Kit Fisheye Lens for Apple® iPhone® 6 Plus and 6s Plus', 'Screw the Fisheye lens into the case on this Death Lens 6 Plus Pro Kit, and take professional grade photographs without a lot of work. The impact-resistant case is compatible with your iPhone 6 Plus, leaving your ports open for easy access. This Death Lens 6 Plus Pro Kit can be used with or without the lens for versatility.', 'abcat0811002', 79.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5690/5690404_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5706132', 'Ultra Mobile - Prepaid SIM Card', 'Stay connected with this Ultra Mobile card which works with most unlocked GSM phones. Monthly plans available from $19. Ultra Mobile Prepaid offers many plans with unlimited voice calls in the U.S.', 'abcat0811002', 2, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5706/5706132_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5706136', 'Ultra Mobile - 1-Month 2GB Prepaid SIM Card', 'Ultra Mobile provides the best value in wireless! Bring your unlocked, compatible phone to receive unlimited nationwide talk, global text, and data PLUS free unlimited talk to 80+ international destinations. In addition, Ultra offers free mobile hotspot, high-speed 5G&#8226;4G LTE data on the largest nationwide 5G network, the best international rates worldwide, and 3-in-1 Nano/Micro/Standard SIM card for compatible devices. On the T-Mobile 5G Network.', 'abcat0811002', 19, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5706/5706136_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5706137', 'Ultra Mobile 1 Month - 6GB Phone Plan with (Micro/Mini/Nano) Sim Kit', 'Ultra Mobile provides the best value in wireless! Bring your unlocked, compatible phone to receive unlimited nationwide talk, global text, and data PLUS free unlimited talk to 80+ international destinations. In addition, Ultra offers free mobile hotspot, high-speed 5G&#8226;4G LTE data on the largest nationwide 5G network, the best international rates worldwide, and 3-in-1 Nano/Micro/Standard SIM card for compatible devices. On the T-Mobile 5G Network.', 'abcat0811002', 29, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5706/5706137_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5710888', 'Belkin - Lightning Audio with Charge Adapter - White', 'Enjoy nonstop music while charging your iPhone with this Belkin Lightning Audio + Charge RockStar adapter. It keeps your iPhone 7 or 7 Plus fully functional while plugged in, and it''s compatible with Apple MFi-certified cables and headphones. The 12W power pass-through of this Belkin Lightning Audio + Charge RockStar adapter provides optimal charging speed for compatible devices.', 'abcat0811002', 44.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5710/5710888_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5712098', 'Speck - CandyShell Grip Case for LG G5 - Black/white', 'Keep your LG G5 phone safe with this Speck Candyshell Grip case. Its raised rubber ridges ensure a nonslip hold on the phone, and cutouts maintain your access to buttons and ports. This Speck Candyshell Grip case comes with dual-layered, military-grade material for shock absorbency and increased device protection during falls and bumps.', 'abcat0811002', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5712/5712098_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5733515', 'JOBY - GripTight ONE GorillaPod Magnetic Smartphone Kit - Black/red', 'Snap perfect pictures with this Griptight ONE Magnetic Impulse tripod. Its spring-loaded mount fits most smartphones, and its GorillaPod flexible legs stand on uneven surfaces and are magnetic for additional positioning options. This Griptight ONE Magnetic Impulse tripod''s rotating ball head lets you find precise camera angles for artful shots.', 'abcat0811002', 59.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5733/5733515_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5746815', 'JOBY - GripTight ONE Mount for Mobile Phones - Black/charcoal', 'Snap great smartphone photos with help from this GripTight ONE mount. Its threading hole secures to tripods and selfie sticks, and its spring-loaded structure lets you attach and release your phone easily. The TPE rubber clamps fold in, flattening the GripTight ONE mount to make it an easier fit for pockets and purses.', 'abcat0811002', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5746/5746815_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5746820', 'JOBY - GripTight ONE GorillaPod Stand - Black', 'Find the best camera positions for smartphone photos with this GripTight ONE GP stand. It lets you adjust quickly between landscape and portrait view, and its flexible GorillaPod legs and rotating ball heads keep the phone stable on uneven surfaces. This GripTight ONE GP stand is lightweight and convenient for travel.', 'abcat0811002', 34.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5746/5746820cv15d.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5753128', 'SureCall - Flare 4G Cell Phone Signal Booster - Silver', 'Improve cellular coverage throughout your home or office with this SureCall cell phone signal booster. It handles multiple users simultaneously, providing improved voice, text and 4G LTE data signals covering up to 2,500 sq. ft. This SureCall cellular phone signal booster comes with the antennas, cable and power supply for fast setup.', 'abcat0811002', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5753/5753128_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5776920', 'Bracketron - MagnetXT Dash Mount for Most Smartphones - Black', 'Only at Best Buy Secure your smartphone or GPS with this Bracketron MagnetXT dash mount. Its powerful magnet lets you attach a device to your vehicle''s dash or windshield for safer driving and single-handed operation when stopped. This Bracketron MagnetXT dash mount includes two round mounting-plate options, so you can choose from matte black or silver.', 'abcat0811002', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5776/5776920_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5781143', 'myCharge - Adventure Plus 6,700 mAh Portable Charger for Most USB-Enabled Devices - Orange/black', 'Charge your phone quickly while you''re on the road with this myCharge Adventure Plus charger, which features a carabiner clip so you can attach it to your gear. The durable rubberized exterior can handle every adventure, and Smart-sense technology ensures compatibility with your device. This myCharge Adventure Plus charger offers four backup charges for your iPhone.', 'abcat0811002', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5781/5781143_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5781541', 'Xentris - 4'' USB-to-Micro USB Charge-and-Sync Cable - Gray', 'Transfer files while charging your portable gadget with this 4-foot Xentris microUSB cable. Its slim connector fits easily in the port of a compatible mobile device with or without its case, and its push-button LED light makes it easy to find. This flat RoHS-certified Xentris microUSB cable coils easily for convenient storage and portability.', 'abcat0811002', 14.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5781/5781541_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5792904', 'Bunker Ring - Essentials Finger Grip/Kickstand for Mobile Phones - Matt black', 'Keep your gadget close at hand with this innovative Bunker Ring smartphone accessory. This unit&#8217;s repositionable mount works with most cases and adds functional style to your device. Simply flip out the sleek metal band to activate this Bunker Ring smartphone accessory and adjust the angle to suit you.', 'abcat0811002', 16.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5792/5792904_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5792906', 'Bunker Ring - Essentials Finger Grip/Kickstand for Mobile Phones - Matt silver', 'Add an elegant, functional element to your portable device with this Bunker Ring smartphone accessory. Use the chrome ring on this gadget to set your phone or tablet up at an angle and enjoy movies and video calls on the go. This low-profile Bunker Ring smartphone accessory has a repositionable mount, which works with most smartphone cases.', 'abcat0811002', 16.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5792/5792906_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5792911', 'Bunker Ring - Essentials Finger Grip/Kickstand for Mobile Phones - Rose gold', 'Hold your device safely with this Bunker Ring smartphone accessory. Simply slip your finger through the ring attached to this innovative gadget to keep your tech firmly in hand as you commute. When you&#8217;re ready, swivel the band up to 360 degrees to set this Bunker Ring smartphone accessory at the ideal angle for videoconferencing or movie-watching.', 'abcat0811002', 16.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5792/5792911_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5792912', 'Bunker Ring - Essentials Finger Grip/Kickstand for Mobile Phones - Jet black', 'Upgrade your tablet or phone with this inventive Bunker Ring smartphone accessory. Coated in strong semi-permanent adhesive, the repositionable mount on this gadget holds up to 4kg, making it ideal for use with a range of different devices. Adjust the shiny chrome band on this Bunker Ring smartphone accessory to turn the accessory into a handy kickstand.', 'abcat0811002', 16.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5792/5792912_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5795900', 'Aluratek - Bluetooth Audio Cassette Adapter - Black', 'Update your listening experience with this Aluratek Bluetooth cassette receiver. It converts your car''s cassette deck, or a walkman or boom box, into a Bluetooth receiver, providing a simple wireless upgrade for older stereos. Fully charged in 3 hours, this Aluratek Bluetooth cassette receiver provides up to 8 hours of continuous streaming.', 'abcat0811002', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5795/5795900_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5824622', 'ChargeHub - X5 5-Port USB SuperCharger - White', 'Keep device batteries at full power with this ChargeHub charging station. Each of its five USB ports provides 2.4 amps to ensure devices are quickly operational, and the single power supply cord eliminates clutter. This ChargeHub charging station is compatible with Apple and Android devices, and the LED light lets you verify its status.', 'abcat0811002', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5824/5824622_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5824631', 'ChargeHub - X3 3-Port USB SuperCharger - White', 'Keep multiple electronics ready to use with this three-port ChargeHub USB charging station. Its 25W built-in power supply and SmartSpeed technology provide optimal recharging for each connected device, and it frees up outlets by creating a central location. This green ChargeHub USB charging station keeps you organized by eliminating cable tangles.', 'abcat0811002', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5824/5824631_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5824632', 'ChargeHub - X3 3-Port USB SuperCharger - Black', 'Simplify device maintenance with this convenient ChargeHub universal charger station. It lets you power up to three devices at once, eliminating the clutter of multiple wires, and its SmartSpeed technology provides optimal charging at up to 2.4 amps per port. This ChargeHub universal charger station works with any USB-enabled device.', 'abcat0811002', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5824/5824632_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5824651', 'ChargeHub - X5 5-Port USB SuperCharger - Black', 'Power as many as five devices at once with this ChargeHub USB charging station. The ports are compatible with almost all USB plug-in devices, and each one delivers up to 2.4 amps. A delicate blue LED light glows when this ChargeHub USB charging station is turned on, letting you know it''s in use.', 'abcat0811002', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5824/5824651_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5843706', 'Speck - Presidio GRIP Case for LG G6 - Graphite gray/charcoal gray', 'Keep your LG G6 smartphone in pristine condition with this Speck Presidio case. Its IMPACTIUM polycarbonate barrier shields your device during accidental impact, and its outer finish guards against scratches and other surface damage. The precise cutouts on this Speck Presidio case ensure access to all your phone''s controls and ports.', 'abcat0811002', 22.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5843/5843706_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5874518', 'Sunpak - FlexPodDX PlatinumPlus Tripod for Mobile Phones - Black', 'Support camera equipment for clear shots with this Sunpak table tripod. It includes adapters, so you can use it with smartphones and select GoPro cameras.', 'abcat0811002', 14.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5874/5874518_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5879005', 'Insignia™ - 10'' Micro USB Charge-and-Sync Cable - Black', 'This Insignia&#8482; NS-MCDT10 cable lets you easily charge and sync micro-USB-enabled phones and devices and offers 10'' of length for flexible placement options.', 'abcat0811002', 11.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5879/5879005_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5957520', 'SureCall - Fusion2Go 2.0 RV 4G LTE Cell Phone Signal Booster - Black', 'Increase cell phone signal strength while traveling in your RV with this SureCall Fusion2Go signal booster. Multiple mobile devices can reap the benefits, which include a reduction in dropped and missed calls and an increase in battery life. Use this SureCall Fusion2Go signal booster with all the major North American cell phone carriers.', 'abcat0811002', 449.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5957/5957520_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6005400', '360 Degree Camera for Essential Cell Phones', 'Affix this Essential smartphone camera to your mobile device to capture memories all around you. Its 360-degree field of view produces 12-megapixel images, and it lets you take Ultra HD video at 30 fps with high-quality sound picked up by its four microphones. This Essential smartphone camera attaches magnetically for easy installation and removal.', 'abcat0811002', 169.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6005/6005400_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6021407', 'SaharaCase - Clear Case for Apple® iPhone® 7 and 8 - Rose Gold', 'Enjoy advanced impact protection with this SaharaCase iPhone 7, 8 and SE (2nd generation) clear protective kit. Designed to complement your rose gold device, this kit includes a cover with shock-absorbent bumpers, which provide drop protection. Precise cutouts in the SaharaCase iPhone 7 and iPhone 8 clear protective kit let you access your device&#8217;s charging port, camera and buttons.', 'abcat0811002', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6021/6021407_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6021425', 'SaharaCase - Classic Case for Apple® iPhone® 7 and 8 - Rose Gold', 'Defend your iPhone 7, 8 or SE (2nd generation) against everyday damage with this SaharaCase classic protective kit. This cover comes with a ZeroDamage tempered glass screen protector, which keeps your phone&#8217;s display in great shape. Easy to install, this SaharaCase classic protective kit has a built-in camera hood and precisely placed cutouts for your phone&#8217;s buttons and ports.', 'abcat0811002', 18.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6021/6021425_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6021433', 'SaharaCase - Classic Case with Glass Screen Protector for Apple® iPhone® 7 Plus and Apple® iPhone® 8 Plus - Navy Blue', 'Wipe off smudges and remove dust with this Sahara Classic smartphone case kit. The kit includes a durable dual-layer case for iPhone 7 Plus or 8 Plus to keep your phone defended against a drop or ding. A tempered-glass screen protector in this Sahara Classic smartphone case kit is effortless to apply and keeps your phone free from cracks.', 'abcat0811002', 18.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6021/6021433_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6022200', 'Mint Mobile - 15GB Phone Plan - 3 Months of Wireless Service', 'Mint Mobile is the easy way to save a ton on wireless. Get unlimited talk and text plus 5G &#183; 4G LTE data on the largest nationwide 5G network, and you can even bring your own phone. Genius, right? Everyone knows the more you buy of something, the more you save&#8212;so why buy wireless one month at a time? We brought buying in bulk to your phone plan so you can save even more. Plus, we don&#8217;t want you to overpay for data you never use, which is why we offer plans that fit your needs&#8212;with your choice of 5G &#183; 4G LTE data each month. Installing and activating your Mint Mobile SIM card is a snap&#8212;bring your phone number with you from your current carrier or get a new one. The sooner you buy, the sooner you start saving like a fox.', 'abcat0811002', 75, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6022/6022200_sd.jpg');
