INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6022214', 'Mint Mobile - 4GB Phone Plan - 12 Months of Wireless Service', 'Mint Mobile is the easy way to save a ton on wireless. Get unlimited talk and text plus 5G &#183; 4G LTE data on the largest nationwide 5G network, and you can even bring your own phone. Genius, right? Everyone knows the more you buy of something, the more you save&#8212;so why buy wireless one month at a time? We brought buying in bulk to your phone plan so you can save even more. Plus, we don&#8217;t want you to overpay for data you never use, which is why we offer plans that fit your needs&#8212;with your choice of 5G &#183; 4G LTE data each month. Installing and activating your Mint Mobile SIM card is a snap&#8212;bring your phone number with you from your current carrier or get a new one. The sooner you buy, the sooner you start saving like a fox.', 'abcat0811002', 180, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6022/6022214_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6028008', 'OtterBox - Symmetry Series Hard Shell Case for Apple iPhone 7, 8 and SE (2nd generation) - Black', 'You don&#8217;t have to choose between a protective case and a stylish one. Symmetry Series for Apple iPhone 7, 8 or SE (2nd generation) is the slim and protective case that inspires your style. All of your phone&#8217;s buttons, features and functions work flawlessly. And, Symmetry Series is easy to remove and install. Which is great because with all of the colors, patterns and clear options, you need more than just one. Symmetry Series &#8212; slimmer than ever, as protective as always.  Model 77-56687.', 'abcat0811002', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6028/6028008_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1053557', 'Logitech - K120  Full-size Wired Membrane Keyboard for Windows with Spill-Resistant Design - Black', 'Logitech Keyboard K120. A better typing experience that''s built to last. You&#8217;ll enjoy a comfortable and quiet typing experience thanks to the low-profile keys that barely make a sound and standard layout with full-size F-keys and number pad. With its thin profile, spill-resistant design, durable keys that can withstand up to 10 million keystrokes and sturdy, adjustable tilt legs, this sleek keyboard not only looks and feels good&#8212;it&#8217;s built to last. Setup is simple too. You just plug it into a USB port and start using it right out of the box. Bold, bright white characters make the keys easier to read. And it all comes with the high quality and reliability that&#8217;s made Logitech the global leader for keyboards and mice.', 'abcat0513000', 14.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1053/1053557cv11d.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1083236', 'Logitech - MK120 Full-size Wired Membrane Keyboard and Mouse Bundle for Windows with USB Plug-and-Play - Black', 'The MK120 Combo makes getting things done simple. A full-sized keyboard and mouse deliver a familiar, easy-to-use design that works right out of the box. Just plug in this corded combo via USB and go. The wired keyboard with number pad makes data entry, calculations and navigation a breeze. The curved spacebar along with easy-to-read keys provide a comfortable typing experience. A full-sized, ambidextrous mouse delivers smooth tracking and a curved shape to support the palm. This keyboard mouse set provides reliability and durability.', 'abcat0513000', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1083/1083236cv11d.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5262501', 'Kensington - Expert Mouse® Wireless Trackball - Black', 'Navigate your desktop with precision and speed with this Kensington wireless trackball mouse. Scan through documents in seconds with the unique scroll ring, and customize your trackball to suit your needs with the free TrackballWorks software. When paired through Bluetooth, this Kensington wireless trackball mouse saves valuable USB port space.', 'abcat0513000', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5262/5262501_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1147528', 'Logitech - M100 Wired Optical Ambidextrous Mouse with 1000 DPI Optical Tracking - Gray', 'Logitech Mouse M100 gives you just the basics for comfortable, reliable control of your computer. It&#8217;s built by Logitech&#8212;the mouse experts&#8212;and comes with the quality we&#8217;ve built into more than a billion mice. There&#8217;s no software to install. And since it&#8217;s corded, you can just plug the cable into a USB port and use it right away. The full-size, ambidextrous shape means your hand will rest comfortably, while high-definition optical tracking (1000 dpi) means you&#8217;ll get responsive, smooth cursor control for precise tracking and easy text selection.', 'abcat0513000', 9.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1147/1147528_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1261402', 'Logitech - MK550 Ergonomic Full-size Wireless Alkaline Wave Keyboard and Mouse Bundle - Black', 'Logitech MK550 Wireless Wave Keyboard and Mouse: Enjoy freedom of motion while working at your PC with this keyboard and mouse that wirelessly connect to your computer from up to 33 feet away. The keyboard features Comfort Wave technology and a cushioned, contoured palm rest, and the mouse features contoured sides and soft rubber grips, so you can comfortably type and input data.', 'abcat0513000', 49.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1261/1261402_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1261563', 'Microsoft - Arc Touch Mouse - Black', 'Microsoft Arc Touch Wireless Mouse: You can easily navigate features on your compatible PC or Mac with this mouse, which wirelessly connects to your computer to provide a flexible range of motion. Everyone in your household can comfortably use the mouse, since it features an ergonomic, ambidextrous design for right- or left-handed use.', 'abcat0513000', 59.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1261/1261563_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1294039', 'Logitech - MK320 Full-size Wireless Optical Keyboard and Mouse Bundle - Black', 'Logitech MK320 920-002836 Wireless Keyboard and Mouse: Keep cord clutter out of your workspace and free up a USB port with this wireless keyboard and mouse, which can both be simultaneously connected to the included wireless USB receiver.', 'abcat0513000', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1294/1294039_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1297054', 'Logitech - M310 Wireless Optical Ambidextrous Mouse - Silver', 'Logitech M310 Wireless Mouse is an easy-to-use, full-size mouse that feels just right. Feel comfortable for hours on end - in your right or left hand - thanks to its contoured, ambidextrous design with soft rubber side grips. M310 comes with a plug-and-forget nano USB receiver that is small enough to stay in your USB port so you won''t lose it no matter where you take your laptop. Navigating on your PC or Macbook is simple, with smooth, responsive tracking and Logitech Advanced 2.4 GHz wireless connectivity. For hassle-free use and extreme reliability and durability, choose M310 wireless mouse.', 'abcat0513000', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1297/1297054_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1325119', 'Logitech - M705 Marathon Wireless Optical Mouse with 5 Programmable Buttons - Black', 'Logitech Wireless Mouse Marathon M705 lets you power on... and on. It uses less power than comparable wireless mice from other companies, so you''ll go up to three full years between battery changes.* And it uses a tiny wireless receiver that stays plugged in to your computer, so your mouse is ready to go-whenever, wherever, and for as long as it takes. Plus, hyper-fast scrolling means you''ll fly through long documents to find what you need in a flash. Advanced Optical Tracking means you''ll get smooth, responsive cursor control. And the sculpted, right-hand shape means you''ll be as comfortable finishing up as you were getting started.', 'abcat0513000', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1325/1325119cv17d.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1355094', 'Adesso - AKB-310UB Compact (60%) Wired Mini Trackball Keyboard - Black', 'This keyboard features a built-in optical track ball for smooth navigation and a membrane design that offers quiet typing. The USB interface allows simple connectivity.', 'abcat0513000', 43.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1355/1355094_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1440638', 'Logitech - MK270 Full-size Wireless Membrane Romer-G Keyboard and Mouse Bundle for Windows - Black', 'Logitech Advanced 2.4 GHz wireless delivers the reliability of a cord plus wireless convenience for up to 32.8ft, with virtually no delays or dropouts&#8212;even in the busiest wireless environments. The Logitech receiver is so tiny, you can plug it in once and forget about it. Plus, the mouse features a built-in storage compartment, so you can take your mouse wherever you use your computer. A 36-month keyboard and 12-month mouse battery life&#8212;with auto-sleep and on/off switch&#8212;lets you go years without the hassle of changing batteries.', 'abcat0513000', 27.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1440/1440638_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1722039', 'Logitech - K750 Solar Full-size Wireless Keyboard - Black', 'Battery hassles are a thing of the past with the solar-powered Logitech Wireless Solar Keyboard K750. It charges itself whenever there''s light, so you can say goodbye to batteries, power bricks and charging cables. With sleek lines and a thin profile, this stylish, streamlined keyboard adds style to your workspace. Combining the best of traditional keyboards, laptops and a Logitech-only concave key cap design, you''ll enjoy faster, quieter, feel-good typing -hour after hour. Plus, you''ll get wireless freedom thanks to the Logitech Unifying receiver.', 'abcat0513000', 54.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1722/1722039_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1805526', 'Microsoft - Wireless Mobile Mouse 3500 - Black', 'Microsoft Wireless Mobile Mouse 3500: Connect this mouse to your PC with the included plug-and-go nano transceiver, so you can enjoy wireless use. BlueTrack Technology allows precise tracking on most surfaces.', 'abcat0513000', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1805/1805526_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1818015', 'Microsoft - L3V-00001 Ergonomic Full-size Wireless Sculpt Comfort Desktop USB Keyboard and Mouse - Black', 'Microsoft Sculpt Comfort Desktop Wireless Keyboard and Mouse: Enjoy comfortable control over your PC with this keyboard and mouse, which wirelessly connect to your computer from up to 32.8 feet away using the included 2.4GHz USB transceiver. The keyboard features a contoured design with comfort-curve keys and a detachable palm rest to fully support your hand and wrist during use.', 'abcat0513000', 79.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1818/1818015_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1818024', 'Microsoft - L5V-00001 Ergonomic Full-size Wireless Sculpt Desktop Wireless USB Keyboard and Mouse - Black', 'This wireless keyboard and mouse are designed to encourage good hand and wrist posture. The keyboard has a split dome shape to fit the curve of your hands, and the mouse''s raised design allows you to keep your wrist in a more comfortable, natural position.', 'abcat0513000', 94.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1818/1818024_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2577677', 'Logitech - M325 Wireless Optical Ambidextrous Mouse - Silver', 'Logitech Wireless Mouse M325. A better mix of precision and comfort-with designed-for-Web scrolling. Designed for how you use the Web, our newest micro-precise scrolling makes everything you love to do online easier. Its feel-good, contoured shape and textured grips help keep your hand happy-even after long hours. And with up to 18 months of battery life, it virtually eliminates the hassle of changing batteries.*', 'abcat0513000', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2577/2577677_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2969104', 'Verbatim - Mini Travel Wireless Optical Mouse - Blue', 'Slip this Verbatim wireless mini travel mouse in your laptop bag, and enjoy full computer function without taking up a lot of space. This compact mouse features all of the capabilities of a larger mouse, such as 2.4GHz technology to keep up with each click. A tiny nano wireless receiver lets you use this Verbatim wireless mini travel mouse wherever.', 'abcat0513000', 17.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2969/2969104_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3106271', 'Logitech - K270 Full-size Wireless Mechanical Keyboard - Black', 'Logitech Wireless Keyboard K270. Reliable wireless-wherever you use your keyboard. The tiny Logitech Unifying receiver is small enough to stay in your laptop. Plus, you can easily add another compatible mouse or keyboard-without the hassle of multiple USB receivers. With Logitech Advanced 2.4 GHz wireless connectivity, you''ll enjoy virtually no signal loss from up to 33 ft away. Eight hot keys and plug-and-play setup that takes just seconds add to the simplicity. The familiar, full-size layout-including number pad-gives you all the right keys right where you''d expect them. And it''s built to last with the high quality and reliability Logitech is known for-with a spill-resistant design and UV-coated keys for durability.', 'abcat0513000', 24.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3106/3106271_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3435677', 'Logitech - M510 Wireless Optical Mouse - Blue', 'This mouse features 3 standard buttons, programmable back and forward buttons and side-to-side scrolling for simple navigation and personalization. The soft rubber grips and deep contours offer comfortable extended use.', 'abcat0513000', 22.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3435/3435677_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3435868', 'Logitech - M525 Wireless Optical Ambidextrous Mouse - Black', 'Logitech M525 Wireless Mouse: Everyone in your household can comfortably navigate features on your PC or Mac with this mouse, which features an ambidextrous, contoured shape with rubber grips for right- and left-handed use. The included unifying receiver allows you to wirelessly connect the mouse and up to 5 other devices to your computer, so you can enjoy freedom of motion.', 'abcat0513000', 23.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3435/3435868_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3640004', 'Insignia™ - Gaming Mouse Pad - Gray', 'Improve your gaming experience with this Insignia&#8482; NS-PCY5MP9 mouse pad that features a double-sided design for enhanced speed and control.', 'abcat0513000', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3640/3640004_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3730815', 'Verbatim - 96983 TKL Wireless Optical Slim Keyboard and Mouse - Piano black', 'If you''re looking for a keyboard that saves space, try Verbatim''s Wireless Slim Keyboard and Mouse. Designed with a piano black finish, this keyboard features low profile keys that provide a crisp, responsive feel when typing. This ultra-slim keyboard offers 2.4 GHz wireless communication - that means no annoying delays in what you type and what you see on-screen and no cord clutter. If you''re in to music, the media console lets you control your favorite tunes directly from the keyboard. With its slim design and a wireless mouse, this keyboard is a perfect space-saver.', 'abcat0513000', 63, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3730/3730815_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3736928', 'Digital Innovations - 4250400 Full-size Wired Easy-View Keyboard - Black', 'Eliminate typos and avoid eye strain as you hunt and peck with this Micro Innovations Easy-view keyboard. The large font on each key is easy to see, and the responsive key mechanics makes typing enjoyable. This Micro Innovations Easy-view keyboard features a USB connection for easy integration with your setup.', 'abcat0513000', 11.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3736/3736928_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3921715', 'Verbatim - Mini Travel Wireless Optical Mouse - Graphite', 'Surf the internet with ease with this Verbatim wireless mini mouse. The optical mouse fits comfortably in your hand, and the Nano receiver has a small footprint. You don''t have to worry about cords getting tangled, and this Verbatim wireless mini mouse is small enough to fit into a laptop bag.', 'abcat0513000', 17.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3921/3921715_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3921742', 'Verbatim - Mini Travel Wireless Optical Mouse - Red', 'Work or play easily with this Verbatim wireless optical mouse. The mini mouse has 2.4GHz reliability, so you don''t have to worry about the cursor skipping around. A small receiver does away with the need for cords, so you can take this Verbatim wireless optical mouse with you anywhere you plan to use your computer.', 'abcat0513000', 25.8, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3921/3921742_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3924785', 'Kensington - Pro-Fit K72369US Full-size Wired Mouse- USB - 2400 dpi- Right-handed Only - Black', 'The Kensington Pro Fit&#174; Full-Size Mouse USB has an ergonomic, right-handed shape with a soft rubber grip for all-day comfort. It features a high-definition optical sensor with a pointer speed quick-select button for enhanced productivity. It has the plug-and-play reliability of a wired USB connection. And it is built to last with a 3 Year Warranty. PC and Mac compatible.', 'abcat0513000', 22.95, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3924/3924785_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3925939', 'Logitech - M310 Wireless Optical Ambidextrous Mouse - Flame Red', 'Logitech M310 Wireless Mouse is an easy-to-use, full-size mouse that feels just right. Feel comfortable for hours on end - in your right or left hand - thanks to its contoured, ambidextrous design with soft rubber side grips. M310 comes with a plug-and-forget nano USB receiver that is small enough to stay in your USB port so you won''t lose it no matter where you take your laptop. Navigating on your PC or Macbook is simple, with smooth, responsive tracking and Logitech Advanced 2.4 GHz wireless connectivity. For hassle-free use and extreme reliability and durability, choose M310 wireless mouse.', 'abcat0513000', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3925/3925939_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3937934', 'Logitech - M325 Wireless Optical Ambidextrous Mouse - Light Silver', 'Logitech Wireless Mouse M325. A better mix of precision and comfort-with designed-for-Web scrolling. Designed for how you use the Web, our newest micro-precise scrolling makes everything you love to do online easier. Its feel-good, contoured shape and textured grips help keep your hand happy-even after long hours. And with up to 18 months of battery life, it virtually eliminates the hassle of changing batteries.*', 'abcat0513000', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3937/3937934_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3937943', 'Logitech - M325 Wireless Optical Ambidextrous Mouse - Blue', 'Logitech Wireless Mouse M325. A better mix of precision and comfort-with designed-for-Web scrolling. Designed for how you use the Web, our newest micro-precise scrolling makes everything you love to do online easier. Its feel-good, contoured shape and textured grips help keep your hand happy-even after long hours. And with up to 18 months of battery life, it virtually eliminates the hassle of changing batteries.*', 'abcat0513000', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3937/3937943_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3937952', 'Logitech - M325 Wireless Optical Ambidextrous Mouse - Red', 'Logitech Wireless Mouse M325. A better mix of precision and comfort-with designed-for-Web scrolling. Designed for how you use the Web, our newest micro-precise scrolling makes everything you love to do online easier. Its feel-good, contoured shape and textured grips help keep your hand happy-even after long hours. And with up to 18 months of battery life, it virtually eliminates the hassle of changing batteries.*', 'abcat0513000', 15.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3937/3937952_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4223800', 'Microsoft - Designer Bluetooth Wireless Keyboard and Mouse - Black', 'Maintain productivity while minimizing desk clutter with this Microsoft Designer 7N9-00001 keyboard and mouse, which connect to select Bluetooth-enabled devices for flexible use. BlueTrack technology offers precise tracking on almost any surface.', 'abcat0513000', 84.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4223/4223800_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4225900', 'Logitech - MK345 Wireless Ergonomic Optical Combo Keyboard and Mouse - Black/blue', 'Experience total comfort with Logitech MK345 Wireless Combo full-sized keyboard with palm rest and comfortable right-handed mouse. Enjoy robust connections thanks to Logitech advanced wireless connectivity, providing fast data transmission and seamless connectivity. Focus on what''s truly important and forget about the hassle of changing batteries thanks to our energy-efficient engineering. With easy access to media controls, mute your computer, skip to the next song or pause a video instantly thanks to 12 programmable F-keys. (Requires Logitech software.)', 'abcat0513000', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4225/4225900ld.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4375300', 'Logitech - M535 Bluetooth Optical Ambidextrous Mouse - Black', 'Logitech M535 Bluetooth Optical Mouse: Scroll, point and tap on your computer or tablet using this mouse, which offers Bluetooth connectivity to help limit the amount of wires on your workspace. The ambidextrous design accommodates a variety of users.', 'abcat0513000', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4375/4375300_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4415400', 'Logitech - K380 TKL Wireless Bluetooth Scissor Keyboard for PC, Laptop, Windows, Mac, Android, iPad OS, Apple TV - Gray', 'The Logitech K380 Multi-Device Bluetooth keyboard makes any space minimalist, modern, and multi-device, letting you type on your smartphone, tablet, and more. Connect with up to three Bluetooth-enabled devices simultaneously and switch instantly between them. The K380 Multi-Device is compact and lightweight. You can type on the device of your choice&#8212;anywhere. It automatically detects your device, maps keys, and provides a familiar typing experience with all your favorite shortcuts. So you can own your space on any device, anywhere.', 'abcat0513000', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4415/4415400_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4458704', 'AZIO - KB505U Wired Full-size Wired Membrane with Back Lighting Keyboard - Black', 'Help reduce the risk of eyestrain with this AZIO Vision keyboard. The extra-large print makes it easy to see the keys, and built-in backlighting in three colors helps improve visibility in low-light environments. This AZIO Vision keyboard has built-in multimedia keys and hotkeys for fast access to audio settings and other frequently used functions.', 'abcat0513000', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4458/4458704_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4533200', 'Microsoft - Comfort Desktop 5050 Ergonomic,Full-size Wireless Optical Curved Keyboard and Mouse - Black', 'This ergonomic Microsoft Wireless Comfort Desktop curved keyboard features a numeric keypad and customizable shortcut keys, so you can easily complete tasks or access your favorite Web pages. BlueTrack mouse technology offers precise control.', 'abcat0513000', 49.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4533/4533200_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4533300', 'Microsoft - Desktop 850 PY9-00001 Full-size Wireless Optical Keyboard and Mouse - Black', 'Type notes and input data comfortably with this Microsoft Wireless Desktop keyboard, which features a 30'' wireless range, quiet-touch keys and media shortcuts for intuitive control. The included mouse offers simple navigation.', 'abcat0513000', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4533/4533300_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4533400', 'Microsoft - Desktop 900 Full-size Wireless Keyboard and Mouse - Black', 'With this full-size Microsoft Wireless Desktop 900 PT3-00001 keyboard and mouse, you can easily navigate the Web or type up e-mails and presentations. Hot keys and customizable mouse buttons offer easy access to the Windows features you use most.', 'abcat0513000', 31.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4533/4533400_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4533501', 'Microsoft - Desktop 3050 Full-size Wireless Keyboard and Mouse - Black', 'Type comfortably with this Microsoft Wireless Desktop 3050 PP3-00001 keyboard, which features quiet keys and an integrated palm rest. BlueTrack mouse technology offers precise tracking and navigation, and wireless technology provides flexibility.', 'abcat0513000', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4533/4533501_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4575228', 'Microsoft - Bluetooth Mobile Mouse 3600 - Black', 'Microsoft Bluetooth Mobile Mouse 3600: Whether you''re at your desk or working at the airport, BlueTrack technology allows comfortable use on a variety of surfaces. Pair wirelessly with your PC using Bluetooth for flexible mobility.', 'abcat0513000', 21.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4575/4575228_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5025525', 'Logitech - K750 Full-size Wireless Membrane Solar Keyboard for Mac - White/Silver', 'Featuring Internet and multimedia keys, this Logitech K750 920-003677 wireless keyboard makes it quick and easy to access your Mac''s frequently used functions. The solar-powered design ensures reliable use in most locations with ample lighting.', 'abcat0513000', 54.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5025/5025525_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5106403', 'Logitech - M510 Wireless Optical Mouse - Red', 'Navigate your desktop or laptop computer effortlessly with this Logitech wireless mouse. A scrolling wheel provides smooth operation, and the integrated side buttons let you page forward and back without your keyboard. Showcasing a sleek contoured design and rubberized grips, this Logitech wireless mouse fits comfortably in the palm of your hand.', 'abcat0513000', 27.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5106/5106403_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5294006', 'Logitech - M187 Mini Wireless Optical Ambidextrous Mouse - Black-gray', 'Logitech Mini Mouse M187. Take it wherever you take your laptop&#8212;thanks to its pocket-ready, extra-small design. Setup is simple. Just plug in the nano receiver and start using your mouse. Plus, the receiver is small enough to stay in your USB port&#8212;and stores inside the mouse if you do need to remove it&#8212;so there&#8217;s no need to worry about losing it. You&#8217;ll enjoy the freedom of wireless with more precision and control than your laptop&#8217;s touchpad. And you get the confidence that comes with owning a mouse from the global leader in connecting you to the digital experiences you care about.', 'abcat0513000', 12.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5294/5294006_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5355200', 'Logitech - MK360 Full-size Wireless Scissor Keyboard and Mouse - Black', 'Upgrade your computer capability when you install this Logitech wireless keyboard and mouse. The full keyboard includes 12 programmable function keys and six hot keys for faster access to the Internet and other features. This Logitech wireless keyboard and mouse combo adds sophistication to your system while providing a compact design to save space.', 'abcat0513000', 35.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5355/5355200_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5355300', 'Logitech - M170 Wireless Compact Ambidextrous Mouse - Black', 'With Logitech M170 Wireless Mouse, choose the reliability of a cord with the convenience of wireless &#8211; and a 33-foot range &#8211; thanks to Logitech Advanced 2.4 GHz wireless technology. This affordable mouse works for up to 12 months on a single AA battery. Set up is simple &#8211; just plug the tiny wireless receiver into a USB slot. There''s no hassle with pairing or software installation, and M170 is compatible with Windows, Mac, Linux and Chrome.', 'abcat0513000', 9.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5355/5355300cv12d.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5355302', 'Logitech - M170 Wireless Compact Ambidextrous Mouse - Blue', 'With Logitech M170 Wireless Mouse, choose the reliability of a cord with the convenience of wireless &#8211; and a 33-foot range &#8211; thanks to Logitech Advanced 2.4 GHz wireless technology. This affordable mouse works for up to 12 months on a single AA battery. Set up is simple &#8211; just plug the tiny wireless receiver into a USB slot. There''s no hassle with pairing or software installation, and M170 is compatible with Windows, Mac, Linux and Chrome.', 'abcat0513000', 9.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5355/5355302cv20d.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5355303', 'Logitech - M170 Wireless Compact Ambidextrous Mouse - Red', 'With Logitech M170 Wireless Mouse, choose the reliability of a cord with the convenience of wireless &#8211; and a 33-foot range &#8211; thanks to Logitech Advanced 2.4 GHz wireless technology. This affordable mouse works for up to 12 months on a single AA battery. Set up is simple &#8211; just plug the tiny wireless receiver into a USB slot. There''s no hassle with pairing or software installation, and M170 is compatible with Windows, Mac, Linux and Chrome.', 'abcat0513000', 9.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5355/5355303cv20d.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5385495', 'Prestige - Handshoe Wireless Mouse - Black', 'Prestige Handshoe Wireless Mouse: Maintain a neat workspace with this mouse, which wirelessly connects to your PC or Mac to allow freedom of motion and reduce cable clutter. The right-handed Light Click design helps minimize strain and support your hand for lasting comfort.', 'abcat0513000', 122.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5385/5385495_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5422358', 'Logitech - M325 Wireless Optical Ambidextrous Mouse - Violet', 'Logitech Wireless Mouse M325. A better mix of precision and comfort-with designed-for-Web scrolling. Designed for how you use the Web, our newest micro-precise scrolling makes everything you love to do online easier. Its feel-good, contoured shape and textured grips help keep your hand happy-even after long hours. And with up to 18 months of battery life, it virtually eliminates the hassle of changing batteries.*', 'abcat0513000', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5422/5422358_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5536841', 'Prestige - Handshoe Wireless Left-Handed Mouse - Black', 'Prestige Handshoe Wireless Mouse: Navigate features on your PC or Mac without experiencing gripping force, pinching and finger stretching when you use this ergonomic wireless mouse, which features a left-handed Light Click design with full hand support for lasting comfort.', 'abcat0513000', 121.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5536/5536841_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5555011', 'Microsoft - Wireless All-In-One Media Keyboard - Black', 'This Microsoft N9Z-00001 wireless all-in-one keyboard features an integrated multitouch trackpad that makes it simple to navigate features on your compatible PC. Customizable media hot keys let you quickly access frequently used content.', 'abcat0513000', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5555/5555011_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5556015', 'Adesso - Luminous AKB-132UY Full-size Wired Membrane Keyboard - Black/Yellow', 'Ease eyestrain when working with this Adesso EasyTouch keyboard. Fluorescent yellow keys and black typeface four times the size of traditional lettering provide high contrast and readability. The membrane keypad switches on this Adesso EasyTouch keyboard are quiet and built for heavy use, and one-touch hot keys provide fast access to multimedia and online sites.', 'abcat0513000', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5556/5556015_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5556018', 'Adesso - SlimTouch AKB-212UB TKL Wired Membrane Keyboard - Black', 'Enjoy beverages while working without worrying about spills with this Adesso keyboard. The waterproof, antimicrobial properties help it withstand minor weather elements during outdoor use and make it easy to wipe clean with soap and water. This Adesso keyboard has hot keys for one-button control of media or web applications.', 'abcat0513000', 20.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5556/5556018_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5556019', 'Adesso - SlimTouch AKB-232UB Full-size Wired Membrane Keyboard - Black', 'Type quickly from any location with this Adesso Flex keyboard. The silicone material resists water, dust and oil, making it easy to wipe clean, and the antimicrobial properties prevent the growth of harmful germs. Navigate the internet and control your music playlist at the press of a button with the multimedia hot keys on this Adesso Flex keyboard.', 'abcat0513000', 21.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5556/5556019_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5556024', 'Adesso - iMouse Optical Ergonomic Mouse - Black', 'Click in comfort with this ergonomic Adesso wireless iMouse. Its vertical, contoured body provides more support for the forearm, reducing strain, and the navigation buttons on the side let you perform tasks with fewer hand movements. Speed up response times with the built-in DPI switch of this Adesso wireless iMouse.', 'abcat0513000', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5556/5556024_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5556026', 'Adesso - Tru-Form WKB-3500UB Ergonomic Wireless Membrane Keyboard - Black', 'Work in comfort with this Adesso ergonomic keyboard. The built-in trackball provides fuller cursor control, and the ergonomic design with split key zones lets you place your hands and wrists in a natural position. Complete tasks quickly with hot keys, and operate this Adesso ergonomic keyboard up to 30 feet away from your computer thanks to the 2.4GHz wireless technology.', 'abcat0513000', 93.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5556/5556026_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5556030', 'Adesso - SlimTouch AKB-110EB TKL Wired Membrane Keyboard - Black', 'Reduce eyestrain when you work at night with this Adesso SlimTouch illuminated keyboard. Dim or brighten lights on the keys by using hot keys, or turn the lights off when working during the day. This Adesso SlimTouch illuminated keyboard has membrane key switches that reduce noise so you won''t disturb others when you type.', 'abcat0513000', 34.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5556/5556030_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5577232', 'Kensington - Optical Mouse - Black', 'Point, click and scroll with this Kensington wireless mouse. The middle scroll wheel lets you scan articles and documents quickly, and the silent clicking ensures there''s no distractions in quiet environments. This Kensington wireless mouse is contoured for a more comfortable grip, and the two-button design works for both right-handed and left-handed users.', 'abcat0513000', 23.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5577/5577232_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5592420', 'Logitech - K780 Full-size Wireless Scissor Keyboard - White', 'Type with this multi-device Logitech wireless keyboard. The built-in rubber cradle supports devices vertically, making small screens easily viewable, and 128-bit AES encryption keeps information private. Compatible with Windows, Mac, Chrome and Android devices, this Logitech wireless keyboard uses USB and Bluetooth technology to connect to your smartphone and tablet.', 'abcat0513000', 64.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5592/5592420_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5592421', 'Logitech - M720 Triathlon Wireless Optical Mouse - Black', 'Ready, set go! Move between screens and straight through your to-do list with Logitech M720 Triathlon, the athletic mouse built for endurance, versatility, and comfort. With EASY-SWITCH technology you can pair your mouse with up to 3 computers and seamlessly switch between them with a click of a button. Reliable hyper-fast scrolling lets you fly through documents and web pages or switch to click-to-click scrolling when you need precision. A true athlete, this portable mouse is designed to endure, with buttons built to withstand up to 10 million clicks. Focus on what really matters thanks to the extended battery life of up to 24 months of power on a single AA battery. Simply connect M720 Triathlon wirelessly via the included Logitech Unifying receiver or via Bluetooth smart technology. Download Logitech Options Software to unlock the full range of personalization for your Logitech mouse.', 'abcat0513000', 49.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5592/5592421_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5611903', 'Verbatim - Multi-Trac Blue LED Wireless Optical Mouse - Blue', 'Enjoy full functionality on your computer anywhere you decide to work by using this Verbatim wireless mouse. The blue LED lets you enjoy optimal performance without worrying about the texture or gloss of the work surface. An ergonomic shape and comfort grips make this Verbatim wireless mouse easy to use for extended periods.', 'abcat0513000', 21.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5611/5611903_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5657922', 'Fellowes - Slimline Cordless Combo Full-size with Antimicrobial Protection Wireless Optical Keyboard and Mouse - Black', 'Operate your computer wirelessly with this Fellowes cordless keyboard and mouse set. Third-button scrolling on the mouse makes it easy to use, and the keyboard has multimedia and quick-launch keys for fast internet browsing. This Microban-protected Fellowes cordless keyboard and mouse set is also connectible via USB for versatile use.', 'abcat0513000', 124.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5657/5657922_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5663300', 'Microsoft - Surface Mouse - Silver', 'Maintain steady control over your internet browsing and other computing tasks with this Microsoft Surface mouse. It&#226;&#8364;&#8482;s ergonomically sculpted for comfort, and it has a metal scroll wheel for accurate navigation. This Microsoft Surface mouse is suitable for both left-handed and right-handed users, and Bluetooth connectivity lets you connect wirelessly to your computer.', 'abcat0513000', 49.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5663/5663300_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5663301', 'Microsoft - WS2-00025 Full-size Wireless Surface Keyboard - Silver', 'Create emails and documents with this Microsoft Surface keyboard. The Bluetooth capability lets you connect wirelessly to your computer within a 50-foot range for greater movement, and the optimized feedback lets you depress the keys silently so you won&#8217;t disturb others. This Microsoft Surface keyboard has full-sized keys for comfortable, accurate typing.', 'abcat0513000', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5663/5663301_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5667018', 'Microsoft - 1850 Wireless Mobile Mouse - Black', 'Browse through documents and your favorite Web sites with this Microsoft Mobile Mouse 1850 U7Z-00001 mouse, which features a scroll wheel for quick, easy navigation. The wireless design with a USB 2.0 transceiver lets you work in a comfortable spot.', 'abcat0513000', 14.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5667/5667018_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5688114', 'ZOWIE - TF-X Series Mouse Pad - Black', 'Create a more comfortable, efficient workspace with help from this BenQ mouse pad. A soft rubber base and unique top surface ensure smooth mousing and consistent performance.', 'abcat0513000', 34.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5688/5688114_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5688118', 'ZOWIE - SR Series Mouse Pad - Black', 'Enjoy long-term gaming sessions with greater comfort by using this BenQ mouse pad. The rubber base ensures it stays in place as the mousing action heats up.', 'abcat0513000', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5688/5688118_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5688122', 'ZOWIE - TF-X Series Mouse Pad - Black', 'Add this discreet BenQ mouse pad to your work station to increase comfort. It lets you move your device smoothly for enhanced navigation in games and apps.', 'abcat0513000', 24.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5688/5688122_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5688123', 'ZOWIE - SR Series Mouse Pad - Black', 'Place this small BenQ mousepad at your work or gaming station to create smoother navigation. A rubber base grips the surface to keep the pad in place.', 'abcat0513000', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5688/5688123_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6276710', 'Magic Keyboard with Touch ID and Numeric Keypad for Mac models with Apple silicon - Black', 'Magic Keyboard is now available with Touch ID, providing fast, easy, and secure authentication for logins and purchases.', 'abcat0513000', 199.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/6276/6276710_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5689821', 'Microsoft - 3RA-00022 Ergonomic Full-size Wireless Surface Keyboard - Silver', 'Intersection of design and functionality The Surface Ergonomic Keyboard&#8217;s double-cushioned palm rest uses a special, ultra-durable version of Alcantara&#174; - a unique, proprietary material, sourced only in Italy, with aesthetic, sensory, and technical qualities unlike anything you&#8217;ve ever experienced.', 'abcat0513000', 129.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5689/5689821_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5690402', 'Logitech - MK750  Full-size Wireless Laser Combo Keyboard and Mouse - Black', 'Get full function without the wires with this Logitech wireless solar combo. The slim design of the solar-powered keyboard fits easily on your desk, and this keyboard stays charged with indoor or outdoor light for up to 3 months in total darkness. The included Marathon mouse with this Logitech wireless solar combo runs up to 3 years on a battery.', 'abcat0513000', 84.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5690/5690402_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5707092', 'AZIO - MK-RETRO-01 Full-size Wired Mechanical Keyboard - Black/white', 'Bring a vintage look to your office with this typewriter-inspired AZIO keyboard. The key-socket design is dust-resistant, and the keys operate smoothly even when you type rapidly. Clicky tactile keys help prevent errors, letting you type confidently. This AZIO keyboard is height-adjustable for maximum comfort, and it has shortcut hot keys to increase productivity.', 'abcat0513000', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5707/5707092_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5709661', 'Insignia™ - USB Keyboard - Black', 'Easily control your computer or laptop with this Insignia wired keyboard. It includes a full-size number pad so that you can quickly input data, and a row of flexible function keys ensures easy operation of your device. The USB connection that comes with this Insignia wired keyboard makes it simple to install.', 'abcat0513000', 9.49, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5709/5709661_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5709669', 'Insignia™ - Bluetooth Mouse - Black', 'Utilize your mouse more efficiently with this Insignia six-button Bluetooth mouse. It incorporates forward and backwards buttons as well as a scrolling wheel and left and right buttons, and the dpi button lets you change sensitivity on the fly. This Insignia six-button Bluetooth mouse is wireless so that you can use it anywhere that''s in range.', 'abcat0513000', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5709/5709669_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5712174', 'Insignia™ - Mouse Pad - Marble', 'Ensure smooth gliding and less friction with this Insignia mouse pad. The marble decoration keeps it looking pretty, but it prevents your optical or laser mouse from getting clogged up with dust or dirt to ensure smooth operation. A low-friction surface on this Insignia mouse pad reduces tugging when you''re using your mouse.', 'abcat0513000', 4.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5712/5712174_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5712175', 'Insignia™ - Mouse Pad - Geo Blue', 'Reduce friction when you''re using a mouse with this low-friction Insignia mouse pad. The surface, patterned with a Blue Geo design, also prevents your optical or laser mouse from picking up dust and dirt to improve overall performance. Eliminating tugging with this Insignia mouse pad makes it easier to play games.', 'abcat0513000', 4.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5712/5712175_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5761911', 'Logitech - MK850 Performance Full-size Wireless Optical Keyboard and Mouse - Black', 'Reach peak performance with this Logitech keyboard and mouse combo set. The mouse includes all the buttons you need to control your computer, while the full-size keyboard lets you access an array of functions and controls. Hotkeys, an ergonomic wrist rest and wireless connectivity ensure this Logitech keyboard and mouse combo set is great for work and play.', 'abcat0513000', 89.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5761/5761911_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5822302', 'Apple - MQ052LL/A Full-size Wireless Scissor Magic Keyboard with Numeric Keypad - Silver', 'Magic Keyboard with Numeric Keypad features an extended layout, with document navigation controls for quick scrolling and full-size arrow keys for gaming. A scissor mechanism beneath each key allows for increased stability, while optimized key travel and a low profile provide a comfortable and precise typing experience. The numeric keypad is also great for spreadsheets and finance applications. And the built-in, rechargeable battery is incredibly long-lasting, powering your keyboard for about a month or more between charges.', 'abcat0513000', 129.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5822/5822302_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5845302', 'ENHANCE - Pathogen Mouse Pad - Red', 'Make game play simple with this ENHANCE extended mouse pad. Its stitched perimeter resists fraying for long-term use, and its low-friction tracking surface enables pinpoint mousing precision. This ENHANCE extended mouse pad has a nonslip backing that prevents it from sliding when in use, and its 31.5'' x 13.75'' size leaves plenty of room for your keyboard.', 'abcat0513000', 21.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5845/5845302_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5859103', 'Microsoft - Arc Mouse - Black', 'Microsoft Arc Mouse is designed to conform comfortably to your hand, and snaps flat to fit easily in your bag. The next generation of Arc Touch Mouse, Microsoft Arc Mouse features numerous refinements, including the ability to scroll both vertically and horizontally. Connects via Bluetooth. Now available in a choice of rich colors to complement your style.', 'abcat0513000', 79.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5859/5859103_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5859104', 'Microsoft - Arc Mouse - Light Gray - Surface', 'The Surface Arc mouse is designed to conform comfortably to your hand - and snaps flat to fit easily in your bag. The next generation of the Arc Touch mouse, the Surface Arc mouse features numerous refinements, including the ability to scroll both vertically and horizontally. Connects via Bluetooth. Now available in a choice of rich colors to complement your style.', 'abcat0513000', 79.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5859/5859104_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5867176', 'Microsoft - 1850 Wireless Mobile Mouse - Blue', 'The built-in mini USB transceiver storage on this Microsoft 1850 U7Z-00011 mouse ensures easy portability. Plug-and-play operation enables simple use on Mac, PC and Android systems for versatility.', 'abcat0513000', 10.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5867/5867176_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5870700', 'Logitech - M585 Bluetooth Optical Mouse - Graphite', 'Navigate quickly between windows with this Logitech wireless mouse. The precise scroll wheel is grooved to provide a better grip, and two customizable thumb buttons let you program your most-used functions. This Logitech wireless mouse includes a special FLOW interface that lets you move between two different computers without lifting your hand.', 'abcat0513000', 34.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5870/5870700_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5882201', 'Logitech - M330 SILENT PLUS Wireless Optical Mouse with USB Nano Receiver - Black', 'With the same click feel and over 90% noise reduction compared to classic mice, M330 SILENT PLUS offers a quiet experience for yourself and those around you. It has a long-lasting up to 24-month battery life with auto-sleep and a powerful up to 10-meter wireless range. Plus, it&#8217;s designed with contoured grips made of soft rubber for total comfort. Just plug the tiny USB receiver and it works with Windows, Mac, Chrome OS or Linux.  Finally, the Logitech Advanced Optical Tracking guarantees smooth and precise moves on almost any surface.', 'abcat0513000', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5882/5882201cv18d.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5888209', 'HP - Z3700 Wireless Blue LED Mouse - Gold', 'Enjoy effortless navigation with this HP wireless mouse. Blue LED technology lets it operate on almost any type of surface, and its 2.4GHz wireless connection is strong and reliable, The 1,200 optical sensors on this HP wireless mouse ensure optimal control and accuracy, and it operates for up to 16 months with a single battery.', 'abcat0513000', 21.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5888/5888209_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5975092', 'Das Keyboard - Model S Professional Full-size Wired Mechanical Cherry MX Blue Clicky Switch Keyboard for Mac - Black', 'Type with ease using this Das Keyboard Model S Professional keyboard that is compatible with Mac and features mechanical key switches with gold contacts for comfortable use. The 2-port USB 2.0 hub allows flexible peripheral connectivity.', 'abcat0513000', 119.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5975/5975092_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6080600', 'Logitech - MX ERGO Plus Wireless Trackball Mouse with Ergonomic design - Graphite', 'Logitech''s most advanced trackball for trackball enthusiasts and consumers searching for alternatives to mice and touchpads. Delivers 20% less muscular strain compared to a regular mouse. A unique adjustable hinge offers personalized comfort - choose the best angle for you between 0 and 20&#176;. Precision mode button allows to instantly switch between speed and precise tracking. Easy-Switch and FLOW-enabled for effortless multi-computer workflow. Pair up to 2 computers and easily switch between them, copy and paste text, images and files. Connect using the included Logitech Unifying receiver or via Bluetooth.', 'abcat0513000', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6080/6080600_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6166360', 'Adesso - Tru-Form WKB-4500UB Ergonomic Full-size Wireless Membrane Keyboard with Touchpad - Black', 'Control your TV or computer from the couch with this Adesso wireless keyboard. It provides up to 30 feet of range to suit any living space, and the ergonomic structure is slightly sloped to encourage natural placement of hands and fingers. This Adesso wireless keyboard has an integrated touch pad for more precise control of the cursor.', 'abcat0513000', 84.95, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6166/6166360_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6166362', 'Adesso - AKB-450UB Ergonomic Full-size Wired Membrane Keyboard with Touchpad - Black', 'Increase your typing efficiency with this Adesso Tru-Form keyboard. Its ergonomic shape and split-key design encourage natural hand and wrist positions, and its integrated palm rest reduces wrist strain. This Adesso Tru-Form keyboard has a touch pad that replaces a traditional mouse and employs GlidePoint technology for precise cursor control.', 'abcat0513000', 69.95, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6166/6166362_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6166368', 'Adesso - Tru-Form Media WKB-1150CB Ergonomic Wireless Membrane Optical Keyboard and Mouse - Black', 'Do computer work comfortably with this wireless Adesso Tru-Form Media peripheral combo. The mini ergonomic keyboard with split-key design follows the natural positioning of your hands and has a built-in scroll wheel for easy scrolling. The optical mouse included with this Adesso Tru-Form Media peripheral combo is elevated for enhanced wrist and forearm support.', 'abcat0513000', 72.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6166/6166368_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6201006', 'Logitech - USB Unifying Receiver', 'Connect unifying mouses and keyboards to your computer with this Logitech USB receiver. Wireless functionality lets you efficiently link up to six devices per receiver, while the compact form factor takes up minimal bag space. Featuring 2.4GHz wireless technology, this Logitech USB receiver provides a reliable connection at a range of up to 33 feet for versatile use.', 'abcat0513000', 14.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6201/6201006_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6215118', 'Logitech - MK540 Full-size Advanced Wireless Membrane Keyboard and Mouse Bundle - Black', 'MK540 Advanced is an instantly familiar wireless keyboard and mouse combo built for precision, comfort and reliability. The full-size keyboard features a familiar key shape, size, and feeling &#8211; optimized for precision and noise reduction. The palmrest and adjustable tilt legs keep you comfortable for long stretches and the contoured mouse is designed to fit perfectly into either palm. Plug and play your keyboard and mouse with one tiny USB receiver with Logitech Unifying technology. You&#8217;ll get a reliable &#8211; and encrypted &#8211; wireless connection up to 32.8 ft away with virtually no delays or dropouts.', 'abcat0513000', 49.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6215/6215118_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6261287', 'Microsoft - Surface Mobile Mouse - Silver', 'Light, portable, comfortable mouse is perfect for precise navigation on the go. No cords or dongle - connects wirelessly to your Surface via Bluetooth. Enhanced wheel is optimized for smooth, natural scrolling. Works on a variety of surfaces&#185; thanks to BlueTrack technology. Available in a choice of rich colors.&#178;', 'abcat0513000', 34.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6261/6261287_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6272732', 'Microsoft - Precision Bluetooth Optical Mouse - Black', 'Designed for exceptional accuracy, comfort, and control, the new Microsoft Precision Mouse helps you stay in your flow with flawless scrolling, beautiful ergonomic design, and three programmable buttons.&#185; &#185; Customization not available on devices running Windows 10 S or Mac OS X.', 'abcat0513000', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6272/6272732_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6276701', 'Apple - Magic Mouse - Black', 'Magic Mouse is wireless and rechargeable, with an optimized foot design that lets it glide smoothly across your desk.The Multi-Touch surface allows you to perform simple gestures such as swiping between web pages and scrolling through documents.', 'abcat0513000', 99.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/6276/6276701_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6276706', 'Apple - Magic Trackpad - Black', 'Magic Trackpad is wireless and rechargeable, and it includes the full range of Multi-Touch gestures and Force Touch technology. Sensors underneath the trackpad surface detect subtle differences in the amount of pressure you apply, bringing more functionality to your fingertips and enabling a deeper connection to your content. It features a large edge-to-edge glass surface area, making scrolling and swiping through your favorite content more productive and comfortable than ever.', 'abcat0513000', 149.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/6276/6276706_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6282602', 'Logitech - MX Vertical Advanced Wireless Optical Mouse with Ergonomic Design - Graphite', 'MX Vertical is an advanced ergonomic mouse that combines science-driven design with the elevated performance of Logitech&#8217;s MX series. The natural handshake position of MX Vertical reduces wrist pressure and forearm strain. The unique 57&#176; vertical angle has been optimized for an ergonomic posture without compromising a pixel of performance. MX Vertical features a 4000 DPI high-precision sensor, resulting in 4x less hand movement and reducing fatigue. And the cursor speed switch allows you to instantly adjust DPI speed and accuracy with the touch of a button. MX Vertical stays powered for up to four months on a full charge &#8211; and gets three hours of use from a one-minute quick charge.', 'abcat0513000', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6282/6282602_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6301672', 'Microsoft - Modern Mobile Wireless BlueTrack Mouse - Black', 'Lightweight and portable - with a redesigned wheel optimized for great scrolling, sculpted ergonomic design, and dongle-free Bluetooth connectivity - new Microsoft Modern Mobile Mouse works on virtually any surface&#185; thanks to BlueTrack technology.', 'abcat0513000', 24.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6301/6301672_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6322999', 'Das Keyboard - 4 Professional DASK4MKPROCLI Ergonomic Wired Mechnical Cherry MX Blue Clicky Switches Keyboard', 'The Das Keyboard 4 Professional mechanical keyboard experience is like no other. From the initial idea to every fine detail when crafting this machine, the experience we deliver to customers is what drives our team. The combination of tactile feel, the psycho-acoustic experience, and incredible craftsmanship all deliver an unmatched typing experience that only Das Keyboard 4 offers. With a Das Keyboard 4, you''ll type faster and longer. It feels so good, you won''t want to stop.', 'abcat0513000', 169.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6322/6322999_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4291000', 'Canon - PIXMA MG3620 Wireless All-In-One Printer - Red', 'Canon PIXMA MG3620 All-in-One Printer: Effortlessly complete office tasks with this versatile printer, which lets you print, copy and scan photos and documents. You can even create borderless photos and print directly from your mobile device via built-in Wi-Fi.', 'abcat0511002', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4291/4291000_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4291015', 'Canon - PIXMA MG3620 Wireless All-In-One Inkjet Printer - White', 'Canon PIXMA MG3620 All-in-One Printer: Effortlessly complete office tasks with this versatile printer, which lets you print, copy and scan photos and documents. You can even create borderless photos and print directly from your mobile device via built-in Wi-Fi.', 'abcat0511002', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4291/4291015_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4291017', 'Canon - PIXMA MG3620 Wireless All-In-One Inkjet Printer - Black', 'Canon PIXMA MG3620 All-in-One Printer: Effortlessly complete office tasks with this versatile printer, which lets you print, copy and scan photos and documents. You can even create borderless photos and print directly from your mobile device via built-in Wi-Fi.', 'abcat0511002', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4291/4291017_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4973203', 'HP - PageWide Pro 477dw Wireless All-In-One Inkjet Printer - White', 'Handle the printing, copying, fax and scanning needs of your business with this HP PageWide Pro printer, which frees up office space with its multifunction capabilities. Two-sided scanning saves you time, and a 100-page fax memory for black and white lets you take care of large document sharing with the push of a button on this HP PageWide Pro printer.', 'abcat0511002', 699.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4973/4973203_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4973324', 'HP - PageWide Pro 577dw Wireless All-In-One Inkjet Printer - White', 'Make quick work of big printing jobs with this HP PageWide Pro printer, which can print on virtually any type of paper or cardstock. This multifunction printer lets you copy true-to-life images and fax them at once, eliminating the need for multiple machines. This HP PageWide Pro printer has a 300-page output tray so you can take on large jobs.', 'abcat0511002', 899.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4973/4973324_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5119600', 'HP - OfficeJet Pro 6978 Wireless All-In-One Instant Ink Ready Printer - Black', 'Bring fast, reliable printing, scanning and copying to your workstation with this HP OfficeJet Pro all-in-one printer. Wireless technology lets you print important documents directly from your laptop or smartphone, and the fast printing speeds deliver beautiful documents in just seconds. Boasting a 35-page two-sided document feeder, this HP OfficeJet Pro all-in-one printer makes tackling paperwork easy.', 'abcat0511002', 164.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5119/5119600_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5234375', 'HP - DeskJet 3755 Wireless All-In-One Instant Ink Ready Inkjet Printer - Stone', 'Streamline space and productivity with this HP all-in-one printer. Compact and wireless, this printer minimizes clutter and easily connects to computers and mobile devices. This HP all-in-one printer helps you save on ink with efficient printing functions and delivers high-resolution printouts of text and graphics you''ll be proud to display in business presentations.', 'abcat0511002', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5234/5234375_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5341000', 'HP - OfficeJet 200 Mobile Inkjet Printer - Black', 'Enjoy crisp, clear printouts with this HP OfficeJet 200 mobile printer. Its compact footprint lets it fit neatly into your backpack or briefcase for on-the-go printing, and its long-lasting battery keeps charging interruptions to a minimum. This HP OfficeJet 200 mobile printer produces up to 10 pages per minute to keep productivity high.', 'abcat0511002', 359.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5341/5341000_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5375401', 'HP - OfficeJet 250 Mobile Wireless All-In-One Inkjet Printer - Black', 'HP OfficeJet 250 Mobile All-In-One Printer. Take a printer with you wherever you go using this HP OfficeJet mobile multifunction printer. The long battery life lets it print out a variety of media anywhere, so it''s ideal for mobile offices and invoicing in particular. Speeds of up to 20 ppm make printing with this HP OfficeJet mobile multifunction printer a seamless experience.', 'abcat0511002', 459.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5375/5375401_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5519200', 'HP - DeskJet 3755 Wireless All-in-One Instant Ink Ready Inkjet Printer - Blue', 'HP DeskJet 3755 All-in-One Printer:Print, scan and copy with this compact HP DeskJet all-in-one printer. Its small footprint makes it ideal for a college dorm room or home office, and it prints black-and-white documents at speeds up to 8 ppm. With built-in Wi-Fi and wireless capabilities, this HP DeskJet all-in-one printer can print from and scan to almost any device.', 'abcat0511002', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5519/5519200_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5536500', 'HP - OfficeJet Pro 8210 Wireless Inkjet Instant Ink Ready Printer - Black', 'Print professional documents with this HP OfficeJet printer. Enhanced security features and built-in networking let you connect several computers wirelessly without compromising data, and four separate ink cartridge slots let you replace ink colors as they are used. This HP OfficeJet printer is Energy Star compliant to help save you money.', 'abcat0511002', 169.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5536/5536500_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5536900', 'HP - OfficeJet Pro 7740 Wireless All-In-One Inkjet Printer - White', 'Go wider with this HP OfficeJet Pro wide format all-in-one printer. Outstanding print clarity and the capability of going full bleed delivers professional-looking documentation and marketing material straight from this office printer. Legendary flexibility ensures this HP OfficeJet Pro wide format all-in-one printer keeps your office running at full speed.', 'abcat0511002', 329.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5536/5536900_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5577769', 'HP - DeskJet 3755 Wireless All-in-One Instant Ink Ready Inkjet Printer - Seagrass', 'Make the most of your office space with this compact HP DeskJet All-in-One printer. Print, scan and copy documents without a wired connection thanks to built-in wireless functionality, and enable mobile printing on your cell phone for additional efficiency. This HP Desktop All-in-One printer is Energy Star compliant to reduce utility costs.', 'abcat0511002', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5577/5577769_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5656869', 'Canon - PIXMA MG2525 All-In-One Inkjet Printer - Black', 'Print high-quality photos at home with this Canon PIXMA all-in-one printer. It produces up to eight full-color images per minute with resolutions of up to 4800 x 600 dpi for display-worthy photographs. This Canon PIXMA all-in-one printer uses a high-speed USB interface, and it scans at resolutions of up to 600 x 1200 dpi for clarity. Prints up to 8 ipm* in black, up to 4 ipm* in color.', 'abcat0511002', 79.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5656/5656869_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5713403', 'Canon - imagePROGRAF PRO-1000 Wireless Inkjet Printer - Black', 'Create copies of professional shots or graphic art with this Canon imagePROGRAF PRO photo printer. Its pigment-based LUCIA PRO 11-color plus Chroma Optimizer ink system provides a wide color gamut for accurate reproduction of detailed images on glossy paper. The 17-inch-wide format of this Canon imagePROGRAF PRO photo printer lets you produce large pictures.', 'abcat0511002', 1399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5713/5713403_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5732906', 'Epson - WorkForce Pro WF-4740 Wireless All-In-One Inkjet Printer - Black', 'Achieve more with this Epson Workforce all-in-one printer. Its faxing, scanning and copying capabilities complement its built-in duplexing and fast, high-quality printing with its PrecisionCore ink technology, satisfying all your home office needs with one device. This Epson Workforce all-in-one printer offers connections through USB, Gigabit LAN and Wi-Fi for added versatility.', 'abcat0511002', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5732/5732906_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5733008', 'Canon - PIXMA iX6820 Wireless Inkjet Printer - Black', 'Generate high-quality photos and documents with this Canon Pixma iX6820 8747B002 printer, which features up to 9600 x 2400 optimized dpi resolution for crisp, detailed prints. Built-in wireless and Ethernet networking offer flexible connectivity options.', 'abcat0511002', 179.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5733/5733008_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5961901', 'HP - ENVY Photo 7855 Wireless All-In-One Instant Ink Ready Inkjet Printer - Black', 'Increase home office productivity with this HP ENVY all-in-one printer. It has a USB port and SD card slot for quick printing of colorful, borderless photos, and its dual-band Wi-Fi lets you print directly from your mobile device. The 2.7-inch touch screen of this HP ENVY all-in-one printer lets you configure options for printing, scanning, copying and faxing.', 'abcat0511002', 214.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5961/5961901_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6042206', 'Epson - Expression EcoTank ET-2750 Wireless All-in-One Inkjet Printer - Black', 'Throw away your cartridges and enjoy flawless printing from this Epson Expression EcoTank printer. Compact in size and ideal for home use, this machine features an easy-to-read screen for quick setting. The front-facing fill tank on this Epson Expression EcoTank printer reduces refill messes, and Wi-Fi compatibility means you can print from your tablet or phone.', 'abcat0511002', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6042/6042206_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6042500', 'Epson - Expression Premium EcoTank ET-7750 Wireless All-in-One Inkjet Printer - Black', 'Print high-quality photographs without wasting time or ink on this Epson Expression EcoTank printer. Designed to create 11" x 17" prints in clear colors, this cartridge-free printer features a large easy-to-fill tank that reduces the need for frequent refills. Featuring 3-in-1 function, this Epson Expression EcoTank printer copies, scans and prints all in one spot.', 'abcat0511002', 649.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6042/6042500_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6060200', 'Epson - WorkForce WF-7210 Wireless All-In-One Inkjet Printer - Black', 'File office documents and pursue creative projects with this Epson WorkForce wireless inkjet printer. Its dual trays have a total capacity of 500 sheets for efficient bulk printing, and it has a 125-sheet output tray for your printed paper. This wide-format Epson WorkForce wireless inkjet printer accommodates 13" x 19" paper for printing spreadsheets and banners.  Fast print speeds up to 18 ISO ppm* in black, up to 10 ISO ppm* in color', 'abcat0511002', 199.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6060/6060200_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6178694', 'Canon - PIXMA TS302 Wireless Inkjet Printer - Black', 'Print quickly and wirelessly with this Canon PIXMA color inkjet printer. Its Smartphone Copy function lets you scan and copy directly from your smartphone with the Canon PRINT app, and it prints up to 7.7 ISO ipm in black and white to reduce wait times. This Canon PIXMA color inkjet printer has a rear paper tray for easy loading.   Prints up to 7.7 ISO ipm*, up to 4 ISO ipm* in color', 'abcat0511002', 79.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6178/6178694_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6178696', 'Canon - PIXMA TS202 Inkjet Printer - Black', 'Get the documents you need quickly with this Canon PIXMA color inkjet printer. Its quiet mode minimizes distractions around the office, while its compact design helps streamline your desktop environment. This eco-friendly Canon PIXMA color inkjet printer has auto power on/off functionality and is ENERGY STAR-certified to help reduce power costs.   Prints up to 7.7 ISO ipm*, up to 4 ISO ipm* in color', 'abcat0511002', 54.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6178/6178696_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6214992', 'Epson - WorkForce WF-2860 Wireless All-In-One Inkjet Printer - Black', 'Share print, copy and fax resources through Wi-Fi with this Epson all-in-one printer. It prints with four-color inkjet technology and automatic duplexing for colorful, two-sided output and uses USB 2.0 for compatibility with a wired desktop or server. This Epson all-in-one printer copies documents directly and clearly with a CIS scan element.     Prints up to 14 ISO ppm* in black, up to 7.5 ppm* in color', 'abcat0511002', 149.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6214/6214992_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6239805', 'Brother - Work Smart Series MFC-J895DW Wireless All-In-One Inkjet Printer - Black', 'The Brother Work Smart Series MFC-J895DW is the ideal print, copy, scan and fax solution for home, home office or small office needs. This wireless color inkjet all-in-one delivers reliable, high-quality output and enables wireless mobile device printing from your desktop, laptop, smartphone or tablet. This easy-to-use wireless color inkjet all-in-one delivers affordable printing and has a 2.7" touch screen for effortless workflow navigation. The automatic document feeder, 150-sheet capacity paper tray and bypass tray handle a variety of sizes and specialty papers. Automatic duplex (2-sided) printing helps save paper while the compact design helps save desk space. Cloud connectivity lets you print from and scan to popular Cloud services directly from the printer. There''s no network setup needed for Near Field Communications (NFC) one "touch to connect" mobile device printing and scanning. Includes a two-year limited warranty and free online, call, or live chat support for the life of the printer.    Prints up to 12 ISO ppm* in black, up to 10 ISO ppm* in color', 'abcat0511002', 129.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6239/6239805_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6239806', 'Brother - Work Smart Series MFC-J497DW Wireless All-In-One Inkjet Printer - Black', 'The Brother Work Smart Series MFC-J497DW is easy to connect, compact, affordable and loaded with features and functionality to help boost productivity in your home, home office, dorm room or small office. This wireless color inkjet all-in-one delivers high-quality output, lets you reliably print, copy, scan and fax and enables wireless mobile device printing from your desktop, laptop, smartphone or tablet. Use the automatic document feeder and 100-sheet capacity paper tray for generous output without constant monitoring, and help save paper with automatic duplex (2-sided) printing. Cloud connectivity lets you scan to popular Cloud services directly from the printer. Comes with a one-year limited warranty and free online, call, or live chat support for the life of the printer.    Prints up to 12 ISO ppm* in black, up to 6 ISO ppm* in color', 'abcat0511002', 89.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6239/6239806_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6276400', 'HP - Tango Wireless Instant Ink Ready Inkjet Printer - Wisp Gray', 'Built to match the way you live and designed for use with the HP Smart app, Tango helps you stay a step ahead by connecting and printing from any device, anywhere.', 'abcat0511002', 159.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6276/6276400_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6290017', 'Canon - PIXMA TR4520 Wireless All-In-One Inkjet Printer - Black', 'Print, scan and fax with this Canon PIXMA wireless all-in-one printer. It has Wi-Fi capability for easy access from laptops, desktops, phones and tablets, and the compact size works well in smaller offices. This Canon PIXMA wireless all-in-one printer has automatic duplexing to save you money on supplies and produces clear photo prints.   Fast print speeds up to 8.8 ISO ipm* in black, up to 4.4 ISO ipm* in color; creates a 4" x 6" photo-quality print in as little as 70 seconds*', 'abcat0511002', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6290/6290017_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6290018', 'Canon - PIXMA TR4520 Wireless All-In-One Inkjet Printer - White', 'Print, scan and fax with this Canon PIXMA wireless all-in-one printer. It has Wi-Fi capability for easy access from laptops, desktops, phones and tablets, and the compact size works well in smaller offices. This Canon PIXMA wireless all-in-one printer has automatic duplexing to save you money on supplies and produces clear photo prints.   Fast print speeds up to 8.8 ISO ipm* in black, up to 4.4 ISO ipm* in color; creates a 4" x 6" photo-quality print in as little as 70 seconds*', 'abcat0511002', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6290/6290018_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6302026', 'Brother - INKvestment Tank MFC-J5845DW Wireless All-in-One Inkjet Printer with Up to 1-Year of Ink In-box - White/Gray', 'The Brother MFC-J5845DW INKvestment Tank color inkjet all-in-one printer with tank technology delivers reliable performance, enhanced productivity and professional results perfect for small businesses and home offices. The MFC-J5845DW features reengineered INKvestment Tank cartridges along with an internal ink storage tank to deliver uninterrupted printing for up to 1-year(1) without the need to purchase ink. Business-capable features include mobile device printing(2), flexible paper handling options, 11&#8221; x 17&#8221; printing, automatic two-sided printing and easy onscreen navigation using the 3.7&#8221; color touchscreen. The Brother INKvestment Tank all-in-one printer with up to one-year of ink in-box(1) provides truly uninterrupted printing, exceptional features, super convenience, large page yields and low-cost printing. Includes a two-year limited warranty with free online, call, or live chat support for the life of your printer.', 'abcat0511002', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6302/6302026_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6332287', 'Canon - PIXMA TS702 Wireless Inkjet Printer - Black', 'Get vibrant results for creative office or school projects with this Canon PIXMA wireless printer. The fast output, 350-sheet capacity and compatibility with high-yield ink cartridges deliver high performance for handling large tasks, and multiple connectivity options support versatile operation. This Canon PIXMA wireless printer works with AirPrint and Mopria Print Service for direct printing from iOS and Android devices.    Prints up to 15 ESAT ipm* in black, up to 10 ESAT ipm* in color.', 'abcat0511002', 129.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6332/6332287_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6347454', 'Epson - EcoTank ET-2720 Wireless All-In-One Inkjet Printer - White', 'Print smudge-free text and rich, vibrant images with this Epson EcoTank all-in-one color printer. Wi-Fi Direct connectivity lets you print remotely without a router, and voice-activated printing capabilities let you schedule jobs using voice commands. This Epson EcoTank all-in-one color printer produces gorgeous photos and graphics with a maximum resolution of 5760 x 1440 dpi.    Prints up to 10 ISO ppm* in black, up to 5 ISO ppm* in color.', 'abcat0511002', 199.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6347/6347454_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4483016', 'NETGEAR - Dual-Band AC1750 Router with 16 x 4 DOCSIS 3.0 Cable Modem - Black', 'The NETGEAR Dual-Band AC1750 Router with 16 x 4 DOCSIS 3.0 Cable Modem provides very fast cable speeds with an AC1750 WiFi router and integrated DOCSIS 3.0 cable modem, up to 680 Mbps. Compatible with cable Internet providers such as XFINITY from Comcast, Spectrum, Cox, Cablevision, and more.', 'abcat0503000', 199.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4483/4483016_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6347500', 'Epson - WorkForce WF-2830 Wireless All-in-One Inkjet Printer - Black', 'Ensure forms, photos and other documents are sharp with this Epson WorkForce printer. The built-in scanner, fax and copy machine provide versatility for a wide array of office tasks. This Epson WorkForce printer has a two-sided printing feature for added speed and efficiency, while the 100-sheet feed capacity easily handles large projects.  Prints up to 10 ISO ppm* in black, up to 4.5 ISO ppm* in color', 'abcat0511002', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6347/6347500_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6347505', 'Epson - Expression Premium XP-6100 Wireless All-In-One Inkjet Printer - Black', 'Handle various office tasks with this Epson Expression all-in-one printer. The 2.4-inch color LCD screen lets you quickly copy or scan documents, and wireless connectivity supports mobile printing with iOS and Android devices. This small-size Epson Expression all-in-one printer occupies minimal space, while the built-in card slot reads from most memory cards for versatility.  Prints up to 15.8 ISO ppm* in black, up to 11.3 ISO ppm* in color, creates a 4" x 6" photo-quality print in as little as 15 seconds*', 'abcat0511002', 169.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6347/6347505_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6348813', 'Epson - Expression Home XP-4100 Wireless All-In-One Inkjet Printer - Black', 'Print, scan and copy wirelessly from your device with this Epson Expressions Home all-in-one inkjet printer. The 100-sheet paper tray minimizes downtime to improve productivity, while the 2.4-inch LCD screen ensures simple setup and use. This Epson Expressions Home all-in-one inkjet printer features automatic duplex printing to save on paper.  Prints up to 10 ISO ppm* in black, up to 5 ISO ppm* in color', 'abcat0511002', 104.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6348/6348813_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6356231', 'Canon - PIXMA MegaTank G6020 Wireless All-In-One Inkjet Printer - Black', 'Canon PIXMA MegaTank G6020 Wireless All-In-One Printer: Save big on ink with this Canon PIXMA MegaTank inkjet printer. The MegaTank ink storage container can be easily refilled to offer over 30 times as much ink compared to standard cartridges. Tackle big print jobs with a page yield of up to 6,000 black or 7,700 color sheets from this Canon PIXMA MegaTank inkjet printer.    Prints up to 13 ISO ipm* in black, up to 6.8 ISO ipm* in color', 'abcat0511002', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6356/6356231_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6356232', 'Canon - PIXMA MegaTank G5020 Wireless Inkjet Printer - Black', 'Canon PIXMA MegaTank G5020 Wireless Printer: Eliminate the need for ink cartridges with this Canon MegaTank wireless printer. The integrated tank system holds up to 6,000 black and 7,700 color prints, while the 4800 x 1200 dpi resolution delivers detailed images. This Canon MegaTank wireless printer has print speeds of up to 13 ipm in black and 6.8 ipm in color for high-volume printing tasks.    Prints up to 13 ISO ipm* in black, up to 6.8 ISO ipm* in color', 'abcat0511002', 249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6356/6356232_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6360501', 'Epson - EcoTank ET-M2170 Wireless Monochrome All-in-One SuperTank Printer - White', 'Meet your high-volume printing needs efficiently with this Epson EcoTank all-in-one supertank printer. PrecisionCore printing delivers sharp text and detailed images for high-quality output, while wireless connectivity lets you print from a variety of devices for added convenience. This Epson EcoTank all-in-one supertank printer features a compact design to save space in the office.    Prints up to 20 ISO ppm** in black', 'abcat0511002', 329.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6360/6360501_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6360502', 'Epson - EcoTank ET-M3170 Wireless Monochrome All-in-One SuperTank Printer - White', 'Print, copy, scan and fax with ease by using this Epson EcoTank wireless monochrome supertank printer. Featuring Wi-Fi Direct and Ethernet, this wireless printing solution lets you quickly print documents for improved productivity. The 250-sheet paper tray of this Epson EcoTank wireless monochrome supertank printer provides a handy bulk document storage option.    Prints up to 20 ISO ppm** in black', 'abcat0511002', 399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6360/6360502_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6360504', 'Epson - EcoTank ET-M1170 Wireless Monochrome SuperTank Printer - White', 'Give your high-volume printing a boost with this Epson EcoTank monochrome printer. The PrecisionCore technology offers cartridge-free printing and quick output speeds and ensures your prints come out sharp and detailed. This Epson EcoTank monochrome printer is equipped with a 250-sheet paper tray, auto two-sided printing and wired and wireless networking features to optimize your printing assignments.    Prints up to 20 ISO ppm** in black', 'abcat0511002', 279.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6360/6360504_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6367438', 'Canon - PIXMA TS3320 Wireless All-In-One Inkjet Printer - White', 'Canon PIXMA TS3320 All-in-One Printer: Print stunning color documents and photos with this Canon PIXMA wireless all-in-one printer. Built-in Wi-Fi and Apple AirPrint compatibility let you print from any room in your home, and the rear paper tray allows for effortless loading. Boasting a compact footprint, this Canon PIXMA wireless all-in-one printer makes a smart addition to your home office or family computer desk.    Prints up to 7.7 ESAT ipm** in black, up to 4 ESAT ipm** in color.', 'abcat0511002', 89.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6367/6367438_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6367440', 'Canon - PIXMA TS5320 Wireless All-In-One Inkjet Printer - Black', 'Canon PIXMA TS5320 All-in-One Printer: Print photos and documents from virtually anywhere in your home with this Canon PIXMA wireless inkjet all-in-one printer. The compact design fits neatly in small spaces, and built-in Wi-Fi offers a dependable connection. This printer makes it easy to print perfectly square photos directly from your favorite social media accounts or smartphone or tablet.    Prints up to 13 ESAT ipm** in black, up to 6.8 ESAT ipm** in color.', 'abcat0511002', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6367/6367440_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6367441', 'Canon - PIXMA TS6320 Color All-In-One Inkjet Printer - White', 'Upgrade your home office to handle on-demand printing jobs with this Canon PIXMA all-in-one wireless inkjet printer. The built-in LED bar and 1.44-inch OLED display let you view and navigate the printing status easily, while the auto expandable output tray makes printing from across the room possible. This Canon PIXMA all-in-one wireless inkjet printer features a five-color individual ink system for replacing ink tanks more efficiently.   Prints up to 15 ISO ipm* in black, up to 10 ipm* in color', 'abcat0511002', 129.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6367/6367441_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4562303', 'NETGEAR - Dual-Band AC1600 Router with 16 x 4 DOCSIS 3.0 Cable Modem - Black', 'The NETGEARDual-Band AC1600 Router with 16 x 4 DOCSIS 3.0 Cable Modem provides the fastest cable speed available with an AC1600 WiFi router and integrated DOCSIS 3.0 cable modem, with up to 680 Mbps. It''s compatible with cable internet provider Comcast XFINITY, Spectrum, Cox, Cablevision, and more.', 'abcat0503000', 179.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4562/4562303_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6367442', 'Canon - PIXMA TS3320 Wireless All-In-One Inkjet Printer - Red', 'Canon PIXMA TS3320 All-in-One Printer: Upgrade your home office with this Canon PIXMA all-in-one wireless printer. Built-in Wi-Fi connectivity makes accessing and producing documents from your smartphone or tablet simple. The 1.5-inch segment LCD screen of this red Canon PIXMA all-in-one wireless printer lets you adjust settings easily, while the two-cartridge FINE hybrid ink system delivers impressive prints on plain or photo paper.    Prints up to 7.7 ESAT ipm** in black, up to 4 ESAT ipm** in color.', 'abcat0511002', 89.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6367/6367442_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6367444', 'Canon - PIXMA TS3320 Wireless All-In-One Inkjet Printer - Black', 'Canon PIXMA TS3320 All-in-One Printer: Maximize office space and experience simple document creation with this Canon PIXMA all-in-one printer. Wireless Connect lets you access and print from any room using your smartphone or tablet. The two-cartridge FINE hybrid ink system ensures consistent print quality, while the rear-feed tray of this Canon PIXMA all-in-one printer easily holds plain or photo paper.    Prints up to 7.7 ESAT ipm** in black, up to 4 ESAT ipm** in color.', 'abcat0511002', 89.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6367/6367444_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6367468', 'Canon - PIXMA TS6320 Color All-In-One Inkjet Printer - Black', 'Connect to your Wi-Fi network and start printing from any room with this Canon PIXMA all-in-one wireless inkjet printer. The separate ink system lets you replace individual ink tanks as they run out for added efficiency, while dual paper feeding holds plain and photo paper simultaneously. This Canon PIXMA all-in-one wireless inkjet printer features Mopria printing for pairing with your smartphone or tablet easily.   Prints up to 15 ISO ipm* in black, up to 10 ipm* in color', 'abcat0511002', 129.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6367/6367468_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6371542', 'Epson - WorkForce WF-110 Wireless Inkjet Printer', 'Epson WorkForce WF-110 Printer: Print contracts, invoices and charts with this Epson WorkForce wireless mobile printer. Built-in wireless connectivity helps you work more efficiently by allowing direct printing from tablets, laptops or smartphones, and a rechargeable battery with an auto-off feature provides portability. The 1.4" color LCD and control panel of this Epson WorkForce wireless mobile printer are simple and easy to operate.  Prints up to 6.7 ISO ppm*, up to 3.8 ppm* in color, creates a 4" x 6" photo-quality print in as little as 77 seconds*', 'abcat0511002', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6371/6371542_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6371546', 'Epson - Expression Photo XP-970 Wireless All-In-One Printer', 'Epson Expression Photo XP-970 All-In-One Printer: Print directly from a smartphone or tablet with this Epson Expression all-in-one printer. Ultra HD inks and a wide-format design let you print stunning large borderless photos, and smaller pictures can be printed in as little as 11 seconds. Intuitive touch-screen controls make this Epson Expression all-in-one printer simple and easy to use.  Prints up to 8.5 ISO ppm*, up to 8 ISO ppm* in color', 'abcat0511002', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6371/6371546_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6393533', 'Canon - PIXMA MegaTank G7020 Wireless All-In-One Inkjet Printer with Fax - Black', 'Meet your printing, scanning, copying and faxing needs with this Canon PIXMA MegaTank all-in-one printer. The high-page-yield ink tanks are ideal for large-volume jobs, offering up to 6,000 pages, while Wi-Fi functionality and mobile support enable remote access. This Canon PIXMA MegaTank all-in-one printer is compatible with popular virtual assistants for voice control.', 'abcat0511002', 379.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6393/6393533_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6397573', 'Epson - Expression Photo XP-8600 Wireless All-In-One Inkjet Printer', 'Turn digital images into ready-to-frame pictures with this Epson Expression Photo small-in-one printer. The MicroPiezo inkjet technology and six-color Claria Photo HD inks produce gorgeously detailed photos in up to 5760 x 1440 dpi resolution. This Epson Expression Photo small-in-one printer produces 4 x 6-inch borderless photos in as little as 10 seconds.    Prints up to 9.5 ISO ppm* in black, up to 9 ISO ppm* in color.', 'abcat0511002', 249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6397/6397573_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6397577', 'Epson - EcoTank ET-15000 Wireless All-In-One Inkjet Printer', 'Meet your printing, scanning, faxing and copying needs with this Epson EcoTank all-in-one supertank printer. The 250-sheet front tray paper capacity is suitable for high-volume jobs, while Wi-Fi and Ethernet functionality offers versatile connectivity options. This cartridge-free Epson EcoTank all-in-one supertank printer features an EcoFit ink bottle design for seamless refilling, and the 2.7-inch touch screen supports simple operation.', 'abcat0511002', 599.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6397/6397577_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6397578', 'Epson - EcoTank Pro ET-5880 Wireless All-In-One Inkjet Printer with PCL Support', 'Print up to 25 ISO pages per minute* in black and white or color with this Epson EcoTank all-in-one wireless printer. The pigment-based inks deliver crisp, vibrant prints consistently, while the supersize ink tanks are uniquely designed for hassle-free refilling. This cartridge-free Epson EcoTank all-in-one wireless printer lets you copy, scan and fax documents for all-around functionality.', 'abcat0511002', 899.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6397/6397578_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6397580', 'Epson - EcoTank Pro ET-5850 Wireless All-In-One Inkjet Printer', 'Employ high-quality printing with this Epson EcoTank Pro all-in-one printer. The 550-sheet paper tray capacity handles a large volume of work without interruption, while Wi-Fi, Ethernet and Bluetooth connectivity lets you print from various devices. This Epson EcoTank Pro all-in-one printer has a 4.3-inch touch screen for easy menu navigation, and the print speed of up to 25 ISO ppm produces documents quickly.', 'abcat0511002', 849.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6397/6397580_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6397581', 'Epson - EcoTank Pro ET-16650 Wireless All-In-One Inkjet Printer', 'Produce high-quality reports and forms with this Epson EcoTank all-in-one printer. Wi-Fi compatibility supports printing directly from a tablet or smartphone, while the built-in scanner, copier and fax machine let you handle multiple office tasks in one location, enhancing productivity. This Epson EcoTank all-in-one printer features an exclusive EcoFit ink bottle design for hassle-free filling.', 'abcat0511002', 1129.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6397/6397581_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6397582', 'Epson - EcoTank Pro ET-16600 Wireless All-In-One Inkjet Printer', 'Produce crisp, vibrant prints in black and white and color with this Epson EcoTank all-in-one wireless printer. The PrecisionCore Heat-Free technology offers high-volume print-shop quality prints, while the 550-sheet paper capacity and black print speed of up to 25 ISO ppm ensure high printing productivity. This Epson EcoTank all-in-one wireless printer boasts cartridge-free printing to save energy.', 'abcat0511002', 999.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6397/6397582_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6402210', 'Canon - SELPHY Square QX10 Wireless Photo Printer - Black', 'Get a printed copy of your treasured snapshots with this Canon SELPHY Square QX10 photo printer. The lightweight design, compact size and built-in battery let you easily bring the device everywhere, while the dye-sublimation technology delivers quick-drying prints. This Canon SELPHY Square QX10 photo printer works with the SELPHY app so you can add filters and stickers to your pictures.', 'abcat0511002', 149.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6402/6402210_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6404827', 'HP - ENVY 6055 Wireless All-In-One Instant Ink-Ready Inkjet Printer - White', 'Designed to make printing easier for the whole family, the HP ENVY 6055 all-in-one printer lets everyone print, scan, and copy everyday documents, schoolwork, borderless photos and more. This wireless picture printer can order ink for you and deliver it to your door with up to 50% savings on ink using the HP Instant Ink delivery service, so you can print high-quality documents and photos when you need them (subscription required). Set up, and connect the all-in-one printer to your family''s mobile devices in a few easy steps for remote scanning and sharing using the HP Smart app. And keep connected, and reduce interruptions with self-healing Wi-Fi&#8482; and Bluetooth&#174; 5.0 technology. Prints up to 10 ISO ppm* in black and up to 7 ppm* in color.', 'abcat0511002', 129.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6404/6404827_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6405195', 'Epson - EcoTank Pro ET-5800 Wireless All-In-One Inkjet Printer', 'Produce high-quality documents with this Epson EcoTank Pro multifunction printer. Print speeds up to 25 ISO ppm* make short work of large jobs, and the maximum resolution of 4800 x 2400 dpi ensures clear text and crisp images. This Epson EcoTank Pro multifunction printer produces up to 23 copies per minute.', 'abcat0511002', 799.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6405/6405195_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6407491', 'Canon - PIXMA TR150 Wireless Inkjet Printer', 'Produce full-size document copies and borderless 4R photos almost everywhere with this lightweight Canon PIXMA wireless portable printer. The hybrid ink system lets you print black-and-white and colored pages efficiently, and support for Apple AirPrint, Google Cloud Print and Mopria Print Service enables smooth connectivity with various mobile sources. This 12.7-inch Canon PIXMA wireless portable printer is compact enough to fit in a backpack.', 'abcat0511002', 249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6407/6407491_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6420641', 'Canon - imagePROGRAF PRO-300 Wireless Inkjet Printer - Black', 'Take complete creative control of your images with the imagePROGRAF PRO-300 professional photo and fine art printer.Produce gallery quality color and black-and-white prints with detailed gradations, a wide color gamut, and deeper blacks on fineart paper thanks to the new Matte Black ink. With a 9-color plus Chroma Optimizer ink system, this 13&#8221; wide photo printer isdesigned to meet the demands of every photographer, from advanced amateurs to professionals. The imagePROGRAF PRO-300offers professional image quality, productivity, and outstanding workflow with a smaller footprint, allowing you to consistentlydeliver the results your images deserve.', 'abcat0511002', 899.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6420/6420641_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6421442', 'Envy 6075 Wireless All In One Inkjet Printer with 2 years of HP Instant Ink - White', 'For everyone in the family. For every device. Print, scan, and copy everyday documents, schoolwork, photos, and more. Set up and connect on any device with HP Smart app, and get self-healing Wi-Fi', 'abcat0511002', 249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6421/6421442_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6421445', 'Envy Pro 6475 Wireless All In One Inkjet Printer with 2 years of HP Instant Ink - White', 'Handle it all from home. Print, scan, copy, 24 months send mobile fax with HP Smart App, and get a 35-page auto document feeder. Set up and connect on any device, and get self-healing Wi-Fi', 'abcat0511002', 269.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6421/6421445_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6421533', 'HP - DeskJet 2725 Wireless All-In-One Instant Ink Ready Inkjet Printer - White', 'All the basics, now with easy-to use features. Print, scan, and copy everyday documents, and get worry-free wireless. Simple setup with HP Smart app means you&#8217;re ready on any device.', 'abcat0511002', 69.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6421/6421533_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6426721', 'Epson - WorkForce Pro WF-4820 Wireless All-in-One Printer', 'Experience the power of high-performance business printing with the WorkForce Pro WF-4820. Providing high-speed printing, the WF-4820 blazes through high-volume print jobs at an astounding 25 black/12 color ISO ppm&#8224;. Built for productivity, this reliable printer consistently delivers sharp, professional-quality prints with innovative PrecisionCore Heat-Free Technology&#8482; and vivid DURABrite&#174; Ultra instant-dry pigment inks. An efficient, easy-to-use solution, the WF-4820 offers convenient features designed to enhance efficiency and streamline workflow, including a large, 4.3" color touchscreen for intuitive navigation, a 250-sheet paper capacity, auto 2-sided printing, wireless connectivity and more.', 'abcat0511002', 199.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6426/6426721_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6426722', 'Epson - WorkForce Pro WF-3820 Wireless All-in-One Printer', 'Bring a new level of productivity to your business with the ultra efficient WorkForce Pro WF-3820 all-in-one printer. Designed for high-volume print environments, the WF-3820 delivers precise, professional-quality prints at fast speeds up to 21 (black)/11 (color) ISO ppm&#8224; using vibrant DURABrite&#174; Ultra instant-dry pigment inks. A breakthrough in business printing, the WF-3820 features Epson&#8217;s innovative PrecisionCore Heat-Free Technology&#8482; designed for enhanced reliability with minimal downtime. Built with convenience in mind, the WF-3820 offers a variety of user-friendly features to support easy, streamlined printing for small workgroups, including auto 2-sided printing, a large, 250-sheet paper capacity, built-in wireless and a 2.7" color touchscreen for quick navigation and control.', 'abcat0511002', 179.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6426/6426722_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6426723', 'Epson - WorkForce Pro WF-7820 Wireless Wide-format All-in-One Printer', 'Amplify office productivity with the high-performance WorkForce Pro WF-7820. Built from the ground up for high-volume, wide-format printing up to 13" x 19", this powerful, duplex solution offers auto 2-sided print, copy, scan and fax, and a convenient 50-sheet ADF. Featuring state-of-the-art PrecisionCore Heat-Free Technology&#8482; and vivid DURABrite&#174; Ultra inks, the reliable WF-7820 delivers high-speed prints with 25 black/12 color ISO ppm&#8224;, plus fast first-page-out. Designed with ease-of-use in mind, the WF-7820 offers a variety of features for enhanced convenience and efficiency, including a large, 250-sheet paper capacity, an intuitive 4.3" color touchscreen and simple wireless setup and connectivity.', 'abcat0511002', 279.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6426/6426723_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6426725', 'Epson - WorkForce Pro WF-7840 Wireless Wide-format All-in-One Printer', 'Supercharge workplace efficiency and productivity with the ultra fast WorkForce Pro WF-7840. Offering high-speed wide-format printing, this reliable all-in-one consistently delivers sharp, professional-quality, prints using innovative PrecisionCore Heat-Free Technology&#8482; and vivid DURABrite&#174; Ultra inks. Built from the ground up to meet the demands of fast-paced businesses, the WF-7840 tackles a variety of tasks with wide-format printing up to 13" x 19", auto 2-sided print, copy, scan and fax, a 50-sheet rear tray, and a large, 500-sheet paper capacity. Convenient and easy-to-use, this complete duplex solution offers an abundance of features for simplified operation and navigation, including a 4.3" color touchscreen and wireless setup using mobile devices', 'abcat0511002', 329.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6426/6426725_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6426727', 'Epson - WorkForce Pro WF-4830 Wireless All-in-One Printer', 'Streamline workflow and increase efficiency with the ultra productive WorkForce Pro WF-4830. A complete duplex solution, the WF-4830 offers auto 2-sided print, copy, scan and fax, plus a 50-sheet Auto Document Feeder, to quickly and conveniently accomplish a variety of tasks. Providing high-speed printing, the WF-4830 uses state-of-the-art PrecisionCore Heat-Free Technology&#8482; and vivid DURABrite&#174; Ultra inks to deliver professional-quality prints at an astounding 25 black/12 color ISO ppm&#8224;. The perfect choice for fast-paced work environments, the WF-4830 makes high-volume printing easy with an intuitive, 4.3" color touchscreen, a large, 500-sheet paper capacity and simple, wireless connectivity.', 'abcat0511002', 219.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6426/6426727_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6426766', 'Canon - Pixma TS6420 Wireless All-In-One Inkjet Printer - Black', 'Introducing the PIXMA TS6420, a compact and sleek All-in-One printer built for your busy lifestyle. It&#8217;s easy to setup and simple to use &#8212; featuring a 1.44&#8221; OLED window which delivers clear, easy to read status messages as well as Front & Rear Paper feeding so you can print on a variety of paper types. The TS6420 can handle your everyday tasks with ease from scanning an old hand-written recipe to printing crafts from the Canon Creative Park App22. Whether printing from your computer or wirelessly1 from your smartphone, the TS6420 is an effortless All-In-One Printer that fits your everyday printing needs.', 'abcat0511002', 159.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6426/6426766_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6426769', 'Canon - Pixma TS6420 Wireless All-In-One Inkjet Printer - White', 'Introducing the PIXMA TS6420, a compact and sleek All-in-One printer built for your busy lifestyle. It&#8217;s easy to setup and simple to use &#8212; featuring a 1.44&#8221; OLED window which delivers clear, easy to read status messages as well as Front & Rear Paper feeding so you can print on a variety of paper types. The TS6420 can handle your everyday tasks with ease from scanning an old hand-written recipe to printing crafts from the Canon Creative Park App22. Whether printing from your computer or wirelessly1 from your smartphone, the TS6420 is an effortless All-In-One Printer that fits your everyday printing needs.', 'abcat0511002', 159.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6426/6426769_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6426772', 'Canon - Pixma TR7020 Wireless All-In-One Inkjet Printer - Black', 'Functionality meets style in the PIXMA TR7020, a compact wireless All-in-One printer built for your home or work needs. It&#8217;s easy to setup, simple to use, and feature-rich &#8212; with a clear 1.44&#8221; OLED Display, built-in compact Auto Document Feeder, Front & Rear Paper feeding, and Auto-Duplex Printing. The TR7020 can handle a variety of tasks with ease, from scanning a signed contract with the ADF to printing homework assignments from virtual classrooms. Whether printing from your computer or wirelessly1 from your smartphone, the TR7020 is a quality All-In-One Printer for your everyday home and work tasks.', 'abcat0511002', 189.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6426/6426772_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6426774', 'Canon - Pixma TR7020 Wireless All-In-One Inkjet Printer - White', 'Functionality meets style in the PIXMA TR7020, a compact wireless All-in-One printer built for your home or work needs. It&#8217;s easy to setup, simple to use, and feature-rich &#8212; with a clear 1.44&#8221; OLED Display, built-in compact Auto Document Feeder, Front & Rear Paper feeding, and Auto-Duplex Printing. The TR7020 can handle a variety of tasks with ease, from scanning a signed contract with the ADF to printing homework assignments from virtual classrooms. Whether printing from your computer or wirelessly1 from your smartphone, the TR7020 is a quality All-In-One Printer for your everyday home and work tasks.', 'abcat0511002', 189.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6426/6426774_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6426775', 'Canon - Pixma TR8620 Wireless All-In-One Inkjet Printer with Fax - Black', 'When you need a compact home office printer that can handle all your work needs, the PIXMA TR8620 has you covered. With front and rear paper feeding, a 5-Individual Ink System, 4.3&#8221; LCD Touchscreen, and impressive wired and wireless5 connectivity options, you&#8217;ll be able to do it all. The PIXMA TR8620 can easily transition from scanning a multi-page contract with the built-in Auto Document Feeder to printing double-sided homework assignments from online classrooms systems, or a family photo wirelessly from your smartphone. Whether it&#8217;s printing documents and reports, or faxing and scanning, the PIXMA TR8620 is the ultimate compact home office printer that&#8217;s big on performance and productivity.', 'abcat0511002', 229.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6426/6426775_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6439509', 'Canon - PIXMA PRO-200 Wireless Inkjet Printer - Black', 'The PIXMA PRO-200 Wireless Professional Inkjet Photo Printer is the ideal choice to bring your photos and designs to life in vibrant color. With an 8-color dye-based ink system, this versatile 13&#8221; wide printer is designed to meet the demands of photographers and graphic artists alike. The PIXMA PRO-200 offers beautiful print quality, high-speed printing, and outstanding productivity in a compact footprint, allowing you to consistently produce the results your artistic work deserves.', 'abcat0511002', 599.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6439/6439509_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6443806', 'Canon - PIXMA MegaTank G3260 Wireless All-In-One Inkjet Printer - Black', 'The Canon PIXMA G3260 Wireless MegaTank All-In-One Printer is designed for productivity&#8212; delivering high-volume, low-cost printing. Its refillable MegaTank ink system prints up to 6,000 black / 7,700 color pages from one set of ink bottles1&#8212; that&#8217;s 30 times1 what you can print with a conventional ink cartridge set! Print, copy, and scan with ease and enjoy great versatility. Print documents, borderless3 photos, and more on a variety of media types and sizes with hybrid inks for crisp blacks and vivid colors. Plus, you can print on the go wirelessly from your favorite mobile devices2. Print more for less with the Canon PIXMA G3260 Wireless MegaTank All-In-One Printer.', 'abcat0511002', 229.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6443/6443806_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6443807', 'Canon - PIXMA MegaTank G2260 All-In-One Inkjet Printer - Black', 'The Canon PIXMA G2260 MegaTank All-In-One printer delivers high-volume, low-cost printing, copying and scanning. With its refillable MegaTank ink system, print up to 6,000 black / 7,700 color pages from one set of ink bottles1 &#8212; that&#8217;s equivalent to 30 conventional ink cartridge sets!1 Cost-effectiveness isn&#8217;t the only highlight, the PIXMA G2260 printer is amazingly versatile too. Print documents, borderless2 photos, and more on a variety of media types and sizes with hybrid inks for crisp blacks and vivid colors. Print more for less with the Canon PIXMA G2260 MegaTank All-In-One Printer.', 'abcat0511002', 199.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6443/6443807_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6443808', 'Canon - PIXMA MegaTank G1220 Inkjet Printer - Black', 'The Canon PIXMA G1220 MegaTank Inkjet Printer makes it simple to save on printing. Fitted with refillable ink tanks and enough ink to do the work of 30 conventional ink cartridge sets1 &#8212; that means you can print to up to 6,000 black / 7,700 color pages1 with one set of ink bottles. The PIXMA G1220 printer easily delivers on a variety of media types with its versatile hybrid inks that produce crisp blacks and rich colors for both documents and borderless2 photos. High volume, low cost printing&#8212; get more for less with the Canon PIXMA G1220 MegaTank inkjet printer.', 'abcat0511002', 189.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6443/6443808_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6450663', 'HP - OfficeJet Pro 8025e Wireless All-In-One Inkjet Printer with 6 months of Instant Ink Included with HP+ - White', 'The HP OfficeJet Pro 8025e delivers increased productivity with fast speeds and custom mobile shortcuts. It includes the optional HP+ Smart Printing System that keeps itself up to date, secure, and ready to print from virtually anywhere at any time. Optional HP+ system requires an HP account, internet connection, and use of only Original HP Ink for the life of the printer.', 'abcat0511002', 209.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6450/6450663cv14d.jpg');
