INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6454282', 'HP - DeskJet 2755e Wireless Inkjet Printer with with 6 months of Instant Ink Included with HP+ - White', 'The HP DeskJet 2755e has the essential features you need to print basic color documents like recipes and forms. Print, copy and scan with ease, print from your phone and get easy setup. It includes the optional HP+ Smart Printing System that keeps itself up to date and ready to print from virtually anywhere at any time. Optional HP+ system requires an HP account, internet connection, and use of only Original HP Ink for the life of the printer.', 'abcat0511002', 79.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6454/6454282_sd.jpg');
