INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6459601', 'Epson - EcoTank Pro ET-5150 Wireless All-in-One Supertank Printer', 'The EcoTank Pro ET-5150 all-in-one supertank printer offers fast Cartridge-Free Printing, ideal for high-volume environments. Save up to 80 percent with low-cost replacement ink bottles vs. standard-capacity color laser toner cartridges &#8211; that&#8217;s about 2 cents per color ISO page versus 14 cents with cartridges1. Engineered for high productivity in a small footprint, the ET-5150 delivers professional-quality prints face down for greater privacy. Epson DURABrite ET pigment ink ensures vibrant borderless prints. This hardworking printer offers demanding businesses reliability they can count on, including a 2-year limited warranty with registration and permanent printhead designed to last the life of the printer. Plus, there&#8217;s zero cartridge waste', 'abcat0511002', 499.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6459/6459601_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6459602', 'Epson - EcoTank® Pro ET-5170 Wireless All-in-One Supertank Printer', 'Ideal for high-volume environments, the EcoTank Pro ET-5170 all-in-one supertank printer offers fast Cartridge-Free Printing, plus copy, scan and fax. Save up to 80 percent with low-cost replacement ink bottles vs. standard-capacity color laser toner cartridges1 &#8211; that&#8217;s about 2 cents per color ISO page versus 14 cents with cartridges1. Engineered for high productivity in a small footprint, the ET-5170 delivers professional-quality prints face down for greater privacy. Epson&#174; DURABrite&#174; ET pigment ink ensures vibrant borderless prints. This hardworking printer offers demanding businesses reliability they can count on, including a 2-year limited warranty with registration2 and permanent printhead designed to last the life of the printer. Plus, there&#8217;s zero cartridge waste.', 'abcat0511002', 549.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6459/6459602_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6459641', 'Epson - EcoTank® Photo ET-8500 Wireless Color All-in-One Supertank Printer', 'The EcoTank Photo ET-8500 wireless all-in-one prints lab-quality color photos, graphics and everyday documents &#8212; all at an incredible value. Epson&#8217;s cartridge-free, 6-color Claria&#174; ET Premium Ink system delivers vibrant colors and sharp text for all your creative projects. With low-cost replacement ink bottles, print 4" x 6" photos for about 4 cents each compared to 40 cents with cartridges1. Print everything from borderless 8.5" x 11" photos to customized CDs/DVDs. You can even print on cardstock and other media up to 1.3 mm thick. For added convenience, each set of bottles lets you print for up to 2 years2.  Plus, save up to 80 percent with replacement ink bottles vs. ink cartridges3 &#8212; that&#8217;s about $2,000 on each set3. The EcoTank Photo lets you do it all with affordable in-house printing.', 'abcat0511002', 599.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6459/6459641_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6461022', 'Canon - MAXIFY MegaTank GX7020 Wireless All-In-One Inkjet Printer with Fax - White', 'Designed to meet the needs of small offices, the MAXIFY GX7020 delivers high-quality, low-cost printing, and outstanding wireless connectivity. Get serious print productivity with a high page yield of up to 6,000 Black / 14,000 Color pages per full ink bottle set7 and a combined 600 sheet plain paper capacity. Save up to 80% on the cost of ink compared to high-yield laser cartridges with a low cost per print of less than 2 cents per page.7  Each printer comes with a full set of ink, plus 2 bonus black ink bottles, and a 3-year or 80,000 pages* limited warranty so you can print with confidence. The MAXIFY GX7020 is easy to setup and maintain and delivers superior versatility thanks to an auto document feeder for scanning, copying, and faxing&#8212; plus, print on a variety of media types and sizes, including labels, envelopes, and banners. Produce crisp, colorful documents quickly and cost-effectively thanks to fast print speeds and a 4-color pigment-based ink system. Connectivity is paramount with the GX7020, easily connect and print through high-speed USB, Ethernet, or wirelessly8 from computers or mobile devices.', 'abcat0511002', 899.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6461/6461022_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6461023', 'Canon - PIXMA TS3520 Wireless All-In-One Inkjet Printer - Black', 'Welcome to simple and intuitive printing with the PIXMA TS3520 Wireless4 All-in-One Printer. Easy to setup and easy to use with a simple to replace 2-Cartridge FINE Hybrid Ink System, improved Wi-Fi&#174; setup through Wireless Connect3, a Rear Paper Tray for quick reloading of plain or photo paper, plus a flatbed scanner &#8212; the PIXMA TS3520 is more than your basic printer. You can also easily print from your mobile devices using the Canon PRINT app1, AirPrint&#174;7, Mopria&#174; Print Service6, or from computers with built-in Wi-Fi&#174;4.', 'abcat0511002', 89.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6461/6461023_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6461024', 'Canon - PIXMA TS3520 Wireless All-In-One Inkjet Printer - White', 'Welcome to simple and intuitive printing with the PIXMA TS3520 Wireless4 All-in-One Printer. Easy to setup and easy to use with a simple to replace 2-Cartridge FINE Hybrid Ink System, improved Wi-Fi&#174; setup through Wireless Connect3, a Rear Paper Tray for quick reloading of plain or photo paper, plus a flatbed scanner &#8212; the PIXMA TS3520 is more than your basic printer. You can also easily print from your mobile devices using the Canon PRINT app1, AirPrint&#174;7, Mopria&#174; Print Service6, or from computers with built-in Wi-Fi&#174;4.', 'abcat0511002', 89.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6461/6461024_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6461025', 'Canon - PIXMA MegaTank G620 Wireless All-In-One Inkjet Printer - Black', 'Print more stunning photos for less with the Canon PIXMA G620 MegaTank Photo Printer. On just one full set of ink bottles, you can print up to 3,800 4&#8221; x 6&#8221; color photos1 &#8212; just 2.5 cents per print2! With a 6-Color Dye-based Ink system, including Red and Gray inks, you will get beautiful vivid photos with an expanded color gamut. Designed for high volume, high quality photo printing, the PIXMA G620 is perfect for memory makers & keepers for photo albums, scrapbooks, and more. Plus, setup out of the box is a breeze and printing is easy through high-speed USB or wirelessly5 from a computer or mobile devices.', 'abcat0511002', 329.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6461/6461025_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4580700', 'Linksys - AC750 Boost Range Extender - White', 'Expand your Wi-Fi coverage with this Linksys AC750 Boost RE6300 wireless range extender, which features Crossband and Beamforming technologies for efficient dual-band operation. WPA, WPA2 and WEP encryptions and an SPI firewall provide security.', 'abcat0503000', 59.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4580/4580700_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6461026', 'Canon - MAXIFY MegaTank GX6020 Wireless All-In-One Inkjet Printer - White', 'Designed to meet the needs of small offices, the MAXIFY GX6020 delivers high-quality, low-cost printing, and outstanding wireless connectivity. Get serious print productivity with a high page yield of up to 6,000 Black / 14,000 Color pages per full ink bottle set7 and a combined 350 sheet plain paper capacity. Save up to 80% on the cost of ink compared to high-yield laser cartridges with a low cost per print of less than 2 cents per page.7  Each printer comes with a full set of ink, plus 2 bonus black ink bottles, and a 3-year or 80,000 pages* limited warranty so you can print with confidence. The MAXIFY GX6020 is easy to setup and maintain and delivers superior versatility thanks to an auto document feeder for scanning and copying &#8212; plus, print on a variety of media types and sizes, including labels, envelopes, and banners. Produce crisp, colorful documents quickly and cost-effectively thanks to fast print speeds and a 4-color pigment-based ink system. Easily connect and print through high-speed USB, Ethernet, or wirelessly5 from computers or mobile devices.', 'abcat0511002', 799.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6461/6461026_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6461474', 'Brother - INKvestment Tank MFC-J1205W Wireless All-in-One Inkjet Printer with up to 1-Year of Ink In-box', 'When you need a truly affordable, reliable and compact color inkjet printer that is simple to use and delivers print, copy and scan capabilities, the Brother MFC-J1205W INKvestment Tank Multi-Function Color Inkjet Printer is the perfect choice. Brother offers this sleek, modern multi-function printer that comes with up to 1-year of ink in-box(1) without needing to replace ink cartridges to meet your home, school, home office or small office document imaging needs. Brother INKvestment Tank printers feature reengineered ink cartridges that hold more ink and automatically deliver a continuous ink supply to the internal ink tank for truly convenient, uninterrupted printing. The newly designed Brother MFC-J1205W INKvestment Tank Printer puts the power of printing at your fingertips featuring the Brother Mobile Connect(2) App which is a user-friendly, cutting edge printer interface that enables you to control how you print, copy and scan and allows for simple printer operations from your mobile device. With the Brother Mobile Connect(2) App you can print anytime, from virtually anywhere and always know the status of your printer. The App also lets you track ink usage for your printer by accessing the Brother Intelligent Page Gauge,(4) a visual, numerical way to know the amount of ink you&#8217;ve used and the amount of ink you have remaining. Choose from flexible connection options that include a built-in wireless(3) interface for sharing with multiple users on your network, Wireless Direct or connect locally to a single computer via a USB interface. Works with Alexa; add voice control by combining with an Alexa device. The printer is easy-to-use, features a clean, modern design and offers quick setup and convenient optional printing via AirPrint&#174; and/or Email Print. When you need a reliable color inkjet printer at an affordable price to keep pace with your home, school or home office document needs, Brother INKvestment Tank MFC-J1205W is the printer for you.', 'abcat0511002', 129.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6461/6461474_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6461498', 'Brother - INKvestment Tank MFC-J4535DW Wireless All-in-One Inkjet Printer with Up to 1-Year of Ink in-box', 'The MFC-J4535DW features fast print and scan speeds, expanded paper capacity and duplex printing along with enough ink for up to one-year of printing with just the ink included in-box(1). Get full print, copy, scan and fax functionality, wireless printing and scanning(2) plus two adjustable paper trays for up to a 400-page total capacity for your home, home office, schoolwork or small business. There&#8217;s also an up to 20-sheet automatic document feeder for fast copying and scanning and a bypass tray to handle a variety of media. The 2.7&#8221; touchscreen enables easy navigation and easy access to powerful features plus print-from and scan-to popular cloud services including Google Drive&#8482;, Dropbox, Box, OneDrive and more(3), directly from the printer. The MFCJ4335DW INKvestment Tank all-in-one color inkjet printer includes versatile connection options with NFC touch to print(4), built in wireless(2), Wi-Fi Direct&#174;, Ethernet or connect locally to a single computer via USB interface. This feature-filled INKvestment Tank printer is supported by the free Brother Mobile Connect(5) App providing a convenient user interface that enables printing, scanning, copying and device management from your smartphone or tablet. Enhanced color graphics and reengineered ink provide vivid colors making it great for printing photos and color documents. The MFC-J4535DW uses reengineered INKvestment Tank ink cartridges that automatically and continually supply ink to the internal tank to deliver uninterrupted printing and convenience with no need to stop and refill the ink tank. Replacing cartridges is super easy - just pop out the empty cartridge and snap in a front-loading, plug-in replacement and get back to printing. The MFC-J4535DW features the unique Brother Page Gauge(6) which estimates remaining page levels, so you always know how much ink you have left. Keep pace with the growing need for color printing with the Brother MFC-J4535DW INKvestment Tank color inkjet all-in-one printer.', 'abcat0511002', 249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6461/6461498_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6461536', 'Brother - INKvestment Tank MFC-J4335DW Wireless All-in-One Inkjet Printer with up to 1-Year of Ink In-box', 'When you need a reliable, compact color inkjet printer with up to 1-year of ink in-box(1) to print, copy, scan and fax for your home, home office, schoolwork or small office, the Brother MFCJ4335DW INKvestment Tank all-in-one color inkjet printer is a great choice. It features versatile connection options, wireless printing and scanning(2), automatic duplex printing plus fast print and scan speeds. This feature-filled INKvestment Tank printer is supported by the free Brother Mobile Connect(3) App providing a convenient user interface that enables printing, scanning, copying and device management from your smartphone or tablet. There&#8217;s an up to 20-sheet automatic document feeder, bypass tray and 150-sheet capacity adjustable paper tray for letter or legal-size paper that offers paper handling versatility. Easily navigate to powerful features plus print-from and scan-to popular cloud services including Google Drive&#8482;, Dropbox, OneDrive and more(4), directly from the printer using the 1.8&#8221; color display. There&#8217;s never a need to stop and refill the internal ink; the reengineered INKvestment Tank cartridges hold more ink than traditional cartridges and automatically and continually supply ink to the tank for uninterrupted printing and convenience. And when a cartridge is empty, simply pop out the cartridge and plug in a front-loading plug-in replacement and get back to printing &#8211; no waiting and no mess. The MFC-J4335DW features the unique Brother Page Gauge(5), a visual, numerical way to know the amount of ink used, estimating the remaining page levels and amount of ink remaining to help take the guesswork out of when to replace ink. Works with Alexa; add voice control by combining with an Alexa device. It comes with a 2-Year Limited Warranty and At Your Side support for the life of the product.', 'abcat0511002', 179.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6461/6461536_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6469371', 'Epson - EcoTank ET-2800 Wireless Color All-in-One Cartridge-Free Supertank Printer with Scan and Copy', 'Your family needs a printer that&#8217;s fast, affordable, and easy to use. That&#8217;s why we developed the EcoTank ET-2800 &#8211; an innovative cartridge-free solution that uses high-capacity, easily refillable ink tanks. So you&#8217;ll worry less about running out of ink, and save a lot on replacement ink. The ET-2800 features genuine Epson print quality, a high-resolution flatbed scanner, and convenient color display &#8211; making it the ideal basic home printer.', 'abcat0511002', 199.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6469/6469371_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6469372', 'Epson - EcoTank Photo ET-8550 All-in-One Wide-format Supertank Printer', 'The EcoTank Photo ET-8550 wireless all-in-one prints lab-quality, wide-format color photos, graphics and everyday documents &#8212; all at an incredible value. Epson&#8217;s cartridge-free, 6-color Claria ET Premium Ink system delivers vibrant colors and sharp text for all your creative projects. With low-cost replacement ink bottles, print 4" x 6" photos for about 4 cents each compared to 40 cents with cartridges. Print everything from borderless 13" x 19" photos to customized CDs/DVDs. You can even print on cardstock and other media up to 1.3 mm thick. For added convenience, each set of bottles lets you print for up to 2 years.  Plus, save up to 80 percent with replacement ink bottles vs. ink cartridges &#8212; that&#8217;s about $2,000 on each set. The EcoTank Photo lets you do it all with affordable in-house printing.', 'abcat0511002', 699.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/6469/6469372cv11d.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1754208', 'NETGEAR - Nighthawk R7000 AC1900 WiFi Router - Black', 'Accelerate your WiFi 5 with NETGEAR Nighthawk! Enjoy fast WiFi speeds up to 1900 Mbps and a powerful dual core 1GHz processor for extreme performance. High-powered amplifiers, external antennas and Beamforming improve range and reliability for up to 100% more wireless coverage. Features like downstream and upstream QoS prioritize streaming and gaming, creating a blazing-fast, lag-free WiFi experience', 'abcat0503000', 179.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1754/1754208_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2001047', 'j5create - USB 3.0-to-Gigabit Ethernet Adapter - Gray', 'Bring high-speed network access to your computer via a USB 3.0 port with this j5create JUE130 adapter, which features a 10/100/1000 Gigabit Ethernet port for rapid data transfer. Aluminum construction ensures rugged durability.', 'abcat0503000', 24.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2001/2001047_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2080012', 'TP-Link - N300 Wi-Fi Range Extender with Ethernet Port - White', 'Eliminate wireless dead zones with this TP-LINK TL-WA850RE Wi-Fi range extender, which features compatibility with 802.11b/g/n wireless standards and offers signal rates up to 300 Mbps. The Smart Signal indicator light helps you find the optimal location.', 'abcat0503000', 17.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2080/2080012_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2080049', 'TP-Link - 8-Port 10/100/1000 Mbps Gigabit Smart Ethernet Metal Switch - Gray', 'Make connectivity simple with this TP-LINK TL-SG108E 8-port 10/100/1000 Mbps Gigabit Ethernet switch, which offers tag-based QoS (Quality of Service) for easy network management. IGMP Snooping capability enhances multicast applications.', 'abcat0503000', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2080/2080049_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2080136', 'TP-Link - Powerline AV600 Nano Adapter Starter Kit - White - White', 'Turn your powerline into a high-speed network with this TP-LINK AV600 Nano TL-PA4010KIT kit, which features compatibility with HomePlug AV, 802.3 and 802.3u Internet standards and a data transfer rate of up to 600 Mbps. AES encryption protects your data.', 'abcat0503000', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2080/2080136_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2080346', 'TP-Link - 5-Port 10/100/1000 Mbps Gigabit Smart Ethernet Metal Switch - Gray', 'Upgrade your equipment for your small or medium business network with this TP-LINK TL-SG105E Gigabit smart switch, which offers 5 10/100/1000 Mbps ports with port-based priority setup, making it easy to integrate with your infrastructure.', 'abcat0503000', 24.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2080/2080346_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2693443', 'ASUS - RT-N12 D1 N300 Single Band Wi-Fi Router - Black', 'Extend the operating range of your wireless signal with this ASUS wireless 3-in-1 network router. The EZ switch lets you seamlessly change between router mode, access point mode or range extender mode for an all-in-one solution, while multiple SSID support lets you create guest networks for a more secure primary network. This ASUS wireless 3-in-1 network router features a three-step installation process for quick setup.', 'abcat0503000', 31.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2693/2693443_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3606023', 'NETGEAR - Nighthawk AC1900 Dual-Band Gigabit Mesh Capable Wi-Fi Range Extender - Black', 'The NETGEAR Nighthawk AC1900 WiFi Range Extender boosts your existing network range & speed, delivering extreme dual band WiFi up to 1900Mbps. The 700mW high-powered amplifiers provide extreme range, while the dual core 800MHz processor enables maximum WiFi performance.', 'abcat0503000', 139.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3606/3606023_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3993445', 'NETGEAR - AC1200 Dual-Band Wi-Fi Range Extender - White', 'NETGEAR AC1200 Mesh WiFi Range Extender boosts your existing WiFi by increasing your range and speed. It compatible with any standard WiFi router to deliver AC1200 dual band WiFi with up to 1200 Mbps. Includes Mesh features Smart Roaming and one WiFi name. Easily connect all your smart home devices to one network, no new WiFi names and passwords needed. Move from room-to-room while streaming video on your mobile device without any interruptions. A Gigabit Ethernet port provides WiFi connectivity to a wired device like Blu-ray players, game consoles, smart TVs or streaming players over your existing WiFi network. Just plug it into any outlet and experience the difference.', 'abcat0503000', 119.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3993/3993445_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4002029', 'NETGEAR - Powerline AC1200 Gigabit Ethernet Adapter (2-pack) - White', 'NETGEAR Powerline adapters are ideal for deliver high-speed wired and wireless Internet to every room in the home using existing electrical wiring for all your gaming and streaming activities. It''s simple to set up - just plug it in and start playing.', 'abcat0503000', 94.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4002/4002029_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4069415', 'NETGEAR - 48-Port 10/100/1000 Mbps Gigabit Fully Managed Switch - Blue', 'NETGEAR''s low-cost, stackable, Gigabit Ethernet switches deliver maximum throughput and flexibility where you need it - to high-speed, high-density workgroups at the edge of the network, in the backbone of growing networks or for bandwidth-thirsty file and application servers. The GSM7352S fully-managed switch deliver 48 ports of auto-sensing 10/100/1000 Mbps interfaces for high-density copper connectivity. Four hot-swappable small form-factor pluggable (SFP) Gigabit interfaces provide optional fiber connectivity for longer reach Gigabit Ethernet requirements. It also has two 10 Gigabit Ethernet small form-factor pluggable (SFP+) interfaces and two high-speed, module bays offering modular expansion for 10 Gigabit Ethernet or 48 Gigabit Stacking connectivity. The non-blocking design of the switches delivers simultaneous, full wire-speed, low-latency throughput to all ports.', 'abcat0503000', 2999.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4069/4069415_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4403100', 'NETGEAR - Nighthawk AC1900 Router with DOCSIS 3.0 Cable Modem - Black', 'The Nighthawk Dual-Band AC1900 Router with 24 x 8 DOCSIS 3.0 Cable Modem delivers WiFi speeds of up to 1.9Gbps. It ensures uninterrupted HD video streaming with 24x8 channel bonding. Save up to $120 a year by eliminating Internet service provider rental fees. This cable modem router supports XFINITY from Comcast, Spectrum, Cox & more.', 'abcat0503000', 157.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4403/4403100_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4403608', 'TP-Link - AC1750 Gigabit Wi-Fi Range Extender - White', 'Expand your wireless network with this TP-LINK RE450 range extender, which features Wireless-AC technology with dual-band speeds up to 1750 Mbps and 3 adjustable external antennas for reliable signal strength and coverage.', 'abcat0503000', 79.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4403/4403608_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4600801', 'ARRIS - SURFboard 32 x 8 DOCSIS 3.0 Cable Modem - White', 'The ARRIS SURFboard SB6190 is a DOCSIS 3.0 cable modem with 32 downstream x 8 upstream bonded channels, making it a perfect addition to your home network. The SB6190 is best for internet speed plans up to 400 Mbps. Cable modems are the heart of your home network. Power yours with the SB6190.', 'abcat0503000', 89, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4600/4600801_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4760603', 'NETGEAR - Powerline 1000 Network Extender - White', 'Expand your wired Internet network with this NETGEAR Powerline 1000 PL1000-100PAS network extender, which features HomePlug AV2 to support Gigabit speeds for improved coverage. Push-and-Secure encrypts your network connections at the touch of a button.', 'abcat0503000', 84.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4760/4760603_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4781602', 'Linksys - 8-Port Gigabit Ethernet Switch - Black', 'This Linksys SE3008 8-port Ethernet switch features a wired design, so you can connect up to 8 devices to fast, reliable Gigabit Ethernet. Setting the system up is simple with plug-and-play installation.', 'abcat0503000', 44.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4781/4781602_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4833500', 'Linksys - 5-Port Gigabit Ethernet Switch - Black/Blue', 'Expand your network and add network devices with this Linksys five-port gigabit switch, letting you transfer 10 times faster than Fast Ethernet. Five ports offer 5X Ethernet so you can plug and play without missing a beat. Power is reduced to unused ports on this Linksys five-port gigabit switch, saving you money by reducing energy costs.', 'abcat0503000', 34.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4833/4833500_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4884001', 'Insignia™ - Bluetooth 4.0 USB Adapter - Black', 'Cut corded contact with this Insignia Bluetooth USB adapter. This adapter lets users connect up to seven Bluetooth-enabled devices to a Bluetooth-compatible computer. It works with laptops and desktops running Microsoft Windows 10. This Insignia Bluetooth USB adapter maintains connections with devices up to 20 feet away.', 'abcat0503000', 14.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4884/4884001_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5008900', 'ASUS - AC5300 Tri-Band AC Gigabit Router - Black', 'Enjoy speedy Internet browsing and gaming with this Asus tri-band gigabit router. A built-in game accelerator enhances gameplay by minimizing game packet loss and lowering ping time. Transmission speeds of 2 Gbps provide quick access speeds. This Asus tri-band gigabit router features advanced privacy and parental controls, including account time limits and schedules that encourage safe browsing.', 'abcat0503000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5008/5008900_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5050001', 'Motorola - MB7420 16x4 DOCSIS 3.0 Cable Modem 646 Mbps - Gray', 'The Motorola MB7420 high-speed 16x4 DOCSIS 3.0 cable modem supports speeds up to 646 Mbps, sixteen times faster than DOCSIS 2.0. A Full-Band Capture digital tuner ensures a faster, more reliable Internet. This attractive, compact design minimizes shelf space, improves cooling, and extends product life while looking great in any home or office. Connects to a computer, HDTV, game station, or wireless router. (This cable modem does not have a built-in wireless router or VoIP telephone adapter.)', 'abcat0503000', 59.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5050/5050001_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5102600', 'Luxul - 52-Port Gigabit Ethernet Switch', 'Expand your network with the Luxul 52-port stackable managed switch. It comes with two Gigabit RJ-45 ports, 48 PoE+ ports and two 10Gb SFP+ stacking ports to let you manage as many as 16 switches at one time. It has 740W of power to help optimize the amount of traffic received over this Luxul 52-port stackable managed switch.', 'abcat0503000', 2999.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5102/5102600_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5113100', 'NETGEAR - Nighthawk X4 AC2200 Dual-Band Wi-Fi Range Extender - White', 'Extend your existing Wi-Fi with Nighthawk X4 AC2200 Wi-Fi Mesh Extender, and get the speeds that you pay for throughout your home. This Mesh Extender improves coverage and works with your home Wi-Fi to create a powerful Wi-Fi System. Includes Mesh features like Smart Roaming and One Wi-Fi Name. Easily connect all your smart home devices to one network, no new Wi-Fi names and passwords needed. Move from room-to-room while streaming video on your mobile device without any interruptions. Other powerful features like MU-MIMO and Smart Connect ensure every device is assigned the fastest available Wi-Fi connection. Easy setup with a touch of a button. Boost your Wi-Fi to the extreme with this Nighthawk X4 Wall-plug Wi-Fi Mesh Extender. Works with your existing Wi-Fi router, gateway, or ISP provided gateway.  NOTE: Firmware upgrade & factory reset required to unlock Mesh Wi-Fi features.', 'abcat0503000', 159.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5113/5113100_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5172000', 'Linksys - MAX-STREAM™ AC1900 Dual Band Repeater with MU-MIMO - White', 'Prevent dead zones around your home with the help of this Linksys Wi-Fi range extender. It works with all types of Wi-Fi routers, and it uses multi-user MIMO for speed and efficiency. This Linksys Wi-Fi range extender can be used to create a different access point or to extend the field of the router&#8217;s connection.', 'abcat0503000', 89.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5172/5172000_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5174100', 'Linksys - Next-Gen AC Dual-Band AC600 USB Network Adapter - Black', 'Create a fast home network with this Linksys USB adapter. Access to both 2.4GHz and 5GHz bands lets you gain more coverage than a standard single-band USB adapter, and connections are fast and secure. This Linksys USB adapter provides a secure Wi-Fi connection when you use it with a Windows-based notebook.', 'abcat0503000', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5174/5174100_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5577333', 'NETGEAR - Orbi AC3000 Tri-Band Mesh Wi-Fi System (2-pack) - White', 'Orbi Whole Home WiFi System delivers up to 3.0Gbps high-performance WiFi. Sleek, modern design with high-gain internal antennas for up to 5,000 square feet of coverage. FastLane3 Technology creates a dedicated Tri-Band WiFi for seamless 4K streaming and gaming everywhere in your home. Keep a single WiFi name for uninterrupted connections as you move from room-to-room. Circle Smart Parental Controls runs on Orbi Routers for a smart way for families to manage content and time online, on any connected device. Provide internet access to guests without sharing your personal network password. Orbi is ready right out of the box and compatible with your ISP. Just use the Orbi app to get started with better WiFi, everywhere in minutes.', 'abcat0503000', 199.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5577/5577333_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6105800', 'Motorola - MB8600 32x8 DOCSIS 3.1 Cable Modem 1 GB Ethernet - Gray', 'The Motorola MB8600 Ultra-fast DOCSIS 3.1 cable modem supports true Gigabit speed with a 1 GB Ethernet port. Approved for Comcast Xfinity, Cox, and Charter Spectrum services, only. This cable modem is backward compatible with 32x8 DOCSIS 3.0.', 'abcat0503000', 159.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6105/6105800_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5580325', 'NETGEAR - Nighthawk AC1900 Dual-Band Wi-Fi Range Extender - White', 'Extend your existing Wi-Fi with Nighthawk AC1900 Wi-Fi Mesh Extender, and get the speeds that you pay for throughout your home. This Mesh Extender improves coverage and works with your home Wi-Fi to create a powerful Wi-Fi System. Includes Mesh features like Smart Roaming and One Wi-Fi Name. Easily connect all your smart home devices to one network, no new Wi-Fi names and passwords needed. Move from room-to-room while streaming video on your mobile device without any interruptions. Other powerful features like MU-MIMO and Smart Connect ensure every device is assigned the fastest available Wi-Fi connection. Easy setup with a touch of a button. Boost your Wi-Fi to the extreme with this Nighthawk Wall-plug Wi-Fi Mesh Extender. Works with your existing Wi-Fi router, gateway, or ISP provided gateway.  NOTE: Firmware upgrade & factory reset required to unlock Mesh Wi-Fi features.', 'abcat0503000', 104.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5580/5580325_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5619201', 'Motorola - Dual-Band AC1900 Router with 16 x 4 DOCSIS 3.0 Cable Modem - Black', 'Connect to the internet wirelessly with this dual-band Wi-Fi Motorola cable modem. Power Boost technology provides wireless amplification to the U.S. legal limit so you can watch videos or enjoy high-performance networking. This Motorola cable modem lets you stream media at up to 686 Mbps on downstream channels and up to 123 Mbps on upstream channels.', 'abcat0503000', 149.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5619/5619201_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5687904', 'TP-Link - 2-Port Gigabit Powerline Starter Kit - White', 'Create higher power line speeds for multiple connections with this pass-through TP-Link Powerline starter kit. It has two Gb ports, letting you connect a smart TV, game console or desktop computer to a secure wired network. You don''t need to configure this plug-and-play TP-Link Powerline starter kit, and the power-saving mode automatically reduces power consumption.', 'abcat0503000', 89.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5687/5687904_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5689635', 'TP-Link - Archer AC1350 Dual-Band Wi-Fi 5 Router - Black', 'The Archer C59 comes with the brand new Wi-Fi standard - 802.11ac, widely compatible with both wireless AC and wireless N devices and three times faster than previous wireless N speeds. With this cutting edge technology, the Archer C59 offers you faster, stronger and more capable Wi-Fi. Simply put: a revolutionized network experience on all your devices.The Archer C59 provides your entire home with simultaneous dual band Wi-Fi connections. The strong and stable 2.4GHz wireless band with 450Mbps Wi-Fi speed is perfect for sending emails, browsing the web or listening to music. Meanwhile, the 5GHz wireless band provides up to 867Mbps Wi-Fi speed for latency-sensitive entertainment so you can stream HD video, play online games and hold video chats all at the same time, without delay.', 'abcat0503000', 52.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5689/5689635_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5709448', 'Linksys - Velop AC2200 Tri-Band Mesh Wi-Fi 5 System (2-pack) - White', 'Connect every corner of your home to the internet with this Linksys Velop wireless Wi-Fi system. Each formidable tri-band dual-stream AC2200 router has two 5GHz bands and a 2.4GHz band for a blazing fast experience. This modular Linksys Velop wireless Wi-Fi system includes two identical units, which you can distribute evenly to ensure your wireless signal always stays strong.', 'abcat0503000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5709/5709448_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5709451', 'Linksys - Velop AC2200 Tri-Band Mesh Wi-Fi 5 System (3-pack) - White', 'Make your home an internet haven with this versatile Linksys Velop wireless Wi-Fi system. Three identical tri-band dual-stream AC2200 routers, each equipped with a quad-core ARM Cortex-A7 processor, deliver lightning-fast internet. Equipped with Bluetooth 4.0/LE, this Linksys Velop wireless Wi-Fi system is simple to set up and pairs easily with computers, tablets and smart devices.', 'abcat0503000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5709/5709451_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5712201', 'NETGEAR - Nighthawk AC2300 Dual-Band Wi-Fi 5 Router - Black', 'The NETGEAR Nighthawk AC2300 Smart WiFi 5 Router provides up to 1625 + 600 Mbps WiFi and MU-MIMO for lag-free gaming, better video streaming and multiple mobile devices. With Gigabit WiFi, Beamforming, and built-in high-powered amplifiers and external antennas, get ready for extreme performance! Frustration-free fast install using NETGEAR Nighthawk App to get online in matter of minutes. NETGEAR Armor - Advanced cyber threat protection for your home and all your devices. Control your home network with voice commands using Amazon Alexa and the Google Assistant.', 'abcat0503000', 169.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5712/5712201_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5712202', 'NETGEAR - Nighthawk DOCSIS 3.1 Cable Modem - Black', 'The CM1000 Ultra-High Speed Cable Modem, with speeds up to 1Gbps and DOCSIS 3.1 is 10X faster than DOCSIS 3.0 devices. It''s backward compatible with DOCSIS 3.0 and ready for future service plan upgrades for XFINITY from Comcast, Cox, and Spectrum. A Gigabit Ethernet port provides faster access and downloads.', 'abcat0503000', 179.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5712/5712202_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5712222', 'Belkin - Wireless-AC Dual-Band Wi-Fi Router', 'Connect and enjoy the internet with the simple setup of this Belkin dual-band wireless router. Multibeam technology lets you surf the internet no matter where you are in your home, and the dashboard is easy to access with one quick click. The 5GHz media band on this Belkin dual-band wirelesss router offers seamless streaming of video and effortless surfing.', 'abcat0503000', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5712/5712222_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5732405', 'ASUS - Dual-Band AC1200 USB Network Adapter - Black', 'Achieve blazing online speeds with this ASUS NANO wireless adapter. It offers selectable 2.4GHz and 5GHz bands for a clearer signal, and its built-in 2x2 patch antennas increase the signal''s range for better network coverage. This ASUS NANO wireless adapter includes a clip to attach it to notebook computers and a cradle with a long USB cord for desktop use.', 'abcat0503000', 36.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5732/5732405_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5791602', 'ARRIS SURFboard  24 x 8 DOCSIS 3.0 Voice Cable Modem with AC1750 Dual-Band Wi-Fi Router for Xfinity - White', 'Create an efficient home or office network with this ARRIS SURFboard router. This device supports multiple simultaneous 4K streams and channels data at up to 1Gbps for ultra-fast file downloads and an enhanced gaming experience. Connect tablets and laptops via Wi-Fi or plug devices into this four-port ARRIS SURFboard router directly.', 'abcat0503000', 199, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5791/5791602_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6105900', 'NETGEAR - AC1000 Dual-Band Wi-Fi 5 Router - Black', 'The NETGEAR AC1000 Dual Band WiFi Router delivers WiFi speeds up to 300 + 700Mbps. It allows you to upgrade your WiFi to support new AC devices. NETGEAR Nighthawk app lets you easily manage your home network. It''s easy to install and ideal for medium to large homes.', 'abcat0503000', 69.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6105/6105900_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5801602', 'Motorola - AC Dual-Band Wi-Fi Router with 16 x 4 Modem - Black', 'Enjoy fast internet speeds with this Motorola router. It supports speeds up to 686 Mbps downstream and 123 Mbps upstream for fast data transfer, and its dual-band Wi-Fi delivers fast wireless access by broadcasting on both 2.4GHz and 5GHz frequencies. This Motorola router includes guest network access, letting visitors browse the internet while keeping your personal local network secure.', 'abcat0503000', 129.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5801/5801602_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5839003', 'ARRIS - SURFboard 32 x 8 DOCSIS 3.1 Cable Modem - White', 'Create a powerful home or small office network with this ARRIS SURFboard cable modem. Two Ethernet ports let you connect directly to your devices, and 32 download and eight upload channels provide real-time video and game streaming without lagging. This ARRIS SURFboard cable modem supports IPv4 and IPv6 browsing for reliable connectivity.', 'abcat0503000', 146.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5839/5839003_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5844809', 'TP-Link - AC2600 Wi-Fi Range Extender - White', 'Gain more network coverage with this TP-LINK Wi-Fi range extender. Its four antennas provide signals for up to an additional 14,000 sq. ft., and it transfers information to multiple devices simultaneously for improved performance. This TP-LINK Wi-Fi range extender includes a Gigabit Ethernet port to provide faster wired connections to TVs, computers and gaming devices.', 'abcat0503000', 119.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5844/5844809_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5844812', 'TP-Link - Dual-Band AC USB Network Adapter - Black', 'Connect your laptop or desktop to a wireless network with this Archer dual-band wireless Wi-Fi USB adapter. The push-and-connect feature lets you connect easily, and it delivers speeds up to 1300 Mbps for streaming videos and games. This Archer dual-band Wi-Fi USB adapter provides twice the bandwidth for reduced interference and a secure connection.', 'abcat0503000', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5844/5844812_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5873516', 'Mesh Wi-Fi 5 System (1 eero + 2 eero Beacons), 2nd Generation - White', 'Extend your internet access with this handy eero TrueMesh Wi-Fi system. Distributed throughout your home, the base units included with this system make it easier to get a clear wireless signal no matter where you are. Built around a quad-core processor and a set of powerful radios, each unit in this eero TrueMesh Wi-Fi system has a maximum 40-foot range', 'abcat0503000', 319, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5873/5873516_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5873517', 'eero - AC Tri-band Mesh Wi-Fi 5 Router - White', 'Improve your existing eero Wi-Fi system with this powerful eero hub. Equipped with a 720MHz quad-core CPU, seven antennas and a pair of powerful tri-band Wi-Fi radios, this unit has a generous 40-foot maximum transmission range. Easy to set up and use, this eero hub works within your TrueMesh network for seamless data streaming.', 'abcat0503000', 159, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5873/5873517_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5873518', 'eero - Pro Mesh Wi-Fi 5 System (3 eeros), 2nd Generation - White', 'The eero Pro WiFi System (3-pack) comes with three eeros and is made for homes with 3-5+ bedrooms. Each eero is tri-band and uses TrueMesh technology to enable great WiFi performance and reliability no matter how many devices you use in your home. With two built-in Ethernet ports per eero, eero Pro WiFi Systems are customizable and flexible. Use them wirelessly or plug them directly into computers, gaming devices, and entertainment systems for even better performance. And with eero''s app, you can set up your system in under 10 minutes, share your network with guests, and manage family screen time from anywhere.', 'abcat0503000', 449, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5873/5873518_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5873520', 'eero - Beacon AC - White', 'Upgrade your network with this compact eero beacon. Equipped with dual-band Wi-Fi radios and a 700MHz quad-core processor, this unit connects intuitively with your existing eero TrueMesh system. This eero beacon plugs directly into a standard wall outlet and expands coverage into any room in your home for a seamless streaming experience.', 'abcat0503000', 79.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5873/5873520_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5889900', 'TP-Link - Archer AC1750 Dual-Band Wi-Fi 5 Router - Black', 'Connect to the Internet with this TP-Link Archer C7 router. It works with 2.4GHz and 5GHz bands simultaneously to satisfy your bandwidth requirements, and three high-quality external antennas increase the signal distance without sacrificing speed. This TP-Link Archer C7 router has one WAN port and four LAN ports for wired connections.', 'abcat0503000', 79.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5889/5889900_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6040713', 'NETGEAR - 5-Port 10/100/1000 Gigabit Ethernet Unmanaged Switch - Blue', 'This NETGEAR Gigabit unmanaged switch helps businesses cost effectively expand their network to Gigabit speeds and high port counts. The GS105 switch comes with 5 Gigabit copper ports in a desktop metal case and is wall-mountable. This switch is energy-efficient, built to last, and rigorously tested to provide the reliability businesses need. 802.1p traffic prioritization and jumbo frame support allow for seamless integration with sophisticated networks.', 'abcat0503000', 45.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6040/6040713_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6058901', 'NETGEAR - 32 x 8 DOCSIS 3.0 Cable Modem - Black', 'The CM700 DOCSIS 3.0 High Speed Cable Modem, with speeds up to 1.4 Gbps and 32X faster than DOCSIS 2.0 devices, is ideal for streaming or gaming. It features a Gigabit Ethernet port and it''s CableLabs DOCSIS 3.0 Certified to work with cable Internet XFINITY from Comcast, Spectrum, Cox and more.', 'abcat0503000', 107.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6058/6058901_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6059000', 'NETGEAR - Nighthawk AC1900 Dual-Band WiFi USB 3.0 Adapter - Black', 'NETGEAR Nighthawk AC1900 WiFi USB 3.0 adapter wirelessly connects your laptop or desktop computer to the next-gen 802.11ac technology with WiFi speeds up to 1.9Gbps. Connect the adapter to a USB 3.0 port and is compatible with next generation WiFi devices and compatible with 802.11ac/n and all legacy WiFi devices.', 'abcat0503000', 84.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6059/6059000_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6092533', 'NETGEAR - AC600 Dual-Band WiFi USB Mini Adapter - Black', 'The NETGEAR AC600 WiFi Dual Band Adapter wirelessly connects your notebook or desktop computer to an 11ac network for applications such as lag-free, HD streams throughout your home, online gaming and a secure and reliable connection to the Internet. It is compatible with next generation WiFi devices and backward compatible with 802.11 a/b/g/n devices. The AC600 WiFi Adapter delivers speeds up to 150/433 Mbps and dual band WiFi technology reduces interference for better connections to more WiFi devices.', 'abcat0503000', 49.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6092/6092533_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6156904', 'NETGEAR - Nighthawk X6S AC4000 Tri-Band Wi-Fi 5 Router - Black', 'The Nighthawk X6S AC4000 Router, with breakthrough Tri-band WiFi 5 and multi-user MIMO (MU-MIMO) is ideal for simultaneous streaming to many WiFi devices in your home. The X6S offers the fastest combined WiFi speed up to 4Gbps, and is powered by a powerful 64-bit, dual core 1.8GHz processor with three offload processors. Enjoy fastest WiFi speed throughout your home with less lag and less buffering as you game, stream and surf. Access and control your router from anywhere using features such as NETGEAR Nighthawk App, ReadyCLOUD and OpenVPN. NETGEAR Armor - Advanced cyber threat protection for your home and all your devices. Control your home network with voice commands using Amazon Alexa and the Google Assistant.', 'abcat0503000', 279.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6156/6156904_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6162241', 'F-Secure - SENSE Wi-Fi Router', 'Connect and secure every device in your home with this F-Secure SENSE smart home Wi-Fi router. The security router keeps your phones, tablets and computers safe from malicious attacks with a built-in firewall, while antivirus technology constantly scans for viruses. Use this F-Secure SENSE smart home Wi-Fi router with the compatible SENSE app to protect devices outside your home network.', 'abcat0503000', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6162/6162241_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6174428', 'NETGEAR - Orbi Pro Business AC3000 Tri-Band  Wi-Fi System (2-pack) - White', 'Blanket your growing business with secure, reliable, and blazing fast WiFi with Orbi Pro. Orbi Pro works for small offices, cafes, retail, and more. Orbi Pro''s Tri-band AC3000 WiFi creates a fast, dedicated wireless connection between the Orbi Pro Router and Satellite similar to a wired Ethernet connection without having to run an Ethernet cable between them.', 'abcat0503000', 499.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6174/6174428_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6178208', 'Linksys - RE9000 AC3000 MU-MIMO Wi-Fi Range Extender - Black', 'Extend your next-gen AC Wi-Fi connection in hard-to-reach locations of your home such as the backyard, garage, or bedroom, so you can get blazing AC3000 Wi-Fi speeds to Smart TVs, Blu-ray Disc players, iPads, tablets, laptops, and smartphones. Powerful amplifiers and four high-performance external antennas deliver maximum power and range, allowing everyone in your family to enjoy 4K/HD movie streaming, simultaneous online gaming, social media, and more.The Max-Stream RE9000 tri-band range extender helps you get the most out of your home Wi-Fi by delivering faster speeds than dual-band range extenders. Dedicated backhaul technology maximizes Wi-Fi speeds by assigning a single, dedicated 5 GHz Wi-Fi band to your router. This frees up the remaining two bands to focus exclusively on your streaming media players, game consoles, and other connected devices, so you''ll enjoy full-strength Wi-Fi without slowdown or degradation.', 'abcat0503000', 111.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6178/6178208_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6190755', 'NETGEAR - Nighthawk Pro Gaming AC2600 Dual-Band Wi-Fi Router', 'Enjoy seamless connectivity when playing online games with this Netgear Nighthawk Pro gaming router. Local connection options and the ability to choose preferred servers help limit game lag, while the Internet utilization monitor lets you keep track of devices that might be using too much bandwidth. With a customizable dashboard, this Netgear Nighthawk Pro gaming router shows usage data and other key details so you can optimize your gaming experience.', 'abcat0503000', 249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6190/6190755_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6203586', 'NETGEAR - Powerline 2000 + Extra Outlet', 'Convert your home electrical system to an internet network with this NETGEAR Powerline 2000. It plugs into any outlet and accepts a network connection, and it lets you access up to Gigabit wired speeds in any room. This NETGEAR Powerline 2000 includes a standard outlet, so it doesn''t even keep you from accessing electricity.', 'abcat0503000', 119.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6203/6203586_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6209705', 'Linksys - Velop AC2200 Tri-Band Mesh Wi-Fi 5 System (3 Pack) - Black', 'Create a reliable wireless network at home with this Linksys Wi-Fi system. It offers up to 6,000 sq. ft. of coverage, so it''s suitable for a large home, and its Tri-Band technology delivers faster speeds for multiple devices by balancing loads effectively. This Linksys Wi-Fi system works with Amazon Alexa to control the unit with simple voice commands.', 'abcat0503000', 239.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6209/6209705_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6215341', 'Linksys - Velop AC1300 Dual-Band Mesh Wi-Fi 5 System (3 Pack) - White', 'Velop with Intelligent Mesh&#8482; Technology is an award-winning family mesh Wi-Fi system created to work seamlessly together. Mix and match nodes with different speeds to modify performance or interchange colors to coordinate with your home style. Regardless of shape, size, or wherever your Internet comes in, Velop can be customized to your home. Which makes it easy to add more nodes as your home and family expand. Unlike traditional routers with range extenders, each node provides a powerful Wi-Fi signal throughout your entire home. It continuously self-organizes and optimizes to find the fastest path to the Internet for seamless Wi-Fi everywhere. Individual nodes may be connected wirelessly or by Ethernet for fast, reliable connection. This is an ultrasimple and powerful system that uses only one Wi-Fi network name and password to give you seamless and secure Wi-Fi. And leading-edge security lets you block content and easily pause the Internet for dinner or homework. It works with all Internet service provider supplied equipment and speeds, and its simple app-based setup will get you up and running in minutes.', 'abcat0503000', 229.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6215/6215341_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6238449', 'ASUS - AC2600 Dual-Band Wi-Fi Router - Blue/white', 'Manage your home network with this dual-band ASUS Blue Cave wireless router. It uses Intel Wi-Fi and 802.11ac 4x4 technology for advanced network throughput, and it delivers blazing-fast data speeds of up to 2600 Mbps for optimal performance. This ASUS Blue Cave wireless router is built to perform, thanks to its dual-core Intel CPU.', 'abcat0503000', 79.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6238/6238449_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6242800', 'eero - Beacon AC - White', 'Upgrade your network with this compact eero beacon. Equipped with dual-band Wi-Fi radios and a 700MHz quad-core processor, this unit connects intuitively with your existing eero TrueMesh system. This eero beacon plugs directly into a standard wall outlet and expands coverage into any room in your home for a seamless streaming experience.', 'abcat0503000', 99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6242/6242800_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1802042', 'Sunpak - PlatinumPlus 5858D 58" Tripod - Black', 'This Sunpak PlatinumPlus 5858D 620-585BB tripod stabilizes your camera or camcorder when taking self-portraits, family photos and more to ensure sharp, detailed images. The 3-way pan head enables simple adjustments, so you can frame shots to your liking.', 'abcat0410000', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1802/1802042_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6251683', 'Motorola - MB7621 24x8 DOCSIS 3.0 Cable Modem 1029 Mbps - Black', 'The Motorola MB7420 high-speed 24x8 DOCSIS 3.0 cable modem supports speeds up to 1029 Mbps, twenty-four times faster than DOCSIS 2.0. A Full-Band Capture digital tuner ensures a faster, more reliable Internet. This attractive, compact design minimizes shelf space, improves cooling, and extends product life while looking great in any home or office. Connects to a computer, HDTV, game station, or wireless router. (This cable modem does not have a built-in wireless router or VoIP telephone adapter.)', 'abcat0503000', 89.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6251/6251683_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6253025', 'ASUS - USB2.0 Bluetooth4.0 Smart Ready USB adapter - Black', 'Bring wireless connectivity to your device with this ASUS USB Bluetooth adapter. Bluetooth 4.0 technology allows cable-free data transfer and streaming, and the compact design offers portability. This ASUS USB Bluetooth adapter has a USB port for use with a variety of computers, printers and smartphones, and full backward compatibility supports connection to older electronics.', 'abcat0503000', 15.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6253/6253025_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6258091', 'Motorola - MM1000 MoCA Adapter for Ethernet - Black', 'The Motorola MM1000 2.0 MoCA Adapter is a great choice if you want to use your home''s coaxial cable wiring to provide a high-speed reliable Ethernet connection between your router and a remote device. Use the MM1000 to connect your router to an HDTV, computer, game station, wireless extender, or other device with an Ethernet port. The MM1000 offers dependable speeds up to 1,000 Mbps, typically much faster and more reliable than WiFi, and uses the same coax cable as your TV and/or Internet.', 'abcat0503000', 69.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6258/6258091_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6290772', 'ARRIS - SURFboard AC1600 Dual-Band Router with 16 x 4 DOCSIS 3.0 Cable Modem - Black', 'Build your home network with this ARRIS SURFboard dual-band router. With Wi-Fi speeds up to 1600 Mbps and a 1.2 GHz processor, it has the power to support multiple devices for streaming and downloading anywhere in your home. This ARRIS SURFboard dual-band router comes with a mobile app for easy connection.', 'abcat0503000', 113.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6290/6290772_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6292280', 'NETGEAR - Nighthawk AX6000 Wi-Fi 6 Router', 'The NETGEAR Nighthawk AX6000 12-Stream WiFi Router is powered by the industry&#8217;s latest 802.11ax WiFi standard with 4 times increased data capacity to handle today and tomorrow&#8217;s growing home network. Blazing-fast combined WiFi speeds up to 6Gbps and AX optimized 64bit 2.2GHz Quad-core processor powers smart home applications, ultra-smooth 4K UHD streaming, online gaming, and more. Keep your family safe from cyber threats with NETGEAR Armor anti-virus and data theft protection for your home and all of your smartphones and computers. Free trial included.', 'abcat0503000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6292/6292280_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6295316', 'TP-Link - AC1200 Dual Band Wi-Fi Range Extender - White', 'Expand the reach of your wireless access point with this TP-Link Wi-Fi range extender. It supports speeds up to 1.2 Gbps and operates on both 5GHz and 2.4GHz for stable, flexible connections from multiple devices. This TP-Link Wi-Fi range extender''s signal light helps you find an optimal placement for boosting your home or small-office signal.', 'abcat0503000', 49.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6295/6295316_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6295317', 'TP-Link - AC750 Wi-Fi Range Extender - White', 'Connect dead zones with this TP-Link Wi-Fi range extender. It generates combined speeds of up to 750Mbps for quick download times, and it operates over either 2.4GHz or 5.0GHz bands for a more stable wireless experience. This TP-Link Wi-Fi range extender works with any router for an exceptional connection versatility.', 'abcat0503000', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6295/6295317_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6298663', 'Motorola - MG7700 24x8 DOCSIS 3.0 Cable Modem + AC1900 Router - Black', 'The Motorola MG7700 24x8 DOCSIS 3.0 cable modem + AC1900 dual-band (2.4GHz and 5GHz) Wi-Fi Gigabit router with four Gigabit (GigE) Ethernet ports, power boost Wi-Fi amplifiers, firewall security, and more. Power Boost technology amplifies the wireless signal to the limit set by the Federal Communications Commission (FCC) to deliver higher WiFi speeds and extend the WiFi range. AnyBeam WiFi beamforming at 2.4 GHz and 5 GHz focuses the wireless signal on your wireless devices to further enhance wireless performance.', 'abcat0503000', 174.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/6298/6298663ld.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6309260', 'Linksys - AC2200 Tri-Band Mesh WiFi 5 Router - Black', 'The MR8300 Max Stream&#8482; AC2200 is a high-performance Tri-Band router. Perfect for households that thrive on entertainment, it delivers up to 2.2 Gbps of superior speed throughout your entire home. The Tri-Band and MU-MIMO technology make it ideal for simultaneous streaming of HD movies, online gaming, video calling and supporting all of your smart home devices. MR8300 also grows as your needs do. With its built-in mesh Wi-Fi, instead of investing in a new router, you can expand coverage by simply adding Linksys Velop&#8482; Mesh Wi-Fi nodes for seamless Wi-Fi everywhere. The MR8300 serves as the master router and must connect directly to your modem to create your network. Sets up in minutes with the Linksys app.', 'abcat0503000', 129.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6309/6309260_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6317625', 'ARRIS - SURFboard 32 x 8 DOCSIS 3.0 Voice Cable Modem for Xfinity - Black', 'Keep your home office or small business connected with this ARRIS SURFboard cable modem for Xfinity Internet & Voice. Dual VoIP ports support two telephone lines, and the DOCSIS 3.0 interface provides up to 1.4 Gbps of network speed for fast data downloads. Supply this ARRIS SURFboard cable modem with backup batteries for seamless performance during power outages.', 'abcat0503000', 149, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6317/6317625_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6320553', 'ARRIS - SURFboard Dual-Band AC2350 with 32 x 8 DOCSIS 3.0 Cable Modem - Black', 'Enjoy effortless speed with this SURFboard cable modem and Wi-Fi router from Arris. Thrilling network speeds as high as 1.4 Gbps and wireless speeds of up to 2350 Mbps make gaming, streaming and downloading fast, while McAfee Secure Home Internet helps keep your connection safe. This SURFboard cable modem and Wi-Fi router includes four 1GB Ethernet ports and is compatible with most cable internet providers in the United States.', 'abcat0503000', 219, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6320/6320553_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6321916', 'ASUS - AX6000 Dual Band Wi-Fi 6 Router', 'Get fast, interruption-free Wi-Fi capabilities with this ASUS dual-band router. Speeds of up to 6000 Mbps mean less waiting for games and videos to load, and the Trend Micro security technology shields your devices from potential breaches. This ASUS dual-band router is compatible with Amazon Alexa, making it easy to integrate your network connection into your smart home setup.', 'abcat0503000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6321/6321916_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6321917', 'ASUS - ROG Rapture GT-AX11000 Tri-band WiFi 6  Gaming Router, 2.5G Port', 'Make sure your wireless connection reaches every room in your home with this ASUS ROG Rapture gaming router. Speeds of up to 11000 Mbps deliver interruption-free connectivity throughout intense games and binge-watching sessions. Built-in network security defends against potential breaches, and the 4X capacity makes this ASUS ROG Rapture gaming router ideal for households running multiple devices.', 'abcat0503000', 431.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6321/6321917_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6324350', 'Linksys - Velop Plug-In AC1300 Dual-Band Wi-Fi Mesh Extender', 'Velop is a flexible Whole Home Mesh Wi-Fi system of modular nodes which can be configured to provide a flawless signal for any home. The new plug-in node is an easy and convenient way to expand coverage to any area of your home. Simply add plug-in nodes to your existing Velop system for a seamless connection to all your devices. They fit all wall sockets, and the sleek design only uses a single outlet and complements any home environment. Powered by Intelligent Mesh technology, you''ll always be on the fast path to the Internet.', 'abcat0503000', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6324/6324350_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6324965', 'TP-Link - Archer AX6000 Dual-Band Wi-Fi 6 Router - Black', 'Enjoy high speeds across multiple devices with this TP Link Archer AX6000 Dual-Band Wi-Fi 6 Router. With four times the throughput, it connects through 11 ports, and the eight precisely targeted, high-gain antennas deliver strong coverage throughout your home. This TP Link Archer AX6000 Dual-Band Wi-Fi 6 Router eliminates interference to provide smooth, stable signal connections.', 'abcat0503000', 279.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6324/6324965_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6328665', 'NETGEAR - Dual-Band Wireless-AC USB Network Adapter - Black', 'Upgrade home or office networks with this NETGEAR smart router. It delivers high-speed dual-band Wi-Fi and Gigabit Ethernet connections for enhanced gaming and video streaming, and the external antennas improve coverage for larger spaces. This NETGEAR smart router works with the Nighthawk app for effortless operation and control via smartphones.', 'abcat0503000', 39.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6328/6328665_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6328666', 'NETGEAR - AC1750 Dual-Band Wi-Fi Range Extender', 'Extend your existing Wi-Fi with NETGEAR AC1750 Wi-Fi mesh extender, and get the speeds that you pay for throughout your home. This mesh extender improves coverage and works with your home Wi-Fi to create a powerful Wi-Fi system. It includes such mesh features as Smart roaming and one Wi-Fi name. Easily connect all your smart home devices to one network with no new Wi-Fi names and passwords needed. Move from room to room while streaming video on your mobile device without any interruptions. Connect a wired device, such as a Blu-ray player, game console, smart TV, or streaming player, to your Wi-Fi network with one Gigabit Ethernet port. Other powerful features, including MU-MIMO and Smart Connect, ensure that every device is assigned the fastest available Wi-Fi connection. Easy setup with a touch of a button. Boost your Wi-Fi to the extreme with this wall-plug Wi-Fi mesh extender. It works with your existing Wi-Fi router, gateway, or ISP-provided gateway.', 'abcat0503000', 129.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6328/6328666_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6332928', 'Circle - Home Plus - Parental Controls - Internet & Mobile Devices - Wifi, Android & iOS - Limit Screen Time - 1-Yr Subscription - White', 'Keep your kids safe online with this Circle Home Plus monitoring setup. The included device uses your router to manage every device on your network, and Circle App makes it simple to limit screen time, filter content, and check browsing histories. This Circle Home Plus monitoring setup is easy to set up and lets you create custom settings for each family member.', 'abcat0503000', 129.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6332/6332928_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6333496', 'ALC - Network Extender - White', 'Enhance Wi-Fi range easily with this ALC Wi-Fi repeater. The built-in Ethernet port allows for an extra connection, offering added convenience, and the 802.11b/g/n compatibility makes it suitable for use with a range of routers . This ALC Wi-Fi repeater can be quickly plugged into a standard outlet for rapid installation.', 'abcat0503000', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6333/6333496_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6335140', 'Motorola - MT7711 24x8 DOCSIS 3.0 Modem + AC1900 Router + Voice - Black', 'The Motorola MT7711 combines an ultra-fast DOCSIS 3.0 cable modem + AC1900 WiFi router + 2 phones lines for use with Xfinity Voice service only. Certified for Comcast Xfinity Internet and Voice service and recommended for cable internet plans with speeds up to 600 Mbps. Features 4 Gigabit Ethernet ports for wired connections. Delivers up to 1900 Mbps wireless speed. Power Boost, Range Boost, and AnyBeam WiFi beamforming enable quality streaming, gaming, and connecting throughout the home. Enjoy crystal-clear calling and enhanced features like caller ID, call forwarding, conference calling, and more. Save up to $168 per year on cable modem rental fees (savings described is for Comcast Xfinity service). Comes with a 2-year warranty and free support from our USA team of connectivity technicians. NOT compatible with Verizon, AT&T, CenturyLink, DSL providers, DirecTV, DISH and non-Xfinity voice services.', 'abcat0503000', 189.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6335/6335140_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6337086', 'ASUS - RT-N300 B1 N300 Single Band Wi-Fi Router', '3-in-1 Router Especially Designed for Small Business and Home Network ASUS RT-N300 B1 is a 300Mbps Wireless N Router with both wired and wireless network connections designed specifically for small business and home office networking use. With 2T2R MIMO Technology and the external high-performance antenna, the RT-N300 B1 creates an extended coverage area with advanced wireless performance, making it ideal for streaming HD video, placing VoIP calls and online gaming. With the ASUS unique Quick Internet Setup and Graphical User Interface, the RT-N300 B1 is easy for anyone to install and manage, even for novices!', 'abcat0503000', 31.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6337/6337086_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6341861', 'ARRIS - SURFboard DOCSIS 3.1 Cable Modem & Dual-Band Wi-Fi Router for Xfinity and Cox service tiers - Black', 'Maximize internet speeds with this ARRIS SURFboard wireless cable modem. Four Gb Ethernet ports offer rapid wired connections, and advanced wireless technology delivers fast long-range 2.4GHz and 5GHz Wi-Fi connections. This ARRIS SURFboard wireless cable modem offers easy plug-and-play installation and lets you manage networks with voice commands via Amazon Alexa.', 'abcat0503000', 199.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6341/6341861_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1899028', 'Sigma - 35mm f/1.4 DG HSM Art Standard Lens for Nikon - Black', 'Enjoy high-speed shooting with your compatible Nikon digital camera using this Sigma 340306 35mm f/1.4 DG standard lens that features HSM (hyper-sonic motor) technology for fast autofocusing. SLD and FLD (fluorite) glass elements ensure sharp images.', 'abcat0410000', 849.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1899/1899028_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6343644', 'Sonos - Geek Squad Certified Refurbished Boost Wi-Fi Range Extender - White', 'Geek Squad&#174; Certified Refurbished products are thoroughly, painstakingly and lovingly tested, so you can be sure that your device will work right, right away. Learn more about Geek Squad&#174; Certified Refurbished products.Extend wireless audio range with this Sonos Boost network extender. Capable of creating a dedicated wireless network, this network extender bypasses existing Wi-Fi and ensures wireless audio signals arrive unimpeded. This Sonos Boost network extender has three internal antennas that improve Wi-Fi coverage by broadcasting signals through walls and ceilings in all directions.', 'abcat0503000', 79.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6343/6343644_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6343646', 'Sonos - Geek Squad Certified Refurbished BRIDGE™ Wi-Fi Range Extender', 'Geek Squad&#174; Certified Refurbished products are thoroughly, painstakingly and lovingly tested, so you can be sure that your device will work right, right away. Learn more about Geek Squad&#174; Certified Refurbished products.Provide multi-room media access with this Sonos ZoneBridge router. The two-port Ethernet switch connects to a router, boosting wireless coverage to ZonePlayers and Controllers. Press the single button to create an AES encrypted wireless network, protecting your data from unauthorized access. This Sonos ZoneBridge router weighs 0.59 lbs. for easy portability, and the front-panel lights offer prompt status updates.', 'abcat0503000', 49.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6343/6343646_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6345931', 'TP-Link - Archer AC1200 Dual-Band Wi-Fi Router - Black', 'Create a reliable connection at work or at home with this TP-Link wireless MU-MIMO Gigabit router. The total available bandwidth capability reaches up to 1200Mbps so everyone can access the web with high speed. This TP-Link wireless MU-MIMO Gigabit router includes four external antennas and an internal one for optimal coverage.', 'abcat0503000', 49.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6345/6345931_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6345936', 'NETGEAR - Orbi Outdoor AC3000 Tri-band Wi-Fi Range Extender - White', 'This Orbi outdoor Wi-Fi mesh extender or add-on satellite extends your Wi-Fi outdoors. Works with your existing Wi-Fi router. The weather-resistant design is built to withstand rain, sun, snow, dust, or sprinklers. Work in the garage or garden, and keep your devices connected with a strong Wi-Fi signal.', 'abcat0503000', 319.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6345/6345936_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6345937', 'NETGEAR - Nighthawk AC3200 Wi-Fi Router with DOCSIS 3.1 Cable Modem', 'This NETGEAR&#174; Nighthawk&#174; X4S AC3200 Wi-Fi DOCSIS&#174; 3.1 ultra-high-speed cable modem router works with the fast DOCSIS&#174; 3.0 and is ready for new DOCSIS&#174; 3.1 Gigabit Internet speeds. The NETGEAR X4S DOCSIS&#174; 3.1 cable modem router with 32 x 8 channel bonding (in DOCSIS&#174; 3.0 mode) offers fast Internet speeds that rival the speed of fiber. Enjoy a quality experience for streaming multiple HD-quality videos to multiple devices, VR gaming and more. Ideal for fast Internet cable services, such as XFINITY&#174; from Comcast and Cox Internet plans.', 'abcat0503000', 399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6345/6345937_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6345940', 'NETGEAR - Nighthawk 32 x 8 DOCSIS 3.1 Cable Modem - Black', 'The Nighthawk CM1200 Multi-Gig speed cable modem by NETGEAR supports link aggregation to deliver true Multi-Gig Internet speeds. The future-proof cable modem supports fast Internet speeds. This DOCSIS 3.1 cable modem is ready for any of today''s service plans and future upgrades.', 'abcat0503000', 239.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6345/6345940_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6350969', 'TP-Link - 5-Port 10/100/1000 Gigabit Switch - Gray', 'Expand your network to rooms without a power outlet using this TP-Link five-port Gigabit desktop switch. Port priority function keeps the system safe by cutting power to the lowest-priority PoE port when a power overload is detected. This TP-Link five-port Gigabit desktop switch is plug and play, bypassing the need for complex configuration.', 'abcat0503000', 49.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/6350/6350969_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6351103', 'TP-Link - Archer AC4000 Tri-Band Wi-Fi 5 Router - Black', 'Improve your home network with this TP-Link Archer C4000 tri-band Wi-Fi router. The two 5GHz bands provide faster data rates with speeds of up to 1625 Mbps, and a 1.8GHz processor maximizes performance and minimizes lag. This TP-Link Archer C4000 tri-band Wi-Fi router uses RangeBoost and beamforming technologies to extend Wi-Fi coverage and improve reliability.', 'abcat0503000', 199.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6351/6351103_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6353944', 'ASUS - AC1200 Dual-Band Ai-Mesh Range Extender - White', 'Broaden your network connection with this ASUS dual-band Wi-Fi range extender. Smart LED indicators help identify the best position for optimized performance, while dual wireless bands offer transfer rates of up to 300Mbps and 433Mbps at 2.4GHz and 5.0GHz for efficient, fast operation. Ensure rapid setup with a push of the WPS button on this ASUS dual-band Wi-Fi range extender.', 'abcat0503000', 59.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6353/6353944_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6353952', 'ASUS - RT-AC86U AC2900 Dual-Band Wi-Fi Router with Life time internet Security - Black', 'Play bandwidth-intensive online games seamlessly with this ASUS dual-band Gigabit Wi-Fi gaming router. NitroQAM technology provides up to 2917 Mbps of speed for smooth 4K streaming by multiple online gamers, and WTFast game accelerator and Adaptive QoS ensure optimal packet routing for low-latency gaming. With AiProtection Pro commercial-grade security, this ASUS dual-band Gigabit Wi-Fi gaming router enables safe network access.', 'abcat0503000', 174.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6353/6353952_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6356336', 'NETGEAR - Orbi Pro Business AC3000 Tri-Band Wi-Fi Range Extender', 'The NETGEAR Orbi Pro ceiling add-on satellite is a perfect addition to the Orbi Pro family for discreet and high-performance tri-band full Mesh Wi-Fi deployments in small connected businesses. Orbi Pro full Mesh Wi-Fi allows seamless roaming between the satellites with no drop in bandwidth for a perfect experience throughout your business. The Orbi Pro router is required for operation.', 'abcat0503000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6356/6356336_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6356344', 'NETGEAR - 8-Port 10/100/1000 Gigabit Ethernet Smart Managed Plus Switch', 'GS110EMX comes with 8 Gigabit Ethernet ports and 2 10-Gigabit/Multi-Gigabit (5-speed) ports that provide either 100Mb, 1Gb, 2.5Gb, 5Gb, or 10Gb connectivity. Each 5-speed port automatically detects which speed is needed by the connected device and provides the adequate speed. Thanks to the unique combination of Gigabit and 5-speed ports GS110EMX offers a full line-rate connectivity to your network.', 'abcat0503000', 249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6356/6356344_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6358170', 'ARRIS - SURFboard mAX Pro Wireless-AX11000 Tri-Band Mesh Wi-Fi 6 System - Black', 'Increase your data capacity to handle all your home network needs with this ARRIS SURFboard mAX Pro Wi-Fi system. The latest Wi-Fi technology, 802.11ax, delivers faster speeds and a wider range to accommodate more users, while the quad-core processors support high-bandwidth applications like simultaneous 4K streaming. This Alexa-compatible ARRIS SURFboard mAX Pro Wi-Fi system features four Ethernet ports for flexible connectivity to WAN networks.', 'abcat0503000', 544.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6358/6358170_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6358171', 'ARRIS - SURFboard mAX Pro Wireless-AX11000 Tri-Band Mesh Wi-Fi 6 Router - Black', 'Get the most of your internet with this ARRIS SURFboard mAX Pro router. The tri-band Wi-Fi 6 mesh system delivers high-speed networking to every room in your home, providing multiple gigabit connectivity for 4K televisions, online gaming and VR. Manage and set up this ARRIS Surfboard Max Pro router easily with the SURFboard mAX Manager app.', 'abcat0503000', 279.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6358/6358171_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1032001', 'Nikon - AF-S NIKKOR 20mm f/1.8G ED Ultra Wide Angle Lens for Select F-Mount Cameras - Black', 'Compatible with most Nikon F-Mount cameras, this Nikon AF-S NIKKOR 20051 ultra wide angle lens makes it easy to take breathtaking photos with a broad perspective. Two ED glass elements and 2 aspherical elements help ensure high-quality images.', 'abcat0410000', 799.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1032/1032001_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1097775', 'Rechargeable Lithium-Ion Battery for Sony NP-FW50', 'Power up your Alpha digital camera with this high-capacity lithium-ion battery that features 7.2V of power.', 'abcat0410000', 59.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1097/1097775_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1230546', 'Sony - 16mm f/2.8 E-Mount Wide-Angle Lens - Silver', 'This lens features an 83&#176; field of view for enhanced low-light performance and quiet autofocus operation to help capture the perfect shot with Sony Alpha NEX E-mount cameras. Learn about different types of lenses &#8250;', 'abcat0410000', 249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1230/1230546_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1305719', 'Olympus - M.Zuiko Digital ED 60mm f/2.8 Macro Lens for Select Cameras - Black', 'Capture clear, detailed close-ups with this Olympus M.Zuiko V312010BU000 digital ED macro lens that features a 60mm focal length and 20&#176; angle of view to help you achieve the shot you want. The dust- and splash-resistant design ensures lasting use.', 'abcat0410000', 499.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1305/1305719_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1319376', 'Fujifilm - instax mini Rainbow Instant Film', 'Designed for use with most Fujifilm 16437401 instax mini camera models, this Fujifilm Rainbow film features an ISO 800 speed to produce high-quality images. The notation area lets you add captions to your photos.', 'abcat0410000', 14.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/1319/1319376_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1362455', 'Sony - LCSU21 Soft Carrying Case - Black', 'With an adjustable internal partition, mesh pouches and 3 external pouches, this Sony LCSU21 case lets you take your camera or camcorder and accessories with you on the go. The shoulder strap makes it easy to transport your gear.', 'abcat0410000', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1362/1362455_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1368051', 'Canon - EF 100-400mm f/4.5-5.6L IS II USM Telephoto Zoom Lens - White', 'Capture crisp images with this Canon L-Series 9524B002 100-400mm super telephoto lens, which is compatible with most Canon cameras with an EF mount and features standard, panning and exposure-only optical image stabilization modes to promote clear shots.', 'abcat0410000', 2399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1368/1368051_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1434383', 'Nikon - AF-S NIKKOR 14-24mm f/2.8G ED Ultra-Wide Zoom Lens - Black', 'Nikon AF-S NIKKOR 14&#8211;24mm f/2.8G ED Ultra-Wide Zoom Lens: Unleash your creativity with an ultra-wide lens that delivers impeccably sharp images even in very low lighting conditions. The rich contrast and saturation offer unparalleled performance for shooting landscapes, cityscapes, interiors and group photos in small spaces. A nearly fisheye angle of view allows you to capture everything from sweeping scenic panoramas to close-up photos with an intense sense of depth &#8212; all without distortion or loss of sharpness throughout the entire depth of field.', 'abcat0410000', 1749.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1434/1434383_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1434392', 'Nikon - AF-S NIKKOR 16-35mm f/4G ED VR Ultra-Wide Zoom Lens - Black', 'This camera lens features a 5.8x zoom for enhanced clarity and sharpness. The Nikon Silent Wave Motor enables fast, accurate and quiet autofocus.', 'abcat0410000', 1099.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1434/1434392_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1434407', 'Nikon - AF-S DX Micro Nikkor 85mm f/3.5G ED VR Telephoto Lens for DX SLR Cameras - Black', 'This camera lens features a 5.8x zoom ratio with Nikon Vibration Reduction for sharp images and videos. The Nikon Super Integrated Coating offers optimal color consistency and reduced flare. Learn about different types of lenses &#8250;', 'abcat0410000', 559.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1434/1434407_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1532171', 'Energizer - Rechargeable Li-Ion Replacement Battery for Canon NB-6L', 'Restore power to your Canon PowerShot digital camera with this rechargeable Energizer ENB-C6L lithium-ion battery, which delivers 7.4V of power and features a 750 mAh capacity to keep your device ready for use.', 'abcat0410000', 21.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1532/1532171_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1532214', 'Energizer - Rechargeable Li-Ion Replacement Battery for Nikon EN-EL19', 'Provide your compatible Nikon digital camera with a reliable charge with this Energizer ENB-NEL19 lithium-ion battery, which offers 3.7V and features a 700 mAh capacity for long-lasting power. The memory-free design helps ensure charging efficiency.', 'abcat0410000', 22.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1532/1532214_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1532223', 'Energizer - Rechargeable Li-Ion Replacement Battery for Canon NB-11L', 'Compatible with select Canon PowerShot digital cameras, this Energizer ENB-C11L lithium-ion battery delivers 3.7V of power and offers a 600 mAh capacity, making it easy to keep your camera ready to capture special moments.', 'abcat0410000', 20.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1532/1532223_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1532311', 'Energizer - USB 3.0/2.0 Memory Card Reader - Black', 'Quickly and easily transfer stored images between select memory cards (not included) and your PC or Mac computer with this Energizer ENR-CRP3SD memory card reader that features a USB 3.0/2.0 interface for simple connectivity.', 'abcat0410000', 12.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1532/1532311_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1532426', 'Energizer - Rechargeable Lithium-Ion Replacement Battery for Sony NP-BN1', 'Keep a spare battery on hand for your digital camera with this Energizer digital replacement battery. Compatible with a range of digital cameras from Sony, Canon and others, this slim battery slides easily into a pocket of your pack. This Energizer digital replacement battery is also compatible with most original lithium-ion camera chargers.', 'abcat0410000', 22.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1532/1532426_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1532532', 'Energizer - Rechargeable Li-Ion Replacement Battery for Sony NP-BD1', 'With this Energizer ENB-SBD lithium-ion battery, you can keep your compatible Sony digital camera ready for use. The memory-free battery delivers 3.6V of power and features a 650 mAh capacity to offer a long-lasting, reliable charge.', 'abcat0410000', 22.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1532/1532532_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1579262', 'Nikon - AF-S DX NIKKOR 18-140mm f/3.5-5.6G ED VR Zoom Lens for Select DX-Format Digital Cameras - Black', 'Cover every shot with this all-in-one Nikon 18-140mm camera lens that lets you zoom from wide-angle to telephoto without missing a beat. Extra-low Dispersion (ED) glass creates amazing contrast, and the zoom enables crisp images as close as 1.48 feet away. This Nikon 18-140mm camera lens features a Silent Wave Motor (SWM) for super quiet clicks.', 'abcat0410000', 499.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1579/1579262_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1599004', 'Sony - 18-200mm f/3.5-6.3 Alpha E-Mount Lens for Alpha NEX DSLR Cameras - Silver', 'This zoom lens is compatible with Sony Alpha NEX DSLR cameras and features direct manual focus and Optical Steady Shot (OSS) image stabilization for crystal-clear images. The 7 aperture blades deliver sharp shots.', 'abcat0410000', 899.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1599/1599004_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1614323', 'SanDisk - Extreme PRO 64GB CompactFlash (CF) Memory Card', 'With a generous 64GB capacity, this SanDisk Extreme Pro CF memory card offers plenty of space for storing photos and high-definition and 4K videos. The RTV silicone interior coating defends your data against shocks and vibration.', 'abcat0410000', 69.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1614/1614323_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1687281', 'Sony - 35mm f/1.8 Prime Lens for Most NEX E-Mount Cameras - Black', 'With built-in Optical SteadyShot image stabilization, this Sony SEL35F18 35mm prime lens helps you achieve crisp, clear images with your compatible Sony NEX E-mount camera. The 2 motors offer quiet and smooth operation for shooting videos.', 'abcat0410000', 474.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1687/1687281_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1687324', 'Sony - 16-50mm f/3.5-5.6 Retractable Zoom Lens for Most NEX E-Mount Cameras - Black', 'This compact, lightweight Sony SELP1650 16-50mm zoom lens features a retractable mechanism that is ideal for on-the-go photography. The electrically driven POWER ZOOM mechanism extends the lens when the camera is powered on for immediate shooting.', 'abcat0410000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1687/1687324_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1687411', 'Sony - 10-18mm f/4 Wide-Angle Zoom Lens for Most NEX E-Mount Cameras - Black', 'Ideal for landscape photography and emphasizing perspective, this Sony SEL1018 10-18mm wide-angle zoom lens features built-in Optical SteadyShot image stabilization to produce crisp images and videos.', 'abcat0410000', 899.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1687/1687411_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1688823', 'Canon - EF 500mm f/4L IS II USM Super Telephoto Lens for Most EOS SLR Cameras - White', 'Designed for use with most Canon EOS SLR cameras, this Canon EF 5124B002 500mm IS II USM super telephoto lens features 3 image stabilization modes to minimize camera shake. Magnesium and titanium construction offers a lightweight design.', 'abcat0410000', 8999.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1688/1688823_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1712497', 'Sony - Cyber-shot ACCTRDCX Travel DC Charger Kit - Black', 'With Sony&#8217;s Cyber-shot ACCTRDCX you&#8217;re able to shoot for longer when you&#8217;re on the go, thanks to this handy travel charger for Cyber-shot cameras.  Equipped with an additional rechargeable battery pack so you always have a spare, the charger connects via Micro USB to almost any AC or DC source, giving you more power to capture all the moments you don&#8217;t want to forget.', 'abcat0410000', 57.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1712/1712497_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1757296', 'Canon - EF 200-400mm f/4L IS USM Super Telephoto Lens for Most EOS SLR Cameras - White', 'Get close to distant subjects and scenes with this Canon EF 5176B002 200-400mm IS USM super telephoto lens, which is compatible with most Canon EOS SLR cameras and features a built-in 1.4x extender that offers shooting versatility.', 'abcat0410000', 11099.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1757/1757296_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1759116', 'Nikon - SB-300 AF Speedlight External Flash', 'Achieve optimal shots with this Nikon SB-300 AF Speedlight 4810 external flash that is compatible with most Nikon cameras with an accessory hot shoe and features i-TTL (intelligent through-the-lens) flash coverage technology to enhance dramatic lighting.', 'abcat0410000', 149.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1759/1759116_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1786128', 'Canon - EF-S 55-250mm f/4-5.6 IS STM Telephoto Zoom Lens for Select Cameras - Black', 'Snap sharp, vibrant photos at a distance with this Canon EF-S 8546B002 telephoto lens, which features a 55-250mm focal length for flexible zooming and optical image stabilization to reduce the effects of camera shake.', 'abcat0410000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1786/1786128_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1790037', 'Nikon - AF-S NIKKOR 85mm f/1.4G Portrait Lens for Select Cameras - Black', 'Snap gorgeous portrait photos with this Nikon AF-S NIKKOR 2195 lens, which features an f/1.4 maximum aperture and 9 diaphragm blades for sharp shots with a soft background blur. SIC (Super Integrated Coating) and Nano Crystal Coat minimize lens flare.', 'abcat0410000', 1599.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1790/1790037_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1790046', 'Nikon - AF-S NIKKOR 800mm f/5.6E FL ED VR Super-Telephoto Lens for Select Cameras - Black', 'Snap vivid photos at a distance with this Nikon AF-S NIKKOR 2205 lens, which features an 800mm focal length and an included 1.25x teleconverter with ED (Extra-Low Dispersion) glass for sharp photos. SWM (Silent Wave Motor) offers fast, quiet autofocus.', 'abcat0410000', 16299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1790/1790046_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1802024', 'Sunpak - PlatinumPlus 6700M 67" Monopod - Black', 'Capture clear images with help from this Sunpak PlatinumPlus 6700M 620-670BB monopod that features a rubber foot with a retractable spike to provide stable support. The standard mounting plate accommodates a wide variety of cameras and camcorders.', 'abcat0410000', 19.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1802/1802024_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1899151', 'Sigma - 35mm f/1.4 DG HSM Art Standard Lens for Canon - Black', 'Utilizing SLD and FLD (fluorite) glass elements, this Sigma 340101 35mm f/1.4 DG standard lens minimizes axial and chromatic aberration while shooting with your compatible Canon digital camera. HSM (hyper-sonic motor) technology allows fast autofocusing.', 'abcat0410000', 849.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1899/1899151_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1969027', 'Panasonic - DMW-BGGH3 Battery Grip - Black', 'This Panasonic battery grip has an ergonomic design, making it is easy to hold even when shooting several vertical shots. It provides long-lasting battery life and a tripod connector, letting you take hundreds of photos comfortably. The dustproof and splash-proof design and weather-seal make this Panasonic battery grip ideal for outdoor photography.', 'abcat0410000', 190.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1969/1969027_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2015049', 'Fujifilm - instax mini Instant Color Film Twin Pack', 'Shoot crisp images with your Fujifilm 16437396 instax mini camera using these Fujifilm instax mini instant color film cartridges, which feature direct positive sigma crystal emulsion technology for optimal grain quality. The 2-pack lets you keep an extra on hand.', 'abcat0410000', 19.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/2015/2015049_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2037002', 'SanDisk - Extreme 64GB CompactFlash (CF) Memory Card', 'Capture action shots and record Full HD videos with this SanDisk Extreme CompactFlash memory card. The 64GB capacity provides ample storage space for media, and the temperature-resistant and shock-resistant construction withstands harsh environments. This SanDisk Extreme CompactFlash memory card has read speeds of up to 120MB/s and write speeds up to 85MB/s for quick data transfer. Ideal for use with mid-range to high-end DSLR cameras and HD camcorders, the SanDisk Extreme CompactFlash Memory Card delivers first-rate read/write speeds to catch fast action shots and enable quick file transfers. This memory card features video performance guarantee to deliver a minimum sustained recording data rate of 20 Mbps to support high-quality Full HD video (1080p) recording. This memory card provides plenty of storage for Full HD videos and RAW photos.', 'abcat0410000', 62.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2037/2037002_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2209067', 'Rechargeable Lithium-Ion Battery Pack for Canon LP-E10', 'This lithium-ion battery pack will recharge up to 500 times to power your digital camera.', 'abcat0410000', 58.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2209/2209067_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2255056', 'Nikon - SB-700 AF Speedlight External Flash', 'This external flash features 3 light distribution patterns for customized use and automatic color filter identification for ensuring photos are clear and detailed.', 'abcat0410000', 329.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2255/2255056_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2678074', 'Lowepro - Lens Case - Black', 'Transport photography equipment safely with this black Lowepro lens case. The one-piece foam padding offers protection against bumps and scratches, while the interior mesh compartment securely stores a cap. This weather-resistant Lowepro lens case has a lightweight nylon construction for comfortable carrying, and the dual zippers provide quick access to the contents.', 'abcat0410000', 30.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2678/2678074_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3187077', 'Nikon - AF-S DX Micro-NIKKOR 40mm f/2.8G Macro Lens - Black', 'Nikon AF-S DX Micro-NIKKOR 40mm f/2.8G Macro Lens: Expand the creative reach of your DX-format camera and produce eye-catching still photos and HD videos. A great choice for food photography or detailed product shots, this Micro-NIKKOR lens is ideal for general close-ups and yet still versatile enough to shoot portraits and landscapes.', 'abcat0410000', 279.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3187/3187077_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3188049', 'Nikon - AF-S NIKKOR 50mm f/1.8G Standard Lens - Black', 'Nikon AF-S NIKKOR 50mm f/1.8G Standard Lens: A perfect everyday lens for any photographer, the AF-S NIKKOR 50mm f/1.8G offers fast autofocusing combined with an integrated lens coating to deliver clear and crisp images. The wide-open aperture is ideal for low-light shooting and creating images with beautiful background blur.', 'abcat0410000', 219.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3188/3188049_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3201155', 'Rechargeable Lithium-Ion Battery for Nikon EN-EL14a', 'Provide your Nikon digital camera with reliable power using this Nikon EN-EL14a 27126 rechargeable lithium-ion battery, which features 7.2V of power and a 1230 mAh capacity that enable extended shooting.', 'abcat0410000', 46.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3201/3201155_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3325029', 'Lenspen - UltraPRO Lens Cleaner', 'With a nontoxic, liquid-free carbon cleaning formula, this LensPen UltraPRO NLP-1CUP cleaner lets you safely and effectively clean your camera, camcorder and optical lenses, so you can maintain a clear display.', 'abcat0410000', 6.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3325/3325029_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3479212', 'Nikon - AF-S Zoom-NIKKOR 17-35mm f/2.8D IF-ED Wide-Angle Zoom Lens for Select DSLR Cameras - Black', 'Ideal for photojournalism and travel photography, this Nikon NIKKOR 1960 zoom lens features a 17-35mm focal length range and a 2.1x zoom ratio to help you capture distant subjects. The ED (Extra-low Dispersion) glass helps ensure high-quality images.', 'abcat0410000', 1954.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3479/3479212_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3479267', 'Nikon - AF-S NIKKOR 50mm f/1.4G Standard Lens - Black', 'Nikon AF-S NIKKOR 50mm f/1.4G Standard Lens: Suitable for professional and amateur photographers, this is a great lens for travel, events, portraits and general purpose photography. Capture clear images in dim lighting without a flash with the wide-open aperture. Switch seamlessly from automatic to fine manual focusing so you can ensure every detail is spot on.', 'abcat0410000', 449.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3479/3479267_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3479276', 'Nikon - AF-S NIKKOR 35mm f/1.4G Wide-Angle Lens - Black', 'Nikon AF-S NIKKOR 35mm f/1.4G Wide-Angle Lens: Designed for professional and serious amateur photographers, this moderate wide-angle lens is ideal for shooting landscapes, night scenes, interiors, weddings and more. With the fast f/1.4 maximum aperture, you''ll capture clear, beautiful images even after the sun goes down.', 'abcat0410000', 1549.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3479/3479276_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3546034', 'Sony - 55-210mm f/4.5-6.3 Telephoto Lens for Most Alpha E-Mount Cameras - Silver', 'Improve the image quality of your photos with this SONY E 55-210mm lens. The built-in OSS stabilizes moving images while ED glass elements improve contrast, resolution, and color. Telephoto zoom on this SONY E 55-210mm lens offers up to 3.8x zoom, and an internal focusing mechanism provides fast autofocus.', 'abcat0410000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3546/3546034_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3560256', 'Olympus - M.Zuiko Digital ED 12mm f/2.0 Wide-Angle Lens for Most Micro Four Thirds Cameras - Silver', 'This Olympus M.Zuiko V311020SU0 12mm f/2 wide-angle lens is ideal for shooting dramatic landscapes and street scenes in low-light conditions. The Movie-Still-Compatible mechanism enables nearly silent focusing.', 'abcat0410000', 671.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3560/3560256_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3597856', 'Panasonic - Rechargable Lithium-ion Battery', 'This Panasonic digital camera battery is ideal for Panasonic Lumix cameras. It has a 7.2-volt capacity and 1200 mAh output voltage meaning your camera will stay charged long enough to capture hundreds of photos. The Panasonic digital camera battery can be discharged at any time without causing memory or performance problems.', 'abcat0410000', 57.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3597/3597856_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3651038', 'Sony - 55-210mm f/4.5-6.3 Telephoto Lens for Most Alpha E-Mount Cameras - Black', 'Capture vibrant videos and images with this Sony telephoto lens. Internal optical SteadyShot image stabilization helps deliver clear handheld shots, and the internal AF mechanism operates silently during movie recording for reduced noise interference. This Sony telephoto lens boasts two ED glass and two aspherical elements for high optical performance across the zoom range.', 'abcat0410000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3651/3651038_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3775222', 'IOGEAR - USB CAC Reader', 'Enhance security at your premises with this IOGEAR USB smart card reader. Compatibility with Windows, Mac OS, and Linux operating systems provides versatility, while the ultra-compact construction allows for mobile operations. With speeds of up to 825 Kbps, this IOGEAR USB smart card reader is optimized for quick card reading, shortening transaction time.', 'abcat0410000', 29.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3775/3775222_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3780056', 'Canon - EF 11-24mm f/4L USM Wide Angle Zoom Lens - Black', 'This Canon EF 9520B002 wide angle zoom lens features an 11-24mm focal length, f/22 minimum aperture and f/4 maximum aperture, so you can easily capture clear photos using your compatible Canon camera.', 'abcat0410000', 2999.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3780/3780056_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3826108', 'Sigma - 105mm f/2.8 EX DG OS Macro Lens for Select Nikon Full-Frame DSLR Cameras - Black', 'Capture crisp digital photos with this Sigma 258306 telephoto macro lens that is compatible with Nikon full-frame DSLR cameras and features an HSM (Hyper-Sonic Motor) for fast, efficient autofocus.', 'abcat0410000', 619.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3826/3826108_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3826339', 'Sigma - 105mm f/2.8 EX DG OS Macro Lens for Select Canon Full-Frame DSLR Cameras - Black', 'This Sigma 258101 telephoto macro lens features an HSM (Hyper-Sonic Motor) for fast, efficient autofocus. The f/22 minimum aperture and f/2.8 maximum aperture ensure optimal light gathering.', 'abcat0410000', 619.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3826/3826339_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3900242', 'Canon - EF 24mm f/1.4L II USM Wide-Angle Lens - Black', 'Canon EF 24mm f/1.4L II USM Wide-Angle Lens: This high-performance wide-angle lens features an antireflective coating that provides sharp images in a variety of settings. Photography professionals and enthusiasts will love the high-speed autofocus and the fast 1.4 maximum aperture for shooting in low light. Plus, the short focusing distance lets you get in close to capture the perfect shot.', 'abcat0410000', 1549.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3900/3900242_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3936043', 'Canon - EF 8-15mm f/4L Fisheye USM Ultra-Wide Zoom Lens - Black', 'Canon EF 8&#8211;15mm f/4L Fisheye USM Ultra-Wide Zoom Lens: Bring a whole new perspective to your photography with this ultra-wide fisheye zoom lens that captures unique and intriguing panoramic shots. Loved by professional photographers and amateurs alike, this Canon L-series lens delivers fine-tuned optics for stunning diagonal and circular images. Ultra-low dispersion (UD) glass reduces aberration, and advanced lens coatings enhance image quality.', 'abcat0410000', 1249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3936/3936043_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3990822', 'SanDisk - Extreme PLUS 32GB SDHC UHS-I Memory Card', 'The SanDisk Extreme PLUS SDHC UHS-I Memory Card delivers performance that lets you take control of your creativity. With shot speeds of up to 60MB/s and UHS speed Class 3 (U3) recording, you&#8217;re ready to capture stunning high-resolution, stutter-free 4K UHD video. The memory card also delivers up to 90MB/s transfer speeds so you can quickly move your photos where you want them. Built to withstand weather, water, shocks and other less-than-ideal conditions so you can rest assured that it&#8217;s good to go wherever you go.', 'abcat0410000', 17.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3990/3990822_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4161537', 'Sony - 30mm f/3.5 Macro Lens for Most NEX Compact System Cameras - Silver', 'Designed for use with most Sony NEX compact system cameras with an E-mount, this Sony SEL30M35 30mm f/3.5 lens enables you to capture crisp, detailed macro photos and videos. DMF (direct manual focus) lets you attain precise focusing results.', 'abcat0410000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4161/4161537_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4188005', 'Lowepro - Volta 25 Camera Case - Black', 'Safely transport your small point-and-shoot digital camera in this Lowepro Volta 25 LP36688 carrying case that features molded EVA foam construction for reliable protection from damage. The belt loop ensures simple portability.', 'abcat0410000', 11.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4188/4188005_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4227136', 'Nikon - AF-S NIKKOR 200mm f/2G ED VR II Telephoto Lens for Select Cameras - Black', 'Nikon AF-S NIKKOR 200mm f/2G ED VR II Telephoto Lens: Get clear, accurate shots thanks to the Nano Crystal Coat and Extra-low Dispersion glass elements of this lens. Multiple shooting modes allow easy switching from auto to manual focusing.', 'abcat0410000', 5699.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4227/4227136_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4262000', 'Nikon - AF-S NIKKOR 500mm f/4E FL ED VR Super Telephoto Lens - Black', 'Nikon AF-S NIKKOR 500mm f/4E FL ED VR Super Telephoto Lens: Capturing distant scenes is simple with this powerful full-frame super telephoto lens. The 4-stop VR image stabilization allows handheld shooting at dawn or twilight, and the Nano Crystal Coat minimizes glare.', 'abcat0410000', 10299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4262/4262000_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4262300', 'Nikon - AF-S DX NIKKOR 16-80mm f/2.8-4E ED VR Standard Zoom Lens - Black', 'Nikon AF-S DX NIKKOR 16-80mm f/2.8-4E ED VR Standard Zoom Lens: Affix this lens to your Nikon DSLR camera''s F-mount to capture crisp shots in low lighting thanks to VR image stabilization. A nonstick coating keeps the glass clean for sharp photos.', 'abcat0410000', 1069.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4262/4262300_sd.jpg');
