INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4374900', 'Nikon - AF-S NIKKOR 24mm f/1.8G ED Wide-Angle Prime Lens - Black', 'Nikon AF-S NIKKOR 24mm f/1.8G ED Wide-Angle Prime Lens: Capture landscapes, skyscrapers, environmental portraits, food, action and hobbies with a single lens. Designed for use with Nikon cameras with an F-Mount, this wide-angle prime lens helps expand your creativity while shooting.', 'abcat0410000', 749.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4374/4374900_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4375000', 'Nikon - AF-S NIKKOR 24-70mm f/2.8E ED VR Wide-Angle Zoom Lens - Black', 'Nikon AF-S NIKKOR 24-70mm f/2.8E ED VR Wide-Angle Zoom Lens: Capture sharp, detailed images with minimal distortion using this wide-angle zoom lens, which works with most Nikon cameras with an F-Mount and features 4 stops of vibration reduction. An electromagnetic diaphragm delivers f/2.8 constant aperture.', 'abcat0410000', 2099.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4375/4375000_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4375103', 'Nikon - AF-S NIKKOR 200-500mm f/5.6E ED VR Super Telephoto Zoom Lens - Black', 'Nikon AF-S NIKKOR 200-500mm f/5.6E ED VR Super Telephoto Zoom Lens: Designed for use with most Nikon cameras with an F-Mount, this super telephoto zoom lens lets you capture birds, wildlife, motorsports and events in crisp clarity. The f/5.6 constant aperture helps you achieve out-of-focus backgrounds and lets you shoot in dim lighting.', 'abcat0410000', 1399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4375/4375103_sd.jpg');
