INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4420503', 'Lowepro - Tahoe BP 150 Camera Backpack - Black', 'Take your camera on your next adventure with this Lowepro Tahoe 150 BP LP36892 camera backpack, which features multiple compartments to accommodate your gear. The durable polyester and nylon construction is moisture-resistant to protect contents.', 'abcat0410000', 86.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4420/4420503_rd.jpg');
