INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4449003', 'Sony - Sonnar T FE 35mm f/2.8 ZA Wide-Angle Lens for Most a7-Series Cameras - Black', 'Capture sharp images with rich contrast and accurate color reproduction using this Sony SEL35F28Z wide-angle lens that is compatible with most Sony a7-series full-frame cameras and features a Carl Zeiss T* coating for optimal clarity.', 'abcat0410000', 799.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4449/4449003_sa.jpg');
