INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4467802', 'Tamron - SP 15-30mm f/2.8 Di VC USD Ultra-Wide Zoom Lens for Nikon - Black', 'Tamron SP 15-30mm f/2.8 Di VC USD Ultra-Wide Zoom Lens for Nikon: This wide-angle zoom lens features vibration compensation technology and eBAND antireflective coating, so you can capture smooth, clear panoramic images with minimal ghosting and blurring. Fluorine coating repels water and dirt to protect the lens from damage.', 'abcat0410000', 1299.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/4467/4467802ld.jpg');
