INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4528300', 'Nikon - MB-D15 Battery Grip - Black', 'Get the ideal shot with this Nikon MB-D15 27096 battery grip, which offers enhanced camera control in portrait position for clear images. Space for 6 AA batteries or 1 EN-EL15 battery makes it easy to extend battery life during photo sessions.', 'abcat0410000', 249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4528/4528300_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4528301', 'Nikon - MB-D16 Multi Power Battery Pack for the D750 Digital SLR Camera - Black', 'This Nikon multipower battery pack extends the life of a Nikon D750 camera with additional battery power. The battery pack incorporates camera controls so you don''t lose any functionality, and it is ergonomically designed for maximum comfort. The vertical release button lets you easily detach the Nikon multipower battery pack when it''s not in use.', 'abcat0410000', 349.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4528/4528301_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4528305', 'Nikon - AS-19 Speedlight Stand - Black', 'Create dynamic lighting for your next photo shoot with this Nikon AS-19 4763 Speedlight stand, which is designed to hold most Nikon Speedlights with a hot shoe and enables wireless use. The plastic construction offers strength and durability.', 'abcat0410000', 9.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4528/4528305_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4550027', 'M.Zuiko Digital 25mm f/1.8 Lens for Most Olympus OM-D and PEN Cameras - Silver', 'Designed for use with most Olympus OM-D and PEN cameras, this Olympus M.Zuiko V311060SU000 lens features a high-speed Imager AF, so you can quickly focus in on subjects as close as 9.4". The 25mm focal length accommodates a wide range of shooting needs.', 'abcat0410000', 399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4550/4550027_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4610351', 'Canon - EF-M 15-45mm f/3.5-6.3 IS STM Standard Zoom Lens for EOS M Series Cameras - Silver', 'Canon EF-M 15-45mm f/3.5-6.3 IS STM Standard Zoom Lens: This everyday lens is perfect for capturing shots of your family and friends or taking in the scenery using your Canon EOS M Series camera. With a 15-45mm focal length, you can zoom in on subjects to capture vivid details.', 'abcat0410000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4610/4610351_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4610353', 'Canon - EF-M 55-200mm f/4.5-6.3 IS STM Telephoto Zoom Lens for EOS M Series Cameras - Silver', 'Canon EF-M 55-200mm f/4.5-6.3 IS STM Standard Zoom Lens: With this long-range lens, you can easily capture wildlife shots from a distance or ensure detail and clarity for everyday photography. The 55-200mm focal length offers versatile shooting options for a wide range of situations.', 'abcat0410000', 349.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4610/4610353_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4615017', 'Sony - FE 24-240mm f/3.5-6.3 OSS Full-Frame E-Mount Telephoto Zoom Lens - Black', 'Enjoy flexible shooting with this dust- and moisture-resistant Sony SEL24240 telephoto zoom lens, which works with most a7-series, 35mm full-frame cameras with a Sony E-mount and features Optical SteadyShot image stabilization for sharp capture.', 'abcat0410000', 1049.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4615/4615017_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4617051', 'Sony - FE 28mm F2 E-Mount Prime Lens - Black', 'This Sony SEL28F20 lens features a 9-blade circular aperture and ED glass with multicoating, so you can easily capture clear photos with minimal ghosting using your a7-series, 35mm full-frame camera.', 'abcat0410000', 449.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4617/4617051_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4618500', 'Canon - EVF-DC1 Electronic Viewfinder - Black', 'Capture great shots on your digital camera using this Canon EVF-DC1 9555B001 electronic viewfinder, which offers a vivid 2,360,000 dots resolution with 100% frame coverage. A soft case and terminal cover help safeguard the viewfinder between uses.', 'abcat0410000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4618/4618500_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4622025', 'Sony - Distagon T* FE 35mm f/1.4 ZA Full-Frame E-Mount Prime Lens - Multi', 'Enjoy clear shooting with this dust- and moisture-resistant Sony Distagon T* SEL35F14Z lens, which features aspherical and AA (advanced aspherical) elements with a ZEISS T* coating to minimize blurring and reflections.', 'abcat0410000', 999.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4622/4622025_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4623015', 'Sony - FE 90mm f/2.8 Macro G OSS Full-Frame E-Mount Macro Lens - Multi', 'Enjoy crystal-clear macro shooting with your compatible a7-series camera by attaching this Sony SEL90M28G lens, which features Optical SteadyShot image stabilization, advanced aspherical elements and super ED glass with multicoating for sharpness.', 'abcat0410000', 1099.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4623/4623015_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4652800', 'Sigma - 150-600mm f/5-6.3 Sports DG OS HSM Contemporary Telephoto Zoom Lens for Canon - Black', 'Sigma 150-600mm f/5-6.3 Contemporary DG OS HSM Telephoto Lens: Get the shot you want by attaching this telephoto lens to your Canon full-frame SLR camera. With optical stabilization and a zoom lock switch, you''ll get the performance and versatility you need to capture clear photos in a variety of settings. Plus, the lens features a water- and oil-repellent coating and a dust- and splash-resistant design.', 'abcat0410000', 899.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4652/4652800_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4671700', 'Tamron - 18-200mm f/3.5-6.3 Di II VC All-in-One Zoom Lens for Nikon - Black', 'Tamron 18-200mm f/3.5-6.3 Di II VC All-in-One Zoom Lens for Nikon: Get the shot you want by attaching this all-in-one zoom lens to your compatible Nikon camera''s DX mount. You''ll achieve sharp photos thanks to an AF drive module and vibration compensation. Plus, the 18-200mm focal length offers the versatility you need to capture a variety of scenes.', 'abcat0410000', 249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4671/4671700_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4671800', 'Tamron - 18-200mm f/3.5-6.3 Di II VC All-in-One Zoom Lens for Canon - Black', 'Tamron 18-200mm f/3.5-6.3 Di II VC All-in-One Zoom Lens for Canon: With a versatile 18-200mm focal length, this lens helps you get the shot you want in a variety of scenarios. Vibration compensation and an AF drive module help ensure sharp, detailed capture. Just attach the lens to your compatible Canon camera''s EF or EF-S mount to start shooting.', 'abcat0410000', 249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4671/4671800_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1312503', 'Definitive Technology - SuperCube 2000 7-1/2" 650W Powered Subwoofer - Black', 'Enhance your home theater system with this Definitive Technology SuperCube 2000 LAWAA 650W powered subwoofer that features a 7-1/2" high-excursion subwoofer driver and 2 Planar low-bass radiators for deep, musical low-end audio.', 'abcat0205000', 599.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1312/1312503_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1516552', 'MartinLogan - Motion FX 5-1/4" Passive 2-Way Bookshelf Speaker (Each) - White', 'Bring bold sound to your living room with this white MartinLogan Motion two-way bookshelf speaker. Dual Folded Motion tweeters combine with a paper cone woofer to handle everything from deep bass tones on up to high treble. With 160W peak power, this MartinLogan Motion two-way bookshelf speaker delivers fluid and sharp reproduction of your favorite tunes.', 'abcat0205000', 499.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1516/1516552_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('1684202', 'MartinLogan - Motion FX 5-1/4" 2-Way Bookshelf Speaker (Each) - Black', 'This bookshelf speaker features dual Folded Motion tweeters and a 5-1/4" paper cone woofer for enhanced dynamic range. The Precision Vojtko crossover ensures customized sound.', 'abcat0205000', 499.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/1684/1684202_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2052555', 'Yamaha - 6-1/2" 2-Way In-Ceiling Speakers (Pair) - White', 'These in-ceiling speakers feature moisture-resistant 6-1/2" polypropylene mica woofer cones for enhanced mid-low sound reproduction. The 1" swivel tweeter lets you precisely aim high frequencies for optimal sound output.', 'abcat0205000', 179.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2052/2052555_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2074269', 'MartinLogan - ElectroMotion ESL 8" Floor Speaker (Each) - Black', 'Enjoy brilliant audio with this floor speaker that features an 8" high-excursion, doped fiber woofer cone for booming lows and a 34" Xstat Curvilinear Line Source (CLS) electrostatic transducer with 292 sq. in. of radiating surface for amazing sound.', 'abcat0205000', 1249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2074/2074269_ra.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2094009', 'Bowers & Wilkins - Architectural Monitor 5" 100W 2-Way Indoor/Outdoor Loudspeakers (Pair) - Black', 'These Bowers and Wilkins Architectural Monitor AM-1 BLACKPAIR speakers feature 1" aluminum dome tweeters and 5" glass-fiber cone woofers for clear sound. The aluminum grille and glass-filled-plastic cabinet materials offer resistance to the elements.', 'abcat0205000', 799.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2094/2094009_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2094018', 'Bowers & Wilkins - Architectural Monitor 5" 100W 2-Way Indoor/Outdoor Loudspeakers (Pair) - White', 'These Bowers and Wilkins Architectural Monitor AM-1 WHITEPAIR speakers feature 1" aluminum dome tweeters and 5" glass-fiber cone woofers for clear sound. The aluminum grille and glass-filled-plastic cabinet materials offer resistance to the elements.', 'abcat0205000', 799.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2094/2094018_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2155524', 'Bowers & Wilkins - CI600 Series 6" Dual Channel Stereo Surround In-Ceiling Speaker w/Aramid Fiber Midbass- Paintable White (Each) - White', 'Create stereo sound with one speaker for smaller spaces such as bathrooms or flip a switch to use as a surround channel in a home theater system. The Bowers & Wilkins CCM663SR dual channel in-ceiling speaker, which features a 6" woven Aramid fiber mid-bass driver with dual voice coils and two 1" soft-dome tweeters for clear cross-spectrum audio. The white grill can be painted to match the surrounding surface. Bowers & Wilkins CI600 Series of in-ceiling and in-wall speakers improves on our CI300 range by combining next-level performance with innovative features that make them a breeze to install and fine-tune for personalized sound. Looking for a step-up in performance? The CI700 Series offers improved parts quality and manufacturing techniques for improved performance.', 'abcat0205000', 700.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2155/2155524_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2155612', 'Bowers & Wilkins - Passive 2-Way In-Ceiling Speakers (Pair) - White', 'Outfit your home theater with these Bowers & Wilkins two-way ceiling speakers. The Aramid Fibre driver offers deep bass and a clean midrange without distortion, while the Nautilus Swirl loaded aluminum dome tweeter delivers crisp highs. These Bowers & Wilkins two-way ceiling speakers have a 150W amp for turning the volume way up.', 'abcat0205000', 1400.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2155/2155612_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2155621', 'Bowers & Wilkins - CI600 Series 6" Dual Channel Stereo Surround In-Ceiling Speaker w/Glass Fiber Midbass- Paintable White (Each) - White', 'Create stereo sound with one speaker for smaller spaces such as bathrooms or flip a switch to use as a surround channel in a home theater system. The Bowers & Wilkins CCM663SR dual channel in-ceiling speaker, which features a 6" woven Aramid fiber mid-bass driver with dual voice coils and two 1" soft-dome tweeters for clear cross-spectrum audio. The white grill can be painted to match the surrounding surface. Bowers & Wilkins CI600 Series of in-ceiling and in-wall speakers improves on our CI300 range by combining next-level performance with innovative features that make them a breeze to install and fine-tune for personalized sound. Looking for a step-up in performance? The CI700 Series offers improved parts quality and manufacturing techniques for improved performance.', 'abcat0205000', 475.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2155/2155621_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2155658', 'Bowers & Wilkins - CI600 Series 6" In-Ceiling Speakers with Glass Fiber Midbass- Paintable White (Pair) - White', 'The CCM665 in-ceiling speaker features a 6" Glass Fiber Midbass Driver and 1" Soft Dome Tweeter for outstanding clarity and bass. The Quick Dog mounting system makes installation a breeze and easy on your arms. The grill and speaker can be painted to match the surrounding surface and a paint guard is included. Looking for better performance? The CCM664 has a larger motor for improved power handling and output as well as a tweeter than can be angled so that you can fine tune your sound.Bowers & Wilkins CI600 Series of in-ceiling and in-wall speakers improves on our CI300 range by combining next-level performance with innovative features that make them a breeze to install and fine-tune for personalized sound. Looking for a step-up in performance? The CI700 Series offers improved parts quality and manufacturing techniques for improved performance.', 'abcat0205000', 550.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2155/2155658_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2156038', 'Bowers & Wilkins - 8" 2-Way Round In-Ceiling Speakers (Pair) - White/Black', 'With 8" fiberglass cone midrange drivers and 1" soft dome tweeters, these Bowers & Wilkins CCM684 PAIR 2-way in-ceiling speakers offer robust sonic output. The pivoting tweeter housing and EQ switch offer off-axis treble response.', 'abcat0205000', 800.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2156/2156038_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2156047', 'Bowers & Wilkins - CI600 Series 5" In-Wall Speakers w/ Cast Basket, Aramid Fiber Midbass and Nautilus Tweeter- Paintable White (Pair) - White', 'The CWM652 in-wall speakers feature a 5" woven Aramid Fiber midbass driver and Aluminum Dome Tweeter so you&#8217;ll experience clear, balanced sound with great driving bass. The tweeter features Nautilus Tube-loaded technology for clearer performance and whole speaker chassis is fabricated from cast aluminum for maximum rigidity and offers superior performance to the plastic baskets found in mass-market designs. The upgraded mid-bass motor improves power handling for greater output, and the Quick Dog mounting system makes installation a breeze and easy on your arms. The grill and speaker can be painted to match the surrounding surface and a paint guard is included. Looking for better performance? The CWM7.5S2 offers better driver technology and an integral backbox all in a retrofittable design. Bowers & Wilkins CI600 Series of in-ceiling and in-wall speakers improves on our CI300 range by combining next-level performance with innovative features that make them a breeze to install and fine-tune for personalized sound. Looking for a step-up in performance? The CI700 Series offers improved parts quality and manufacturing techniques for improved performance.', 'abcat0205000', 700.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2156/2156047_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2156074', 'Bowers & Wilkins - 8" 2-Way In-Ceiling Speakers (Pair) - White/Black', 'Enjoy immersive listening with these Bowers & Wilkins CCM682 PAIR in-ceiling speakers, which feature an 8" Aramid fiber bass/midrange driver and 1" Nautilus swirl-loaded aluminum-dome tweeter for rich cross-spectrum sound.', 'abcat0205000', 1650.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2156/2156074_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2165036', 'Bowers & Wilkins - CCM 683 8" 2-Way In-Ceiling Speakers (Pair) - Black', '"Learn more about MagnoliaPremium Installation These Bowers & Wilkins CCM683 PAIR in-ceiling speakers feature 8"" Aramid fiber bass/midrange cones and 1"" aluminum-dome tweeters, so you can enjoy full-bodied audio in vibrant detail.', 'abcat0205000', 1200.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2165/2165036_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2165054', 'Bowers & Wilkins - CI600 Series 6" In-Wall Speakers w/ Cast Basket, Aramid Fiber Midbass and Nautilus Tweeter- Paintable White (Pair) - White', 'The CWM663 offers the kind of in-wall performance ordinarily reserved for high quality bookshelf speakers. Featuring a 6" woven Aramid Fiber midbass driver and Aluminum Dome Tweeter, you&#8217;ll experience clear, balanced sound with great driving bass. The tweeter features Nautilus Tube-loaded technology for clearer performance, an equalization switch allows fine tuning of the sound and the whole speaker chassis is fabricated from cast aluminum for maximum rigidity, offering superior performance to the plastic baskets found in mass-market designs. The Quick Dog mounting system makes installation a breeze and easy on your arms. The grill and speaker can be painted to match the surrounding surface and a paint guard is included. Looking for better performance? The CWM7.4S2 offers better driver technology and the performance of a small floor-standing speaker in your wall. Bowers & Wilkins CI600 Series of in-ceiling and in-wall speakers improves on our CI300 range by combining next-level performance with innovative features that make them a breeze to install and fine-tune for personalized sound. Looking for a step-up in performance? The CI700 Series offers improved parts quality and manufacturing techniques for improved performance.', 'abcat0205000', 900.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2165/2165054_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2165063', 'Bowers & Wilkins - CI600 Series 664 6" In-Wall Speakers w/Glass Fiber Midbass- Paintable White (Pair) - White', 'The CWM664 in-wall speaker features a 6" Glass Fiber Midbass Driver and 1" Soft Dome tweeter for outstanding clarity and bass. An equalization switch allows you to fine tune the sound for your room. The Quick Dog mounting system makes installation a breeze and easy on your arms. The grill and speaker can be painted to match the surrounding surface and a paint guard is included. Looking for better performance? The CWM663 offers an improved midbass driver and aluminum dome tweeter for greater clarity and power. Bowers & Wilkins CI600 Series of in-ceiling and in-wall speakers improves on our CI300 range by combining next-level performance with innovative features that make them a breeze to install and fine-tune for personalized sound. Looking for a step-up in performance? The CI700 Series offers improved parts quality and manufacturing techniques for improved performance.', 'abcat0205000', 700.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2165/2165063_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2472944', 'Bowers & Wilkins - CI300 Series 8" In-Ceiling Speakers- Paintable White (Pair) - White', 'The CCM382 in-ceiling speaker provides high quality sound at an attractive price by combining an 8&#8221; polypropylene mid-bass driver with a 1&#8221; soft dome tweeter. The sound is balanced for wide-angle listening so that your room will be filled with warm, clear sound and great bass. You will find quality touches not normally find at this price such as a rigid metal chassis which holds the entire speaker together. The grill and speaker can be painted to match the surrounding surface and a paint guard is included. Bowers & Wilkins CI300 Series of in-ceiling and in-wall speakers offer high quality sound at cost effective prices while having the option to be used in more humid areas of your home such as a bathroom or indoor pool. Looking for a step-up in performance? The CI600 Series is a comprehensive lineup that offers improved parts quality and manufacturing techniques for improved performance and flexibility.', 'abcat0205000', 520.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2472/2472944_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2877429', 'Yamaha - Dual 3-1/8" 2-Way Center-Channel Speaker - Piano Black', 'Here''s a center channel speaker that will reproduce the full, dynamic sound of HD sound sources. The Yamaha NS-C210BL Dual 3-1/8-Inch 120-Watt 2-Way Center Channel Speaker gives you everything you need to fully enjoy movies and music. It has a slim design that matches today''s flat panel TVs, light aluminum woofers for extra-fast response, a wide frequency response from 65 Hz to 45 kHz, and is covered in the elegant Yamaha Piano Black finish.', 'abcat0205000', 119.95, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2877/2877429_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('2887527', 'KEF - 4-1/2" 2-1/2-Way Center-Channel Speaker - White', 'Learn more about Magnolia Premium Installation      This KEF T101CWH center-channel speaker utilizes a powerful 4-1/2" bass and midrange driver and 1" vented tweeter to ensure delivery of clear, yet robust, audio. The included wall-mounting brackets offer versatile placement options.', 'abcat0205000', 324.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/2887/2887527_sa.jpg');
