INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3343383', 'Definitive Technology - DI Series 4-1/2" Round In-Ceiling Speaker (Each) - White', 'The DI Series feature Definitive Technology''s most advanced technologies such as BDSS drivers and pivoting Pure Aluminum dome tweeters for spectacular audio performance far beyond traditional flush-mount speakers. Definitive&#8217;s exclusive Balanced Dual Surround System (BDSS) driver technology permits these new flush mounts to deliver more bass output and dynamic range than larger drivers. For example, the 4-1/2" driver-based model has the bass and dynamics of a 5-1/4" traditional speaker, while the 5-1/4" performs like a traditional 6-1/2". Pure Aluminum dome tweeter featuring a specially shaped housing that avoids the diffraction distortions of traditional post mounted tweeters, and a sophisticated adjustable crossover network, the DI Series delivers the kind of lifelike sonic performance and broad even dispersion that you''ve come to expect from Definitive Technology.', 'abcat0205000', 239.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3343/3343383_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4621101', 'KEF - 3.0-Channel Soundbar - High Gloss Black', 'Enjoy an immersive viewing experience on your flatscreen television with this KEF soundbar, featuring a 3-channel setup for left to right sound. The slim profile is designed to accommodate the thin design of modern televisions, creating an all-in-one look. This KEF soundbar comes with a wall-mount bracket and table stand to expand your placement options.', 'abcat0205000', 599.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4621/4621101_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4669018', 'Polk Audio - 6.5" 2-Way In-Ceiling Speaker (Each) - White', 'Enjoy immersive, dynamic audio with this Polk Audio VT60 in-ceiling speaker, which features a 6.5" Dynamic Balance polypropylene cone and a 0.75" swivel-mount, aimable silk-dome tweeter for clear low, high and midrange tones.', 'abcat0205000', 149.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4669/4669018_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3343392', 'Definitive Technology - DI Series Dual 5-1/4" Bipolar Surround In-Wall Speaker (Each) - White', 'The DI Series feature Definitive Technology''s most advanced technologies such as BDSS drivers and pivoting Pure Aluminum dome tweeters for spectacular audio performance far beyond traditional flush-mount speakers. Definitive&#8217;s exclusive Balanced Dual Surround System (BDSS) driver technology permits these new flush mounts to deliver more bass output and dynamic range than larger drivers. For example, the 4-1/2" driver-based model has the bass and dynamics of a 5-1/4" traditional speaker, while the 5-1/4" performs like a traditional 6-1/2". Pure Aluminum dome tweeter featuring a specially shaped housing that avoids the diffraction distortions of traditional post mounted tweeters, and a sophisticated adjustable crossover network, the DI Series delivers the kind of lifelike sonic performance and broad even dispersion that you''ve come to expect from Definitive Technology.', 'abcat0205000', 499.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3343/3343392_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3444974', 'BIC America - Eviction Series 12" 475W Powered Subwoofer - Black', 'So good, it''ll get the neighbors around every time: the Eviction Series front-firing powered subwoofer delivers 475 watts of low-frequency sound to get your party or movie night going with a bang. The 25Hz to 200Hz frequency response ensures this Eviction Series front-firing powered subwoofer has plenty of growl all night long.', 'abcat0205000', 479.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3444/3444974_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3526156', 'Bowers & Wilkins - CI600 Series 6" In-Ceiling Speaker w/ Cast Basket, Aramid Fiber Midbass and Nautilus Tweeter- Paintable White (Each) - White', 'The CCM663 offers the kind of in-ceiling performance ordinarily reserved for high quality bookshelf speakers. Featuring a 6" woven Aramid Fiber Midbass Driver and Aluminum Dome Tweeter, you&#8217;ll experience clear, balanced sound with great driving bass. The tweeter features Nautilus Swirl technology for clearer performance and it can be angled towards your listening area to fine tune your sound. The whole speaker chassis is fabricated from cast aluminum for maximum rigidity and offers superior performance to the plastic baskets found in mass-market designs. The Quick Dog mounting system makes installation a breeze and easy on your arms. The grill and speaker can be painted to match the surrounding surface and a paint guard is included. Looking for better performance? The CCM662 offers an even larger motor system for greater power handling and output. Bowers & Wilkins CI600 Series of in-ceiling and in-wall speakers improves on our CI300 range by combining next-level performance with innovative features that make them a breeze to install and fine-tune for personalized sound. Looking for a step-up in performance? The CI700 Series offers improved parts quality and manufacturing techniques for improved performance.', 'abcat0205000', 475.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3526/3526156_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3526174', 'Bowers & Wilkins - CI600 Series 6" In-Ceiling Speakers with Glass Fiber Midbass and Pivoting Tweeter- Paintable White (Each) - White', 'The CCM664 in-ceiling speaker features a 6" Glass Fiber Midbass Driver and 1" Soft Dome Tweeter for outstanding clarity and bass. The tweeter can be angled towards your listening area to fine tune the sound. The Quick Dog mounting system makes installation a breeze and easy on your arms. The grill and speaker can be painted to match the surrounding surface and a paint guard is included. Looking for better performance? The CCM663 offers an improved midbass driver and aluminum dome tweeter for greater clarity and power. Bowers & Wilkins CI600 Series of in-ceiling and in-wall speakers improves on our CI300 range by combining next-level performance with innovative features that make them a breeze to install and fine-tune for personalized sound. Looking for a step-up in performance? The CI700 Series offers improved parts quality and manufacturing techniques for improved performance.', 'abcat0205000', 350.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3526/3526174_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3527067', 'Bowers & Wilkins - CI300 Series 6" In-Ceiling Speaker- Paintable White (Pair) - White', 'The CCM362 in-ceiling speaker provides high quality sound at an attractive price by combining a 6&#8221; polypropylene mid-bass driver with a 1&#8221; soft dome tweeter. Sound is balanced for wide-angle listening so that your room will be filled with warm, clear sound and great bass. You will find quality touches not normally find at this price such as a rigid metal chassis which holds the entire speaker together. The grill and speaker can be painted to match the surrounding surface and a paint guard is included. Bowers & Wilkins CI300 Series of in-ceiling and in-wall speakers offer high quality sound at cost effective prices while having the option to be used in more humid areas of your home such as a bathroom or indoor pool. Looking for a step-up in performance? The CI600 Series is a comprehensive lineup that offers improved parts quality and manufacturing techniques for improved performance and flexibility.', 'abcat0205000', 400.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3527/3527067_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3815142', 'Sonance - Sonarray 8.1-Ch. Outdoor Speaker System with In-Ground Subwoofer - Black/Brown', 'Enjoy music in your backyard with this Sonance Sonarray SR1 outdoor speaker system, which features 8 satellite speakers and 1 subwoofer with 85dB and 89dB sensitivity respectively for evenly distributed sound. Sealed enclosures allow year-round use.', 'abcat0205000', 2749.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3815/3815142_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3887510', 'Bose - 251 Wall Mount Outdoor Environmental Speakers - Pair - White', 'What&#8217;s better than relaxing in your back garden, by the patio or pool? Listening to your favorite music while you&#8217;re there, and enjoying deep, full stereo sound. With the SoundTouch outdoor speaker system with 251 speakers, you can stream the Internet radio station that you recently discovered through TuneIn and your music library outside&#8212;all at the touch of a button. With your home Wi-Fi network, you&#8217;re ready to make hanging out even more fun. Our outdoor speakers are uniquely engineered to give you full stereo performance across a much wider space. Bose 251 environmental speakers deliver our best performance outdoors from two 2.5" full-range drivers and a 5.25" woofer.', 'abcat0205000', 399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3887/3887510_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3992657', 'Polk Audio - Atrium6 5-1/4" Outdoor Speakers (Pair) - White', 'Designed to withstand extreme temperatures and heavy rains for lasting outdoor use, these Polk Audio ATRIUM 6 WHITE speakers are crafted with Dynamic Balance technology that tunes out unwanted resonance and distortion for pure sound.', 'abcat0205000', 399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3992/3992657_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4664000', 'Bose - Virtually Invisible® 791 In-Ceiling Speakers II (Pair) - White', 'Enjoy powerful audio performance with these Bose Virtually Invisible&#174; 791 in-ceiling speakers. Bose Stereo Everywhere&#8482; speaker technology provides balanced stereo sound, and the nearly bezel-less design blends elegantly into the ceiling.', 'abcat0205000', 599.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4664/4664000_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3992911', 'Polk Audio - RC6s In-Ceiling 6.5" Stereo Speaker - Dual Channel Experience | Best for Damp, Humid Indoor/Outdoor Placement - White', 'The RC6s in-ceiling speaker delivers both channels of a stereo signal from a single overhead location. It''s perfect for a bathroom, kitchen, hallway, or anywhere else that you want great stereo sound from just one hideaway speaker. Features Dynamic Balance woofer and dual dome tweeters that provide lifelike stereo imaging with a clean midrange, deep bass and smooth, accurate highs. Easy installation in 3 steps - cut a hole, feed the wires through, and simply drop the speaker in &#8211; puts built-in audio within reach. The rotating cams secure the speakers safely and ensure vibration-free efficiency with no extra assembly or mess. Paintable grilles and its design that mimics a recessed lighting fixture allow the RC6s to blend in perfectly with the decor.', 'abcat0205000', 149.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3992/3992911_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('3992975', 'Polk Audio Atrium 6 Outdoor All-Weather Speakers with Bass Reflex Enclosure, Speed-Lock Mounting System, (Pair, Black) - Black', 'The Polk Atrium 6 All-Weather Outdoor Speaker features a 1&#8221; Tweeter and a 5.25&#8221; Dynamic Balance Driver that deliver high-quality, rich audio that takes your movies and music to the next level. Additionally, the Polk Power Port Bass venting offers clean, noise-free bass. Features a durable, mineral-filled polypropylene cabinet design, with molded-in bracing, that allows the speaker to withstand years of seasonal changes. The rugged, mineral-filled polypropylene enclosure features a rustproof aluminum grille, rustproof aluminum bracket, and stainless steel/brass hardware. Polk Audio All-Weather Certified, the Atrium Series speakers exceed baseline industrial and military specifications for environmental endurance so that they can effortlessly withstand the outdoors and hold up in extreme temperatures and precipitation. The Atrium 6 can be mounted either horizontally or vertically for the best possible sound in a variety of situations The integrated brackets provide full 180-degree rotation (when mounted vertically or horizontally). You can remove the bracket and use the speaker''s built-in stability feet if you simply want to place the speaker on a table or shelf.', 'abcat0205000', 399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/3992/3992975_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4215141', 'Polk Audio - Vanishing Series RT Dual 6.5" 3-Way In-Wall Speaker (Each) - White', 'Make your home theater feel like the cinema with this Polk Audio Vanishing Series RT 265RT in-wall speaker, which features dual mid/woofers and a 1" tweeter for a complete range of sounds. PowerPort bass venting delivers well-blended, booming lows.', 'abcat0205000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4215/4215141_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4227100', 'Polk Audio - T30 100 Watt Home Theater Center Channel Speaker (Single)| Dolby and DTS Surround - Black', 'The T30 is the center channel speaker that puts its overpriced competitors to shame. Since the center channel is the most important speaker in your Home audio system, the T30 is the workhorse that delivers crystal-clear dialogue and room-filling theater sound. What&#8217;s more, it&#8217;s easy to setup, supports Dolby and DTS, and connects to most Home theater receivers, stereos or Home theater processors. Put the T30 center channel to the test and you''ll hear how it rings true-in price and quality. Built for more than your viewing pleasure, the T Series hits the mark on great-sounding audio for all the music that fills your life. Don''t fret, we''ll pat ourselves on the back for you.', 'abcat0205000', 129.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4227/4227100_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4235065', 'BIC America - RtR 15" 430-Watt Passive 3-Way Floor Speaker (Each) - Black', 'Create an auditory experience with this BIC America 15-inch Eviction Series tower speaker. The tower set comes with a woofer and a magnet for deep and rich bass at concerts or celebrations. This BIC America 15-inch Eviction Series tower speaker features a horn tweeter, which helps mids and highs sound excellent at loud volumes.', 'abcat0205000', 499.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4235/4235065_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4289376', 'Wharfedale - WH-D10 10" 300W Powered Subwoofer - Black', 'With a built-in amplifier and a 10" long-throw woofer, this Wharfedale WH-D10 WHDSUB10BLK subwoofer delivers pounding bass. The sealed enclosure helps produce lifelike sound to bring movies and music to life.', 'abcat0205000', 499.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4289/4289376_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4443799', 'TIC - Speaker - Multi', 'TIC TFS12SL Speaker', 'abcat0205000', 159.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4443/4443799_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4580243', 'Logitech - Z906 5.1-Channel Satellite Surround Sound Speaker System (6-Piece) - Black', 'Logitech Surround Sound Speakers Z906-hear every detail, all around you, in theater-quality sound. 500 watts (RMS) of thunderous audio turns any night into opening night. THX Certification gives you quality you can count on, while onboard 5.1 digital decoding immerses you in your favorite movies as you hear every detail of Dolby Digital or DTSTM encoded soundtracks in surround sound-from the roar of the crowd to the footsteps right behind you. You can connect up to six components simultaneously, including your TV, Blu-ray/DVD, player, DVR, Xbox 360, PlayStation 3, Wii, iPod and stereo. With its easy-to-read display and easy-to-stack design, the control console fits right in with the home-entertainment setup in your living room. And a wireless remote lets you control your listening experience without ever getting off the couch.', 'abcat0205000', 399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4580/4580243_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4595047', 'Bowers & Wilkins - CI600 Series 3" In-Ceiling Speakers- Paintable White (Pair) - White', 'The CCM632 speakers features a single 3" driver for well-balanced sound with minimal visual impact. ZipDogs make short work of installation and cope with almost any thickness of mounting panel. Round and Square magnetic grills are included and the speakers can be painted to match your ceiling. Bowers & Wilkins CI600 Series of in-ceiling and in-wall speakers improves on our CI300 range by combining next-level performance with innovative features that make them a breeze to install and fine-tune for personalized sound. Looking for a step-up in performance? The CI700 Series offers improved parts quality and manufacturing techniques for improved performance.', 'abcat0205000', 700.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4595/4595047_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4618300', 'Thonet & Vander - Koloss Dual 6.5" 800W 2-Way Bluetooth Speakers (Pair) - Black', 'Enjoy booming home audio with these Thonet & Vander Koloss wireless speakers, which each feature two 6.5" aramid fiber woofers and a 1" silk tweeter for robust sound. Bluetooth connectivity makes it easy to play music from your compatible mobile device.', 'abcat0205000', 399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4618/4618300_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4676925', 'MartinLogan - ESL Series EFX 6-1/2" On-Wall Speakers (Each) - Black', 'This slim-profile MartinLogan ESL Series EFX 6-1/2" on-wall speaker features an Xstat CLS electrostatic transducer for crisp, vibrant audio. The pivoting wall bracket makes it simple to direct the speaker''s sound.', 'abcat0205000', 1749.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4676/4676925_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4676934', 'MartinLogan - Motion FX 5-1/4" Bookshelf Speaker (Each) - Black', 'Take your home theater system to the next level with this MartinLogan Motion FX MOFXBL2 bookshelf speaker that features two 1-1/2" Folded Motion tweeters for smooth, vibrant high tones. The Vojtko crossover ensures precise audio.', 'abcat0205000', 799.99, 'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/4676/4676934_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4746300', 'MartinLogan - Motion 5-1/4" Passive 2-Way Height Channel Speakers (Pair) - High Gloss Black', 'Take your home audio system to the next level with this MartinLogan Motion AFX 5.25-inch two-way speaker pair. Up to 200W of peak power lets these speakers produce sounds clearly and accurately across a huge range. A two-way speaker system coupled with Dolby Atmos helps this MartinLogan Motion AFX 5.25-inch two-way speaker pair create an immersive sonic experience.', 'abcat0205000', 599.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4746/4746300_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4756372', 'MartinLogan - ElectroMotion IW 6-1/2" In-Wall Speaker (Each) - Paintable White', 'This MartinLogan ElectroMotion IW 6-1/2" in-wall speaker features a Folded Motion tweeter to minimize distortion for clear, natural sound. The ultralow-profile grille can be painted for seamless integration with your living space.', 'abcat0205000', 599.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4756/4756372_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4756423', 'MartinLogan - Motion SLM 4" Flat-Panel Speaker (Each) - Gloss Black', 'This MartinLogan Motion SLM flat-panel speaker features dual 4" fiber-cone woofers, dual 4" high-velocity passive bass radiators and a Folded Motion tweeter to deliver a stunning soundscape. The sleek profile blends seamlessly with your living space.', 'abcat0205000', 499.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4756/4756423_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4756432', 'MartinLogan - ElectroMotion R 8" In-Ceiling Speaker (Each) - Paintable White', 'This MartinLogan ElectroMotion R 8" in-ceiling speaker features a Folded Motion tweeter to minimize distortion for clear, natural sound and an 8" high-resolution aluminum cone woofer for powerful, accurate low-end bass performance.', 'abcat0205000', 699.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4756/4756432_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4756441', 'MartinLogan - ElectroMotion IC 6-1/2" In-Ceiling Speaker (Each) - Paintable White', 'This MartinLogan ElectroMotion IC 6-1/2" in-ceiling speaker features a Folded Motion tweeter to reduce distortion for clear, natural sound and a 6-1/2" aluminum cone woofer with a cast-aluminum basket for powerful, accurate low-end bass extension.', 'abcat0205000', 499.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4756/4756441_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4841572', 'Bowers & Wilkins - 4" 100W Satellite Speaker (Each) - Matte White', 'Experience stunningly clear stereo sound with this Bowers and Wilkins M1MW 100W satellite speaker that features a 4" woven glass fiber woofer cone and 1" aluminum dome tweeter for high-quality audio.', 'abcat0205000', 299.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4841/4841572_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('4841615', 'Bowers & Wilkins - 4" 100W Satellite Speaker (Each) - Matte Black', 'Experience stunningly clear stereo sound with this Bowers & Wilkins M1MB 100W satellite speaker that features a 4" woven glass fiber woofer cone and 1" aluminum dome tweeter for high-quality audio.', 'abcat0205000', 299.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/4841/4841615_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5023601', 'Definitive Technology - CS-9080 Center Channel Speaker with Integrated 8" Powered Subwoofer - Black', 'The CS9080 center channel speaker delivers immense clarity and focus to the vocal range, accurately reproducing even the most demanding audio content so you can experience every detail of pure home theater. An aluminum dome tweeter, BDSS high-performance drivers, an integrated powered subwoofer and Intelligent Bass Control deliver crystal highs and deep, impactful bass creating an authentic reproduction of sound as the artist intends in the studio or concert hall. The inert, resonance-free cabinet structure with acoustically transparent grilles provides natural, uncolored sound without having to remove the speaker grille. The CS9080 can be placed atop any flat-surface such as a stand, shelf or cabinet, and its integrated rubber feet make sure the speaker stays in place and does not scratch your furniture.', 'abcat0205000', 1099.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5023/5023601_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5023602', 'Definitive Technology - BP-9080X Bipolar Tower Speaker with Built-in 12" Powered Subwoofer (455W), Front and Rear Arrays - Black', 'Experience every detail of Pure Home Theater with Definitive Technology BP9080X Tower Speaker with BDSS (Balanced Double Surround System) Technology that improves driver excursion producing bass output equivalent to a large driver while retaining the improved dispersion and midrange definition of a smaller driver. The 9080X Floorstanding Speaker features an integrated 12&#8221; Powered Subwoofer and Dual Bass Radiators making it one of the best loudspeaker that reproduces balance between highs and lows accurately. Enjoy more impactful bass from just the tower speaker without the need to add a separate subwoofer. Two-way integrated Dolby Atmos / DTS:X height module let you explore true multi-dimensional sound. This outstanding speaker from Definitive Technology features its own Intelligent Bass Control gives you the ability to modulate deep bass up or down in level while simultaneously maintaining mid-range tonal balance. Timeless, minimalist design. This is what obsession sounds like.', 'abcat0205000', 1999.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5023/5023602_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5023603', 'Definitive Technology - High-Performance 2-Way Surround Speaker - Black', 'Enjoy true high-definition surround sound from your home theater with this Definitive Technology speaker. With powerful left/right speaker dispersion and balanced surround sound, this speaker immerses you in an enjoyable audio experience. Sized to fit unobtrusively into home theater systems, this Definitive Technology speaker includes iconic design elements that enhance the visual aesthetic of your system.', 'abcat0205000', 399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5023/5023603_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5077700', 'iLive - 2-Channel Soundbar - Black', 'Heighten your home audio listening experience with this iLive HD wireless sound bar. With a listening range of up to 60 feet, this sound bar is ideal for use on a patio or deck. This iLive HD wireless sound bar comes with a battery-operated remote control so you can control the volume from across the room.', 'abcat0205000', 50.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5077/5077700_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5023604', 'Definitive Technology - CS-9040 Center Channel Speaker with Integrated 8" Bass Radiator - Black', 'The CS9040 center channel speaker delivers immense clarity and focus to the vocal range, accurately reproducing even the most demanding audio content so you can experience every detail of pure home theater. An aluminum dome tweeter, BDSS high-performance drivers, and an integrated bass radiator let you hear and feel every note as the artist intends. The inert, resonance-free cabinet structure with acoustically transparent grilles provides natural, uncolored sound without having to remove the speaker grille. The CS9040 features a timeless, minimalist design with machined, aircraft-grade aluminum construction, and can be placed atop any flat-surface such as a stand, shelf or cabinet. Its integrated rubber feet make sure the speaker stays in place and does not scratch your furniture.', 'abcat0205000', 549.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5023/5023604_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5023605', 'Definitive Technology SR-9040 10” Bipolar Surround Speaker, High Performance, Premium Sound Quality, Single, Black - Black', 'Definitive Technology''s SR-9040 bipolar surround speaker will instantly immerse you in every high-speed car chase, high-impact explosion, crystal clear dialogue to take your movies up a notch. Features BDSS (Balanced Double Surround System) technology drivers &#8211; (2) 1" Aluminum Dome tweeters & (2) 3.5" mid drivers that deliver remarkable, room-filling sound and perfectly reproduce even the most demanding audio content. Using left- and right-firing driver arrays that radiate full-range sound in an omni-directional pattern, the SR-9040s provide an enveloping listening experience that goes beyond ordinary surround speakers. Its Bipolar speaker dispersion pattern provides enveloping surround sound, tremendous dynamic range as well as true high-definition sound quality. This speaker comes in a minimalistic, timeless design that complements your home d&#233;cor perfectly. Pair a couple of these bipolar surround speakers with any Bipolar Tower Speaker (BP9020, BP9040, BP9060) & Center Channel (CS9040, CS9060, CS9080) to create a three-dimensional system for a room-filling home theater experience.', 'abcat0205000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5023/5023605_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5023606', 'Definitive Technology - BP-9040 High Performance Home Theater Tower Speaker with Integrated 8” Powered Subwoofer - Black', 'Definitive Technology BP9040 tower speaker produces high resolution audio with a lifelike 3D soundstage for your home entertainment system. Definitive''s optional A90 elevation speaker module lets you integrate Dolby Atmos surround sound seamlessly in your home theater unit for an exceptional music & movie experience. Features a Bipolar Speaker array &#8211; a front-firing tweeter & 2 BDSS midrange drivers plus a rear-facing tweeter and BDSS midrange&#8211; that delivers clear, smooth highs and mids with deeper bass response from the integrated subwoofer coupled to dual bass radiators. This innovative yet minimalist design of the speaker allows greater speaker placement flexibility in any room, without compromising on an immersive soundstage. The sleek BP9040 is supported by a sturdy, cast aluminum base and comes with carpet spikes and floor glides for greater stability. Create or customize a home audio setup of your choice with this tower loudspeaker that is designed to match all center channels and surround speakers in Definitive Technology&#8217;s BP 9000 series.', 'abcat0205000', 999.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5023/5023606_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5023607', 'Definitive Technology - BP-9060 High Performance Home Theater Tower Speaker with Integrated 10” Powered Subwoofer - Black', 'The Definitive Technology BP9060 tower speaker is the answer for remarkable, immersive, room-filling sound so you can experience every detail of your home theater soundtrack. Its patented Forward Focused Bipolar Array creates an incredibly broad and engaging soundstage no matter where you sit, making it flexible in terms of positioning and placement. An aluminum dome tweeter, high-performance midrange drivers, and an integrated powered subwoofer with Intelligent Bass Control let you hear and feel every note as the artist intended. Seamlessly integrate Dolby Atmos surround sound into your home theater via this this tower''s built-in docking port made exclusively for Definitive''s optional A90 Atmos enabled speaker module. Build a complete Definitive Bipolar home theater system using perfectly matched centers and bipolar surrounds from the BP 9000 series.', 'abcat0205000', 1199.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5023/5023607_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5023608', 'Definitive Technology - High-Performance 2-way Height Speaker Module - Black', 'Give added dimension to your sound system with these Definitive Technology height enhancement speaker modules. Fill your room with expansive sound, and add on Dolby Atmos and DTS:X to reproduce audio as media designers intended. Listen to the complexities of live recordings and movie soundtracks with these Definitive Technology height enhancement speakers.', 'abcat0205000', 549.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5023/5023608_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5023610', 'Definitive Technology - BP-9020 High Performance Home Theater Tower Speaker with Integrated 8” Powered Subwoofer - Black', 'Definitive Technology BP9020 tower speaker produces high resolution audio with a lifelike 3D soundstage for your home entertainment system. Definitive''s optional A90 elevation speaker module lets you integrate Dolby Atmos surround sound seamlessly in your home theater unit for an exceptional music & movie experience. Features a Bipolar Speaker array &#8211; a front-firing tweeter & 2 BDSS midrange drivers & a rear-facing BDSS midrange &#8211; that delivers clear, smooth highs and mids with deeper bass from the integrated subwoofer, & also allows greater speaker placement flexibility. The sleek BP9020 is supported by a sturdy, cast aluminum base and comes with carpet spikes and floor glides for greater stability. Create or customize a home audio setup of your choice with this tower loudspeaker that is designed to match all center channels and surround speakers in Definitive Technology&#8217;s BP 9000 series.', 'abcat0205000', 749.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5023/5023610_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5023611', 'Definitive Technology - CS-9060 Center Channel Speaker with Integrated 8" Powered Subwoofer - Black', 'The CS9060 center channel speaker delivers immense clarity and focus to the vocal range, accurately reproducing even the most demanding audio content so you can experience every detail of pure home theater. An aluminum dome tweeter, high-performance drivers, integrated powered subwoofer and Intelligent Bass Control let you hear and feel every note as the artist intends. The inert, resonance-free cabinet structure with acoustically transparent grilles provides natural, uncolored sound without having to remove the speaker grille. CS9060 features a timeless, minimalist design that will easily blend in with any decor, and it can be placed atop any flat surface such as a stand, shelf or cabinet. Integrated rubber feet make sure the speaker stays in place and does not scratch your furniture.', 'abcat0205000', 799.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5023/5023611_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5160065', 'Bowers & Wilkins - CI 300 Series CWM362 6" 2-Way In-Wall Loudspeakers (Pair) - White/Black', 'Find out what Bowers & Wilkins is known for: High-quality loudspeakers with a wide variety of applications and crisp, powerful sound. Using 6" polypropylene bass/mid-range cones and 1" soft-dome tweeters, these in-wall speakers deliver a complete range of lush, high-quality sounds. A bonus? Paintable magnetic grilles that bridge your sound with the style of your space. Sweeten the experience&#8212;learn about Magnolia installation.', 'abcat0205000', 520.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5160/5160065_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5194101', 'MartinLogan - ElectroMotion Dual 8" Passive 2-Way Floor Speaker (Each) - Satin black', 'Shout it out and make sure you''re heard with this Martin Logan ElectroMotion ESL loudspeaker. The slim design packs a lot of punch, using its patented electrostatic technology to pump up the sound on stage or outdoors. This Martin Logan ElectroMotion ESL loudspeaker utilizes a MicroPerf design, increasing the diaphragm-radiating area.', 'abcat0205000', 1999.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5194/5194101_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5194702', 'MartinLogan - ElectroMotion Dual 8" Passive 2-Way Floor Speaker (Each) - High-gloss black', 'Make the most out of your home theater system with this Martin Logan ElectroMotion electrostatic loudspeaker. Made for stage acts or home use, this design is ultrathin and features compact Folded Motion thin film transducer technologies for pure sound. This Martin Logan ElectroMotion electrostatic loudspeaker is voice and timbre matched across the Martin Logan line.', 'abcat0205000', 2249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5194/5194702_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5212715', 'MTX - Monitor Series 5-1/4" 200W 2-way Bookshelf Speakers (Pair) - Black ash', 'Complete your home stereo system with these MTX Monitor Series bookshelf speakers. Front-facing connection ports on each speaker let you plug in your other stereo components, and the black ash finish adds a sleek finishing touch. Featuring 5.25-inch woofers and balanced dome tweeters, these MTX Monitor Series bookshelf speakers amplify sounds both big and small.', 'abcat0205000', 69.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5212/5212715_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5212716', 'MTX - Monitor Series Dual 6-1/2" 200W 2-way Bookshelf Speakers (Pair) - Black ash', 'Give your home theater or stereo system powerful sound with these MTX Monitor Series two-way bookshelf speakers. Two 6.5-inch polypropylene woofers and 19mm dome tweeters amplify nuanced and bold sounds, and the front ports allow for effortless connection to your other stereo components. Boasting 92dB sensitivity, these MTX Monitor Series two-way bookshelf speakers provide responsive power handling.', 'abcat0205000', 166.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5212/5212716_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5212727', 'MTX Audio - MTX 8" 225W 2-way Speaker (Each) - White', 'Enjoy indoor-quality sound when outside on your deck, patio or porch with this MTX all-weather two-way speaker. A polypropylene injection-molded enclosure defends against heat, corrosion and water damage. Featuring a 1-inch compression driver and an 8-inch woofer, this MYX all-weather two-way speaker brings amped up audio to your outdoor space.', 'abcat0205000', 161.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5212/5212727_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5212728', 'MTX - Monitor Series Dual 6-1/2" 200W 2-way Center-Channel Speaker (Each) - Black', 'Give your home theater a powerful centerpiece with this MTX Monitor Series center channel speaker. Two 6.5-inch polypropylene woofers and a PEI dome tweeter pick up sounds across high and low frequencies, and the magnetic shielding allows for placement near your video equipment. Boasting a black ash finish, this MTX Monitor Series center channel speaker offers a sleek, modern look.', 'abcat0205000', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5212/5212728_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5283401', 'Insignia™ - Powered Bookshelf Speakers (Pair) - Black', 'Only at Best Buy Upgrade your sound setup with these Insignia Bluetooth bookshelf speakers. Volume, treble and bass dials provide greater control over your home party, and the energy-saving design makes a minimal impact on your bills. The remote control, RCA cable and speaker wire included with these Insignia Bluetooth bookshelf speakers ensure a quick-and-easy installation.', 'abcat0205000', 99.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5283/5283401_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5316122', 'Jensen - 2.1-Channel Soundbar with Built-in Subwoofer - Black', 'Immerse yourself in your favorite movies, TV shows and more with this Jensen JSBW-650 soundbar, which features 2.1 channels with a built-in 20W subwoofer for robust audio. Bluetooth technology lets you wirelessly stream sound from compatible devices.', 'abcat0205000', 94.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5316/5316122_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5507266', 'Polk Audio - Polk Signature Series S55 Floor Standing Speaker - American HiFi Surround Sound for TV, Music, and Movies - Black', 'Built to bring the big surround sound theater and music experience into the comfort of your living room the Polk signature S55 tower speaker continues in the Polk tradition of American HiFi Featuring Hi-Res certification a new Dynamic Balance designed acoustic array precision crossovers an anti-diffraction grille modern cabinet styling and exclusive power port bass enhancing technology you get elevated sound for movies TV and music in a totally re-imagined design Curved edges offer a sensual yet powerful look that fits with any home decor Enjoy seamless lifelike soundstage no matter where you&#8217;re seated in your listening room There&#8217;s no more sweet spot&#8212;instead it&#8217;s all around you', 'abcat0205000', 247.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5507/5507266_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5507423', 'beFree Sound - Powered Wireless Speaker System (Pair) - Black', 'Enjoy a modern minimalistic look from this beFree speaker system. The 2.1-channel system delivers outstanding bass and awesome trebles for the ultimate audio experience, and it''s easy to control with the included remote. Bluetooth connectivity, USB compatibility and an SD card slot let you choose your method of streaming music to this beFree speaker system.', 'abcat0205000', 49.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5507/5507423_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5507441', 'beFree Sound - 8" Powered 3-Way Floor Speakers (Pair) - Black', 'Get better sound with these beFree Sound tower speakers. They connect to your smartphone or other devices via Bluetooth or the USB ports, and they also play music from an SD card or the FM radio. These beFree Sound tower speakers have a frequency response of 40Hz to 20KHz to provide the full theater experience right at home.', 'abcat0205000', 109.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5507/5507441_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5526362', 'Yamaha - 8" 3-Way Bookshelf Speakers (pair) - Black', 'Looking for great-performing bookshelf speakers? Then take a closer look at these Yamaha NS-6490 8 In. 140 Watt Max 3-Way Bookshelf Stereo Speakers! This speaker pair is ideal for any home theater or stereo application. Grilles are included.', 'abcat0205000', 169.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5526/5526362_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5543252', 'MartinLogan - Installer Series 50W Outdoor Speakers (Pair) - White', 'Transform your outdoor living space with these MartinLogan Installer Series ML45WH 50W outdoor speakers that feature 1" titanium dome tweeters and 100W peak power handling for immersive audio.', 'abcat0205000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5543/5543252_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5543261', 'MartinLogan - Installer Series 60W Outdoor Speakers (Pair) - Black', 'Enjoy powerful, immersive sound outside with these MartinLogan Installer Series ML55BL 60W outdoor speakers that feature 120W peak power handling and 5-1/2" mineral-filled polypropylene woofer cones for faithful sound reproduction.', 'abcat0205000', 399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5543/5543261_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5543289', 'MartinLogan - Installer Series 7-1/2" 80W Outdoor Speaker (Each) - Gray Stone', 'Enjoy your music outside with this MartinLogan Installer Series ML75R outdoor speaker that features 80W maximum power handling for robust sound and 2 pairs of pre-installed wires that enable easy setup.', 'abcat0205000', 499.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5543/5543289_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5543304', 'MartinLogan - Installer Series 6-1/2" 70W Outdoor Speaker (Each) - Gray Stone', 'Learn more about Magnolia Premium Installation      Listen to your favorite music outside with this MartinLogan Installer Series ML65R outdoor speaker that features a 6-1/2" mineral-filled polypropylene cone woofer for vibrant sound. The 70W maximum power handling offers crisp, robust sound.   .', 'abcat0205000', 399.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5543/5543304_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5543331', 'MartinLogan - Installer Series 50W Outdoor Speakers (Pair) - Black', 'Transform your outdoor living space with these MartinLogan Installer Series ML45BL 50W outdoor speakers that feature 1" titanium dome tweeters and 100W peak power handling for immersive audio.', 'abcat0205000', 299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5543/5543331_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5543368', 'MartinLogan - Installer Series 60W Outdoor Speakers (Pair) - White', 'Enjoy powerful, immersive sound outside with these MartinLogan Installer Series ML55WH 60W outdoor speakers that feature 120W peak power handling and 5-1/2" mineral-filled polypropylene woofer cones for faithful sound reproduction.', 'abcat0205000', 399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5543/5543368_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5622382', 'Polk Audio - Signature S10 Hi-Res 2-Way Bookshelf Satellite Surround Speaker (Pair) - Black Washed Walnut', 'Discover a world of premium home audio with these Polk S10 home theater speakers. Full-range sound is assured thanks to the balanced acoustic array, and you can pair these with other speakers to create a powerful surround-sound system. A 1-inch tweeter and 4-inch cones produce outstanding sound across the full range of these Polk S10 home theater speakers.', 'abcat0205000', 199.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5622/5622382_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5641007', 'Polk Audio - Patio 200 5" 2-Way Indoor/Outdoor Loudspeakers (Pair) - White', 'Enjoy your music outdoors with these Polk Patio 200 2-way loudspeakers, which feature sealed enclosures that offer protection against the elements. The 5" mineral-filled polymer woofer cones and 3/4" anodized-aluminum-dome tweeters produce dynamic audio.', 'abcat0205000', 249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5641/5641007_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5657270', 'MartinLogan - BalancedForce Dual 10" Powered Subwoofer - High-gloss black/dark cherry', 'Create the perfect environment for music appreciation with this MartinLogan BalancedForce subwoofer. Its frequency response ranges from 20-120Hz +/- 3dB, resulting in a more accurate, purer reproduction of your audio system''s low tones. This 850W MartinLogan BalancedForce subwoofer has a Class D switching amplifier that delivers a system peak of up to 1700W.', 'abcat0205000', 3499.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5657/5657270_rd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5657271', 'MartinLogan - BalancedForce Dual 12" Powered Subwoofer - Walnut/High-gloss black', 'Pump up your home audio experience with this MartinLogan BalancedForce subwoofer. Its advanced Class D switching amplifiers define the bass frequencies more clearly while reducing distortion, and its dual back-to-back woofers create massive sound output while preventing cabinet vibration. This MartinLogan BalancedForce subwoofer has easily accessible top-mounted controls to fine-tune its sound characteristics.', 'abcat0205000', 4495.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5657/5657271_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5657274', 'MartinLogan - Expression 2-Way Floor Speaker (Each) - Dark cherry', 'Update your home theater system with this MartinLogan Expression loudspeaker set. Each 24-bit Vojtko DSP engine controls dual 10-inch low-distortion woofers in separate compartments, which are powered by two 300W amplifiers to create robust, realistic bass reproduction. These MartinLogan Expression loudspeakers have 13-inch-wide electrostatic transducers to render authentic high-frequency sounds.', 'abcat0205000', 8249.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5657/5657274_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5657275', 'MartinLogan - BalancedForce Dual 10" Powered Subwoofer - High-gloss black/natural cherry', 'Project your bass line with new clarity by using this Martin Logan BalancedForce subwoofer. BalancedForce technology minimizes distortion and cabinet vibration, leaving you with a crisp, defined sound free from smeared bass. Downloadable custom filters available for this Martin Logan BalancedForce subwoofer ensure an ideal setup with your existing speaker system.', 'abcat0205000', 3398.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5657/5657275_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5657276', 'MartinLogan - Impression Dual 8" 2-Way Floor Speaker (Each) - White gloss', 'Give more impact to your music with these floor-standing MartinLogan Impression loudspeakers. Part of the Masterpiece Series, they contain dual 8-inch woofers powered by 275W Class D amplifiers for pure bass resonance. These electrostatic MartinLogan Impression loudspeakers are engineered with CLS technology to enrich high-frequency detail without losing sound quality.', 'abcat0205000', 5499.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5657/5657276_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5657279', 'MartinLogan - BalancedForce Dual 12" Powered Subwoofer - High-gloss black/cherrywood', 'Bring a theater experience to your home with this MartinLogan BalancedForce subwoofer. Its two low-distortion woofers are mounted 180 degrees apart to eliminate cabinet vibrations, and its dual 850W amplifiers provide sharp, clear bass tones. This MartinLogan BalancedForce subwoofer has multiple connection options including XLR and RCA inputs for versatility.', 'abcat0205000', 4195.98, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5657/5657279_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5657280', 'MartinLogan - Illusion 3-Way Floor Center-Channel Speaker - Gloss black', 'Create a rich entertainment experience in your living room with this Martin Logan Illusion speaker. The floor-standing setup allows for easy placement with your existing speaker system. Four 6.5-inch PowerForce Forward woofers on this Martin Logan Illusion speaker ensure you never miss a sound of high-action films or dramatic television programs.', 'abcat0205000', 7699.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5657/5657280_sa.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5657282', 'MartinLogan - Renaissance Dual 12" 2-Way Floor Speaker (Each) - Rosso fuoco', 'Refine your home audio with this MartinLogan Renaissance loudspeaker. Its dual 500W Class D amplifiers improve sound quality, while its AirFrame blade design seamlessly connects the electrostatic panel with the woofer cabinet. This MartinLogan Renaissance loudspeaker has two 12-inch low-distortion aluminum cone woofers that are aligned to create realistic bass effects.', 'abcat0205000', 13749.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5657/5657282_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5734900', 'LG - 24" Class LED HD TV', 'Watch favorite shows and movies on this LG LED TV. Its space-saving 23.6-inch screen is ideal for smaller rooms and provides great color and contrast, and its 1366 x 768 resolution lets you watch HD programming. This LG LED TV has an HDMI input and accepts a standard VESA mount for flexible installation.', 'abcat0101001', 129.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5734/5734900_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('5900969', 'Peerless-AV - 55" Class LED Outdoor Full Sun 4K UHD TV', 'Stay entertained with this 55-inch Peerless UltraView outdoor television. The all-weather design withstands elements with an operating temperature range of minus 22 degrees F to 122 degrees F, while the ISP and TNI panel enhances contrast for direct sunlight readability without the risk of isotropic blackout. HDMI 2.0 and HDCP 2.2 ports increase compatibility with 4K sources. This Peerless UltraView outdoor television has a 4K UHD resolution that delivers true-to-life imagery for areas with partial or high ambient light.', 'abcat0101001', 3499.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/5900/5900969_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6202105', 'Samsung - 32" Class M4500 Series LED HD Smart Tizen TV', 'Enhance your television viewing with this Samsung smart TV. Its 720p HD resolution provides clear, sharp pictures with richer colors, and it has a quad-core processor to keep things moving smoothly. This 32-inch Samsung smart TV includes the Samsung Smart Hub that connects seamlessly to online content, so you can enjoy more entertainment options.', 'abcat0101001', 199.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6202/6202105_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6202106', 'Samsung - 32" Class N5300 Series LED Full HD Smart Tizen TV', 'Get crisp, beautiful Full HD video from this 32-inch Samsung LED Smart TV. It features Samsung''s HyperReal Engine for amazing detail, color and contrast, and the smart features allow you to browse the web and cast a smartphone screen or compatible apps to the TV. Connect this 1080p Samsung LED Smart TV to your home theater to enjoy Dolby Digital sound via its optical digital audio port.', 'abcat0101001', 229.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6202/6202106_sd.jpg');
