INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6407930', 'Samsung - The Terrace Series 75" Class LED Outdoor Partial Sun 4K UHD Smart Tizen TV', 'Upgrade your audiovisual experience with this 65-inch Samsung The Terrace outdoor TV. The 4K UHD QLED display produces lifelike details, while the wide viewing angle offers comfortable viewing and minimizes neck strain. This smart Samsung The Terrace outdoor TV boasts an IP55 weather-resistant rating to withstand the elements, and Motion Rate 240 reduces motion blur for immersive viewing.', 'abcat0101001', 5499.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6407/6407930_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6407933', 'Samsung - The Terrace Series 65" Class LED Outdoor Partial Sun 4K UHD Smart Tizen TV', 'Stream sports and entertain your guests with this Samsung 65-inch outdoor TV. The 120Hz refresh rate enables smooth playback during fast-moving movie scenes, while the 4K UHD display brings out the fine details in your media. This Samsung 65-inch outdoor TV uses direct full-array lighting technology to produce 2000 nits of brightness for viewing vibrant videos in sunlight.', 'abcat0101001', 4299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6407/6407933_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6412292', 'Samsung - 50" CLASS BE50T-H LED 4K Commercial Grade TV', 'With the Samsung Pro TV, content becomes as dynamic as your customers. The Samsung Pro TV series offers powerful Crystal UHD picture quality, powered by a Crystal 4K processor. Every piece of content is rich, colorful and full of fine detail. Changing content is quick and easy. In three easy steps, you can upload dynamic content right from your phone or tablet with the Samsung Business TV app. You can count on Samsung&#8217;s Pro TV with a 16/7 operating time, while a 3-year warranty adds peace of mind. Do more with your TV with the Samsung Pro TV series displays.', 'abcat0101001', 532, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6412/6412292_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6412507', 'TCL - 32" Class 3-Series HD Smart Android TV', 'Stream your favorite TV shows and movies with this 720p TCL 3-Series Android TV. The tuner provides access to free-to-air channels, while built-in Chromecast lets you mirror audiovisual content from your Android and iOS devices. This black TCL 3-Series Android TV features Google Assistant for voice control and an ultra-thin design for a sleek look.', 'abcat0101001', 159.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6412/6412507_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6414393', 'Hisense - 65" Class R8 Series LED 4K UHD Smart Roku TV', 'Featuring 4K ULED resolution, the R8F packs incredible detail to create astonishing images with enhanced color and more depth. The Hisense Roku TV serves up a massive library of free and premium content at the touch of a button. Simple to set-up and easy-to-use, connect to the internet, activate, and start streaming.', 'abcat0101001', 629.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6414/6414393_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6414921', 'Furrion - 55" Class LED Outdoor Partial Sun 4K UHD TV', 'Improve barbeque entertainment with this 55-inch Furrion Aurora Partial Sun 4K LED outdoor TV. The weatherproof construction has an IP54 rating to withstand wet and hot conditions, while the UHD display produces sharp vivid images for quality visuals. This Furrion Aurora Partial Sun 4K LED outdoor TV features auto-brightness control for detecting external light conditions and adjusting for ideal viewing.', 'abcat0101001', 2299.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6414/6414921_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6414922', 'Furrion - 49" Class LED Outdoor Partial Sun 4K UHD TV', 'Watch your favorite shows on this 49-inch Furrion Aurora partial sun outdoor TV. The 4K display produces stunning UHD imagery, while auto brightness control adjusts brightness depending on the lighting conditions for an immersive experience. This Furrion Aurora partial sun outdoor TV features a weatherproof housing that withstand harsh conditions, and the included weatherproof remote control offers easy operation.', 'abcat0101001', 1799.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6414/6414922_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6414923', 'Furrion - 65" Class LED Outdoor Full Shade 4K UHD TV', 'Catch up with your favorite actors and shows with this 65-inch Furrion Aurora full shade outdoor TV. The 4K support and UHD display deliver lifelike visuals for immersive viewing, while the weatherproof construction and water-resistant remote stand up to the elements. This Furrion Aurora full shade outdoor TV has auto-brightness control to help reduce eye strain.', 'abcat0101001', 2146.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6414/6414923_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6416732', 'LG - 48" Class CX Series OLED 4K UHD Smart webOS TV', 'Watch your favorite movies or programs on this 48-inch LG CX 4K smart TV. The a9 Gen 3 AI processor 4K delivers crisp, detailed visuals for an immersive entertainment experience, while NVIDIA G-SYNC and AMD FreeSync compatibility minimize stuttering and tearing while gaming. This LG CX 4K smart TV has a pair of 20W front-firing speakers for producing quality, room-filling sound.', 'abcat0101001', 1399.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6416/6416732_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6416810', 'VIZIO - 55" Class OLED 4K UHD SmartCast TV', 'Precision, refined to an art. Art, perfected to a masterpiece. A masterpiece, engineered to the finest detail. Behold the power of the new 2021 VIZIO OLED TV. In the realm of picture quality, contrast is king, and VIZIO OLED has unprecedented contrast that is truly infinite, with pixels that reach perfect black. Movies are transformed by this pure pixel perfection, while sports are clearer and more engaging. The intense OLED Ultra Color Spectrum&#174; brings more than one billion authentic colors that are even more spectacular against absolute black. Dolby Vision and HDR10+ high dynamic range reveals details you&#8217;ve never seen before in streaming content from Netflix, Vudu, Prime Video, Disney+, and more. The revolutionary IQ Ultra&#8482; processor achieves ultimate picture performance with the power to fine-tune individual pixels and upscale entertainment to stunning, lifelike 4K quality. The all-new ProGaming Engine&#8482; makes Xbox One and PlayStation gameplay more responsive, with Variable Refresh Rate* (40Hz-120Hz) that matches a game&#8217;s framerate to the TV&#8217;s refresh rate for smoother visuals and more immersive play. HDMI 2.1 connectivity assures the highest performance from 4K entertainment devices, with the bandwidth to support 4K video at 120Hz. Beautiful from every angle, the TV flaunts a bold bezel-less esthetic that tapers to an unbelievable 4mm. The enhanced SmartCast&#8482; platform lets you stream, control and share content as never before. VIZIO OLED also pairs seamlessly with Siri, the Google Assistant and Alexa-enabled devices, so you can control the TV using just your voice. Explore infinite contrast. Feel every pixel. Experience a new reality. This is the wonder of VIZIO OLED.           *VRR and auto low latency mode only compatible with Xbox One X', 'abcat0101001', 1199.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6416/6416810_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6416812', 'VIZIO - 65" Class M-Series Quantum Series LED 4K UHD SmartCast TV', 'Step up to the infinite possibilities of streaming 4K in award winning Quantum Color that offers up to 75% more color than standard 4K TVs for a more nuanced, more immersive range of colors that brings everything you watch to life. UltraBright&#8482; 600 and Dolby Vision high dynamic range bring the image to thrilling new life, combined with the Active Full Array&#174; backlight to enhance contrast and deepen black levels. The lightning-fast IQ Active&#8482; processor boosts overall performance while the ProGaming Engine&#8482; with Auto Game Mode and AMD FreeSync provides fluid, artifact-free gaming performance when gaming1. And VIZIO SmartCast&#8482; is now smarter than ever, letting you stream, control and share like never before, with Apple AirPlay 2 and Chromecast built-in in Dolby Vision and HDR10+ for a best in class 4K streaming experience.     1Color defined as the color volume measured using Dolby''s MDC spec that factors the range of colors and luminance levels; standard 4K HDR TV features rec 709 color, up to 300 nits      2AMD FreeSync, VRR and auto low latency mode only compatible with Xbox One X', 'abcat0101001', 699.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6416/6416812_sd.jpg');
INSERT INTO public.catalog (item_id, name, description, category, price, image) VALUES ('6416848', 'VIZIO - 65" Class OLED 4K UHD SmartCast TV', 'Precision, refined to an art. Art, perfected to a masterpiece. A masterpiece, engineered to the finest detail. Behold the power of the new 2021 VIZIO OLED TV. In the realm of picture quality, contrast is king, and VIZIO OLED has unprecedented contrast that is truly infinite, with pixels that reach perfect black. Movies are transformed by this pure pixel perfection, while sports are clearer and more engaging. The intense OLED Ultra Color Spectrum&#174; brings more than one billion authentic colors that are even more spectacular against absolute black. Dolby Vision and HDR10+ high dynamic range reveals details you&#8217;ve never seen before in streaming content from Netflix, Vudu, Prime Video, Disney+, and more. The revolutionary IQ Ultra&#8482; processor achieves ultimate picture performance with the power to fine-tune individual pixels and upscale entertainment to stunning, lifelike 4K quality. The all-new ProGaming Engine&#8482; makes Xbox One and PlayStation gameplay more responsive, with Variable Refresh Rate* (40Hz-120Hz) that matches a game&#8217;s framerate to the TV&#8217;s refresh rate for smoother visuals and more immersive play. HDMI 2.1 connectivity assures the highest performance from 4K entertainment devices, with the bandwidth to support 4K video at 120Hz. Beautiful from every angle, the TV flaunts a bold bezel-less esthetic that tapers to an unbelievable 4mm. The enhanced SmartCast&#8482; platform lets you stream, control and share content as never before. VIZIO OLED also pairs seamlessly with Siri, the Google Assistant and Alexa-enabled devices, so you can control the TV using just your voice. Explore infinite contrast. Feel every pixel. Experience a new reality. This is the wonder of VIZIO OLED.          *VRR and auto low latency mode only compatible with Xbox One X', 'abcat0101001', 1799.99, 'https://pisces.bbystatic.com/prescaled/500/500/image2/BestBuy_US/images/products/6416/6416848_sd.jpg');
